(10, 17, '*THIS IS OFFICIAL LUDO KINGâ¢ GAME<br><br><b>100 Million Downloads!</b><br><br>Ludo Kingâ¢ is a classic board game played between friends, family &amp; kids. Play the royal game of kings! Recall your childhood!<br><br>Ludo King is a cross platform multiplayer game that supports Desktop, Android, iOS and Windows mobile platform at same time. This game also support offline mode, where player can play with Computer or, Local multiplayer (play and pass mode). Ludo King is also a favorite game of Bollywood superstar.<br><br><b>What\\\'s new:</b><br><b>*</b> Real chat with friends and buddies<br><b>*</b> Auto move system (No cheating allowed now!)<br><b>*</b> Resume game (Got a call? No worries!)<br><b>*</b> Make buddies worldwide<br><b>*</b> Challenge Facebook friends/buddies<br><b>*</b> Improved online connectivity<br><b>*</b> Save/Load Ludo game option<br><b>*</b> Player statistics with XP and level up system<br><b>*</b> More user-friendly UI<br><b>*</b> Support extended to low end devices<br><b>*</b> Bug fixes &amp; improvements<br><br>Ludo King is the modern version of the royal game of Pachisi. A Ludo game which was played between Indian kings and queens in ancient times. Roll the Ludo dice and move your tokens to reach the center of the Ludo board. Beat other players, become the Ludo King.<br><br>Ludo King follows the traditional rules and the old school look of the Ludo game. The Ludo game has evolved throughout the centuries to come to your mobile phone. Just like the kings and queens of India\\\'s golden age, your fate depends on the roll of the Ludo\\\'s dice and your strategy of moving the tokens effectively. <br><br><b>Features of Ludo King:</b><br>* No internet connection required! Play against the computer.<br>* Play with your family and friends through Local and Online Multiplayer.<br>* Play 2 to 6 Player Local Multiplayer Mode.<br>* Play Online Multiplayer Mode through 9 competing game rooms.<br>* Invite and challenge your Facebook Friends in a private game room and beat them to become Ludo King.<br>* Play with world players and make them your buddies.<br>* Private chat with your Facebook friends &amp; Buddies.<br>* Express yourself by sending emojis to your opponents. <br>* Play Snake and Ladders on 7 different gameboard variations.<br>* Simple rules which can be followed by players of all ages.<br>* Graphics with a classic look and the feel of a royal game.<br><br>Ludo King is a family game as well as kids game that was once played by kings and now it can be enjoyed by you and your family and friends. While the Ludo gameplay might seem simple at first, the Ludo game is immensely enjoyable and challenging. You\\\'ll be playing this Ludo for hours and its fun for the whole family. Try to beat your opponents and compete for the highest scores on the Ludo leaderboards.<br><br>Ludo King is a perfect time pass game of Ludo board game. You played Ludo in your childhood, now play on your phone and tablet.<br><br>Another nostalgic game similar in structure is Snakes and Ladders. Like Ludo, you may have played this board game when you were young. Ludo King now incorporates this classic game as a whole new level. The objective of the game is simple: you start on 1 and you have to be the first one to make it to 100. However, you can only move the same number of tiles as the number you roll on a die. As the name suggests, the board is also littered with snakes and ladders. If you land on the same tile as the beginning of a ladder, then you can take the ladder as a shortcut and move on up. But if you land on the mouth of a snake, then down you go to its tail. A game of ups and down, Snakes and Ladders has been a favorite for generations; and now you can play it too, with Ludo King. <br><br>Ready to roll the dice! Make your moves and become Ludo King.<br><br>Follow us to get news and updates:<br>* Facebook: https://www.facebook.com/ludokinggame<br>* Twitter: https://twitter.com/Ludo_King_Game<br>* Youtube: https://www.youtube.com/c/LudoKing<br>* Instagram: https://www.instagram.com/ludo_king_game<br>* https://ludoking.com/', 'https://lh3.googleusercontent.com/rYkgGL6hGTUPvv3z9knQ3qMHPd9o80slsQUsic3MKFZNx9nD2alqxMXvLLrQDNFWPQA=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"April 6, 2019\"},{\"type\":\"Size\",\"info\":\"36M\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"4.5.0.101\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact, Shares Info, Shares Location\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a050.00 - \\u20b9\\u00a06,500.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Gametion Technologies Pvt Ltd\"},{\"type\":\"Developer\",\"info\":\"Visit websitecontact@ludoking.comPrivacy PolicyMumbai, India\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/pBruwD03fQ0\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/-VC8_mH-3dPdIq4eKKt_Na7AO4Q8I1x-JLpdRQt5AxX_nO_5ww8FNldZIewpV56TR7mD=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/Wds_yuEEt-I8TWkvYaDuclx5YsSJFIhYcG2AsZrCE5quk6wGfgu2XHkeX9bXIucu1g=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/