(97, 104, 'Get behind the wheel of legendary GT car and begin enjoying the car driver simulator in this car games 2018. Use nitro booster to boost up your GT car speed and drive fast as fast as you can. Forget everything you know about racing, just hit the gas and feed your passion of speed car parking and racing adventure. Become extreme speed stunts hero and impossible car stunt racing professional driver on the stunt car tracks 3D. Racing in crazy GT speed cars on impossible race tracks is going to be an amazing experience.<br><br>The fantastic and amazing crazy car stunts on stunts tracks will blow your mind. Crazy smart GT car smashing machines and super smart driving stunt environment makes this game more interesting. Extreme City GT car stunts is a thrilling game of car racing 2018. You need extreme stunt car driving skills to drive safely on tricky impossible race tracks and curvy paths. You will feel like you are real smart car driver on real crazy mountain heights and city tracks to accomplish impossible stunts racing and driving missions. Driving a real super GT car can be challenging for you. You will have to be competent to complete all the racing car track driving missions given to you.<br><br>Many top gear and exciting GT cars are parked in the garage of this classics car racing GT game. Each car comes with unique specifications and speed. Car dealer has set fair car price for your buying ease so play and unlock all the exciting and cool cars to have endless and exclusive GT drive fun and sharpen your racing and stunt skills. Drive, perform extreme speed stunts and car drifting and enjoy stunt race against time, gather worth remembering racing experience and set new racing records to show to the racing world in this drifting car simulator.<br><br>GT racing comes with super cool and amazing environment. It comprises of dangerous and enchanting racing tracks, car parkings, straight and curvy roads and stunts for maximum challenge, beautiful hills and mo