(123, 130, 'Snapchat is the most fun way to share the moment with friends and family ð» <br><br>Snapchat opens right to the camera, so you can send a Snap in seconds! Just take a photo or video, add a caption, and send it to your best friends and family. Express yourself with Filters, Lenses, Bitmojis, and all kinds of fun effects.<br><br><br>SNAP ð¸ <br>â¢ Snapchat opens right to the camera. Tap to take a photo, or press and hold for video.<br>â¢ Add a Lens or Filter to your photo â new ones are added every day! Change the way you look, dance with your 3D Bitmoji, and discover games you can play with your face.<br>â¢ Create your own Filters to add to photos and videos â or try out Lenses made by our community!<br><br>CHAT ð¬ <br>â¢ Stay in touch and Chat with friends with live messaging, or share your day with Group Stories.<br>â¢ Video Chat with up to 16 friends at once. You can even use Filters and Lenses!<br>â¢ Express yourself with Friendmojis â exclusive Bitmojis made just for you and a friend.<br><br>DISCOVER ð<br>â¢ Follow friends and watch their Stories to see their day unfold.<br>â¢ Keep up to date with exclusive Stories from top publishers and creators.<br>â¢ Watch breaking news, original Shows, and community Stories â made just for your phone.<br><br>SNAP MAP ðº<br>â¢ See where your friends are hanging out, if theyâve shared their location with you.<br>â¢ Share your location with your best friends, or go off the grid with Ghost Mode.<br>â¢ Discover live Stories from the community nearby, or across the world!<br><br>MEMORIES ðï¸<br>â¢ Look back on Snaps youâve saved with free cloud storage.<br>â¢ Edit and send old moments to friends, or save them to your Camera Roll.<br>â¢ Create Stories from your favorite memories to share with friends and family.<br><br>FRIENDSHIP PROFILE ð¥<br>â¢ Every friendship has its own special profile to see the moments youâve saved together.<br>â¢ Discover new things you have in common with Charms. See how long youâve been friends, your astrological compatibility, your Bitmojisâ fashion sense, and more!<br>â¢ Friendship Profiles are just between you and a friend, so you can bond over what makes your friendship special.<br><br>Happy Snapping!<br><br>â¢ â¢ â¢<br><br>Please note: Friends, family, and other Snapchatters can always capture or save your messages by taking a screenshot, using a camera, or otherwise. Be mindful of what you Snap!', 'https://lh3.ggpht.com/vdK_CsMSsJoYvJpYgaj91fiJ1T8rnSHHbXL0Em378kQaaf_BGyvUek2aU9z2qbxJCAFV=s180', 4.1, '[{\"type\":\"Updated\",\"info\":\"April 5, 2019\"},{\"type\":\"Size\",\"info\":\"56M\"},{\"type\":\"Installs\",\"info\":\"500,000,000+\"},{\"type\":\"Current Version\",\"info\":\"10.54.1.1\"},{\"type\":\"Requires Android\",\"info\":\"4.4 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 12+Parental Guidance RecommendedLearn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact, Shares Info, Digital Purchases\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Snap Inc\"},{\"type\":\"Developer\",\"info\":\"Visit websitesnapchat@snap.comPrivacy Policy63 Market St.\\nVenice CA, 90291\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/Tg8j7ifezVWfWJW6RMqBpNYF6_aCisp0kzwuN8XKulfOyYS0aBs3fgzURi9T1IgkETbL=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/dkgkI44bw5EHEjouJwaS1XsxVilROxhrlHHH0H43MSBxZLy69BbvzpGhnVOB-o_rp28=w720-h310\",null,null]', '[]', '2019-04-07 19:15:22', '2019-04-07 19:15:22', NULL),
