(129, 136, 'Cricket Exchange provides you fast Live Cricket Score with accurate Odds and Session and everything that keep you in touch with cricket.O<br><br>All International, League, Women, ODI, T20, Test matches covered.<br>Fixtures with complete detail of recent and upcoming matches.<br>ICC Rankings and Polls.<br><br>Current Live matches and live series on home.<br><br><b>Complete Live Match detail :</b><br>- Complete match information with teams current form and squads.<br>- Live match ball to ball fast update.<br>- Accurate match odds with session update.<br>- Full detailed scorecard<br>- Odds &amp; Session history ball by ball for entire match<br>- Playing XI, Squad, head to head, average score, past records and much more<br>- Zero ads for premium users<br><br><b>Fixtures :</b> <br>- Upcoming and recent matches detail.<br>- Categorised match schedule (International, ODI, Test, T20, Leagues,Women).<br>- Search matches  date wise, team wise and series wise. <br>- Complete upcoming and live series details with point table and series stats.<br><br><b>Featured Videos and News :</b><br>- Videos with pre match reports.<br>- Special cricket videos with interesting facts and records.<br>- Interesting cricket news with special cricket facts.<br><br><b> Rankings and Polls : </b><br>- Categorised ICC rankings.<br>- Men and Women complete rankings.<br>- Match Polls with monthly, weekly and yearly leaderboard.<br><br>Coverage of all International T20s, ODIs, TESTs, Tours, Leagues including:<br>Indian Premier League 2019 (IPL19)<br>ICC Cricket World Cup 2019<br>Mzansi Super League 2019 (CSA T20)<br>Big Bash 2018<br>Big Bash Woman 2018', 'https://lh3.googleusercontent.com/vBJNiGe9_QzRVpqNnROqpHIWiXMj_XVfT3c6OmKONvvwJ4AYERjiGNesAH3Z57h2nuQ=s180', 4.8, '[{\"type\":\"Updated\",\"info\":\"April 2, 2019\"},{\"type\":\"Size\",\"info\":\"6.6M\"},{\"type\":\"Installs\",\"info\":\"5,000,000+\"},{\"type\":\"Current Version\",\"info\":\"nd4.3.5\"},{\"type\":\"Requires Android\",\"info\"