(130, 137, 'Record any phone call you want and choose which calls you want to save. You can set which calls are recorded and which are ignored. Listen to the recording, add notes and share it. Integration with Google Driveâ¢ and Dropbox allows calls to be saved and synchronized to the cloud as well. <br>Google Drive integration works on Android versions 3.0 and above.<br>Please note that call recording does not work on certain handsets and can result in inferior quality recordings. We therefore suggest that you try the free version before purchasing the paid app.<br>If you encounter any recording issues or wish to improve voice quality, try recording from a different audio source, or use auto-on speaker mode.<br>Recorded calls are stored in the Inbox. You can set the size of the inbox. The number of saved calls is limited only by your device memory. If you decide that a conversation is important, save it and it will be stored in the Saved Calls folder. If not, old recordings will automatically be deleted when new calls fill up the inbox.<br>You can enable a Call Summary Menu with options to appear immediately after a call.<br>Search for recordings by contact, phone number, or note.<br><br>There are 3 default settings for automatic recording:<br>Record everything (default) â This setting records all calls except for contacts pre-selected to be ignored.<br>Ignore everything â This setting records no calls except for contacts pre-selected to be recorded.<br>Ignore contacts â This setting records all calls with people who are not contacts, except for contacts pre-selected to be recorded.<br>In the Pro version only: You can set calls from particular contacts to be automatically saved, and they will be saved in the cloud.<br>This app contains ads.', 'https://lh3.googleusercontent.com/5FDNvkkhDmUrJ2WprLpDU8lgsd1AvfDrghk_1QIi7K9P0U0tRDE3Gu02QU1YI_4zINPu=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"April 2, 2019\"},{\"type\":\"Size\",\"info\":\"7.6M\"},{\"type\":\"I