(142, 149, 'From the producers of Racing Fever comes a brand new motor racing experience!<br><br>In this game, we have blended all the adrenalin, fun and excitement a pair of tires can offer together for you. With the amazing racing experience and breathtaking graphics, you wonât be able to put your phone down.<br><br>4 different camera angles<br>For a more realistic experience, you may play from your racerâs viewpoint or increase your control on the race using different camera angles.<br><br>Realistically modeled motorcycles<br>We have modeled 16 different motorcycles down to the smallest detail for you. Take your pick, improve its performance, alter its design and start racing.<br><br>A racing adventure with 4 different gang leaders and tens of levels<br>4 different regions and 4 ruthless gang leaders! Tens of different racing types in different seasons in an amazing atmosphere await you. Defeat all 4 leaders to prove that you are the best racer!<br><br>4 different control options<br>We know that no two racers are alike! We included a control option to satisfy you all. Control your bike by tilting your phone or by touching the screen. You have no excuses left to win the race!<br><br>Support in 23 different languages<br>Donât worry, we understand and speak the same language as you!<br><br>Escape Mode<br>In this game, speed limits were set to be broken! Remember that when running from the cops, it is just you and your bike!<br><br>Daily Bonus Mode<br>We didn\\\'t forget to add a mode where you can race daily to win valuable gifts!<br><br>Private Mode<br>You get to set the time of day, weather conditions, traffic density, speed and flow and even the number of cops! You set the rules, you win the race!<br><br>Please donât forget to get in touch with us with your feedback and suggestions!', 'https://lh3.googleusercontent.com/pK-5TELK5bvbRhLfU6HFqxiaYypPJOWd4Qxy-MDe1JCSQZ29dKsrzpWnImqE9Lqruw=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"April 4, 2019\"},{\"type