(147, 154, 'Ola cabs app offers the easiest &amp; fastest way to book a ride. With more than 3,00,000 cabs &amp; taxis in 100+ cities including Bangalore, Chennai, Delhi, Mumbai, Hyderabad, Kolkata, Pune, Jaipur, &amp; Ahmedabad, Ola is the most popular cab booking service in India.<br><br>Where will go to in your next Ola ride? Download the app, complete the fast signup process &amp; book your first ride. Have a friendâs referral code? Sign up with that code to get your first trip free!<br><br>Some of the popular travel options available on the Ola app are:<br><br><b>â¢ Auto:</b> Fastest way to book autos without the hassle of waiting &amp; haggling for price<br><b>â¢ Share:</b> Book up to 2 seats to share AC cars with others travelling on the same route. Save up to 50% on regular cab fares<br><b>â¢ Share Express:</b> Save time &amp; money by travelling in shared cabs on fixed routes<br><b>â¢ Micro:</b> Book the cheapest AC taxi in town starting at just Rs. 6/km<br><b>â¢ Mini:</b> Travel in comfy AC hatchbacks at pocket-friendly fares<br><b>â¢ Prime Sedan:</b> Top sedans with free Wi-Fi &amp; top-rated drivers<br><b>â¢ Prime Play:</b> High-rated Prime Sedans with free in-cab entertainment. Enjoy movies, music, live video streaming &amp; more on the go<br><b>â¢ Prime SUV:</b> Spacious SUVs with more seats, free Wi-Fi &amp; top rated drivers<br><b>â¢ LUX:</b> Travel in top-of-the-line luxury cars at unbeatable fares<br><b>â¢ Outstation:</b> Ride out of town at affordable one-way &amp; round trip fares with free in-cab entertainment. Enjoy songs, movies, live video streaming &amp; more. <br><b>â¢ Rentals:</b> The affordable car rental service for all your city tours. Choose from flexible hourly packages to rent cabs driven by our top-rated partners <br><br>All our vehicles come equipped with onboard GPS for route navigation. See all your available ride options in the app. <br><br><b>Book a taxi in just a few taps. Hereâs how it works:</b><br><br>â¢ Set your pickup location (E.g. Home, Office, Airport, Railway station, current location, etc.)<br>â¢ See all available cabs/taxis near your location being displayed on the map<br>â¢ Choose from multiple payment options including cash, Ola Money, UPI, credit card, etc.  <br>â¢ Pick the type of vehicle you want &amp; tap âRIDE NOWâ<br>â¢ Get instant confirmation with trip details<br>â¢ Track your cab in real time<br><br>Invoices will be mailed to you immediately after youâve completed your journey. <br><br><b>More benefits of using Ola: </b><br><br><b>â¢ Multiple ways to pay:</b> Pay for your trips in cash or via multiple cashless options like Ola money, UPI, debit card, credit cards, Jio money etc<br><b>â¢ Save more with Cab, Auto &amp; Share Pass:</b> Enjoy more savings in your daily commute with Cab Pass, Auto Pass &amp; Share Pass<br><b>â¢ Ola Select:</b> Become an Ola Select member to avail exclusive benefits like Prime Sedans at Mini fares &amp; more<br><b>â¢ Know fares &amp; ride features:</b> Check fares &amp; various features of a ride category before booking <br><b>â¢ Ola Play:</b> Enjoy free in-cab entertainment in Prime Play, Prime SUV, Lux, Outstation and other select rides. Play songs, Videos, movies, TV shows and more on the go!<br><b>â¢ Schedule a ride:</b> Choose âRIDE LATERâ to book a cab/taxi in advance from anywhere<br><b>â¢ Travel with safety:</b> Share your travel plan with family &amp; friends so they can track your vehicle &amp; know you are safe<br><br>You can also tag work or business related trips as Corporate rides. Youâll get invoices for these rides at your official email address. Companies can use Ola Corporate to easily track &amp; sponsor rides for employees.<br><br>Got questions? Visit Ola support website (https://help.olacabs.com/support/home) for more information or write to us at  support@olacabs.com.<br><br>Stay up to date on all our exciting offers and latest happenings by connecting with us online.<br><br> â¢ Follow us on Twitter - https://twitter.com/Olacabs<br> â¢ Like our Facebook  page - https://www.facebook.com/Olacabs<br> â¢ Follow us on Instagram - https://www.instagram.com/olacabs', 'https://lh3.ggpht.com/4rrRCFJo4GSxHBON0M8OIwKNfT6b5zOA20fMniJKaeU3CUylFA9i6vazeazxKwZU6Ng=s180', 4.1, '[{\"type\":\"Updated\",\"info\":\"April 5, 2019\"},{\"type\":\"Size\",\"info\":\"14M\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"4.8.4\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"olacabs\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport@olacabs.comPrivacy Policy\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/zJXYR6JAGURNf6msvFYc-SRePa9pER2MmZ0Dkx_ZiBXS-KkvXCXEgUcC9u8C9QUouWU=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/xp-qPiclV8p_4mJDPu4ldjeWQk_fozXer_sVd9qB6sVhC9X5tB9X6zmBYFyu_5K7P2g=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[]', '2019-04-07 19:15:22', '2019-04-07 19:15:22', NULL),
