(149, 156, 'YONO SBI lets you Bank, Shop,Travel,Pay Bills,Recharge,Invest, avail IRCTC ticket booking, use UPI to transfer money, book movie tickets. With SBI YONO, convenience has a new name. <br><br><b>What YONO SBI offers you</b> <br> <br>YONO SBI, SBIâs latest mobile banking offering is an extension of our trusted banking legacy which gave India secure digital products such as SBI Anywhere and SBI Net Banking. YONO SBI puts Indiaâs largest range of products and services at your fingertips. YONO SBI lets you bank digitally, invest, shop (be it groceries or from the latest fashion trends!), book movie tickets, vacations, flights and IRCTC train tickets with one single app. <br><br><b>The YONO SBI experience</b>â¯ <br> <br>Download YONO SBI, our mobile banking and lifestyle application now and experience its best-in-class features â <br><br>â¢ Indiaâs largest shopping marketplace â Be it buying your groceries, the latest electronics, booking your flight/train tickets or your next vacation, YONO SBI has you covered. Exclusive discounts and offers for SBI customers across merchants who offer shopping, vacation bookings, flight and bus ticket bookings, train ticket bookings through IRCTC, food delivery and much more <br><br>â¢ Banking simplified â Perform basic banking transactions such as checking your balance, creating a fixed deposit, adding beneficiary etc. with our easy to use interface <br>â¢ Quick pay - Immediate transfer to a newly added beneficiary up to Rs. 10,000/- <br><br>â¢ One view - Link and view your relationships with all State Bank entities (Credit Cards, Life Insurance, General Insurance, Travel Insurance, Accident Insurance, SIP, Mutual Funds or investments) in one app <br><br>â¢ Smart spending â Get an overview of your expenditure with our Intelligent spend analysis, which automatically tags and categorises your transactions <br><br>â¢ Your friend in need â Get Pre-approved personal loans on the go within 2 minutes, with no documentation up to Rs. 5 Lac  <br><br>â¢ Liquidity on the go â Use this one click facility to avail overdraft against Fixed Deposit <br><br>â¢ Live your dreams â Use our goal based deposit product to fulfil your dreams through regular savings <br><br>â¢ Experience convenience: Request Cheque Books, ATM Cards/Debit Cards or use the emergency services to change ATM PIN, block ATM cards/Debit cards or stop cheques, through YONO SBI <br><br><b>Getting started</b> <br> <br>If you have an account with SBI, use your internet banking credentials to register and log in to experience the convenience that YONO SBI brings to your life. If you do not have internet banking credentials, you can generate temporary internet banking password using your debit card, and register using the same. Once you log in after that YONO SBI is at your fingertips. <br> <br><br><b>Please note that your data is safe with Indiaâs most secure bank. We do not share any information with third parties without your permission.</b> <br> <br><b>YONO is supported on Android 5.0 and above.</b>', 'https://lh3.googleusercontent.com/uAGuxZ872xYq99O9O1IgYEceMWAheQyEwZskZ9sE6Xrt1A-WinZkHj3MDAcTcJVLATFP=s180', 3.7, '[{\"type\":\"Updated\",\"info\":\"April 6, 2019\"},{\"type\":\"Size\",\"info\":\"14M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.22.17\"},{\"type\":\"Requires Android\",\"info\":\"5.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"State Bank of India\"},{\"type\":\"Developer\",\"info\":\"Visit websitefeedback.yono@sbi.co.inPrivacy Policy\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/g-qIWRpps4s\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/meQQtQTNFyEZM4rwxyIKZ6rXN4gusryN4f_65qaTIVKGdeLjljLw57CPTVbqkU0XSg=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/x52D