(158, 165, 'About Voter Helpline App<br><br>Taking forward its continuous efforts of building an active democratic citizenry in the country, Election Commission of India has undertaken a new initiative by designing a Mobile Application for developing a culture of avid electoral engagement and making informed and ethical ballot decisions among citizens of the country. The app aims to provide a single point of service and information delivery to voters across the country.  The app provides following facilities to Indian voters:<br><br> A. Electoral Search (#GoVerify your name in the electoral roll)<br> B. Submission of online forms for New Voter Registration, shifting to a different <br>     the constituency, for Overseas Voters, Deletion or Objection in the electoral roll, correction of entries &amp; Transposition within Assembly.<br> C. Register Complaints related to Electoral Services and track its disposal status<br> D. FAQ on Voter, Elections, EVM, &amp; Results<br> E. Service &amp; Resources for Voters &amp; Electoral Officers', 'https://lh3.googleusercontent.com/3APi4HdWb0_rhnhAEoyJEYfSemXW9cNbA2VdOCSN7L6wgdjC_oTxLphER647R9PnSCkV=s180', 4.2, '[{\"type\":\"Updated\",\"info\":\"April 4, 2019\"},{\"type\":\"Size\",\"info\":\"9.9M\"},{\"type\":\"Installs\",\"info\":\"1,000,000+\"},{\"type\":\"Current Version\",\"info\":\"v1.1.17\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Election Commission of India\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport@ecitech.inPrivacy PolicyNirvachan Sadan\\nNew Delhi, Delhi 110001\\nIndia\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/TKOpB-rZUHU\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/IB29sdc34-4IHAb9lHNFtCyqSyulj2vCMmLKVFhYqG5PmSuDmDmLs7iK_9k3sxQNQ2g=w720-h310\",\"https:\\/\\/lh3.goog