(159, 166, '<b>Chhota Bheem Speed Racing just introduced an EXCITING &amp; NEW feature that allows the players to collect tons of new Power-ups with which you can defeat your enemies and have an amazing new experience each and every time. So come on and play the whole game again with a completely different and new gameplay!!!</b><br><br>Race with Chhota Bheem through exciting worlds of Dholakpur, Kathmandu, Incan, Petra , Bali &amp; Shinobi! <br><br>A unique game of Speed and Kids Racing that has Chhota Bheem The Hero as a fire fighter, a hero taking on the Asuras, helping his friends and much more while racing throughout the villages.<br><br>This time Chhota Bheem and his friends Raju, Chhutki, Jagu and Dholu Bholu have a very important mission.<br>They have to travel through the 6 different worlds and help the citizens to solve their problems.<br>You are the one that must join Chhota Bheem and guide him through his adventures!<br>Bheem is driving fast cars in these exciting race tracks to accomplish his mission faster!<br>Unlock special super-powers, find hidden places, collect all achievements, buy new cars and become the best hero in the world by reaching the top of the leaderboard!<br><br><b>Features:</b><br>Explore 6 worlds full of adventures: Petra, Bali, Incan, Kathhmandu, Dholakpur, and Shinobi!<br>Compete with other heroes in 6 leader-boards - can you become the best in all worlds?<br>Meet your favorite super-heroes and help them to save the day!<br>Unlock 6 different super-powers that will help you on your journey!<br>Find hidden places and surprises!<br>Complete missions and get generous rewards!<br>Collect all 24 cars and try them all!<br>Boost your special-powers for even better results!<br>Show how much you can achieve in the endless race mode!<br>Enjoy nice and kids friendly music and sounds!<br>Controls are so simple to learn that even toddler can play this game!<br><br>Enjoy this special new addition of Chhota Bheem Speed Racing to Nazara\\\'s portfolio of super hitgames - Chhota Bheem Jungle Run, Chhota Bheem The Hero, Chhota Bheem Talking Toy and Chhota Bheem Race<br><br>***********************************************************************************<br>Chhota Bheem Speed Racing respects your privacy, does not store any personal information and does not allow you share this information. <br>We do require a few additional Permissions to function: <br><br>1. READ_EXTERNAL_STORAGE &amp; WRITE_EXTERNAL_STORAGE<br>These permissions are needed to cache and read ad content during the game play<br><br>2. ACCESS_COARSE_LOCATION/READ_PHONE_STATE/ACCESS_FINE_LOCATION<br>These permissions are needed to show suitable ad content for targeted user for better ad experience<br><br>3. GET_ACCOUNTS<br>This permission would use your google account name and picture to show it on the leaderboard once you sign in', 'https://lh3.googleusercontent.com/Lb965HT_b1j_hNKiFX7CUfjWB8rxW8y-ucMIE_GFtc-QHcDHS5izLukeejnGuOHcYA=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"February 27, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.93\"},{\"type\":\"Requires Android\",\"info\":\"4.2 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a020.00 - \\u20b9\\u00a06,700.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Nazara Games\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport@nazara.comPrivacy Policy5th Floor, Makers Chambers 3, Nariman Point, Mumbai - 400021, India\\n\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/pM5Zm6USyEUoUojsvRALS1XQsOc6X76ohMmMf89PX0J5aq5lEttAwB6NFPlU4eA8KxY=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/qllAopWU_c-RsD-1TG5jVFF7rks_vcAuiT-m9D-_q3WHAVIKopiNSlDu0TD2h5e-jx0=w720-h310\",\"data:image\\/gif;base64,R0