(168, 175, 'Files by Google is a file management app that helps you:<br>â¨ <b>Free up space</b> with cleaning recommendations<br>ð <b>Find files faster</b> with search and simple browsing<br>âï¸ <b>Share files offline</b> with others, fast and without data<br>âï¸ <b>Back up files to the cloud</b> to save you space on device<br><br>FREE UP MORE SPACE<br>In just a few taps, you can free up space more quickly and easily than ever: Delete old photos and memes from chat apps, remove duplicate files, erase unused apps, clear your cache and more.<br><br>CHECK YOUR STORAGE<br>Use Files to see how much free space is left on your phone and SD card. Easily transfer files to an SD card to free up your phoneâs storage, right from the app. Or use the integrated file cleaner to get more space on the phone.<br><br>BE IN CONTROL<br>You will always know what youâre deleting, we donât hide behind complicated terms and phrases. Select only what you want to remove and keep the rest. Itâs your photos, your videos, your files so you are in charge.<br><br>BOOST PHONE PERFORMANCE<br>Use Files to keep enough of memory, so that your phone keeps on running smooth. Regularly, you get a prompt to remove junk or temporary files which helps you get more storage immediately.<br><br>SMART RECOMMENDATIONS<br>Get helpful suggestions of files to erase before you run out of space. The recommendation from Files app get smarter the more you use it.<br><br>FIND FILES FASTER<br>Save time looking for photos, videos, and documents on your phone. Files uses filters rather than folders so your stuff is organized more intuitively. Files by Google is the file manager and storage browser that helps you find what youâre looking for fast.<br><br>EASILY MANAGE FILES<br>Search for your files or simply navigate to them through categories and filters. View, delete, move, rename or share any files. Sort them by file size to understand whatâs taking space. Browse all the GIFs your have. Find and share that video you downloaded last week. All of this with few taps.<br><br>SHARE FILES OFFLINE<br>Share your pictures, videos, documents, or apps with others nearby who also have the app. With fast speed up to 480 Mbps, itâs fast, free, and it works without the internet, so it doesnât cost mobile data. Just pair up your phone with anyone nearby who has Files app.<br><br>ENCRYPTED FILE SHARING<br>Filesâs offline file sharing is secured with WPA2 encryption, providing a more secure file transfer. Files app uses Bluetooth to set up encrypted and direct fast wifi connection, so that you can transfer app APK or large files in seconds, send videos or pictures to your friends. Safe and secure.<br><br>BACKUP FILES TO THE CLOUD<br>If you want to keep a file forever, select it from the Files menu and back it up to Google Drive or any other cloud storage app. Save them forever without taking space in your phone.<br><br>BACKUP FILES TO THE SD CARD<br>If you run out of storage on your phone, simply transfer large files or videos to your SD card if you have one. With a few clicks, you can clean up your phone and fully use the SD card. That leaves your internal storage free and your phone faster.<br><br>EFFICIENT, EFFECTIVE STORAGE MANAGEMENT<br>Files app takes less than 10MB of storage on your phone. And thereâs no malware or bloatware to affect your phoneâs performance.<br><br>THREE-IN-ONE TOOL APP<br>While taking very little storage on your device, Files does three things in one:<br>1) Free up space - Clean junk files and cache, boost your mobile phone or tablet as you clean up the phone memory and optimize your smartphone performance.<br>2) Find files fast - Browse your storage and find everything fast without being expert in file management.<br>3) Share files - Send pictures, share videos, transfer large files or app apks. All of this with super fast speed with rate up to 480 Mbps over an encrypted direct wifi network.', 'https://lh3.googleusercontent.com/pepfeN3daojo