(200, 207, 'Ludo board game is fun and hilarious game to play with friends and family. It is the best of all board games, lets you share some wonderful time with your loved ones. Don\\\'t wait any further, get the dice rolling and play Ludo SuperStar!<br><br><br>It is also known as Pachisi, and is very similar to a Spanish board game, ParchÃ­s.<br><br>This game has stayed popular throughout the ages, varying only a little in its game structure. The game is played between 2 to 4 players and you have the option of playing the game against the computer, against your friends, or even against people from around the world.<br><br>Ludo by BlackLight lets you define your own rules that suit your requirements. <br><br>Ludo Classic Features:<br>- Added rules/options which are played and popular in the world.<br>- Option to show safe cells(square) which is represented by star icon.<br>- Option to get another turn on both dice number 1 and 6.<br>- All the rules are optional so you can play both international version.<br>- New modern design with wooden board.<br>- Option to choose the dice number 6 which will start the coin.<br>- Option to choose the number of coins to be played with 2,3 and 4.<br>- Multiplayer in the same device, 2 and 4 player Real-Time Ludo.<br>- Play against Computer.<br><br>In ludo the objective is pretty straightforward; each player gets 4 tokens, these tokens must make a full turn of the board and then make it to the finish line.<br><br>Whoever gets all four tokens to the end first is the winner. However, each move can only be made based on the number decided by casting a six-sided die, and each token can only move out of their home by casting a six. Additionally, the competition factor of the games is upped by the fact that while moving if another playerâs token lands on the same square as your token, then your token will automatically be sent back home and youâll need to roll a six again.<br><br>Coming soon:<br>- Creating private room to play with friends and family in multiplayer mode<br>- Options menu with more rules and settings<br>- Score history and statistics<br>- Sounds and notifications<br><br><br>Check our Web Site for out latest blogs <br>http://Ludo.ooo/<br><br><br>**Localized name of the game:<br>Mens-erger-je-niet (the Netherlands),<br>ParchÃ­s or Parkase (Spain),<br>Le Jeu de Dada or Petits Chevaux (France),<br>Non t\\\'arrabbiare (Italy),<br>Fia med knuff (Sweden),<br>ParquÃ©s (Colombia),<br>Griniaris (Greece).<br><br><br>Some Arabic Pachisi variants are :<br>Barjis / Bargis (Palestine),<br>Barjis(s) / Bargese (Syria),<br>PachÃ®s (Persia/Iran).<br>da\\\' ngu\\\'a (\\\'Vietnam\\\') <br>Fei Xing Qi\\\' (China)<br><br>Check more on Wikipedia at https://en.wikipedia.org/wiki/Ludo_(board_game)', 'https://lh3.googleusercontent.com/f7Y6fXuaLCNGj2S6r5AAMTwcNf8Qd-mZwS5LhN5BsJxSKV2xn5bZvx_kF6MhltpaDwQ=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"March 28, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"8.80\"},{\"type\":\"Requires Android\",\"info\":\"4.3 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a025.00 - \\u20b9\\u00a04,500.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"\\ud83c\\udf1fBlackLight Studio Games \\ud83c\\udf1f\"},{\"type\":\"Developer\",\"info\":\"Visit websitecontact@blacklightsw.comPrivacy PolicyNoida, India\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/xD5tjQ2AE-0\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/sROuwvUl6ixr1n4koVOU3cwelh6YCEX_Chi1bf3k0pUgJ-zjiEcAnSBv-r1Qrevyr_I=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/fTEGeo5ay6ncfBF21ecnNDPMBaVbnCfJJTtZurQvhsS0rSBg0DQ8AdTSn_iXWQPxPLdC=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKA