(201, 208, 'Be a top Traffic rider of 2019 on ATV quad bike and kart in endless racing game. Go kart driving simulator 2019 is about highway racing ferocity of ATV endless traffic racing game. Get in the cockpit of your dream sports ATV moto and take control of the wheel as it is going to be a ride un-imagined like a best atv bike rider among the city traffic. Highway quad bike racer with our ATV Traffic Rider 2019: Quad Bike &amp; Kart, race your quad bike among highway traffic and win this racing simulator like a pro and skilled traffic atv bike racer. Have a drive in your luxurious buggy at full speed at become a most furious kart driver in endless kart driving simulator. You will surely enjoy this buggy highway racing with atv traffic race mania.<br><br><b>Endless Highway ATV Quad Racing Simulator</b><br>Letâs have fun driving the most powerful ATV motor bikes. Drive with nitro booster and have high speed highway traffic quad bike racing. In Street atv racing, dodge the freeway traffic and ride your atv like a stunning atv motorcycle riders.Â Choose the sporty cool motor in your moto garage, starting the engine and touching to accelerate, tilting the atv bike, clipping along the busy road.Â As traffic quad bike racer, all you have to do in this endless buggy traffic racing just speed up! Rush, overtake or crash. Offroad endless mode is also available with desert &amp; Iceland which having multiple offroad atv bike racing modes. In this racing ferocity 3d quad bike endless, experience sharp visuals and super controls for the endless atv driving game. Enhance your gameplay in every mode of racing. The traffic highway is setting a new standard for traffic racing bikes.<br><br><b>Buggy Kart Traffic Racing</b><br>A next-gen &amp; new racing game with dozens of highway kart race fun quests. Play this amazing kart racing adventure, select the driving buggy that you like and have real cool buggy driving experience in desert, city freeway &amp; snow scenarios! Use speed booster for fast paced kart driving. Your racing buggy has amazing physics. Become a worldâs best kart driver or a thrill buggy rider. Racing in kart is the best mobile racing game you have been looking for. You drive your buggy inside or up view through the endless traffic riding and realistic 3D open world environments. The game started with the busy traffic road and the highway, be careful! Roads and highways are filled with high-speed cars, trucks, buses and other vehicles. Play this street buggy racing on the asphalt roads with endless riding traffic racing roadway fun.<br><br><b>How to Play Endless Racing Ferocity</b><br><br>- Tilt or Touch to steer<br>- Touch gas button to accelerate<br>- Touch brake button to slow down<br><br><b>Top Features of ATV Traffic Rider 2019: Quad Bike &amp; Kart</b><br><br>Sharp 3D graphics &amp; visuals<br>Several high performance quad bikes &amp; karts<br>Nitro booster for intense speed<br>Many open world detailed environments to race<br>Advanced AI controlled traffic riding with range of vehicles<br>City, desert &amp; snow highway for endless racing<br>Racing games 2019 at its best<br>Electrifying roadway quad bike racing<br>Simple simulator control<br>Endless highway ATV bike racer rider', 'https://lh3.googleusercontent.com/kqOFJy05R9LukysmHTwIwECPYbLXIOyjlzrbbaBjVt3msKkdgyOBPwXPEzt1CXxQfwY=s180', 4, '[{\"type\":\"Updated\",\"info\":\"April 1, 2019\"},{\"type\":\"Size\",\"info\":\"42M\"},{\"type\":\"Installs\",\"info\":\"1,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.0\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 7+FearLearn More\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a0250.00 - \\u20b9\\u00a04,200.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Gamestr - Car Moto Bike Racing Games\"},{\"type\":\"Developer\",\"info\":\"game