(222, 229, 'KreditBee is an <b>Instant Personal Loan</b> and Credit Platform for Young Professionals, where one can apply for <b>Personal Loan Online</b> and avail upto â¹ 1 Lakh as Direct Cash Transfer to Bank Account as per their requirement. The interest rate ranges from 24% per annum to 36% per annum, which translates to <b>2% - 3% Per Month only</b>. The repayment tenure is flexible and goes upto 6 months. The documentation is very minimal &amp; the entire process starting from registration to cash disbursement does not take more than <b>15 minutes</b>. The application process is <b>100% online</b>, and on approval, the cash is immediately transferred to the bank account of the user. <br><br><b>Eligibility:</b><br><br>Any Indian individual who is above the age of 18 years, and has a monthly source of income. <br><br><b>Documents:</b><br><br>The minimum documents required to avail Instant Personal Loan Online are your Address Proof (either of Aadhaar/Voter ID/Passport) and Identity Proof (PAN ID). In some cases, your basic workplace details such as your Company Name, a picture of your Office ID Card, Workplace E-mail ID etc. might be required.<br><br>Credit Card is not required for availing Personal Loan from KreditBee.<br><br><b>How it works?</b><br><br>1. Install the KreditBee app from the Play Store by clicking \\\'Install\\\' above.<br>2. Register yourself through your Facebook profile.<br>3. Fill in your basic details to check your eligibility. This process hardly takes 2-3 minutes. (Sometimes, this might take up to 24 hours in case there is some manual check that is required. In such cases, you shall receive a call from KreditBee within 1 working day of application). <br>4. Once eligible, upload your Address Proof (either of Aadhaar/Voter ID/Passport) and Identity Proof (PAN ID), and fill in a few more details about yourself. Once done, the profile will be auto-verified depending on the validity and quality of the documents uploaded.<br>5. Avail Instant Personal Loan Online from KreditBee. The Cash is directly credited into your Bank Account within <b>15 minutes</b>.<br><br><b>Features</b><br><br>1. 100% Online Process<br>2. Minimal Documentation<br>3. Quick Approval<br>4. Immediate Bank Transfer<br><br><b>How is KreditBee better than other options?</b><br><br>The Personal Loan processed by a Bank usually takes a lot of time, effort and documentation, accompanies by frequent visits to the branch office. However, the KreditBee Personal Loan process is entirely, and takes hardly 10-15 minutes to be processed depending on your eligibility. The fulfillment is done as Online Cash Transfer to your Bank Account, which can be used anywhere by you as per your convenience. <br><br><b>Why Personal Loan from KreditBee?</b><br><br>1. It could be to gift your loved one, or a case of medical emergency for anyone in your family, or a discount sale going on which you donât want to miss out on. Situations and opportunities donât come with a notification, so KreditBee stands with you in those times for you to do the needful.<br>2. Availing the Instant Personal Loan Online from KreditBee and repaying back on time regularly will improve your Credit Score. This will help you avail bigger loans from banks (home loan, car loans, education loans etc.) at a much better interest rate.<br><br><b>Operational Cities:</b><br><br>KreditBee is operational Pan India.<br><br><b>Security:</b><br><br>Your data is safe with us. It is transferred over a secure HTTPS connection to us, and we do not share it with anyone without your consent except the Lenders. All the transactions are secured via a 128-bit SSL encryption.<br><br><b>Contact Us:</b><br><br>For help, you may contact help@kreditbee.in or call at 08044292200.', 'https://lh3.googleusercontent.com/94YPebqxbDBDcswtDud0xPVVRH5HDCJxAJ_4BQeYW7Hf7sCc6bHdwli3RAlbynGJaZ4=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"February 26, 2019\"},{\"type\":\"Size\",\"info\":\"17M\"},{\"type\":\"Installs\",\"