(252, 259, 'Azar allows you to talk and make friends with people from over 190 countries. <br><br>â¢ Over 100 million downloads worldwide!<br>â¢ More than 20 billion matches!<br>â¢ Featured in Google Play Store in over 130+ countries! <br><br>â· Discover &amp; Connect!<br>Azar allows you to meet someone new at the turn of each swipe. <br>You can easily explore new cultures and people from all over the world. <br><br>- Meet new people from all over the world through live video calls (using 3G, 4G, Wi-Fi)<br>- Select the region and gender of your choice and start building new conversations <br>- Enhance your chat experience with facial recognition stickers and costume effects.<br>- Add new people to your friend list and spark conversations <br>- Send and receive messages/video calls with existing friends <br>- Donât be afraid of foreign languages! Chats are translated in real time. <br><br>â· Share Azar with people around you and make more connections <br>Please leave a review on the Google Play Store and Facebook. Your review will help make Azar a better service.<br><br>- Want more information? http://azarlive.com <br>- Updates on Azar? http://www.facebook.com/azar.application <br>- Want to follow Azar? https://instagram.com/azar_official <br>- Need help or have suggestions? https://help.azarlive.com/hc <br>- Business partnership inquiry? azar.business@hpcnt.com<br><br>â· Creating a better and enjoyable community at Azar <br>The Azar team is committed to creating a service that anyone can use safely. We believe our users are able to meet new and genuine people with each swipe. Please respect other users and follow our community guidelines to keep the Azar community at its best!<br><br>â· Protection of Personal Information <br>- All personal information is securely stored and not sold nor shared to third parties.<br>- Information other than what you write directly on the profile can not be seen by other users.<br>- Your detailed location is not shared with any other user or third parties.<br>- Please take caution when delivering sensitive information, because you are responsible for the information you provide to the other party once you connect through Azar.', 'https://lh3.googleusercontent.com/-Uo9eYTnCHQlZJaJA1QcNFHiGC3nlvoIBBWnpq-BYHkeAJzLvRZJ92RV8VsZjRATmx0=s180', 4.2, '[{\"type\":\"Updated\",\"info\":\"March 13, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 12+Parental Guidance RecommendedLearn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact, Shares Location, Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a075.00 - \\u20b9\\u00a011,999.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Hyperconnect inc\"},{\"type\":\"Developer\",\"info\":\"Visit websitehelp@azarlive.comPrivacy PolicyZip code 06620, Research & Product Development Center, Hyperconnect inc. Asia Division,\\n14, Teheran-ro 63,Gangnamgu,Seoul,Korea\\n\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/w5c28an5oeI\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/RTxl_jGqfUo01ufuXEk28r4nI_mmXb7CY0PGICPVnhCWR3zSPm4sDkrqzs8Zb5nSW_Do=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/8E0P2z0LnoQRxFfvuxaFELO4hVXpuFoHU_8LbTzaHlYshH3phCdRlqZ8lD-DNoXazSo=w720-h310\",null,null,null]', '[{\"url\":\"https:\\/\\/www.youtube.com\\/embed\\/w5c28an5oeI?ps=play&vq=large&rel=0&autohide=1&showinfo=0\",\"image_url\":\"https:\\/\\/i.ytimg.com\\/vi\\/w5c28an5oeI\\/hqdefault.jpg\"}]', '2019-04-07 19:43:47', '2019-04-07 19:43:47', NULL),
