(262, 269, 'Use our true caller ID to identify calls and see photos and names of unknown caller and contacts in your phone book by only clicking one icon. <br><br>Automatically record calls. Save important one to your phone or share them with your cloud backup (not supported on Android Pie).<br><br>Sync with Facebook to automatically add photos to your phone dialer, contacts &amp; address book with Eyecon. Check numbers of unknown calls with our simpler caller ID and smart dial contacts. Automatically link messaging and calling apps to connect quickly. <br><br>FEATURES<br><br>â Visual â We sync with Facebook and other social media channels to identify your contactâs true photos to create a photo based address book and dialer. See names and photos instead of numbers for unknown callers and your contacts when you are dialing or receiving calls. <br><br>â Safe â Protect yourself from spam and anonymous phone calls with our caller ID. Our caller ID is based on Facebook and other social media identifiers, so the photos are all high quality and the information is completely accurate. Block calls to control who can call you. <br><br>â Connective â Sync your dialer, Whatsapp, Facebook, Viber, messaging, email, Skype, Linkedin and more with a single click for all in one communication through your favorite app icons.    <br><br>â ACR Call recorder - record phone calls automatically. Save the ones that are important by pinning them to your favorites list. Back them up by sharing your recordings to Dropbox, Google Drive, WhatsApp, Email and more (not supported on Android Pie).<br><br>â Ultimate personalization-  Control how your image and contact information appear in your friendâs address book and in their phones when you call them.  Choose from one of our 30+ themes to customize your address book with your favorite of our skin options! Change your settings to determine your dual or single SIM settings, caller ID notifications and more. <br><br>â Availability checker â Find out if your friends are free before you dial with our non-intrusive \\\"can you talk\\\" feature to allow people to either answer the phone, call you back immediately or respond that they are busy. <br><br>â Intuitive â Our technology learns your preferences as you interact with Eyecon and use our phone dialer. We organize contacts by those most dialed and display communication icons according to those you use the most often.<br><br>â Set photos â Enjoy participating in our one-of-a-kind game to review the photos we automatically synced with your contacts and find new pictures of your friends. <br><br>â Add contacts - After a conversation with someone who isnât already in your phonebook, use our built in caller ID to easily add them as a new contact with a suggested name and photo without typing anything additional.  <br><br>â Private â login by simply adding your phone number without syncing with third party social media or a lengthy registration process.<br><br><br>CONNECT WITH US<br>â¥ Learn more at http://www.eyecon-app.com.<br>â¥ Email us at support@eyecon-app.com if you need assistance or have a suggestion.<br>â¥ Follow us on Facebook at https://www.facebook.com/eyeconapp/.', 'https://lh3.googleusercontent.com/PygEZPqDR0K7Ouo6SIvbk8qEqnbOZ_zoADDdqOn2_d8b4agRzdadQyU1TiDGlcMmvKw=s180', 4.6, '[{\"type\":\"Updated\",\"info\":\"April 1, 2019\"},{\"type\":\"Size\",\"info\":\"17M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.0.224\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a010.00 - \\u20b9\\u00a01,200.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Eyecon Phone Dialer & Contacts\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport@eyecon-app.comPrivacy Policy10685-B Hazelhurst Dr. #24067\\nHouston, TX 77043\\nUSA\\n\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/6KU4q81rxYI\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/FsSpr1DsS2ldxqCs5IWYIyGSXqAUCAQH3gwvwPo3cQYHyjfMqpDkKF5SuElF7lC_MHU=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/m0Ib0YB9c8PjQ_FEbjzhppwWOKu8iiTQ_B66oF78xh8yR6dFqhkhUhdkMmLsVbAqOT0=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[{\"url\":\"https:\\/\\/www.youtube.com\\/embed\\/6KU4q81rxYI?ps=play&vq=large&rel=0&autohide=1&showinfo=0\",\"image_url\":\"https:\\/\\/i.ytimg.com\\/vi\\/6KU4q81rxYI\\/hqdefault.jpg\"}]', '2019-04-07 19:46:00', '2019-04-07 19:46:00', NULL),
(263, 270, '<b>A world of learning and fun, made just for kids</b><br>We created YouTube Kids to make it safer and simpler for kids to explore the world through online video â from their favorite shows and music to learning how to build a model volcano. Thereâs also a whole suite of parental controls, so you can tailor the experience to your familyâs needs.<br><br><b>A safer online experience for kids</b><br>We use a mix of filters, user feedback and human reviewers to keep the videos in YouTube Kids family friendly. But no system is perfect and inappropriate videos can slip through, so weâre constantly working to improve our safeguards and offer more features to help parents create the right experience for their families.<br><br>KID PROFILES: Create up to eight kid profiles, each with their own viewing preferences, video recommendations, and settings.<br><br>PARENT APPROVED CONTENT: Choose this setting if you want to make sure youâre in control of what your kids watch and handpick the videos, channels, and collections of channels they can see. Search is disabled in this setting.<br><br>OLDER EXPERIENCE: As your little ones grow and develop you have the option to open up new content appropriate for 8-12 year olds. Simply enable this option when creating a new profile or update an already existing one. This setting allows kids to watch and search popular music and gaming videos from creators like Justin Bieber, Rosanna Pansino, Dan TDM, and many more.<br><br>We work hard to make videos in the app family friendly, but no system is perfect. Itâs always possible that you may find something you donât want your child to watch. Videos may contain some explicit language and imagery, violence and suggestive content.<br><br>YOUNGER EXPERIENCE: The âYoungerâ version includes videos from The Little Bus Tayo, Monster High, and more. With a range of sing-alongs and learning videos, this experience is perfect for preschool to school aged kids to search and find videos they love.<br><br>We work hard to make videos in the app family friendly, but no system is perfect. Itâs always possible that you may find something you donât want your child to watch.<br><br>BLOCKING:  Find a video or channel you donât want your kid to watch? Block it to automatically remove it from all of your kidsâ profiles.<br><br>VIDEO REPORTING:  Alert us immediately by reporting videos that shouldnât be in the app. The video will be sent for fast review.<br><br>TIMER:  Set up a timer to put limits on how long your kids can watch.<br><br>WATCH HISTORY:  Keep tabs on what your kids are watching.<br><br>Other important information:<br><b>Parental setup is needed to ensure the best experience possible for your kid.</b><br><br>YouTube Kids contains paid ads in order to offer the app for free. Your kid may also see videos with commercial content from YouTube creators that are not paid ads.<br><br>Important information for parents with Family Link Google accounts. You can create Google Accounts for kids under the age of 13 in Family Link. Your kids can sign into YouTube Kids with their Google Account. You can access parental settings in the Family Link app and enable an additional content level setting in our app. Opt into an âolderâ setting [applies only in the regions where it is launched, currently launched in the United States], if you feel your kid is ready for less restricted videos. These videos may contain some explicit language and imagery, violence and suggestive content. In addition, this setting tries to exclude mature content, but no automated system is perfect and your kid may find content with nudity, highly offensive language, and extreme violence. Please note that parent approved content is not available if you sign into YouTube Kids with kidsâ Google accounts created in Family Link.<br><br>The Privacy Notice for Google Accounts managed with Family Link describes our privacy practices when your kid uses YouTube Kids with their Google Account. When your kid uses YouTube Kids without signing into their Google Account, the YouTube Kids Privacy Notice applies.', 'https://lh3.googleusercontent.com/k_HSvNKlleJNrzuL3OqDuXFm3Es8d77UQtiZvPqLg8lera9Xj99GRkDwWaJGMz8nkb1B=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"March 27, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Google LLC\"},{\"type\":\"Developer\",\"info\":\"Visit websiteytkids-support@google.comPrivacy Policy1600 Amphitheatre Parkway, Mountain View 94043\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/A9o6dWmQvJeGIB59rvKjqU-Jq17m7TsIJyPe4CDhQGXrhjUllXn-ZE0oW9sRu_sWmBKD=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/_oxUCBpJ3ONGF9EGXEvFo2zlfnVV680Mqox6i7tkWK2Sp9EJ0XEL3kjASOraEmi3NDs=w720-h310\",null,null,null,null,null,null,null,null,null,null,null,null,null]', '[]', '2019-04-07 19:46:00', '2019-04-07 19:46:00', NULL),
(264, 271, 'Detective needs you to solve some difficult cases. Youâll be drawn into the plot of multiple investigations, each with its own unique fugitive to catch, challenges, and surprises.<br><br>Where players must find a set number of differences between two otherwise similar images. <br><br><b>FEATURES</b><br>â Find 5 clues in a limited time! <br>â 20 cases to be resolved and continuous update!<br>â Over 1000+ different and puzzles!<br>â Use the hint option to provide a clue!<br>â Full Color images!<br>â Free to play!<br><br><b>Translation For Help</b><br>You can help us translate \\\"Find The Differences - The Detective\\\" into your language like Spanish, Portuguese, French, German, Italian, Russian and other languages.<br><br>You can contact us via this email: ð®finddifference@boooea.com ð®. <br>Thanks for your effort to help us.<br><br>Feel free to contact us by finddifference@boooea.com if you have any problem about Find The Differences - The Detective.', 'https://lh3.googleusercontent.com/4TlMBfcIfgI_MI-MyEXkWO2oDidmbIkqEiC1FqsJZM11XWoxnHpbT9OVIijWGsBwyA=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"February 19, 2019\"},{\"type\":\"Size\",\"info\":\"92M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.4.0\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 7+Implied ViolenceLearn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a090.00 - \\u20b9\\u00a01,750.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"10P STUDIO\"},{\"type\":\"Developer\",\"info\":\"finddifference@boooea.comPrivacy PolicyWAYSONCOMMERCIAL BUILDING 28CONNAUGHT ROAD WEST SHEUNG WANHONG KONG\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/GZv_mQmrBs1KHffKPpevub9bOSCMRIqbk9dW4Cly9