(265, 272, 'Bike Race is one of the best racing game on Android! Race and have fun against millions of players. Bike Race is one of the top-rated free games! And it\\\'s free! Speed up the wheels and get ready for fun!<br><br>Addictive racing gameplay<br>- New game mode: Tournaments!<br>- Race against millions of users on multiplayer<br>- Train on single player to improve your skills<br>- Fun guaranteed<br>- Simple and intuitive driver controls<br>- Challenge your facebook friends<br>- Play without wifi<br><br>Amazing features<br>-Hundreds of crazy tracks and mad worlds<br>-Cool stunts<br>-Tons of amazing bikes<br>- Don\\\'t miss the free updates with lots of new content<br><br>Forget those dumb drag car racing games. To become a master motorcycle, skills matter (a lot). As they say: no pain, no gain! So, start practicing right now to become a pro bike racer and rule them all. It will be addicting, we guarantee fun at the tip of your finger!<br><br>Bike Race is brought to you by Top Free Games - the creators of the addicting game: Racing Penguin.<br><br>â Details about user created levels<br>If you want to play more than 3 featured user created levels per day, you will need to buy a level pack. You can play unlimited free levels created by you or your friends if you have their codes. You can also play unlimited free levels shared publicly on the internet by other users. Levels can not be created on a mobile device. To create a level, surf to https://www.bikerace.com<br><br>â Play it anywhere<br>Bike race free does NOT require any internet connection. you can have fun racing in the subway, while flying on a (real) plane, in the car on the road, during services in a temple (or maybe even on the toilet!)<br><br>â Low data usage<br>This free game will not consume tons of data from your mobile plan that you\\\'d want to use instead to surf the web, watch youtube videos and listen to free music<br><br>â Compatibility and support<br>We\\\'re continuously working (hard) so that all Android phones and tablets run the game smoothly. please report any issue you may experience to support+bikeraceandroid@topfreegames.com<br><br>â Age rating disclaimer<br>It does NOT contain violence nor any other mature content. it\\\'s just a simple and straightforward racing game. Feel free to play it with your friends and have fun as if you were children and boys. We bet it will be fun and you\\\'re gonna love it!<br><br>â Privacy policy<br>https://www.topfreegames.com/games/bikerace/legal/privacy', 'https://lh3.googleusercontent.com/B_EE8Uh6aHsjnAsoTHOww3-9ai64qA6iSOcAqxd_AnTezbZ8ZMIqRbZjSIykpCqk6wm1=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"April 5, 2019\"},{\"type\":\"Size\",\"info\":\"28M\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"7.7.20\"},{\"type\":\"Requires Android\",\"info\":\"4.2 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a065.00 - \\u20b9\\u00a06,800.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Top Free Games.\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport+bikeraceandroid@topfreegames.comPrivacy PolicyRua Dr Renato Paes de Barros 1017, COnjunto 81\\nSao Paulo\\/SP - Brasil\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/8wkTMfQqsTM\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/JCzVM9CFivPVqq8MDsBimsSi2WN1vnLB3VE35lwxuHRpIh0vlSs9lIHIuAk8RDLcrq8=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/l1q3dpsOgGHdD_uIkqTV78y9z-QQ_0BL4SPyiKIvDjyBU_uo7-fy9sNd57w2FbU35xk=w720-h310\",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]', '[{\"url\":\"https:\\/\\/www.youtube.com\\/embed\\/8wkTMfQqsTM?ps=play&vq=large&rel=0&autohide=1&showinfo=0\",\"image_url\":