(289, 296, 'Qureka is a daily live quiz show app that you can play for free, and win cash prizes daily. Also make sure you play Mega Quiz for prize money worth â¹1,50,000 on 10th April at 9:00 PM. You can play numerous live Quiz games every day on Qureka.<br><br>Qureka is available in English, Hindi, Kannada, Tamil, Bengali &amp; Telugu. You can play quizzes in your preferred languages &amp; win exciting cash prizes.<br><br>Our daily prize gets split amongst all the winners equally, and in case there is no winner the prize gets added to the prize for the next show. The live show has 10 questions (might vary) and you get 10 seconds to answer each question. You win awesome cash prizes on answering all 10 questions correctly in a live Quiz show. Qureka also gives you opportunity to earn coins that help you from elimination in live quiz. In any live quiz show, 30 coins get applied automatically on your 1st wrong answer (not applicable on last question). <br><br>You can earn coins in multiple ways. There are  multiple mini quizzes running few times a day, where user can play &amp; earn coins. There are a few other ways through which you can earn coins, explore Qureka to find them out yourselves.<br><br>Note: For old Qureka users, the lives will be converted to coins (1 Life = 30 Coins) once they update their app to the latest version of Qureka.<br><br>Qureka is completely free and at no point do we ask users to pay us for playing a game, there is no gambling involved when you play games on Qureka. Generally, all the quizzes will be free to join, but there will be special quiz games which will require coins to join the game. So keeping sufficient coins in your wallet is recommended.<br><br>The Quiz show in Qureka has questions from these topics: History, Science, Trending, General Knowledge, Cricket, Technology, Business, Sports, Food, Art, Culture, Politics, Music, Films, TV, Mythology, Movies, Nature, Geography, Literature, Celebs, World &amp; Social.<br><br>Other exciting features:<br>- Monthly Mega Quiz: Play Monthly Mega Quiz for Prize money worth â¹ 1,50,000 which is held on 15th or 30th of every month.<br><br>- Mega Referral Program: Invite as many friends as possible from your referral code and get prizes when they join and play. You get Rs.10 when your friend joins &amp; plays 1st game on Qureka. Also, if your referred wins any game &amp; you have also played the same game, then you win 50% of your friend\\\'s winning amount. This also applies to the Monthly Mega Quiz, so if your friend wins Rs.5 lakhs, you get Rs. 2.5 lakhs.<br><br>- Daily Mini Quiz: This will run multiple times every day. You get 3 questions. All 3 right answers can help you earn a coin. Use coins during the daily live quizzes to avoid elimination.<br><br>- Least Data Consumption: We know for you playing seamlessly is important hence we bring to you a show that has least buffering and uses very less memory and data on your phone.<br><br>Qureka combines speed, performance and the winning in an enthralling manner. If you love these, you will love Qureka.<br><br>Preparing for the exams like UPSC, IAS, Civil Service, GATE, CLAT, government exams like Bank exams, Railway exams, TGT, PGT, NEET etc. Qureka will be helpful to you.', 'https://lh3.googleusercontent.com/kK1MrfdCtj0YdMOtbagReVdzuqKC-_jAJWCHRlJ7M_p4IwJpj_LkJzqOrrBm3v_OxgM=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"April 7, 2019\"},{\"type\":\"Size\",\"info\":\"13M\"},{\"type\":\"Installs\",\"info\":\"5,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.1.5\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"CoolBoots Media\"},{\"type\":\"Developer\",\"info\":\"support@goqureka.comPrivacy Policy\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/6gpqPPcoBfY\\/hqdefault.jpg\",\"https:\\/\