(294, 301, 'RailYatri is a complete train app which enables the users to check Live Running Train Status, check their IRCTC PNR Status, Book Train Tickets via IRCTC authorised agents, download and read Train Time Table, check Seat Availability with confirmation prediction, order Food on Train besides much more. <br><br>It is one of India\\\'s most trusted train apps helping more than 34 million train travellers plan their train journeys smartly and efficiently. <br><br><b>Key highlights of the app</b> <br><br><b>Live Train Running Status</b> - Running train status gives current position of the train, delay or on-time information, and estimate time of arrival at upcoming stations. If you\\\'re on train, it is recommended to use GPS status for live updates. Easily check out where is the train by giving in train name or train number.<br><br><b>PNR Status with Prediction</b> - Simply enter your PNR number to know all about PNR Status- current waiting list number, confirmation chance, chart preparation time, bogie number, berth or seat number etc. Check if your wait-listed PNR will get confirmed to plan better. Moreover, get periodic updates about your PNR status, chart preparation status besides much more.<br><br><b>Order Food on Train </b> - Order fresh, hot, hygienic, tasty and pristinely packed food and we will deliver it right on your berth by providing your Train Number or PNR details or both via our app. Choose from <i>thalis</i>, combos, quick munches or our newly launched express delivery menu. Check out for \\\'Order Meal\\\' option in PNR Status detail page for quick access. <br><br> <b>Indian Railways Train Time Table </b> - Download once and access Time Table for offline use. Also, check the on-time performance of the train on stations. <br><br><b>Coach Position &amp; Platform Numbers</b> - Find out the platform number, coach position, seat and berth layout even before boarding your train. <br><br><b>Book Train Tickets via IRCTC authorised Agents</b> - Get assistance &amp; human help for booking train tickets through IRCTC authorised e-ticketing agents.<br><br><b>Confirmed seats availability on trains </b> - Know seat availability &amp; find out getting confirmed berth chances. <br><br><b>Fare Enquiry</b> - Know Fare for various categories and find out station to station and catering charges break up. <br><br><b>Medical Emergency</b> - In case of medical emergency while on train, you can now easily check for hospitals nearest to the stations on your route. <br><br><b>RailWisdoms</b> - Fellow travellers share wisdoms and insights from their past train travel. This helps our users to stay updated and plan well. <br><br><b>Book Hotels near Station</b> - Book hourly stays, why pay full if you just need it for few hours to fresh up and go.Try it now! <br><br><b>Book Bus Tickets</b> - Now book bus tickets instantly through our trusted operators. Avail upto 30% discount on your bus ticket through RailYatri. Save more! <br><br><b>Automated task-reminder for your train trip</b> - Your upcoming trip gets detected automatically from the ticket SMS. Simply paste your ticket sms in the add trip section. We then send you automated timely reminders on expected delays, platform and closest station entry gate, coach position, berth position, food booking reminder, wisdoms, and much more.  <br><br><b> App got selected by Google for Developers Launchpad 2017 </b> <br><br><b> Awarded the best mobile app in SE Asia </b> <br><br>http://mbillionth.in/mobile-based-solution-in-travel-tourism/ <br><br><u>Important</u> <br>-Please note that PNR Status service is unavailable between 11:30 PM &amp; 12:30 AM - For any issues email us at feedback@railyatri.in &amp; we will be happy to investigate any matter. <br> <br><u>Disclaimer</u> This app is not affiliated with CRIS, NTES or IRCTC.', 'https://lh3.googleusercontent.com/LETweCtJAGZKFDqmmDGqezvu33IDnENNJNLEPnOYdJR_T8j642jivSl9tIoKaGEn-w=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"April 4, 2019\"},{\"type\":\"Size\",\"info\":\"15M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"3.7.0\"},{\"type\":\"Requires Android\",\"info\":\"4.3 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact, Shares Location\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"RailYatri: Best Railway App for PNR & Train Status\"},{\"type\":\"Developer\",\"info\":\"Visit websitefeedback@railyatri.inPrivacy Policy\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/ezaEMsyrTsA\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/78RD_2AuayLVNu3kuKwJrQtzD7RuaKR3hgLacxTtMdgiBIJuqXry5lYebFUC55f12Yra=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/xg0GU8ACtiaHja25y0NH9clwvcRc7ZmAgT0P7MdpzbAGlXpmL6g5OKWBHxAL60X10uQ=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0