(296, 303, 'Humanity thought that a strike of WW1 and WW2 would never happen again. But it seems that Armageddon had already begun... Help peaceful country survive! Master command of war, guide your army and win the trench war!<br><br>Lead your troops to historic triumph! Build a strong card deck and crush your enemy\\\'s HQ by tactically deploying your army! <br><br>Numerous military equipment is at your disposal: stormtroopers, artillery, bunkers, snipers, machine gunners, guns, a tank, a bomb. Earn medals and climb up the Leaderboard! Open crates to unlock new powerful units and spells! Will you get one of the legendary cards? <br><br>FEATURES:<br>+ World War 2 theme<br>+ PVP<br>+ Intuitive mechanics <br>+ Destroy enemy HQ to unlock cards<br>+ Trench warfare with epic explosions<br>+ Earn medals<br>+ Quick and spectacular battles<br>+ Deck building: aggro, control, combo-archetypes<br>+ Play for free!<br><br>Variation in strategy and freedom of operation are waiting for you. Fight for courage and glory! Become an honored Commander!<br><br>Support:<br>Are you having problems? Contact us at ta@amt-games.com or in the game by going to Settings &gt; Support. <br><br>Privacy Policy: <br>https://amt-games.com/privacy/<br><br>Terms of Service: <br>https://amt-games.com/tos/', 'https://lh3.googleusercontent.com/qI1XEiOGvZ6ulBnz4dy7iKwHIZwep7FfuKmxAZckl-hr9e4IPL_eWZjgpfHBDkQHRDM=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"March 25, 2019\"},{\"type\":\"Size\",\"info\":\"9.8M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.6.1\"},{\"type\":\"Requires Android\",\"info\":\"4.0.3 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 12+Moderate ViolenceLearn More\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a010.00 - \\u20b9\\u00a0860.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"AMT Games Publishi