(300, 307, 'Another masterpiece from the creators of Traffic Racer. This time, you are behind the wheels of a motorbike in a much more detailed gaming experience, but also retaining the old school fun and simplicity.<br><br>Traffic Rider takes the endless racing genre to a whole new level by adding a full career mode, first person view perspective, better graphics and real life recorded bike sounds. The essence of smooth arcade racing is still there but in the shell of the next generation. Ride your bike in the endless highway roads overtaking the traffic, upgrade and buy new bikes to beat the missions in career mode.<br><br>Now it is time to hit the roads with a motorcycle!<br><br>FEATURES<br>- First person camera view<br>- 29 motorbikes to choose from<br>- Real motor sounds recorded from real bikes<br>- Detailed environments with day and night variations<br>- Career mode with 70+ missions<br>- Online leaderboards and 30+ achievements<br>- Support for 19 languages<br> <br>TIPS<br>- The faster you ride, the more scores you get<br>- When driving over 100 kmh, overtake traffic cars closely to get bonus scores and cash<br>- Driving in opposite direction in two-way gives extra score and cash<br>- Do wheelies to get extra score and cash<br><br>FOLLOW US<br>* http://facebook.com/trafficridergame<br>* http://twitter.com/traffic_rider<br><br>*** No Timers, No Fuel ***  Just pure endless fun!<br><br>Traffic Rider will be updated regularly with your suggestions. Don\\\'t forget to leave a review with your feedback.', 'https://lh3.googleusercontent.com/590AflDt-hW2t85Cit_ODJPJdRiMMRn2cSF0vYNfsBpjm895x1zDy0npbD7IlDCvmNvI=s180', 4.7, '[{\"type\":\"Updated\",\"info\":\"September 17, 2018\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"}