(338, 345, 'Drive big oil tankers across beautiful cities! Offroad Oil Tanker Transporter Truck Simulator 2019 is an is an action packed, realistic tanker truck simulator game.<br>Get behind the wheels of your oil tanker, start up the engine and show off your driving skills! Operate big tankers to deliver oil tanks and complete different missions.Transport highly flammable gasoline and other oils safely from one station to the other on different offroad paths. Feel like a real Trucker! Offroad Oil Tanker Transporter Truck Simulator 2019 gives you a realistic driving experience in the hilly open world environment!<br>Driving a big truck in the exciting Offroad Oil Tanker Transporter Truck Simulator 2019 game is not as easy as it looks! You must be an expert in parking tankers to deliver oil to the right locations. Drive your loaded tanker carefully through the dangerous offroad paths because every time you crash, your tanker will get damaged and oil will spill out. Be sure you deliver the oil before your tanker is completely broken and damaged!<br>Each level of Offroad Oil Tanker Transporter Truck Simulator 2019 is more challenging and exciting than the other! Complete several challenging missions and upgrade your tanker to more powerful ones! <br>Change the camera view as per your comfort to the sturdy exterior or the realistic plush interiors.<br><br>Offroad Oil Tanker Transporter Truck Simulator 2019 FEATURES:<br>Realistic offroad environment<br>Many goods delivery missions<br>- Realistic oil tanker physics<br>- Amazing 3D graphics<br>- Realistic oil tanker interiors<br>- Realistic game sound effects<br>- Many grand oil tankers to drive<br>- Easy driving controls<br>- Realistic weather conditions<br>- Fresh attractive music<br><br>Get Offroad Oil Tanker Transporter Truck Simulator 2019 now to feel like you are driving a real tanker!<br>Become the ultimate oil tanker driver in this Offroad Oil Tanker Transporter Truck Simulator 2019 game!', 'https://lh3.googleuserc