(345, 352, 'Vault is a mobile app designed to hide private photos, videos on your phone. Currently there are more than 100 million users worldwide using Vault to protect their mobile privacy while enjoying App Lock, Private Bookmark, Incognito Browser, Cloud Backup and many other helpful features for completely free! Join them now!<br><br><b>Top Features</b><br><br>â <b>Hide and Protect Photos &amp; videos: </b> Photos and videos imported into phone can only be viewed or played after the correct password is entered. These photos and videos can also be backed up to Cloud Space for better protection.<br><br>â<b>Call Reminder: </b>Whenever there is an incoming call, you will be informed of whether it\\\'s from a telemarketer, package delivery or simply a spam call.<br><br>â <b>App Lock (Privacy Protection): </b>Use App Lock to protect your social, photo, call logs and telephone apps to prevent privacy leak.<br><br>â <b>Private Browser: </b>With Private browser, your internet surf will leave no traces behind. There is also Private Bookmark feature.<br><br>â <b>Cloud Backup: </b>Back up your SMS, contacts and call logs, photos and videos to Cloud so they never get lost.<br><br>â <b>Data Transfer:</b>With Cloud Backup feature, you could easily transfer your data to a new phone by cross-device synchronization.<br><br>â <b>Password recovery: </b> Worried about forgetting your password? Set a security email in Vault so you can retrieve it.<br><br><b>Advanced Features</b><br><br>âº <b>Multiple Vault &amp; Fake Vault</b><br>Create multiple vaults with different passwords for storing photos, videos or private contacts respectively. And one of them can be a fake vault.<br><br>âº <b>Stealth Mode</b><br>Make Vault icon disappear from your home screen and it can only be found again with the correct password, so no one knows it exists.<br><br>âº <b>Break-in Alerts</b><br>Secretly snaps a picture of any one who attempts to access with a wrong password. Vault captures a photo, the time stamp and PIN code entered by all intruders.<br><br><b>Support:</b><br><br>âº <b>Q&amp;A: </b><br><br><b>1. What if I forgot my password? </b><br><br>If you have a security Email set up before, you should be able to see a \\\"Forgot Password\\\" en-trance once you input the wrong password. Tap on the entrance and follow the instructions to reset your password. <br><br>If you do not have a security Email but you had backed up your data to cloud space, then the data can be recovered from the cloud by reinstalling Vault app.<br><br><br><b>2. How do I enter vault in stealth modeï¼</b><br><br><br>1. Put Vault back to the phoneâs home screen by adding Vault widget, once it appears on home screen, tap on it, and then input your password to enter, or, <br><br>2. Download \\\"NQ calculator\\\" in Google Play, open it, and input correct password then tap \\\"=\\\". <br><br><br><b>3. Why are my photos/videos lost? </b><br><br>Some cleaning or free storage apps may automatically delete Vaultâs data folder used to store pictures and videos. So, as a best practice, please do not choose to delete Vaultâs data folder and subfolders (mnt/sdcard/SystemAndroid) when you use such apps. <br><br>You can also backup your sms, pictures and videos to cloud by using \\\"Cloud Backup\\\" feature in the premium page of Vault.<br><br>For more questions or comments,<br>Email: vault@nq.com<br>âº <b>Facebook Page &amp; Messager: </b><br>Vault â hide pics&amp;videos, sms, lock app @nqvaultapp<br><br>This app uses the Device Administrator permission.', 'https://lh3.ggpht.com/_lV9mTAwnUQUCdvbv2cAvhUhDrCNv2oVsQqpJI-AOAhOhjMl5hxO4I0kOz7dqqjIYw=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"April 2, 2019\"},{\"type\":\"Size\",\"info\":\"11M\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"6.9.00.22\"},{\"type\":\"Requires Android\",\"info\":\"4.3 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\"