(348, 355, '\\\'BHIM SBI Payâ (UPI App of SBI) is a most innovative payment app that allows any Banksâ customer to send or receive money to/from any other Banks customer using a single app &amp; also allows to pay for services like recharge, food orders, bill payments &amp; local deals. You need not worry which Bank you have your account with. Just download âBHIM SBI Payâ &amp; start using it.<br><br>You just need to ensure that:<br>â¢ Your mobile number has been linked to your Bank accounts<br>â¢ You have a Debit card linked to your account<br><br>BHIM SBI Pay allows you to make easy, instant &amp; secure payments at your convenience on all 365 days of the year<br><br>With BHIM SBI Pay you can also do recharges, order food, pay utility bills &amp; buy local deals.<br><br><b>Recharge</b>: Prepaid, Postpaid &amp; DTH<br>â¢ Track all your recharges at one place<br>â¢ Get reminders for postpaid bills<br><br><b>Food</b>: Order Food from your Favourite Restaurants<br>â¢ Compare &amp; Use Swiggy, Freshmenu, Faasos, Behrouz Biryani at one place<br>â¢ Browse menu, add food items to cart, pay from your account &amp; get food delivered<br><br><b>Bill Payments</b>: Hassle free payment of Electricity, Gas, Broadband, Landline &amp; Water Bills<br>â¢ Fetch your bill using your customer id or unique identification number of bill<br>â¢ Get Reminder for utility bills<br>â¢ Pay for 70+ popular bills<br><br><b>Local Deals</b>: Explore all local deals at one place<br>â¢ Notification of latest deals<br>â¢ Get discounts on Buffets, Spa &amp; salons, weekend activities &amp; more<br><br>Transaction Limits on BHIM SBI Pay:<br>â¢ Max. limit per transaction: Rs.1,00,000/-<br>â¢ Max. transaction limit per day is Rs.1,00,000/-<br><br>If you are a Merchant: Login to the app, Click on âI am a Merchantâ option, fill-up your business details &amp; you are ready to collect payments from your customers.<br><br>Toggle between Consumer &amp; Merchant modes:<br>â¢ With BHIM SBI Pay, you can collect payments as a Merchant or make payments as a Consumer by simply using the toggle switch from the Menu icon at the top left<br><br>Pay/Send money using:<br>â¢ VPA of the beneficiary<br>â¢ Account Number + IFSC of the beneficiary<br>â¢ Using Beneficiaryâs Aadhaar Number<br>â¢ Scanning QR Code of the beneficiary<br><br>Steps to Send Money:<br>â¢ Login to the App &amp; Click on Pay<br>â¢ Select Debit Account, Payee Address type (VPA or Account and IFSC or Aadhaar)<br>â¢ Enter other required details<br>â¢ Enter UPIN<br>â¢ Click Submit<br><br>Steps to Receive/Collect Money:<br>â¢ Login to the App &amp; Click on Collect <br>â¢ Enter Payer VPA<br>â¢ Enter other required details<br>â¢ Click Submit<br><br>Transaction History:<br>â¢ View your latest 20 transactions &amp; transactions done for a range of dates<br><br>Manage multiple bank accounts: <br>â¢ Select My Accounts option from Menu, select your bank &amp; simply add it<br>â¢ If you have only one Bank account, that will be your Default account to make &amp; receive payments on BHIM SBI Pay<br>â¢ In case you have multiple accounts, you can select any 1 of them as your Default account, by clicking on âSet as Defaultâ option against the account<br>â¢ During the âPayâ transaction, select any debit account by swiping through the accounts displayed on the Home screen<br><br>Create and Manage Multiple VPAs:<br>â¢ To add a VPA, go to the Menu at the top right of your app screen, click on View Profile.<br>â¢ Select Add a New VPA and create your new handle, for e.g. mobileno@sbi<br>â¢ Select the account to link to the new VPA<br>â¢ Multiple VPAs can be used for different accounts or one VPA can be linked to different accounts<br><br>Steps to Reset PIN:<br>â¢ In case you forget the App PIN, choose âForgot App PINâ option on the login screen, answer the secret question to reset the App PIN<br>â¢ In case you forget the UPIN of Account, reset it by clicking on âReset UPI PINâ against that account<br><br>Complaints/Dispute management: <br>Dispute can be raised only for successful transactions.<br><br>â¢ Login to the App<br>â¢ Click on View All in Recent Transactions<br>â¢ Select the transaction and Click Raise Dispute button<br>â¢ Select Dispute type, enter Remark.<br>â¢ Click Submit<br> <br>For other queries/complaints related to BHIM SBI Pay, please write to support.upi@sbi.co.in', 'https://lh3.googleusercontent.com/7lCBYNuvV5JNj0ZGjxSzF_krwWqBaEkowDJ7LnwxwO4imSJBp_Edi9wlmlGuFjhPf2I=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"February 20, 2019\"},{\"type\":\"Size\",\"info\":\"21M\"},{\"type\":\"Installs\",\"info\":\"5,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.2.3\"},{\"type\":\"Requires Android\",\"info\":\"4.2 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"State Bank of India\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport.upi@sbi.co.inPrivacy Policy\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/N0hkEojEDc6PLfeseUg-ZIdxK9_r_JEXFKFzpdWwILtF_QhSvqhRRkWvCHI0-XCAeTM=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/IuhaYMcevgaliSvHmmjacmSGQtXV7bTltJjgS0Yzb4ian_qlO2mKhA4IuTFeiCo_XXY=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[]', '2019-04-07 1