(399, 406, 'Hide Photos, Videos, Apps, Messages, Calls in your phone. <b>COMPLETELY FREE and UNLIMITED</b><br><br>Hide photos &amp; videos from your photo gallery and access them easily using a secret PIN code. Now you can easily share your phone without worrying about privacy. <br><br>-- About the app â<br><br>The app is cleverly disguised as \\\"Audio Manager\\\" in the App Drawer.<br>Disguises itself as an Audio Manager app which can be used to turn the volumes up and down. but if you Long press on the Audio Manager title the actual Hide It Pro app will launch, which is basically your SECRET VAULT of hidden photos, videos, messages, apps etc.<br>You can Hide photos, videos, or any other files in your Private Vault<br><br><h1>Features</h1>\n<br><br>1.) App disguised behind a fully functional Audio Manager (Other disguises like Calculator etc. are available)<br>2.) Categorize media into hidden folders of your choice<br>3.) <b>Free Cloud backup</b> of your files<br>4.) <b>App Disappears from recent apps list, can\\\'t be tracked</b><br>5.) Gallery with integrated Slideshow and sharing to WhatsApp, WeChat, Facebook etc.<br>6.) Integrated Video player with support for VLC player, MPlayerX etc.<br>7.) Multiple lock screen options - <b>Pin, Password, Pattern</b><br>8.) <b>Fingerprint unlock</b><br>9.) Escape pin/password for times when you get caught<br>10.) Built in encryption tool to secure your most important files<br>11.) Other Features like Secret Chatting, Private Messaging / Calls, Private Browsing, Locking Apps.<br>12.) <b>Hide app icon</b> from the app drawer of phone<br><br>etc.<br>There are a lot more features like custom slideshows, batch delete, share, unhide, move data between albums, sort files and folders to your liking etc.<br><br>Please email us you have any issues, If the app doesn\\\'t install properly do a reinstall, that would solve 99% the problems<br><br>Contact us at: <br>Email : support@hideitpro.com<br>Twitter: @hideitpro<br>Facebook: fb.com