(405, 412, 'UMANG (Unified Mobile Application for New-age Governance) is envisaged to make e-governance \\\'mobile first\\\'. It is developed by Ministry of Electronics and Information Technology (MeitY) and National e-Governance Division (NeGD).<br>                                                                                                     <br>It is an evolving platform designed for citizens of India to offer them access to the pan-India e-Gov services from the Central, State, Local Bodies, and Agencies of government on app, web, SMS, and IVR channels.<br> <br>Key Features:<br>- Unified Platform: It brings together all government departments and their services on a single platform to provide better and easier services to citizens.<br>- Mobile First Strategy: It aligns all government services with the mobile first strategy to leverage mobile adoption trends.    <br>- Integration with Digital India Services: It provides seamless integration with other Digital India Services like Aadhaar, DigiLocker, and PayGov. Any new such service will automatically be integrated with the platform.<br>- Uniform Experience: It is designed to enable citizens to discover, download, access, and use all government services easily.<br>- Secure and Scalable: It supports Aadhaar-based and other authentication mechanisms for service access. The sensitive profile data is saved in an encrypted format and no one can view this information.               <br> <br>Key Services:<br>UMANG provides easy access to a plethora of Indian government services ranging from â Healthcare, Finance, Education, Housing, Energy, Agriculture, Transport to even Utility and Employment and Skills.<br> <br>Key Benefits for Citizens:<br>- Single-Point Ubiquitous Access: All government services are available for citizens on a unified platform for easy access through multiple online and offline channels (SMS, email, app, and web).      <br>- More for Less: Only a single mobile app needs to be installed instead of each app of each department.<br>- Convenience: Citizens do not even need to install or update the app again to avail government services if more services are added to the platform.<br>- Saving of Time and Money: Citizens can anytime and anywhere avail these services through their mobile phones, desktops, and laptops without any need for visiting the department office and standing in queues.<br>- Uniform Experience: All the government services including payment-based transactions provide secure and uniform experience.', 'https://lh3.googleusercontent.com/m5WMZLMyCSDQiohkE3m-evp75xR3EKWNlMGM2rXWrOln7tOquJJwek_pQNYQHueSUek=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"February 20, 2019\"},{\"type\":\"Size\",\"info\":\"20M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.2.7\"},{\"type\":\"Requires Android\",\"info\":\"4.4 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Shares Info\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"MeitY, Government Of India\"},{\"type\":\"Developer\",\"info\":\"Visit websitecustomercare@umang.gov.inPrivacy Policy\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/aRvJC_rKpsb8pe4mhSnCaeCXgO1R3d441pYsoPeX8pw1VnvZmzEi-AIGbUCxrIGb1GU=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/V7-MCXHGqXBcmg_YvaDySLzzXhCQu1_uUHH-Rh_NaU9MkNjckzRA7sEKd6Jw3bNRh3Wm=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/