(424, 431, 'Hungry? Get baking! Become the best cake baker in town and create the yummiest cakes, in this delicious cooking game! This cooking gameâs beautiful 3D art will make you feel like youâre baking a real cake! Yummy! What are you waiting for? Get your mixer out and start cracking those eggs! <br><br>Be the best cake baker the world has ever seen! Whatâs your favorite type of cake? Sweet birthday cakes? Fancy wedding cakes? Whatever it is, you can make it! Decorate your cakes to make them extra beautiful, and take photos so you can show your friends your yummy creations! You can even enter your cakes in a contest and serve them to your friends at the cake party!<br><br>Features:<br>&gt; Learn how to bake the most delicious cakes EVER in this fun cooking game!<br>&gt; Tons of mouth-watering cake recipes to make for you and your friends!<br>&gt; Use professional baker tools to bake, design &amp; decorate the most delicious cakes!<br>&gt; From rainbow-sprinkled birthday cakes to strawberry cupcakes, the choices are infinite!<br>&gt; Decorate your cakes with yummy frosting, delicious decorations &amp; adorable toppers!<br>&gt; Are those wedding bells? Design and bake a beautiful cake for the bride. <br>&gt; Put the prettiest picture of yourself on your very own cake!<br>&gt; Have a cake party with your fuzzy bunny, kitty and puppy friends, cute babies, and more!<br>&gt; Make the party extra festive with your very own party decorations!<br>&gt; Enter the cake bake competition, vote for your favorite cake, and win first prize!<br>&gt; To-die-for dark chocolate, cherry-banana cake or cheesecake? You choose - Youâre the baker! <br>&gt; Itâs princess party time! Put your favorite princess on a cake! <br>&gt; Take pictures of your masterpiece to show off your gorgeous cake designs!<br>&gt; Make a cake album so youâll always remember your incredibly delicious creations!<br>&gt; Tons of adorable and fun coloring pages for you to draw in, in this awesome cooking game!<br><br><br>About Coco Play<br>Coco Play is China-based developer of creative and unique apps for kids and the whole family. Founded in 2013, Coco Play provides rich 3D simulation-based games for the whole family. Coco Play is a subsidiary of TabTale, a leading, global creator of innovative games, interactive books and educational apps.<br>Visit us: http://www.tabtale.com/ <br>Like us: http://www.facebook.com/TabTale<br>Follow us:@Tabtale<br>Watch us: http://www.youtube.com/iTabtale<br><br> CONTACT US <br>Let us know what you think! Questions? Suggestions? Technical Support? Contact us 24/7 at WeCare@TabTale.com.<br><br>FOR PARENTS: 	<br>The app is free to play but certain in-game items may require payment. You may restrict in-app purchases by disabling them on this device. The app may include advertising for TabTale and certain third parties which will redirect users to our sites, apps or third-party sites.<br><br>Privacy is important to us. The app may enable collection of limited user data by TabTale or its carefully selected providers (e.g. ad networks and analytics) for limited legal purposes described in our Privacy Policy (e.g. respond to support queries; enable, analyze and improve the appâs features and services; serve contextual ads). The app includes certain features only accessible behind an age-gate to protect children (e.g. restrict behavioral ads; social networks links to connect with others while playing; option to accept push notifications to inform of exciting news e.g. updates). By downloading or using the app you accept our Privacy Policy: https://tabtale.com/privacy-policy/  and Terms of Use: https://tabtale.com/terms-of-use/   and permit such uses for users of your device.', 'https://lh3.googleusercontent.com/S8im9spSY22w8UNgRZBBaXLR0YS_4s9OkxR8m4X7gedVQ7vi4kvKYLo_nZQci2rq4ps=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"July 9, 2018\"},{\"type\":\"Size\",\"info\":\"94M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"