(441, 448, 'Experience the convenience of My DishTV app in its all new avatar. <br>My DishTV is your one stop destination for managing your DishTV account, recharges and much more. With My DishTV now you can:<br>* A companion for your DishTV set-top-box: Now control your DishTV set-top-box with all-new Infrared remote feature. (Available only for android mobile devices with an Infrared transmitter/blaster). <br>* Voice commands for IR remote (change channel, control volume or search for content using voice commands).<br>* Now My DishTV can tell you what to watch. Handy information about currently running programs and Top programs on the home page. <br>* Talk to My DishTV app with the newly introduced Adi Chatbot. Tell Adi your DishTV related issues and get quick solutions. <br>* Multi VC management: Control all your VCs with the same account.<br>* Recharge Instantly: Recharge anytime, anywhere with three simple taps. Variety of payment modes available, including UPI and wallets.<br>* Get information on your fingertips: Quickly get your DishTV information like Switch off date, account balance and Subscribed pack etc. <br>* Change your pack: Easily select the pack of your choice and enjoy your favourite channels or subscribe to add-on packs.<br>* Get exciting Recharge offers<br>* Channel Guide:  Detailed information about your favourite entertainment is on your fingertips with our âChannel Guideâ section. You can even set reminders for your favourite programs and share program information with your friends. <br>* Usage Instructions: Get tips on how to effectively use My DishTV App to manage your account.                                                                                                                                                                                                                                             <br>* Social Login: Link your social account and login with just a tap. <br>* Login with OTP: No need to remember your password. G