(470, 477, 'Do you want to know if your Wireless Access Point is vulnerable to the WPS protocol?<br>Wps Wpa Tester is the app that you need!<br><br>With this app, you can try the connection to an Wi-Fi Access Point via WPS PIN.<br>PINs are calculated with several algorithms throught MAC Address and there are others PINs included in a local database for many Access Point.<br><br>Luckily just a small part of Wireless Access Point are vulnerable to WPS protocol.<br><br>If you will find out that your Access Point has WPS protocol enabled, we suggest to disable it.<br>The purpose of the app is educational to let the customers know about vulnerability of their own Access Point.<br><br>There are many connection mode with this app and you can try the bruteforce mode either.<br><br>App also discovers if an Access Point with WPS enabled is invulnerable (WPS LOCKED).<br><br>App allows users with root permissions to see Wi-Fi passwords saved.<br><br>Some important Notes:<br><br>NOTE: you can test the PINs with this app and you can connect, but you cannot see the password without root permissions.<br><br>Use this app only with your own AP not to go against the law.', 'https://lh3.googleusercontent.com/yviyxUxNWNXdBl2GqNMCzyql2leoeytpIXse4EUt75EOzB6P-qwnE-_MA_2S-JIMxQ=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"January 14, 2019\"},{\"type\":\"Size\",\"info\":\"5.6M\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"3.9.2\"},{\"type\":\"Requires Android\",\"info\":\"4.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Sangiorgi Srl\"},{\"type\":\"Developer\",\"info\":\"Visit websitealessandrosangiorgi31@gmail.comPrivacy PolicyVia Giovanni Falcone\\nMilitello in val di Catania (CT)\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/9CiKhoyGCJdV6rwHvV9N93MSJDmOAtpDMorOs