(473, 480, '<b>Do you like farming tractor driving games? Are off-road Tractor cargo simulator games are fun to drive on steep hills and mountains? If yes then welcome to Farm Tractor Cargo Driving Simulator Game 2019 whereas the best farmer driver your duty is to transport cargo in village farm. This heavy-duty tractor trolley game is a pull test for farm tractor transporter.</b><br><br>This tractor farming simulator game is an ultimate test for heavy tractor drivers. You can play chained tractor games to improve tractor pulling precision skills by controlling the speed of tractor trailer while climbing hill and village farms. As a farm tractor crew driver, you need to supply logistics like a haystack, rice, wheat, corn, water tankers and wooden logs to the hill station. Be the best logistics transporter by playing offroad tractor farming simulator game of 2019!<br><br>The project cargo transport has limited tractor supply hours so take control of tractor seat to pedal tractor for shipping and freight cargo. The tractor transport company have multiple tractors for transportation services to facilitate farmer driver. There are various means of transport tractor supply like a big green tractor, garden tractor, lawn tractor, small and compact tractor. The trolley is attached with modern tractors to complete the cargo carrier transporter duty.<br><br><b>Features of Farm Tractor Cargo Driving Simulator 19:</b><br>- No internet connection required and it\\\'s Free!<br>- New farm tractor driving games of 2019<br>- Tractor farming games for kids<br>- Real Tractor Mania for farming driver<br>- Multiple heavy machinery for driving<br>- Many luxury loader trucks to choose from<br>- Thrilling Hill driving transport missions <br>- Off-road tracks to test tractor speed<br>- Tractor race and brake controls', 'https://lh3.googleusercontent.com/UxaeKEQPYLtUwFAxE5Ba8yc1IJMiaXq-SirusF7FaHJfUkoXZhaJWmNmVoOU1BJzNNo=s180', 4.1, '[{\"type\":\"Updated\",\"info\":\"February 15, 2019\"},{\"