ess to:<br>Location<br>Photos/Media/Files<br>Device-id<br><br>In case of any queries, please visit<br>http://www.firstcry.com/contactus<br><br>Email us @ customercare@firstcry.com<br><br><br>By signing in to our app, you agree to FirstCry\\\'s T&amp;C and Privacy Policy<br>http://www.firstcry.com/termsofuse<br>http://www.firstcry.com/privacypolicy', 'https://lh3.ggpht.com/iMI6Qq-tDRZlnUrgHu6EaeWKD74WjrEpBTEf8pZ7e2NbzXITPtSndCbbIYYjPJg5AQ=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"February 19, 2019\"},{\"type\":\"Size\",\"info\":\"18M\"},{\"type\":\"Installs\",\"info\":\"5,000,000+\"},{\"type\":\"Current Version\",\"info\":\"81\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Shares Info\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"FirstCry.com\"},{\"type\":\"Developer\",\"info\":\"Visit websitecustomercare@firstcry.comPrivacy Policy\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/jmjRq_f-di8\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/GgEpuuVFrh382GI8t5RVdoFrhPqgMqPY-8HJifWgvjeuTCcbcC1mu10S_sFcokTrYWM=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/UaFEPge1RqjpKW8TfhCLhMVHHX2tez-bpV4Z54sG8z8uBd58EplY4OBpvkMsF_5xqqY=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAE