(479, 486, 'ZArchiver - is a program for archive management. It has a simple and functional interface.<br> <br>ZArchiver lets you:<br> <br>- Create the following archive types: 7z (7zip), zip, bzip2 (bz2), gzip (gz), XZ, tar;<br>- Decompres the following archive types: 7z (7zip), zip, rar, rar5, bzip2, gzip, XZ, iso, tar, arj, cab, lzh, lha, lzma, xar, tgz, tbz, Z, deb, rpm, zipx, mtz, chm, dmg, cpio, cramfs, img (fat, ntfs, ubf), wim, ecm, arc (freearc), lzip;<br>- View archive contents: 7z (7zip), zip, rar, rar5, bzip2, gzip, XZ, iso, tar, arj, cab, lzh, lha, lzma, xar, tgz, tbz, Z, deb, rpm, zipx, mtz, chm, dmg, cpio, cramfs, img (fat, ntfs, ubf), wim, ecm, arc (freearc), lzip;<br>- Create and decompress password-protected archives;<br>- Edit archives: add/remove files to/from the archive (zip, 7zip, tar, apk, mtz);<br>- Create and decompress multi-part archives: 7z, rar(decompress only);<br>- Partial archive decompression;<br>- Open compressed files;<br>- Open an archive file from mail applications;<br>- Extract splited archives: 7z, zip and rar (7z.001, zip.001, part1.rar, z01);<br> <br>Key features:<br>- Multithreading support (useful for multicore processors);<br>- UTF-8/UTF-16 supporting in filenames. Allows you to use national symbols in filenames;<br>- No need for enabling multiselect mode. You can select files by clicking on the icon from the left of the filename;<br> <br>ATTENTION! Any useful ideas and wishes are welcome. You can send them by email or just leave a comment here.<br> <br>Mini FAQ:<br>Q: What password?<br>A: The contents of some archives may be encrypted and the archive can only be opened with the password (don\\\'t use the phone password!).<br>Q: The program is not working correctly?<br>A: Send me an email with detailed description of the problem.<br>Q: How to compress files?<br>A: Select all files, you want to compress, by clicking on icons (from the left of filenames). Click on the one of selected files and choose \\\"Compress\\\" from menu. Set desired options and press OK button.<br>Q: How to extract files?<br>A: Click on archive name and select suitable options (\\\"Extract Here\\\" or other).', 'https://lh3.googleusercontent.com/KnBAHtl-qwXuS1s9L5_1VVWijJwRYAwkEA3xM8QMx2rzX33TbYOKuMj8RWVM33WcSw=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"February 16, 2018\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"ZDevs\"},{\"type\":\"Developer\",\"info\":\"Visit websiteprozanton@gmail.comTraktoristov, 17 Ekaterinburg, Russia\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/YQirnc5zCZPMT3HbAaLTkzue8iZ9a16VLUm0DeV0pRZPVXs39IC_HIIu2cXfAbHo76k=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/YrWvmieX7Ehruc3EY_oBZZ27MUMT20uYZ8Bqn-vbeBDDSuOgQFbixAqOEktRY4YB6w=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[]', '2019-04-07 19:56:40', '201