(493, 500, 'The Excel spreadsheet app lets you create, view, edit, and share your files with others quickly and easily. Manage charts, data analyses and more while you view and edit workbooks attached to email messages.<br><br>Work in data analysis, accounting, auditing, finance, or any other fields with confidence. Your office moves with you when you use Excel, enabling you to implement complex formulas with amazing features. <br><br>Create spreadsheets, review your charts or start a budget on the go. Create spreadsheets customized your way with robust formatting tools and great features. Excel lets you build your charts and spreadsheets to meet your specific needs.<br><br>Get the data analysis, spreadsheets and business features of Microsoft Office on your phone with Microsoft Excel.<br><br><b>Microsoft Excel Features:</b><br><br><b>Create Spreadsheets &amp; Calculate</b><br>â¢ Manage charts, budgets, task lists, accounting, or financial analysis with Excel\\\'s modern templates. <br>â¢ Use data analysis tools and familiar formulas to run calculations.<br>â¢ Rich Office features and formatting options make your workbook easier to read and use.<br>â¢ All charts and spreadsheet features, formats, and formulas operate the same way, no matter the device you use. <br><br><b>Review and Edit</b><br>â¢ Review your Excel files from any device.<br>â¢ Edit charts and data or update your task list from anywhere.<br>â¢ Use data analysis features like sort and filter columns to focus your review.<br>â¢ Create spreadsheets, duplicate, hide, and unhide easily.<br>â¢ Annotate charts with notes, highlight portions of your worksheet, create shapes, or write math equations using ink with the draw tab feature on devices with touch capabilities.<br><br><b>Data Analysis</b><br>â¢ Insert charts to bring your data to life.<br>â¢ Use data analysis features like add and edit chart labels to highlight key insights.<br><br><b>Collaborate and Work Anywhere</b><br>â¢ Share charts and files with a few taps to quickly invite others to edit, view, or leave comments directly in your workbooks.<br>â¢ Copy your worksheet in the body of an email message with its format intact or attach or copy a link to your workbook for other sharing options.<br><br>Use business apps to create spreadsheets with all the functionality of Microsoft Office. Download Microsoft Excel today.<br><br>REQUIREMENTS:<br>ï¿½ OS version: running any of the supported versions of Android and have an ARM-based or Intel x86 processor. Support for Kitkat &amp; Lollipop devices will continue till June 2019<br>ï¿½ 1 GB RAM or above<br>To create or edit documents, sign in with a free Microsoft account on devices with a screen size smaller than 10.1 inches. <br>Unlock the full Microsoft Office experience with a qualifying Office 365 subscription (see http://aka.ms/Office365subscriptions) for your phone, tablet, PC, and Mac. <br>Office 365 subscriptions purchased from the app will be charged to your Play Store account and will automatically renew within 24 hours prior to the end of the current subscription period, unless auto-renewal is disabled beforehand. You can manage your subscriptions in your Play Store account settings. A subscription cannot be cancelled during the active subscription period.<br>This app is provided by either Microsoft or a third-party app publisher and is subject to a separate privacy statement and terms and conditions. Data provided through the use of this store and this app may be accessible to Microsoft or the third-party app publisher, as applicable, and transferred to, stored, and processed in the United States or any other country where Microsoft or the app publisher and their affiliates or service providers maintain facilities.<br><br>Please refer to Microsoft\\\'s EULA for Terms of Service for Office on Android. By installing the app, you agree to these terms and conditions: http://aka.ms/eula', 'https://lh3.ggpht.com/GkNfqm17WFuzaIR87_oz690ErF63hL08Ngj73QtDxyWlCOF80d2gWd2GHrPLJJ-YmHYS=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"March 20, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"500,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact, Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a061.51 - \\u20b9\\u00a0460.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Microsoft Corporation\"},{\"type\":\"Developer\",\"info\":\"Visit websiteoffandro@microsoft.comPrivacy PolicyOne Microsoft Way\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/1quD6hxYhBO4HAO845k_la6md99JArOX4lOm8Ywf2wXNusQT2OyEFZMuSDvj-fCMuig=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/WlyavdApWXvDuPKGotQhVEqCmKbIWseGxBn3Zs_F-ztxhT3O3OJ1C75UIvgB4nwtDHI=w720-h310\",null,null,null,null,null,null,null,null,null,null,null,null,null]', '[]', '2019-04-07 19:56:40', '2019-04-07 19:56:40', NULL),
(494, 501, 'Motu Patlu Speed Racing is a game of Motu and Patlu travelling to exciting worlds of Furfuri Nagar,Egypt, Jungle,etc..  and their adventures in the most fun, dangerous and exciting places in the world. The main objective in this game is to Race till the end of the level quickly and collect as many coins as possible to unlock new vehicles and upgrade powerups.<br><br>In between the Race the player will face John and his goons menacing the town and its people. Youâll have to help Motu Patlu and keep teaching these goons a lesson from time to time and save the people from getting troubled!<br><br>Motu and Patlu can collect pieces of puzzle in the level to complete puzzles and unlock a very secret level too!<br><br>Also you can play out other games - Chhota Bheem Speed Racing, Motu Patlu Race, Chhota Bheem Up the Hill, Motu Patlu King of Hill Racing, and Chhota Bheem Club, Hanuman : Lanka Run<br><br>Game Features -:<br>1. Play with Motu Patlu!<br>2. Drive lots of different vehicles!<br>3. Zoom through lots of worlds like Furfuri Nagar, Jungles and Alien World!<br>4. Collect pieces of puzzle for playing an extra secret level!<br><br>-------------------------------------------------------------------------------------------------------------------------------------------<br>Motu Patlu Speed Racing respects your privacy, does not store any personal information and does not allow you share this information<br><br>We do require a few additional Permissions to function:<br><br>1. READ_EXTERNAL_STORAGE &amp; WRITE_EXTERNAL_STORAGE<br>These permissions are needed to cache and read ad content during the gameplay.<br><br>2. ACCESS_COARSE_LOCATION/READ_PHONE_STATE/ACCESS_FINE_LOCATION<br>These permissions are needed to show suitable ad content for targeted user for better ad experience and also for tournaments updates.<br><br>3. RECORD_AUDIO<br>This is required for zapr SDK which is integrated with this app for the purposes of profiling the device on media consumption and other device data and utilizing the same to target relevant content and ads to the device (\\\"Services\\\") pursuant to the terms and conditions of RBL Services (\\\"Terms of Use\\\").<br><br>4. GET_ACCOUNTS<br>This permission would use your Google account name and picture to show it on the leaderboard once you sign in.', 'https://lh3.googleusercontent.com/kdKsiKgTU6G0sceDtN_2OhZqFEaebsRuaxHk-eolPCb0GlN5Uj-k5FtfzrI4l3Cm7Es=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"March 11, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"5,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.39\"},{\"type\":\"Requires Android\",\"info\":\"4.2 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a020.00 - \\u20b9\\u00a06,700.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Nazara Games\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport@nazara.comPrivacy Policy5th Floor, Makers Chambers 3, Nariman Point, Mumbai - 400021, India\\n\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/Jhh1RMGsj32ZC8BXBXbTIx8ppEp3-m_2ZaaNfR4EKx4agPv4kMMVIT_UXEDrlxIGVh8=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/AeIVxtnKZavToxsXZCtLXvwFfBSYBdi71MXR_WtSMh4ixJZKqTl4EK9lghiTXyE6Wvb3=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\