(503, 510, 'An ever growing library of FREE emoji and funny stickers for Messenger, Snapchat, WhatsApp, Facebook, Twitter, WeChat, Instagram, Line, and other social media messengers. <br><br>Smart stickers pop-up to help you express yourself quickly.<br><br>Hundreds of keyboard themes available to suit your style.<br><br>Custom keyboard theme by choosing your own photos, wallpapers, emoji wallpaper. You can also change the theme colors, customize the font style, fonts size and colors! <br><br>Customizable layout (one-hand mode and split screen) to completely suit your needs. QWERTY, QWERTZ and AZERTY for phone mode and other layouts specifically for pad tablet.<br><br><br>Irides Keyboard caters for all typing tastes ? all colors, designs and themes. Support for 50+ languages, Tons of emoji (smileys, emoticons), stickers, who said typing had to be boring?<br><br><br>Key Features<br><br>Fast and accurate <br><br>Irides Keyboard helps you type fast and accurate, and learns your writing style automatically. That means autocorrect input and word predictions that actually works because it adapts to you. Besides, users can fast input emoji, GIFs, stickers, emoticons conveniently everywhere.<br>Fastest keyboard uses autocorrect so you can type accurately without even looking, and save time using intuitive gestures! <br><br><br>Massive free stickers, emojis and colorful themes<br><br>Show your style on Irides Keyboard with thousands of emoji, stickers, emoticons and personalized themes, there\\\'s never a boring conversation with Irides Keyboard!<br><br>Smart enough to recognize mistyping, provide correction suggestions and make your typing easy.<br><br>Various layouts, support for most Android phones<br><br>Irides Keyboard provides various layouts such as qwerty keyboard and QWERTZ keyboard for most android phones. <br> <br><br>PRIVACY<br>Irides Keyboard does not collect any personal data without your explicit permission. We take privacy very seriously.<br>The warning message that says Irides Keyboard may be able to collect ?all the text you type, including personal data like passwords and credit card numbers? is part of the Android Operating System that appears when any third party keyboard is enabled.<br>Happy Typing!', 'https://lh3.googleusercontent.com/9Rpikyk-sHhwqbcuJj0mt58Ny2M8_5WhijC9xpv-SDJ5mklyMFFmHj7fSSfrOmZm4uo=s180', 3.2, '[{\"type\":\"Updated\",\"info\":\"March 23, 2019\"},{\"type\":\"Size\",\"info\":\"35M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.0.29.0323\"},{\"type\":\"Requires Android\",\"info\":\"5.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Tick Keyboard\"},{\"type\":\"Developer\",\"info\":\"Fnkbkl@gmail.comPrivacy Policy\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/39YYkFmDXAd06ge7NpfEtc0T8n8exGVR5Ac59wSvJJjsh6qIVeXtvV9oMzVb5vy3TjIT=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/cUvCn0qJ-17dVtFN3toJSY589m_RkKeCu6Rdi58drdlsEvYCzIAnOAAqLSWr7qtnVSE=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[]', '2019-04-07 20:04:58', '2019-04-07 20:04:58', NULL),
(504, 511, '<b> 2 hour delivery of groceries, electronics, home &amp; kitchen essentials and more</b><br><b> Available in various pin codes across Bengaluru, Delhi-NCR, Mumbai &amp; Hyderabad </b><br><br><b> Up to 50% Off Daily Essential - Powered by BigBazaar, Spar, More &amp; Local Supermarkets</b><br><br><b>Convenience is just a tap away:</b> Shop online on the Amazon Prime Now app to get grocery &amp; other daily essentials delivered to your doorstep within 2 hours. Now you donât need to carry heavy grocery shopping bags around! <br><br><b>Daily essentials delivered on your schedule:</b> Get 2 hour Express Delivery. With Amazonâs fast &amp; reliable delivery, you know your grocery will reach you on time! You can also choose to get scheduled delivery in any 2 hour slot between 10 am &amp; 10 pm, on the same or the next day.<br><br><b>Save big every day:</b> Get exclusive deals on the best products. As part of our launch promotions you can get cashbacks on your 1st order! This is in addition to all the fabulous discounts that our sellers have on offer everyday.<br><br><br><br><b>Your one stop online shop from electronics to groceries</b><br>Your favorite neighborhood grocery shops are now selling online on the Amazon Prime Now app. Why visit multiple stores to get all the items in your grocery list when you can relax at home &amp; shop online using Amazon Prime Now!<br>Some of the stores available for online grocery shopping on the app-  <br>â¢ Big Bazaar  <br>â¢ More MegaStore<br>â¢ Spar Hypermarket<br>â¢ Now Store<br>â¢ Local Supermarkets<br><br><b>All the products you want</b> <br>With the Amazon Prime Now online shopping app, you get thousands of daily items - fresh vegetables, fruits, bread, egg &amp; dairy items, cooking essentials, personal care essentials, snacks &amp; beverages, easy meals &amp; mixes, chocolates, pastas &amp; noodles, household supplies, healthcare essentials, baby care, make-up, beauty &amp; gourmet products, electronic items &amp; home &amp; kitchen essentials delivered to you within hours!<br>We have a wide selection of all the brands you love to shop for, including products from Patanjali, Nestle Maggi, Surf Excel, Haldiram, Dove, Aashirvaad, Golden Harvest, Nandini, Kelloggs, Britannia, MTR &amp; many more. So however unique your grocery list might be there is a good chance you will find your favorite brand on Amazon Prime Now.<br><br><br><b>Easy returns &amp; refunds</b>  <br>All of this is backed with the peace of mind that comes from Amazonâs trusted return policy. At the time of delivery you can reject items that are no longer wanted or not as expected. You can also claim a full refund on expired or defective products at any time within 10 days of delivery.<br>  <br><br><b>Important Note:</b><br>The Amazon Prime Now Grocery Shopping app is currently available in select pin codes across Bengaluru, Delhi-NCR, Mumbai &amp; Hyderabad.', 'https://lh3.googleusercontent.com/PT8dZdIesKY4nvZh6wmq_6z5msn41TdXVQSI99P6dVPLlcIlDsslpKuo5K6E3525Aw=s180', 4.1, '[{\"type\":\"Updated\",\"info\":\"March 8, 2019\"},{\"type\":\"Size\",\"info\":\"7.0M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.4.8\"},{\"type\":\"Requires Android\",\"info\":\"4.4 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact, Shares Info\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Amazon Mobile LLC\"},{\"type\":\"Developer\",\"info\":\"Visit websiteamazonnow@amazon.comPrivacy PolicyAmazon Mobile LLC\\n500 9th Avenue N,\\nSeattle, WA 98109\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/NHoQasfuwwLksd5P_Sd71AQ0t3TeKwimhguemf5DE3Q21aSXez924Kp-lgdeaNJ_Pxw=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/aiO7UmC13owoRuAVAUCk2YVEEJMiuIWYVdruaGFS6peX5PsJqnR7kVueb4Z23b4dswVH=w720-h310\",\"da