(506, 513, 'iMobile is ICICI Bankâs official mobile banking application.<br><br>iMobile, the most comprehensive and secure Mobile Banking application, getting payments done through Unified Payment Interface (UPI), offers over 170 banking services on your mobile.<br><br>The features of the new iMobile are:<br><br>Pay and collect money from anyone instantly using Unified Payment Interface (UPI)<br>View and transact from all your accounts including Loans, PPF, iWish, Insurance, Cards and Deposits<br>Check your bank balance, view &amp; email detailed statement and view passbook on your mobile<br>Transfer funds to an account or to contact no or email id<br>Send cash through ICICI Bankâs Cardless Cash facility<br>Transact superfast using Favourite feature. By tagging a transaction as favorite, you can quickly access and complete your transactions like mobile recharge or fund transfer<br>Connect directly to ICICI Bank Phone Banking Officer from your mobile phone application<br>Track your deliverables<br>Open FD â Open FDs, RDs or iWish deposits<br>Get personalized offers on your mobile<br>Access and manage Life Insurance policies<br>Service At Your Convenience: Avail banking services from the comfort of your home. You can locate an ATM, stop or check status of your cheque, order a cheque book, track your service requests and more.<br><br>Now you can also view the following details on your Smart watch by using iWear - ICICI Bank\\\'s Android Wear Banking application:<br>â¢ Information about your Bank and Credit Card accounts<br>â¢ Balance details and last 3 transactions<br><br>iWear is a companion app that works only when user has downloaded Android Wear to their mobile devices.<br>iWear offers banking and informational services to make a simplified banking experience as never before.<br><br>For more details on ICICI Bank Mobile Banking visit http://www.icicibank.com/mobile-banking/index.html.<br><br>Legal Terms and conditions: http://www.icicibank.com/terms-conditi