(507, 514, 'Conquer street and sky in Turbo Driving Racing, a mix of high-octane driving and endless racing. Turbo Driving Racing is one of the best arcade endless racing games with stunning 3D graphics.<br><br>This is Turbo Driving Racing. The ultimate endless race in the city streets, countryside roads and seashores, featuring amazing vehicles, addictive gameplay and intense traffic competition. Barrel through packed streets, avoid crashes, take down traffic cars, pick up coins and perform dynamic, high-speed aerial stunts! The game will challenge even the most skilled racing fans.<br><br>Game Features:<br>- Breathtaking visuals and amazing tracks<br>- Earn cash to unlock and upgrade 8 high-performance vehicles<br>- Pick your favorite colors with 9 paint choices<br>- Customize your cars through 9 different types of wheels', 'https://lh3.googleusercontent.com/QUM3PMNJvBPb0J5ovrt1WYefhq4ik3LNhIhBDWCSZ_qthzm5F7ODHqfkBoLVhiS0Rdau=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"July 18, 2018\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a0133.36 - \\u20b9\\u00a06,667.80 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"TerranDroid\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport@terrandroid.comPrivacy PolicySuite 603,6th Floor,Laws Commercial Plaza 788 Cheung Sha Wan Road Kowloon,Hong Kong\"}]', '[\"https:\\/\\/lh3.ggpht.com\\/31iQm9j2xYkIdV0JrVc6Soq6D5t1RHtmwHCqLNXNRfQJqIq3w7fxxjVjHfBRinTyRg=w720-h310\",\"https:\\/\\/lh3.ggpht.com\\/K8S1PZ2PruqzwWRokDKCwbFp0tZgTEh_WbQXyI2m2b7_Rg3_WwPBNH1fB