(508, 515, 'With the Quik app, you can create awesome videos with just a few taps. Choose your favorite photos and video clips then let Quik work its magic. In seconds, it finds great moments, adds beautiful transitions and effects, and syncs everything to the beat of the music. Customize your story with text, music and easily share it with friends. Editing has never been this fastâor this fun.<br>	<br>--- Key Features ---<br><br>ADD YOUR PHOTOS + VIDEOS <br>+ Add up to 75 photos and video clips from your Gallery, Albums, Google Photos, Dropbox, GoPro Plus or GoPro Quik Key. Quik even works with Motion Photos.<br>+ Quik gets data from your GoPro footage (smile [1], faces [2], voices, cheering, speed, jumps, water, panoramic and steady footage [3]) and analyzes your videos to select great moments. It detects faces and colors to frame each photo perfectly. Adjust the layout or interest point manually. <br>+ Want to select your own moments? Use HiLights to tag the best footage. <br><br>CHOOSE YOUR THEME <br>+ Choose from 23 themes, each with transitions and graphics designed for any occasion.<br>+ Adjust the font, filters and graphics to fit your style.<br><br>CUSTOMIZE YOUR VIDEO <br>+ Easily reorder, trim and rotate photos and video clips. <br>+ Personalize your story with text overlays and title slides. You can even add emojis :)<br>+ Let Quik do its magic with Smart Cuts or use full video clips. <br>+ Speed up footage or play it in Slo-Mo.<br>+ Add GPS Stickers to show how fast you were going. [4]<br>+ Quik automatically turns on the audio when it detects voices.<br>+ Choose cinema, square or portrait formatting for easy sharing on Instagram or Snapchat.<br>+ Set a duration for photos and titles - Quik adjusts the cuts and transitions automatically.<br><br>PICK THE PERFECT SOUNDTRACK <br>+ Choose from more than 100 free songs or use a song from your own collection. Quik supports MP3, M4A, MP4, MOV, AAC, FLAC, AIFF and WAV.<br>+ Start your soundtrack at any point in the song.<br>+ Quik automatically syncs transitions to the beat of the music.<br><br>SAVE + SHARE YOUR VIDEO<br>+ Save videos in gorgeous HD 1080p or 720pâeven in buttery-smooth 60 fps. <br>+ Share to Instagram, Facebook and more, or send a private Quik link via text or email.<br>+ With GoPro Plus, your shared videos are saved as Shared Links in your Plus account. [5]<br>+ Need more time to edit? Save projects as drafts and Quik will keep them for 7 days.<br><br>VIDEOS MADE FOR YOU<br>+ Relive the day with Flashbacks 24Hâready-to-watch videos of your adventures created from your last 24 hours of footage.<br><br>QUIKSTORIES<br>+ Quik works with the GoPro App to bring you QuikStoriesâawesome videos made automatically with media shot within the last 72 hours. [6]<br>	<br><br>--- Camera Compatibility ---<br><br>Fusion (Quik only supports Fusion clips exported in OverCapture mode. It doesn\\\'t support full 360Â° videos)<br>HERO7<br>HERO6<br>HERO5<br>HERO (2018)<br>HERO4<br>HERO Session<br>HERO3+<br>HERO3 (requires camera software update, see gopro.com/update)<br>HERO+<br><br>+ Also supports photos + videos captured with your phone or other devices.  <br><br>--- Footnotes ---<br><br>[1] Compatible with HERO7 Black.<br>[2] Compatible with HERO6 Black.<br>[3] Compatible with HERO5 Black.<br>[4] Compatible with HERO5 Black/HERO6 Black/HERO7 Black.<br>[5] GoPro Plus is a subscription service available in select territories. Cancel anytime. Cloud access is subject to storage limits. Separate data fees may apply. Visit gopro.com/plus for info and availability.<br>[6] Compatible with HERO5 cameras and later. Requires the GoPro and Quik mobile apps.<br><br>-----<br>Have feedback? Email us at support@gopro.com or visit gopro.com/support.<br>-----', 'https://lh3.googleusercontent.com/SCDvLYRVgpiWvFanyqnH3UdLco7F9ohiBLTy6x0wgQbR-7m3RNx8hLi0yqA9uJF4tA=s180', 4.7, '[{\"type\":\"Updated\",\"info\":\"March 8, 2019\"},{\"type\":\"Size\",\"info\":\"99M\"},{\"type\":\"Installs\",