(548, 555, 'â¢ ABOUT THE GAME â¢ <br><br>Get ready for this epic adventure! <br><br>Step into your cart and begin this exploring frenzy! Accelerate through these insanely fast rails while tilting and swiping to avoid the obstacles. <br><br>Your job is to collect precious stones, so get those gold nuggets and gems! There will be surprises along the way, and special gifts to earn if you\\\'re lucky! Break the rock eggs to reveal whatâs inside of them and pick up all the gems for your personal explorerâs collection! <br><br>Find new and exciting paths to explore across the mine, and go through those special levels to earn more nuggets! Featuring many exciting environments in 10 different settings: dash through the Crazy Caves, fight the horde in the Zombie Caves, make your sweetest dreams come true in Sweet Wonderland, hurtle through the lush and dangerous Amazon jungle, immerse in the terrific Undersea World, take a dive in the Horror Land, visit the wonderful Snow Land, navigate on the Steam Factory, find your way on the Jurassic Jungle and explore the Pharaoh\\\'s Tomb, all this and many surprise levels which will amaze you with their colorful scenarios. <br><br>You can also equip your cart with power ups to extend your chances inside the mine, while completing missions and ranking up, in order to become the ultimate explorer! <br><br>KEY FEATURES: <br><br>â¢ 18 different characters <br>â¢ Cool power ups <br>â¢ 10 different worlds and many hidden levels <br>â¢ Stunning graphics <br>â¢ Action packed gameplay <br>â¢ Many in-game achievements <br>â¢ Game statistics <br>â¢ Game Center leader boards <br><br>How long can you last in the rails? Find out, by downloading Rail Rush now! <br><br>**************************************** <br>Try also the free web version of Rail Rush on our website: <br>http://www.miniclip.com/games/rail-rush/ <br><br>Find out more about Miniclip: <br>http://www.miniclip.com <br><br>âLikeâ Rail Rush on Facebook: <br>http://www.