(550, 557, '<b>DU Recorder is a stable, high-quality screen recorder for Android that helps you record smooth and clear screen videos. With a variety of features such as screen capture, video recorder, video editor and no rooting needed, DU Recorder provides an easy way to record screen videos, like game videos, video calls, live shows, and more - making everything simple!</b><br><br><b>Advantages: </b><br><br><b>NO root needed, NO recording time limit</b><br><b>HIGH-QUALITY video: 1080p, 12Mbps, 60FPS</b><br><b>Provides interfaces in MORE THAN 20 LANGUAGES</b><br><br><b>Key Features: </b><br><br><b>â Screen Recording</b><br><br>DU Recorder provides stable and fluid screen recording. With this screen recorder, you can easily record popular mobile game videos; you can record video calls with family and friends; you can also record popular programs on live apps like Periscope and Bigo Live! DU Recorder is designed with the following free features:<br><br>------ Many resolutions, frame rates, and bit rates available; support for HD video <br>------ Pause/resume screen recording <br>------ Enable front camera (facecam)<br>------ Record external sound<br>------ Control screen recording through floating window or notification bar; hide floating window for frameless video<br>------ Display click operations in the screen recording<br>------ Shake the device to stop recording screen<br>------ Alternative storage location: Internal storage / SD card<br>------ Brush: Touch screen to draw<br>------ Using a Wi-Fi-connected computer, download videos and screenshots to your computer<br>------ GIF maker: A GIF recorder helps you record screen as GIF<br>------ Live creator: Livestream your screen to YouTube, Facebook and Twitch with DU Recorder<br><br><b>â Video Editor</b><br><br>DU Recorder has lots of video editing functions that can help you create better videos. You can easily make the following video editing operations with the screen recorder :<br><br>------ Trim video / Remove the middle part of video<br>------ Merge videos: Combine mutiple videos into one<br>------ Add background music to video<br>------ Adjust the volume of video<br>------ Add subtitles to video<br>------ Add intro and outro to video<br>------ Add background picture to vertical video<br>------ Change speed of video<br>------ Rotate video<br>------ Crop video<br>------ Convert video to GIF<br><br><b>â Live Creator</b><br><br>With DU Recorderâs screen broadcast, you can stream your screen to YouTube, Facebook and Twitch. You can stream gameplay to show your skills, or stream films, TV shows, and sports events to share the things you like with more people! DU Recorder provides the following features to help you livestream easily:<br><br>------ Broadcast resolution settings, stream with high-quality<br>------ Livestream privacy level settings<br>------ Real-time audience comments<br>------ You can use the front camera when livestreaming<br>------ Live tools: Enjoy many YouTube live tools for better livestreaming: donations, subscription and donation goals, message robot...<br><br><b>â Screenshots and Image Editing</b><br><br>DU Recorder is not only a screen recorder for videos, but also an app to capture screenshots and edit images. With DU Recorder, you can take a screenshot in just one click. With just one hand. No more double-press and hold. Quick and easy! You can also share your screenshots or use in-app image editing tools to stitch and crop local images. <br><br>----- Use notification bar or floating window to take a one-click screenshot.<br>----- Stitch Images: Smartly combine several images into one. <br>----- Blur Image: Pixelate the image to cover areas you do not want to show.<br>----- Crop Image: Keep only the part of the image you want.<br><br>If you have any comments or suggestions on DU Recorder, please contact us at durecorder2016@gmail.com. We appreciate your feedback!!<br><br>Follow us on Facebook: https://www.facebook.com/DURecorderOfficial<b