layer</b><br>Support Inbuilt Image Viewer to view pictures and slideshow them with transition effects.<br>Support Inbuilt Video Player to play videos with any media player installed in your phone.<br><br>âº <b>Uninstall Protection</b><br>Prevents Secret Gallery Lock app from being uninstalled from kids or strangers.<br>This app uses the Device Administrator permission.<br><br>This app uses Accessibility Service.<br><br><b>Quick Tips</b><br><br>â In order to Change PIN quickly go to Settings tab and click on Change Password.<br>â After you Hide Pictures and Videos, Export icon in Gallery lock brings back your media whenever needed.<br>â Easily Change Slide Show interval using the Settings tab.<br>â Use Theme icon to make the Vault Lock Screen colorful so you donât get bored.<br><br><b>---------FAQ--------</b><br><br><b>Q</b>: If I uninstall the app, can I get my pictures back if I reinstall the app?<br><b>A</b>: Re-installing cannot recover those deleted files. So please make sure to unhide and backup all your hidden files before uninstalling this app.<br><br><b>Q</b>: What about if I lost my phone or broken?<br><b>A</b>: Your files are stored only on your device and not online.<br><br><b>Q</b>: Can I take out my media from this photo and video Locker?<br><b>A</b>: Yes, you can easily export photos and videos using couple of steps<br><br><b>Q</b>: Photos and videos are stored together or separately?<br><b>A</b>: You can hide photos in photo locker and videos in videos locker inside this app.<br><br><b>Q</b>: If I forgot my password?<br><b>A</b>: If you Forget Password you can always Recover Password by your registered e-mail id and regain access to this app by,<br>Input 7777 then = button in our Calculator App to send your password into registered email.<br><br>Need Help?<br>Feel free to mail us at: <b>donnadanley247@gmail.com</b>', 'https://lh3.googleusercontent.com/TCgwzLWH3ImBV_fcpjBzKWC5HT2028pc364yq4Y_QauQEI_BYgzO1wZwaQbOmI5Cs_xo=s180', 4.6, '[{\"type