(1, 1, 'Hotstar is a live streaming app that lets you watch your favorite TV shows, movies, sports &amp; live news on-the-go.<br><br><br>Hotstar is India?s largest premium streaming platform with more than <b>100,000 hours of drama &amp; movies in 17 languages,</b> &amp; coverage of every major global sporting event. <br>Launched in early 2015, it is one of India?s most downloaded apps &amp; has attracted <b>more than 350 million followers</b> on the back of a highly evolved video streaming technology &amp; high attention to quality of experience across devices &amp; platforms. <br><b><u>The Content</u></b><br><b>A. For the Movie buffs: </b><br><u><i>Hollywood movies: </i></u><br>Black Panther, The Shape of Water, Star Wars: The Last Jedi : (All the movies)<br>Also, all your favorite Disney &amp; Marvel movies &amp; other blockbusters on the app. <br><u><i>Bollywood movies: </i></u><br>Sanju, Stree, Badhaai Ho, Baaghi 2, Taqdeer &amp; many others.<br><u><i>Vernacular Movies: </i></u><br>Bengali movies, Kannada movies, Malayalam movies, Marathi movies, Tamil movies, Telugu movies.<br><i>Popular Titles: </i><br>Chamak, Aravindante Athidhikal, Koode, Maari 2, Chekka Chivantha Vaanam, Baahubali 2, Saamy 2, Hoichoi Unlimited, Byomkesh Gowtro, Farzand, Maska. <br><br><b>B. For the TV bingers: </b><br><u><i>Hindi serials &amp; shows: </i></u><br>Watch series such as The Voice, Yeh Rishta Kya Kehlata Hai, Kasautii Zindagii Kay, Nazar, Radha Krishn etc.<br><u><i>English Shows: </i></u>	<br>Stream the latest &amp; Emmy-winning English TV series: <br>Game of Thrones (GOT), Veep, Friends, This is Us, Silicon Valley etc.<br><u><i>Vernacular Shows</i></u>:<br>Kasthooriman, Kalakka Povadhu Yaaru, Naam Iruvar Namakku Iruvar, Savitrammagari Abbayi, Agni Sakshi, Sarvamangala Mangalye, Thakumar Jhuli, Ami Sirajer Begum, Anandyatree, Saath De Tu Mala, Pandiyan Stores.<br><u><i>Hotstar Specials: </i></u><br>Bold, authentic and exclusive stories -  produced by Hotstar, especially for you. Watch our latest, <b> Roar of the Lion  </b> , the tale of how M. S. Dhoni and his team Chennai Super Kings made a revolutionary comeback in cricket. <br><b>C. For Sports Enthusiasts:</b><br>Live Cricket(IPL/International), Live Tennis Grand Slams, Football, Formula 1 racing, Hockey, Badminton, Tennis, Table-tennis, Kabaddi.<br><br>For cricket fans who need constant updates of cricket scores, our app is loaded with latest cricketing action with live cricket streaming and the fastest scorecard.<br>For VIVO IPL this year, Watch ?N Play is back with exciting new features: <br>The Social Feed, where you can share opinions about the match and invite your friends and family to do the same and,<br>The Leaderboard, where you can check your rank both nationally and amongst your friend and family groups.<br>You can also watch full match replays/highlights from any recently concluded match on the app.<br>Be it live cricket scores of IPL matches, or cricket scores of ODIs, or Test-match cricket scores, remain updated always. And watch live cricket matches or get live score updates on the go.<br>Please note that Hotstar content varies country wise. We also feature LIVE sports like Premier League (PL), Indian Super League (ISL), Pro Kabaddi League (PKL)  etc, in addition to streaming LIVE Republic TV News Channel, ABP News Live &amp; Asianet News Live only on your Android device.<br>Hotstar Premium membership offers full &amp; unlimited access to latest TV shows, Movies &amp; Live sports, ad-free in HD. Subscribe to avail free trial for the first month!<br>Introducing Hotstar VIP: Get VIP access to exclusive Hotstar Specials\' shows, your favourite Star serials before TV,at 6 am and the biggest Live sporting events including VIVO IPL.<br><br><b><u>The Channels</u></b><br>Watch series &amp; shows of the following TV channels:<br>? Star Plus<br>? Star Bharat<br>? Star Sports<br>? HBO<br>? Star World<br>? Nat Geo<br>? Fox Life<br>? Star Maa<br>? Star Jalsha<br>? Star Pravah<br>? Star Utsav<br>? Star Vijay<br>? Star Suvarna<br>? Asianet', 'https://lh3.googleusercontent.com/f7t_vVv9VIQCSuVb44AmVaqcLpHB2MjWiwaKc_Ih5Sb1ZyCbHGG7PPSTqlaBZS4CTCU=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"April 4, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 12+Parental Guidance RecommendedLearn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Novi Digital\"},{\"type\":\"Developer\",\"info\":\"Visit websitehello@hotstar.comPrivacy PolicyStar House, Urmi Estate, 95 Ganpatrao Kadam Marg, Lower Parel, Mumbai - 400013.\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/kt2TZzhkOPw\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/6Uu3at4ST5mmf6oU2iVaTp9wz8mhj54PMo_DvPlZXANwsVmnukVanP9ExGlCdq2GQfA=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/9d8t9adh33p36UhDfqoS31ECdA1MZU2bHSb4tQOBQVQ2d4QbSO2xQ5lrt6JV1EmJOw=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[{\"url\":\"https:\\/\\/www.youtube.com\\/embed\\/kt2TZzhkOPw?ps=play&vq=large&rel=0&autohide=1&showinfo=0\",\"image_url\":\"https:\\/\\/i.ytimg.com\\/vi\\/kt2TZzhkOPw\\/hqdefault.jpg\"}]', '2019-04-06 17:23:45', '2019-04-06 17:23:45', NULL),
(3, 10, 'TikTok is not your ordinary destination for short-form mobile video. It\\\'s raw, real, and without boundariesâwhether you\\\'re brushing your teeth at 7:45 a.m. or you\\\'re making breakfast at 7:45 p.m. It\\\'s from the gut, \\\'come as you are\\\' storytelling told in 15 seconds. With TikTok life\\\'s more fun when you live in the moment and go beyond to explore. <br><br>We make it easy for you to discover and make your own awesome videos by capturing funny and memorable moments to share with the world. Take your videos to the next level with special effects filters, fun stickers, music, and more. Lifeâs moving fast, so make every second count and show the world what you got! <br><br>â  Watch millions of videos selected specifically for you <br>A personalized video feed specifically for you based on what you watch, like, and share. TikTok will quickly adapt to your taste to offer the most relevant, interesting, fun, quirky, head-turning videos that youâll never want to stop watching.  <br>     <br>â  Get entertained and inspired by a global community of creators <br>Millions of creators are on TikTok showcasing their incredible talents, precious moments, and knowledge. Let yourself be inspired.  <br><br>â  Add your favorite music or sound to your videos for free <br>Easily edit your videos with millions of free music clips and sounds. We create featured music playlists for you with the hottest tracks in every genre, including hip hop, edm, pop, rock, rap, country, and more.  <br><br>â  Use emoji stickers and face filters <br>100+ emoji stickers available for free to take your videos to the next level. Unlock tons of fun face filters and beauty effects in your videos.  <br><br>â  Editing tools allow you to easily trim, cut, merge and duplicate video clips <br>â  Live streaming filters are constantly being updated with fresh, creative designs <br>â  Dance, Comedy, Vlog, Food, Sports, DIY, Animals, and everything in between. Discover videos from endless categories.  <br><br>* Any feedback? Contact us at feedback@tiktok.com or tweet us @tiktok', 'https://lh3.googleusercontent.com/TsPdiLBSCwQ_5tMNNTZElak9X4SBEgyQnK3q3hE99C2hbYMsov4dQK_FmRNyhf64wXpO=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"April 4, 2019\"},{\"type\":\"Size\",\"info\":\"72M\"},{\"type\":\"Installs\",\"info\":\"500,000,000+\"},{\"type\":\"Current Version\",\"info\":\"10.7.1\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 12+Parental Guidance RecommendedLearn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a080.00 - \\u20b9\\u00a08,200.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"musical.ly\"},{\"type\":\"Developer\",\"info\":\"Visit websitefeedback@tiktok.comPrivacy Policy1920 Olympic Blvd\\nSanta Monica, CA 90404\\nUnited States\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/SH-IldNvNkGYGXhwqOKYVne5XbWWy5GgH_6cIoYcFTYIbG6AbXmTPa38kSuAiReoSYA=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/1u1gm2xnSNEU8eAMpfGDMklE2gCmaQ-dNbHYgWX1QoPbkv-_Uv8yM5JxHYDBT3klgA=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[]', '2019-04-06 18:34:29', '2019-04-06 18:34:29', NULL),
(4, 11, 'WhatsApp Messenger is a FREE messaging app available for Android and other smartphones. WhatsApp uses your phone\\\'s Internet connection (4G/3G/2G/EDGE or Wi-Fi, as available) to let you message and call friends and family. Switch from SMS to WhatsApp to send and receive messages, calls, photos, videos, documents, and Voice Messages. <br><br>WHY USE WHATSAPP: <br><br>â¢ NO FEES: WhatsApp uses your phone\\\'s Internet connection (4G/3G/2G/EDGE or Wi-Fi, as available) to let you message and call friends and family, so you don\\\'t have to pay for every message or call.* There are no subscription fees to use WhatsApp.<br><br>â¢ MULTIMEDIA: Send and receive photos, videos, documents, and Voice Messages.<br><br>â¢ FREE CALLS: Call your friends and family for free with WhatsApp Calling, even if they\\\'re in another country.* WhatsApp calls use your phone\\\'s Internet connection rather than your cellular plan\\\'s voice minutes. (Note: Data charges may apply. Contact your provider for details. Also, you can\\\'t access 911 and other emergency service numbers through WhatsApp). <br><br>â¢ GROUP CHAT: Enjoy group chats with your contacts so you can easily stay in touch with your friends or family.<br><br>â¢ WHATSAPP WEB: You can also send and receive WhatsApp messages right from your computer\\\'s browser.<br><br>â¢ NO INTERNATIONAL CHARGES: There\\\'s no extra charge to send WhatsApp messages internationally. Chat with your friends around the world and avoid international SMS charges.* <br><br>â¢ SAY NO TO USERNAMES AND PINS: Why bother having to remember yet another username or PIN? WhatsApp works with your phone number, just like SMS, and integrates seamlessly with your phone\\\'s existing address book. <br><br>â¢ ALWAYS LOGGED IN: With WhatsApp, you\\\'re always logged in so you don\\\'t miss messages. No more confusion about whether you\\\'re logged in or logged out. <br><br>â¢ QUICKLY CONNECT WITH YOUR CONTACTS: Your address book is used to quickly and easily connect you with your contacts who have WhatsApp so there\\\'s no need to add hard-to-remember usernames.<br><br>â¢ OFFLINE MESSAGES: Even if you miss your notifications or turn off your phone, WhatsApp will save your recent messages until the next time you use the app.<br><br>â¢ AND MUCH MORE: Share your location, exchange contacts, set custom wallpapers and notification sounds, email chat history, broadcast messages to multiple contacts at once, and more!<br><br>*Data charges may apply. Contact your provider for details. <br><br>--------------------------------------------------------- <br>We\\\'re always excited to hear from you! If you have any feedback, questions, or concerns, please email us at: <br><br>android-support@whatsapp.com <br><br>or follow us on twitter: <br><br>http://twitter.com/WhatsApp<br>@WhatsApp<br>---------------------------------------------------------', 'https://lh3.ggpht.com/mp86vbELnqLi2FzvhiKdPX31_oiTRLNyeK8x4IIrbF5eD1D5RdnVwjQP0hwMNR_JdA=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"March 27, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"1,000,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact, Digital Purchases\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"WhatsApp Inc.\"},{\"type\":\"Developer\",\"info\":\"Visit websiteandroid@support.whatsapp.comPrivacy Policy1601 Willow Road\\nMenlo Park, CA 94025\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/MMue08byixTw74ST_VkNQDUUJBgVEbjNHDYLhIuHmYhMIMJIp3KjVlnhhqZQOZUtNt8=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/foFmwvVGIwWWXJIukN7png18lFjFgbw3K7BqIm8G-jsFgSTVtkCa-dDkFApUzbvzIvbe=w720-h310\",null,null,null,null]', '[]', '2019-04-06 18:34:29', '2019-04-06 18:34:29', NULL),
