(12, 19, 'Powerful video player with advanced hardware acceleration and subtitle support.<br><br><br><b>a) HARDWARE ACCELERATION</b> - Hardware acceleration can be applied to more videos with the help of new HW+ decoder.<br><br><b>b) MULTI-CORE DECODING</b> - MX Player is the first Android video player which supports multi-core decoding. Test result proved that dual-core device\\\'s performance is up to 70% better than single-core devices.<br><br><b>c) PINCH TO ZOOM, ZOOM AND PAN</b> - Easily zoom in and out by pinching and swiping across the screen. Zoom and Pan is also available by option.<br><br><b>d) SUBTITLE GESTURES</b> - Scroll forward/backward to move to next/previous text, Up/down to move text up and down, Zoom in/out to change text size.<br><br><b>e) KIDS LOCK</b> - Keep your kids entertained without having to worry that they can make calls or touch other apps.<br><br><br><b>Subtitle formats:</b><br><br>- DVD, DVB, SSA/ASS subtitle tracks.<br>- SubStation Alpha(.ssa/.ass) with full styling.<br>- SAMI(.smi) with Ruby tag support.<br>- SubRip(.srt)<br>- MicroDVD(.sub)<br>- VobSub(.sub/.idx)<br>- SubViewer2.0(.sub)<br>- MPL2(.mpl)<br>- TMPlayer(.txt)<br>- Teletext<br>- PJS(.pjs)<br>- WebVTT(.vtt)<br><br>******<br>Permissions:<br>ââââââââââââ<br>MX Player needs permissions on the following categories:<br>* \\\"Access Photos/Media/Files\\\" permission to read your all media files on your storage<br>* \\\"Other app capabilities\\\" for various activities like checking network status, Streaming, controlling bluetooth device, controlling the touch feedbacks, blocking keys with kid lock feature.<br><br>Permission Details:<br>âââââââââââââââââââ<br>* \\\"READ_EXTERNAL_STORAGE\\\" permission is required in order to read your media files in your primary &amp; secondary storages.<br>* \\\"WRITE_EXTERNAL_STORAGE\\\" permission is required in order to rename or deletion of files and to store the downloaded subtitles.<br><br>* \\\"ACCESS_NETWORK_STATE\\\" and \\\"ACCESS_WIFI_STATE\\\" permissions are required in order to get the network status which is required for various activities like license checking, update checking, etc.<br>* \\\"INTERNET\\\" permission is required in order to play internet streams.<br><br>* \\\"VIBRATE\\\" permission is required in order to controls the vibration feedbacks.<br>* \\\"BLUETOOTH\\\" permission is required in order to improve AV sync when Bluetooth headset is connected.<br><br>* \\\"WAKE_LOCK\\\" permission is required in order to prevent your phone from sleeping while watching any video.<br>* \\\"KILL_BACKGROUND_PROCESSES\\\" permission is required in order to stop the MX Player services used in background play.<br>* \\\"DISABLE_KEYGUARD\\\" permission is required in order to temporarily prevent secure screen lock when Kids Lock is used.<br>* \\\"SYSTEM_ALERT_WINDOW\\\" permission is required in order to block some keys when Kids Lock is used.<br>* \\\"DRAW OVER OTHER APPS\\\" permission is required in order to block system buttons when input blocking is activated on the playback screen.<br>******<br>If you are facing \\\"package file is invalid\\\" error, please install it again from product home page (https://sites.google.com/site/mxvpen/download)<br>******<br><br><br>If you have any questions, please visit our Facebook Page or XDA MX Player forum.<br><b>https://www.facebook.com/MX.Player.Official</b><br>http://forum.xda-developers.com/apps/mx-player<br><br>Some of the screens are from the Elephants Dreams licensed under the Creative Commons Attribution 2.5.<br>(c) copyright 2006, Blender Foundation / Netherlands Media Art Institute / www.elephantsdream.org<br><br>Some of the screens are from the Big Buck Bunny licensed under the Creative Commons Attribution 3.0 Unported.<br>(c) copyright 2008, Blender Foundation / www.bigbuckbunny.org', 'https://lh3.googleusercontent.com/GjMNrvblnY4vBtiBxX2jJksGB1wBSdGPO_XAq1AtDKWzdz4dJ1wpt5kHFu8c