(15, 22, 'Tez is now called Google Pay!<br><br>If you are upgrading Tez from a previous version, your account and transactions are not affected by this change. Find out more at <a href=\\\"https://support.google.com/tez/?p=gpayindiahc\\\">https://support.google.com/tez/?p=gpayindiahc</a><br><br>Send money to friends, pay bills and buy online, recharge your phone, or pay at the nearby cafÃ© with Google Pay, Google\\\'s digital payment app.<br><br>Want to share feedback? Write to us on <a href=\\\"http://support.google.com/pay/india\\\">http://support.google.com/pay/india</a> or send us feedback right from the app.<br><br><b>Use Google Pay for All Your Payment Needs</b><br><br><b>+ Pay and receive money straight from your bank account</b><br>Google Pay works with your existing bank account*, which means your money is safe with your bank. There\\\'s no need to worry about reloading wallets and you don\\\'t need to do additional KYC.<br><br>Using NPCI\\\'s (National Payments Corporation of India) BHIM Unified Payments Interface (BHIM UPI), money transfers are simple &amp; secure with Google Pay. You must have an Indian bank account with a phone number linked to it to use this version of Google Pay.<br><br>*Google Pay works with <a href=\\\"https://www.google.com/url?q=https%3A%2F%2Fwww.npci.org.in%2Fupi-live-members&amp;sa=D&amp;sntz=1&amp;usg=AFQjCNE0_8ZHQZe58XZHdmQYR_2EvJTRbA\\\">all banks in India</a> that support BHIM UPI.<br><br><b>+ Pay anyone. Even those without Google Pay</b><br>Starting a payment is as simple as starting a new conversation with someone in your Google Pay contacts or by entering anyone\\\'s UPI ID or bank details.<br><br><b>+ Conveniently pay bills</b><br>Pay for electricity, gas, water, DTH, mobile, and more. You only need to link your biller accounts once to pay your bill with just a few taps. Google Pay works with billers across the country.<br><br><b>+ Pay online with Google Pay</b><br>Google Pay - anywhere BHIM UPI is accepted. When you checkout, look for the Google Pay logo or use your Google Pay UPI ID.<br><br><b>+ Multiple layers of security from your bank, UPI, and Google</b><br>Google Pay protects your money with a world-class security system that helps detect fraud and prevent hacking. Each transaction is secured with your UPI PIN, and you can safeguard your account with a device lock method such as your fingerprint. If you ever need it, our <a href=\\\"http://support.google.com/tez\\\">help center</a>, phone, and chat support are available all day, every day.<br><br><b>+ Transfer money to anyone nearby</b><br>Use Tez Mode to send money securely to people nearby without sharing private details like your phone number.<br><br><b>+ Get rewarded</b><br>Get Google Pay Scratch Cards (TM) in the app and be eligible to win up to â¹1,000 with each eligible transaction. If you win, your rewards go straight into your bank account.<br><br>**See full <a href=\\\"https://support.google.com/tez/?p=offers_rewards\\\">Google Pay Offers Terms and Conditions</a> for all details.<br><br><b>+ Paying in shops is easier than ever!</b><br>The chaiwala nearby, neighbourhood kirana, and even your favorite salon can now accept payments on the spot with Tez Mode, all while keeping your personal and bank details private.', 'https://lh3.googleusercontent.com/2AGGvhEWVJ8qHoeDyLFb9rozSvIsBW7uAZcOoiSQ2NHRn-Hp4XkH_53YD6sVqsau5trA=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"April 2, 2019\"},{\"type\":\"Size\",\"info\":\"11M\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"5.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Google LLC\"},{\"type\":\"Developer\",\"info\":\"Visit websiteapps-help@google.comPrivacy Policy1600 Amphitheatre Parkway, Mountain View 94043\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/QkLPFdcAa8wH20WB3Q0NYru2Z_CKZ4KJrLitEl73dsAiXzquqKuZDU1smQoJd_S-4g=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/-xISD6w9NxLs2q-qM-QECaXgDTo0HtLNBcy54nTwqCoCDJBAzTOc3wlT_fADlb-n9a-V=w720-h310\",null,null,null,null,null]', '[]', '2019-04-06 18:34:29', '2019-04-06 18:34:29', NULL),
(16, 23, 'Keeping up with friends is faster and easier than ever. Share updates and photos, engage with friends and Pages, and stay connected to communities important to you. <br><br>Features on the Facebook app include:<br><br>* Connect with friends and family and meet new people on your social media network<br>* Set status updates &amp; use Facebook emoji to help relay whatâs going on in your world<br>* Share photos, videos, and your favorite memories.<br>* Get notifications when friends like and comment on your posts<br>* Find local social events, and make plans to meet up with friends<br>* Play games with any of your Facebook friends<br>* Backup photos by saving them in albums<br>* Follow your favorite artists, websites, and companies to get their latest news<br>* Look up local businesses to see reviews, operation hours, and pictures<br>* Buy and sell locally on Facebook Marketplace<br>* Watch live videos on the go<br><br><br>The Facebook app does more than help you stay connected with your friends and interests. It\\\'s also your personal organizer for storing, saving and sharing photos. It\\\'s easy to share photos straight from your Android camera, and you have full control over your photos and privacy settings. You can choose when to keep individual photos private or even set up a secret photo album to control who sees it.<br><br>Facebook also helps you keep up with the latest news and current events around the world. Subscribe to your favorite celebrities, brands, news sources, artists, or sports teams to follow their newsfeeds, watch live streaming videos and be caught up on the latest happenings no matter where you are!<br><br>The most important desktop features of Facebook are also available on the app, such as writing on timelines, liking photos, browsing for people, and editing your profile and groups. <br><br>Now you can get early access to the next version of Facebook for Android by becoming a beta tester. Learn how to sign up, give feedback and le