(19, 26, 'Keeping up with friends is faster and easier than ever with the Facebook Lite app! Use Facebook Lite as a friends app to connect and keep up with your social network. The Facebook Lite app is small, allowing you to save space on your phone and use Facebook in 2G conditions. Many of the classic features of Facebook are available on the app, such as sharing to a Timeline, liking photos, searching for people, and editing your profile and groups. Specific features include:<br> <br>* Find friends and family<br>* Post status updates &amp; use Facebook emoji to help relay whatâs going on in your world<br>Share photos and your favorite memes<br>* Get notified when friends like and comment on your posts<br>* Find local social events, RSVP, and make plans to meet up with friends<br>Interact with your friends by adding your own comments or reactions to their Facebook posts<br>* Save photos by adding them to photo albums<br>* Follow people to get their latest news<br>* Look up local businesses to see reviews, operation hours, and pictures<br>* Buy and sell locally on Facebook Marketplace<br> <br>The Facebook app does more than help you stay connected with your friends and interests. It\\\'s also your personal organizer for storing, saving and sharing photos. It\\\'s easy to share photos straight from your Android camera, and you have full control over your photos and privacy settings. You can choose when to keep individual photos private or even set up a secret photo album to control who sees it.<br> <br>Facebook Lite also helps you keep up with the latest news and current events around the world. Subscribe to your favorite celebrities, brands, websites, artists, or sports teams to follow their News Feeds from the convenience of your Facebook Lite app!<br><br><br>Now you can get early access to the next version of Facebook Lite by becoming a beta tester.  Sign up here: <a>https://play.google.com/apps/testing/com.facebook.lite</a><br><br><br>Problems downloading or installing the app? See https://www.facebook.com/help/fblite <br>Still need help? Please tell us more about the issue: https://www.facebook.com/help/contact/640732869364975<br>Facebook is only available for people ages 13 and over.<br>Terms of Service: http://m.facebook.com/terms.php', 'https://lh3.googleusercontent.com/Alon4Gigwl2DqrT36O6JMn-M40tinuxFHWROtv0TP8ozX8Sr5MiBM1CuHX-veqFhnKvQ=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"April 3, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"1,000,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 12+Parental Guidance RecommendedLearn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact, Shares Info, Shares Location\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Facebook\"},{\"type\":\"Developer\",\"info\":\"Visit websitelite-android-support@fb.comPrivacy Policy1 Hacker Way\\nMenlo Park, CA 94025\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/mC69w8Asl2c4y8it_gEb0-2CcwxKWUvz1fs4gOwVfxUkvSN7qAAl41VohsqSdVG-dZs=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/XIDZNTpZ9i0AGqEYS5CfJBI24fH9cTMG9fug7jatp-VGYWIX4Dvy5oTzLogloE9K1bo=w720-h310\",null,null]', '[]', '2019-04-06 18:34:29', '2019-04-06 18:34:29', NULL),
(20, 27, '<b>UC Browser allows you to download videos you like onto your device at lightning speed. No matter where you are, UC Browser helps you easily enjoy funny videos without internet. You can open the videos everytime you want saving internet traffic! 100% free! <b><br><br>UC Browser also enables you to search and share funny videos, status videos, trending videos, and so forth. There are also functionalities such as Fast Download, Data Saving, Ad-Block functionality, and helps you access music, video, cricket information with smooth experience. Cricket channel is hot on UC Browser now. You can visit many cricket sites to support your team, and watch cricket live stream, and check out match scores on UC Browser.</b><br><br><b>Main Features</b><br>âINSERT INTO `app_detail` (`id`, `app_id`, `about`, `images`, `rating`, `additional_info`, `screenshot`, `video`, `created_at`, `updated_at`, `deleted_at`) VALUES
(22, 29, 'PhonePe is a revolutionary way to make mobile payments in India. From UPI payments to recharges, money transfers to online bill payments, you can do it all on PhonePe. PhonePe is way better than Internet Banking and offers you the safest and fastest online payment experience in India.<br><br>Things you can do on the PhonePe app -<br>- Send and request money from your contacts anytime, anywhere.<br>- Recharge prepaid Mobile for most major operators/Datacard/DTH connections across the country.<br>- Pay postpaid Landline, Datacard and Mobile Bills for all major operators.<br>- Pay for utilities such as electricity and gas bills.<br>- Check your account balance, save beneficiaries and manage multiple bank accounts.<br>- Get refunds and cashbacks to your bank account in an instant.<br>- Split bills with your friends and settle them right away.<br>- Shop on Flipkart, Myntra, Jabong, and other online shopping websites. <br><br>PhonePe benefits -<br><br>- Transact up to Rs.1 lakh per transaction, 24*7.<br>- Get instant refunds and cashbacks from our partner merchants into your PhonePe wallet. -Check wallet balance that can be withdrawn to your bank account. Cashback cannot be withdrawn to any linked bank account and cannot be transferred to other users. Cashback can be redeemed for mobile recharges, bill payments, and used for merchant payments where PhonePe has been integrated as a payment option<br>- Top up your wallet using your UPI enabled bank account or a debit card to make instant payments to anyone.<br>- One-click payments using your PhonePe account at any of our merchant partner locations.<br>- Transact in the language of your choice. English, Hindi, Tamil, Bengali, Telugu, Kannada, Malyalam, Assamese, Gujarati, and Marathi are now live. More languages coming soon! <br><br>The PhonePe app works over the Unified Payments Interface (UPI) platform developed by the National Payments Corporation of India (NPCI) and is powered by YES Bank. The PhonePe UPI app is safe and secure, meets all your payment and banking needs, and is much better than Internet banking. No need to remember IFSC codes, account numbers, or other inconvenient details. Make instant bank transfers by just using a mobile number or a unique payment identity â your Virtual Payment Address (VPA). <br><br>PhonePe also provides you with a digital mobile wallet for faster refunds and cashbacks from our merchant partners. You can spend your wallet balance or withdraw it into your linked bank account(s) in one quick swipe. With over 70 billers live on the PhonePe App you can do quick and easy recharges for mobiles, DTH, datacards and also pay gas, electricity, landline and other utility bills.<br>Currently over 40 banks are UPI enabled, with more banks coming soon!<br>Banks currently on UPI: YES Bank (our UPI sponsor), Allahabad Bank, Andhra Bank, Axis Bank, Bank of Baroda (BOB), Bank of Maharashtra, Bank of India, Canara Bank, Catholic Syrian Bank, Central Bank of India, Citibank, City Union Bank, Corporation Bank, DCB Bank, Dena Bank, Federal Bank, HDFC Bank, HSBC Bank, ICICI Bank, IDBI Bank, IDFC Bank, Indusind Bank, Indian Bank, Indian Overseas Bank, Karur Vyasa Bank, Karnataka Bank, Kotak Mahindra Bank, Laxmi Vilas Bank, Oriental Bank of Commerce, Punjab National Bank (PNB), Punjab and Sindh Bank, Ratnakar Bank (RBL), State Bank of India (SBI), South Indian Bank (SIB), Standard Chartered Bank (SCB), TJSB Sahakari Bank, UCO Bank, United Bank of India, Union Bank of India, Vijaya Bank<br><br>For more details, please visit our website at https://www.phonepe.com<br><br>Permissions for App and reasons:<br>SMS - This is required to verify Phone no for registration<br>Location - This is a requirement by NPCI for UPI transactions<br>Contacts - We use this to for phone numbers to send money to and choose numbers to recharge.<br>Camera - We use this to scan QR code.<br>Storage - We use this to store scanned QR code.<br>Accounts- This is used to prepopulate email i