(26, 33, 'Indiaâs #1 wallet &amp; payments app with over 300 million users! #PaytmKaro for mobile prepaid recharge, postpaid &amp; utility bill payments, UPI payments &amp; money transfer, DTH recharge, electricity bill payment, IRCTC train ticket booking, movie tickets, LIC premium payment, shopping, bus &amp; flight booking, bank to bank transfer, metro card recharge, paying challans, buying gold, making loan payments &amp; much more. Now also order Food on app.<br><br>Go cashless with Paytm app. Add money to your wallet &amp; scan QR codes at nearby stores for payments!<br><br>Link your bank account to create your BHIM UPI ID &amp; UPI PIN  &amp; quickly send or receive money or open a savings account with Paytm Payments Bank<br><br><b>Mobile Recharge &amp; Bill Payment</b><br>Airtel prepaid recharge, Idea prepaid recharge, Vodafone prepaid recharge, Jio recharge is possible in a few taps. We facilitate the fastest online recharge &amp; postpaid bill payment for all major telecom operators: <br>â¢Airtel<br>â¢BSNL<br>â¢IDEA<br>â¢Matrix Postpaid<br>â¢Tata Docomo<br>â¢Tata Indicom<br>â¢Vodafone<br>â¢Jio<br>â¢MTNL<br>Avail offers on mobile recharge &amp; postpaid bill payment &amp; get assured cashbacks<br><br><b>Money Transfer</b><br>Send money from wallet to wallet or from your bank account to any bank account at 0% charge. Link any of your savings bank accounts to create a UPI ID on Paytm<br><br><b>Water, Gas &amp; Electricity Bill Payment</b><br>Make all utility bill payments in a few steps. <br>Pay electricity bills:<br>â¢TNEB<br>â¢WBSEDCL<br>â¢PSPCL<br>â¢TSSPDCL<br>â¢MSEDCL<br>â¢SBPDCL <br>â¢DHBVN<br>â¢NBPDCL<br>â¢BESCOM<br>â¢APEPDCL<br>&amp; others<br><br>Pay water bills:<br>â¢BWSSB<br>â¢DJB<br>â¢MCG<br>â¢HMWSSB<br>â¢NWCMC<br>â¢NDMC<br>&amp; others<br><br>Pay gas bills:<br>â¢IGL<br>â¢Gujarat Gas Ltd.<br>â¢Mahanagar<br>â¢Adani<br>â¢SGL<br>â¢VGL<br>&amp; others<br><br><b>DTH Recharge</b><br>Pay online for Tata Sky recharge, Video