(32, 39, '<b>Opera News is a completely personalised news app that lets you follow trending topics, share and view the latest videos, and keep current with local and global news.</b> <br><br><b>Features: </b> <br><br><b>â¢ Top news:</b> <br>Read the latest and most popular news articles on entertainment, economy, finance, business, technology, science, sports, travel, fashion, and politics - all delivered by top global and national media outlets.<br><br><b>â¢ Personalised news:</b> <br>Powered by our most powerful AI news engine, Opera News delivers real-time, AI-curated content according to your interests. Follow your favourite channels to see topics personalised just for you. The more you use the app, the better it becomes. Your preferences and personal information are kept completely secure; Opera News will never share your private data with anyone.<br><br><b>â¢ Instaclips:</b> <br>Instaclips collects the latest trending videos for you to enjoy. Upload video clips from any website and share them with Instaclips. This is a collection of the latest entertaining and viral videos for you to enjoy and share with friends.<br><br><b>â¢ Search news:</b> <br>Want to know what the latest trending searches are? Want to find news about a specific topic or person? Opera News now features a search bar that gives you suggestions on top trending searches and lets you search for specific topics or people to read about or follow.<br><br><b>â¢ My interest graph:</b><br>You can get personalised topic recommendations based on what you have followed and by adding personal preferences, so when you open the app you see only what is relevant to you.<br><br><b>â¢ News push notification:</b> <br>Receive important breaking news alerts directly on your home screen. Always stay updated about what is happening around you.<br><br><b>â¢ Follow your favourite football team:</b> <br>Stay on top of all the latest football news with updates from the Premier League, Serie A, La Liga, Bundesliga, Ligue 1, and all the national teams! Subscribe for updates on your favourite clubs and get live scores and commentary. <br><br><b>â¢ Data savings</b> <br>Save up to 80% of your mobile data with our unique turbo engine.<br><br><b>â¢ Offline reading:</b> <br>Save news stories to your phone while connected to Wi-Fi and read them later offline without using data.<br><br><b>â¢ Save your favourites:</b> <br>Bookmark good finds and save articles to read later - even when offline!<br><br>Twitter â http://twitter.com/opera/<br>Facebook â http://www.facebook.com/opera/<br>Instagram â http://www.instagram.com/opera<br><br><b>Terms &amp; Conditions:</b><br>By downloading this application, you are agreeing to the End User Licence Agreement at https://www.opera.com/eula/mobile. Also, you can learn how Opera handles and protects your data in our Privacy Statement at https://www.opera.com/privacy.', 'https://lh3.googleusercontent.com/oA4IMJYevFpWycf67a00ad08qV99YlLdk-sqciczj9mj1zQkHy9KO2VztM6F2SXq28I=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"April 1, 2019\"},{\"type\":\"Size\",\"info\":\"9.5M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"6.0.2254.136923\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Opera\"},{\"type\":\"Developer\",\"info\":\"Visit websitefeedback-opera-news-app@opera.comPrivacy PolicyGjerdrums vei 19\\nNO-0484 OSLO\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/wQUpM7mEUNfjdrWqls0hODOsoh28YqyPZ1rOdWtDrcJ5iyKA-UE_sjBUN4iDvkbP7CTK=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/ka_2bvg-_MDHeBSCEF7Bw-KUa_Wn60T71JXY4iVpcvSZaJPnT8jrdQ_Ll9T_5ep6-EA=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[]', '2019-04-06 18:34:29', '2019-04-06 18:34:29', NULL),
(33, 40, '\\\"Where is my Train\\\" is a unique train app that displays live train status and up-to-date schedules. The app can function offline without needing Internet or GPS.  It is also packed with useful features such as destination alarms and a speedometer. It is the <b>highest rated travel app in India</b>. Thank you to all the users who make the app better every day by sharing their feedback with us.<br> <br><b>Why this app is the highest rated train app?</b><br> <br><b>Spotting Train Accurately</b> <br> <br>Get live train status of Indian Railways anytime, anywhere. When you are traveling on a train, this feature can work without internet or GPS as it uses cell tower information to find the location. You can share current train location with your friends &amp; family via the share feature. You can also set an alarm to wake you up at a fixed time before your railway station arrives. <br> <br><b>Offline Train Schedules</b><br> <br>The train app has the Indian Railways timetable offline. You don\\\'t have to know train number or names as our Smart search feature allows you to use train source &amp; destination or partial train names even with spelling errors.<br> <br><b>Coach Layout and Platform numbers</b><br> 	<br>Get information on coach position and seat/berth layout before you board the train. Also shows platform numbers for boarding and intermediate stations wherever available.<br> <br><b>Super efficient in Battery, Data Usage and App size</b><br> <br>The app is very efficient in battery and data use as key features like finding train locations and schedules can work offline without Internet or GPS. The app-size is relatively small despite having a lot of information offline.<br> <br> <br><b>Seat Availability and PNR Status </b><br> <br>Check seat availability and PNR status on the official Indian Railways website within the app. <br>  <br>Disclaimer: The app is privately maintained and does not have any affiliation whatsoever to Indian Railways.', 'https://lh3.googleusercontent.com/C9hFJJagXI83NsVzyhbwaaIsj0dGaqKzg6Uem7TgbKDoVCaQCfhQNDNWSrJvPiZDZQW3=s180', 4.6, '[{\"type\":\"Updated\",\"info\":\"April 5, 2019\"},{\"type\":\"Size\",\"info\":\"11M\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"6.0.8\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Sigmoid Labs and its Affiliates\"},{\"type\":\"Developer\",\"info\":\"Visit websitefeedback@whereismytrain.inPrivacy Policy48 Pirrama Road, Floor 5, Google, Pyrmont, NSW 2009\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/HRwhUIxYI0_fy1SOMtep_qr-ln5oVidliDMXT2itAcyRBhd5UC259_RYjUrrCd_XXA8=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/3OPyG5KZhzf57w1y_AAFBez2Z26cMjCH-t6NQ5L41pLCtOFv6xOfVlpFhboj0Nk0tTU=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[]', '2019-04-06 18:34:29', '2019-04-06 18:34:29', NULL),
(34, 41, 'Zomato lets you search for and discover restaurants to eat out at or order in from. Browse through restaurant menus, photos, user reviews and ratings to decide where you want to eat, and use the map feature to guide you there.<br><br>If you are in India, UAE, or Lebanon, you can also order food online for delivery, with thousands of great food delivery restaurants to choose from.<br><br>Features:<br>* Search easily for Restaurants, Cafes, Pubs and Bars by location, cuisine (e.g. Chinese, Italian, Indian), name (e.g. Starbucks, Domino\\\'s Pizza, Amaya).<br>* Explore every restaurant in your city, including the ones near your current location, and use search filters to find the one that suits you best.<br>* View menus, pictures, phone numbers, directions, user reviews, and all the other information you need to choose a restaurant for Dine Out, Food Delivery, Nightlife, or Takeaway.<br>* Browse our theme-based curated lists to discover places for the best burgers, perfect date spots, or the top trending restaurants.<br>* Rate and review restaurants you\\\'ve been to, and share photos of your foodie moments directly from the app.<br>* Maintain an easy reference list of your favorites or places you want to visit with Bookmarks.<br>* Use the map view to explore restaurants around you, or draw a circle to search in a specific area.<br>* Find and follow your friends to see where they\\\'re eating and what they like.<br>* Journal the restaurants you eat at using your Dineline.<br>* In-app table booking (select locations) â you can view and book yourself a table at all partner restaurants.<br><br>Permissions Requested:<br>* Camera - To take photos of food and restaurants for reviews.<br>* Contacts - To get your Google account information for signing in Zomato via Google.<br>* Location - To identify your location and show the restaurants closest to you.<br>* Phone - To make calls to the restaurant directly from the Restaurant listing.<br>* SMS - To read OTP required for phone number verification while placing an Online Order.<br>* Storage - To store photos captured by you and to access photos to be published with your reviews. <br>* Phone state - To identify cellular network information for optimising performance on low bandwidth network.<br><br><br>Zomato is now available in over 10,000 cities across India, the <br>USA, Australia, the UK, UAE, Canada, Ireland, New Zealand, South Africa, Portugal, the Philippines, Indonesia, Turkey, the Czech Republic, Slovakia, Poland, Chile, Italy, Lebanon, Brazil, Sri Lanka, and Qatar. More locations coming very soon.<br><br>USA, Australia, and Canada â we were previously called Urbanspoon in your countries.', 'https://lh3.googleusercontent.com/zfLfmwlADOsxtrHqlqxscwRd215o6dk6EW-Voulxzv9FQuEYRTyQX1WlEct2AcJbFZw=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"March 23, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Zomato\"},{\"type\":\"Developer\",\"info\":\"Visit websiteandroid@zomato.comPrivacy Policy\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/S69sKsCVUkZELSDiT2sbFTonZISM5lFHPMkjOho8Omz-7GmYRWYu8g-H_--Mdjtoqw=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/b2YqfEll5K1gq88lEtemQyG70b4yuPTTKYxSQG1Ai6mWT3aTpKVVZh_dwmc_Gx19y6o=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAA