(35, 42, '<b> Flipkart Online Shopping App - Download app for a delightful shopping experience </b><br><br>Online shopping with Flipkart is very easy as you get to shop from the comfort of your home and get products delivered at your doorstep. By downloading the Flipkart free online shopping app on your Android phone or tablet, you can effortlessly browse our massive collection of more than 80 crore products from multiple categories including mobile phones, fashion wear, electronic devices, accessories and consumer durables.<br>_____________________________________<br><br><br><b>The products you can find on Flipkart shopping app are: </b><br><br>â¢<b>Mobile Phones</b><br>â¢<b>Mobile accessories</b><br>â¢<b>Laptops, Computer Accessories &amp; Tablets</b><br>â¢<b>Electronic gadgets</b><br>â¢<b>Games &amp; Gaming Console</b><br>â¢<b>Home &amp; Kitchen Appliances</b><br>â¢<b>Womenâs Clothing</b><br>â¢<b>Menâs Clothing</b><br>â¢<b>Womenâs &amp; Menâs footwear</b><br>â¢<b>Sports, gym &amp; fitness products</b><br>â¢<b>Travel, luggage &amp; handbags</b><br>â¢<b>Personal care appliances</b><br>â¢<b>Home &amp; Furniture</b><br>_____________________________________<br><br><b> Install Flipkart app for unique benefits </b><br><br>Simply download the Android  shopping app on your device (phone or tablet) and create an account for yourself. Now, you will be taken to the Home screen where you will find links to all the category products, along with amazing offers, deals and discounts under the \\\'Offer Zone\\\' and \\\'Deals of the day\\\'. <br><br>1. Easily type in the product you are looking for in the âSearchâ tab and find it instantly<br>2. Narrow down your search using filters like price, color, style, pattern, brand to find your desired product<br>3. Check ratings and reviews given by other customers along with seller ratings, price and description of the product while buying the product<br>4. You can also add products to your wishlist with a single tap<br>5. To place the order, choose among easy payment options like Flipkart Pay Later, Cardless Credit, Cash on Delivery (COD), debit card, credit card, net banking or UPI enabled PhonePe<br>6. Track your orders inside the app, get notifications on personalized offers, price drops, order status, exclusive launches and upcoming sale events<br>_____________________________________<br><br><b> Permissions </b> <br><br>In addition to basic permissions, the Flipkart shopping app needs access to other functions on your device for it to support the above features -<br>â¢ Device and App History: To detect critical crashes and recover the app state<br>â¢ Identity: For native login functionality with your Google account<br>â¢ Phone: Read call logs to check eligibility for Buy Now Pay Later option<br>â¢ SMS: To auto-verify OTPs and determine your eligibility for Flipkart Pay Later, Cardless Credit<br>_____________________________________<br><br>You can contact our 24x7 customer support for any product or delivery related issues. Download Flipkart app now and start shopping!', 'https://lh3.googleusercontent.com/REVWVIfDnMlClUnFat1qgVljxhvFxd2azTIIH2sPSmLZI-1KTonBD8niz8fh7pg4WX9U=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"April 3, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"6.13\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 12+Parental Guidance RecommendedLearn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Flipkart\"},{\"type\":\"Developer\",\"info\":\"Visit websiteapp-feedback@flipkart.comPrivacy Policy\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/daupXmce3Fc\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/CC1k7HwXA9