(36, 43, '800 million selfies edited by BeautyPlus? What? Find out why 300 million choose BeautyPlus to edit their selfies, pictures and videos every single month. Here\\\'s a hint: BeautyPlus offers simple, yet powerful photo editing tools, artistic effects, augmented reality (AR) filters and so much more to take your selfie game to the next level. So, let\\\'s get ready to post the best selfie to your social media account!<br> <br>Spread some Christmas cheer with the powerful selfie editing feature of BeautyPlus and have some fun with the cute filters.<br> <br>Creating beautiful and natural looking photo and video selfies has never been easier. With BeautyPlus you can erase acne marks, smooth skin, brighten eyes, whiten teeth, edit eye color, add filters and special effects, blur photos and so much more.<br> <br>Itâs our little secret!<br>BeautyPlus has worked with well-known makeup artists, photographers and real people just like you to develop the perfect photo editing app - a tool that is both easy to use and gives flawless selfies. Selfie edits are so subtle no one will ever suspect youâve used an app, allowing you to show off your natural beauty without harsh filters.<br> <br>Skin Editor<br>+ Beauty camera adds a radiant complexion for perfect face and selfie pictures<br>+ Retouch skin tone using our exclusive skin smoothing makeover tool<br>+ Blemish remover lets you make pimples and other skin problems disappear with just a tap<br> <br>Perfect Eyes<br>+ Erase bags and dark circles beneath your eyes<br>+ Brighten eyes and make them pop in photos<br>+ Edit eye color to match your hair color and hairstyle using custom contacts<br> <br>Create The Perfect Smile<br>+ Beauty editor with teeth whitening brings out the natural beauty in your smile<br>+ Take a perfect selfie with a clean smile every time<br> <br>Live Auto-Retouch (NEW!!!)<br>Need to do a quick retouch? Let our selfie editor do the work for you! Retouch using multiple special effects, and instantly preview your photo or video live in BeautyPlus. Pick the one you want and take your flawless photo or video with just one click and flaunt it on your social media account.<br> <br>Magic Brush<br>Give your selfies and photos a fantastic new look with our unique effect brushes: Glow, Neon, Stars, Hearts and so much more to satisfy your imagination about funny selfie. Enjoy finger painting with numerous colors!<br> <br>Professional Photo Editing<br>+ Blur: Selfies instantly take on a professional look with a quick blur. Just swipe to apply the effect!<br>+ Crop: The perfect selfie and photo is just one crop away! Tap to resize and trim<br>+ Photo Filters: From the romantic to the dramatic, we have dozens of special filters to make your selfies and pictures pop<br>+ Professional Control: Enlarge, Stretch, Slim and Rotate features give you the freedom to edit your selfies and photos the way you want!<br> <br>Additional Features<br>+ Selfies arenât everything - BeautyPlus works with both the front-facing and outer-facing camera<br>+ Selfie Timer built in so you can get off the perfect hands-free shot<br>+ Multiple face recognition lets you go for the group shot!<br>+ Perfect lighting even in the darkest locations. Low light? No problem! BeautyPlus automatically adjusts exposure<br>+ Ready for sharing. When you are done editing, you can share to popular social sites like Facebook, Instagram, Twitter, and Snapchat! <br> <br>Share your photos (and feedback) with us!<br>â¢ Facebook: http://www.facebook.com/beautypluscom<br><br>  <br>Device Compatibility<br>The vast majority of all BeautyPlus tools and features will function on most devices. However, our AR filters require storage space of at least 1GB and a minimum resolution of 480x854; if your device does not meet these specifications then the AR filters will not be available.', 'https://lh3.googleusercontent.com/evc-4ioGfX6VPYNCMAJCNi4FH4cDMB_JZKHS6nivPb1mzektPYEmPbRSdp5osq9HAzA=s180', 4.4, '[{\"type\":\"Updated\",\"i