(37, 44, 'Free Fire is the ultimate survival shooter game available on mobile. Each 10-minute game places you on a remote island where you are pit against 49 other players, all seeking survival. Players freely choose their starting point with their parachute, and aim to stay in the safe zone for as long as possible. Drive vehicles to explore the vast map, hide in trenches, or become invisible by proning under grass. Ambush, snipe, survive, there is only one goal: to survive and become the apex of them all.<br><br>[Survival shooter in its original form]<br>Search for weapons, stay in the play zone, loot your enemies and become the last man standing. Along the way, go for legendary airdrops while avoiding airstrikes to gain that little edge against other players.<br><br>[10 minutes, 50 players, epic survival goodness awaits]<br>Within 10 minutes, a new survivor will emerge. Will you be the one at the apex of all other players?<br><br>[4-man squad, with in-game voice chat]<br>Create squads of up to 4 players and establish communication with your squad at the very first moment. Command your friends to victory and be the last team standing at the apex.<br><br>[Realistic and smooth graphics]<br>Easy to use controls and smooth graphics promises the best survival experience you will find on mobile to help you immortalize your name among the legends. <br><br>[Contact us]<br>Customer Service: https://goo.gl/8f5918', 'https://lh3.googleusercontent.com/BnJkgpoi9vlrTQ4mhPShpEnFOG9R0eJ-51sKUt0uPHj72TLT2iTo3A1kj6iEQG-oU5U=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"March 30, 2019\"},{\"type\":\"Size\",\"info\":\"64M\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.30.0\"},{\"type\":\"Requires Android\",\"info\":\"4.0.3 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 12+Moderate ViolenceLearn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact, In-Game Purchases\"},{\"type\":\"In-app Products\",\"info\":