(38, 45, 'Instagram is a simple way to capture and share the worldâs moments. Follow your friends and family to see what theyâre up to, and discover accounts from all over the world that are sharing things you love. Join the community of over 1 billion people and express yourself by sharing all the moments of your day â the highlights and everything in between, too.<br><br>Use Instagram to:<br><br>* Post photos and videos you want to keep on your profile grid. Edit them with filters and creative tools and combine multiple clips into one video.<br>* Browse photos and videos from people you follow in your feed. Interact with posts you care about with likes and comments.<br>* Share multiple photos and videos (as many as you want!) to your story. Bring them to life with text, drawing tools and other creative effects. . They disappear after 24 hours and wonât appear on your profile grid or in feed.<br>* Go live to connect with your friends in the moment. Try going live with a friend and sharing a replay to your story when youâre done.<br>* Message your friends privately in Direct. Send them photos and videos that disappear and share content you see on Instagram.<br>* Watch stories and live videos from the people you follow in a bar at the top of your feed.<br>* Discover photos, videos and stories you might like and follow new accounts on the Explore tab.', 'https://lh3.googleusercontent.com/aYbdIM1abwyVSUZLDKoE0CDZGRhlkpsaPOg9tNnBktUQYsXflwknnOn2Ge1Yr7rImGk=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"April 2, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"1,000,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 12+Parental Guidance RecommendedLearn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact, Shares Info, Shares Location\"},{\"type\":\"Permissions\",\"