(43, 50, 'One of the most addictive and entertaining physics based driving games ever made! And it\\\'s free!<br><br>Meet Newton Bill, the young aspiring uphill racer. He is about to embark on a journey that takes him to where no ride has ever been before. From Ragnarok to a Nuclear Plant, all places are a racing track to Bill. With little respect to the laws of physics, Bill will not rest until he has conquered the highest hills up on the moon! <br><br>Face the challenges of unique hill climbing environments with many different cars. Gain bonuses from daring tricks and collect coins to upgrade your car and reach even higher distances. Watch out though - Bill\\\'s stout neck is not what it used to be when he was a kid! And his good old gasoline crematorium will easily run out of fuel.<br><br>Features:<br>â¢ â¡ Offline Play - Play whenever &amp; wherever!<br> â¢ ð Vehicles - Unlock 29+ vehicles and choose the best one for your playstyle<br> â¢ ð§ Upgrade - Improve the engine, suspension, tires &amp; 4WD of your vehicles<br> â¢ â°ï¸ Drive - 28+ stages that are literally endless<br>â¢ ð Optimized - Plays well on high and low resolution devices<br>â¢ ð  Garage mode - build and drive your dream vehicle with custom parts!<br><br>Vehicles: jeep, motocross bike, monster truck, tractor, hippie van, onewheeler, quad bike, tourist bus, race car, police car, ambulance, fire truck, snow mobile, super offroad, and many more!<br> <br>Hill Climb Racing is free to play but there are optional in-app purchases available.<br><br>Remember that we\\\'re always reading your feedback and are hard at work creating new vehicles, levels, features and of course fixing any issues you may find. So we\\\'d really appreciate if you\\\'d report what you like or dislike and any issues you may have with the game to support@fingersoft.net and please include your device make and model.<br><br>Follow Us:<br>* Facebook: https://www.facebook.com/Fingersoft<br>* Twitter: @fingersoft<br>*