(44, 51, 'The Amazon India Shopping App brings to you, over 17 Crore original products, at great prices &amp; deals. Shop on the Amazon App for the latest electronics â Redmi Y2, Apple iPhone, Samsung Galaxy, OnePlus 6T &amp; more, accessories - memory cards, earphones, chargers, power banks. Shop for your home needs and choose from selection across TVs, refrigerators, water purifiers, washing machines, sofa sets, mattresses, bean bags. Shop from Amazon Fashion for all occasions â Formal attire, vacation wear to casual and daily wear â shirts for men, sarees &amp; gowns for women, watches, jewelry, shoes &amp; footwear. Also, kidâs clothes, footwear, toys, bags, bottles &amp; more. Recharge your prepaid mobile, DTH account and pay your electricity, postpaid, landline, broadband &amp; gas bills with Amazon Pay. Download the Amazon India Shopping App for free, from Google Play Store &amp; enjoy online shopping like never before. <br><br>Great Shopping Experience<br>The free online shopping app from Amazon assures you of a great shopping experience with a lighter app, faster load time &amp; wide selection across categories. You can browse and search for your desired products by product name, category or brands. Enjoy the rich catalogue images - you can view the product from multiple angles, with options to zoom. Get personalized recommendations based on ratings &amp; shopping trends.<br>With Amazon India, you are guaranteed 24x7 customer service support, faster delivery, easy returns, and convenient payment options including cash on delivery as well as the 100% purchase protection offered by Amazonâs A-to-Z Guarantee.<br><br>Fast &amp; Easy Mobile Recharges &amp; Bill payments<br>Recharge your prepaid mobile with all major telco operators: Airtel, Jio, Vodafone, Idea, Docomo, BSNL, MTNL. Recharge your DTH with all major service providers: Tata Sky, Dish TV, Airtel DTH, Reliance digital TV. Pay your electricity bill, postpaid bill, landline bill, broadband bill, gas &amp; water bills.<br><br>Amazon Pay UPI: Now pay directly from bank account <br>Paying for your online shopping, recharges &amp; bill payments is now even faster with Amazon Pay UPI. Just link your bank account to Amazon Pay UPI and start paying. With UPI, payments are hassle free with no CVV or OTPs required. Amazon Pay UPI is powered by BHIM UPI, a government of India supported payments platform.<br><br>Enjoy Safe and Secure Shopping<br>Shop using your Amazon Pay balance, Credit/Debit Card, UPI, EMI or Net Banking knowing that all transactions are securely processed. No need to worry about your personal or account details getting leaked, as Amazon.in provides you 100% purchase protection for safe payments &amp; transactions. You could also pay cash on delivery for your orders.<br><br><br>Track your Orders<br>Shopping on the Amazon app offers you up to the minute updates on the status of your orders &amp; you can choose to track it anytime through the âYour Ordersâ menu option.<br><br>Shopping is Fun on the Amazon.in App<br>Get deals &amp; discounts only on the app. App-only games and quizzes games offer you the chance to win exciting prizes!<br><br>Make the most of Amazonâs exclusive benefits<br>Become an Amazon Prime member &amp; get guaranteed free 1-Day, 2-Day or standard delivery on eligible items, 30-minute early access to top Lightning deals &amp; watch the latest and exclusive movies and TV shows on Prime Video.<br>Use Amazon Pay for Instant checkout for your purchases, hassle-free payments, faster refunds, quick and easy bill payment, mobile &amp; DTH recharges.<br>With Amazon Pantry get next day delivery of household items &amp; groceries and save in the process. Now available in 25 cities in India.<br><br>Permissions<br>In order to offer you the best experience and operate properly, the Amazon Shopping App needs access to the following services:<br>* Operating System Requirements: Requires Android OS 2.3 or higher.<br>* Account: Account per