(45, 52, 'Spring has sprung in Candy Crush Saga, switch and match colourful candies to unwrap egg-cellent in-game surprises!<br><br>Start playing Candy Crush Saga today â  loved by millions of players around the world.<br><br>With over a trillion levels played, this sweet match 3 puzzle game is one of the most popular mobile games of all time!<br><br>Switch and match Candies in this divine puzzle adventure to progress to the next level in hope of achieving that sweet feeling! Quick thinking and smart moves are rewarded with delicious rainbow-colored cascades and tasty candy combos!<br><br>Plan your moves by matching 3 or more candies in a row, using boosters wisely in order to overcome those extra sticky levels! Smash the chocolate and collect ingredients across thousands of levels guaranteed to have you craving more!<br><br>Take on this deliciously sweet match 3 Saga alone or play with friends! Candy Crush Saga is completely free to play but some optional in-game items will require payment.<br><br>By downloading this game you are agreeing to our terms of service; http://about.king.com/consumer-terms/terms<br><br>Candy Crush Saga features:<br>â Tasty ways to play: Target Score, Clear the Jelly, Collect the Ingredients and Order Mode to name a few!<br>â Check back daily to receive free tasty rewards, take part in time limited challenges to earn boosters to help you level up! <br>â Collect sugar drops to progress along the Sugar Track for super sweet surprises!<br>â Spin the Daily Booster Wheel for a delicious prize <br>â Unwrap delicious environments and meet the sweetest characters<br>â Tasty Candies, wrapped and striped Special Candies, Color Bombs and various other magical boosters to help with those challenging sticky levels<br>â Thousands of the best levels and puzzles in the Candy Kingdom and with more added every 2 weeks your sugar fix is never far away! <br>â Leaderboards to watch your friends and competitors!<br>â It\\\'s easy to sync the game between devices and unlock full game features when connected to the Internet<br><br>Visit https://care.king.com/ if you need help!<br><br>Follow us to get news and updates;<br>facebook.com/CandyCrushSaga<br>Twitter @CandyCrushSaga<br>https://www.youtube.com/user/CandyCrushOfficial<br>http://candycrushsaga.com/<br><br>Have fun playing Candy Crush Saga the sweetest match 3 game around!', 'https://lh3.googleusercontent.com/2cpSn-aGl9qcuwXeL8tLUhG15pwiu64PuczJhZmMTN_-SadwCjMf91zhYfgdTaLdg4I=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"April 5, 2019\"},{\"type\":\"Size\",\"info\":\"85M\"},{\"type\":\"Installs\",\"info\":\"500,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.147.0.2\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact, Shares Info, Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a029.00 - \\u20b9\\u00a011,900.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"King\"},{\"type\":\"Developer\",\"info\":\"Visit websitecandycrush.techhelp@king.comPrivacy PolicyKing.com Limited\\nAragon Business Centre, Level 4, Dragonara Road, St Julians STJ3140, Malta\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/g_vo-QBbCcA\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/tk_p7dIHQBEBeYiVkFaPcU_5bd3fOhE8HerKp4Ei0cTyxVoVDdd_QD0SLPJeJrSm4c4=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/Km7Il6ij6xZBtWJPSpEacmz8dC2C9WACUuf37VdjIYaXWaPaC6WWWmx3T8aaNgNkJaBx=w720-h310\",null,null,null,\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",null,null,null,null,null,\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",null,null,null,null,null,\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\