(46, 53, 'Gaana is the one-stop music app for all your Music needs. Gaana offers you free, unlimited online access to all your favorite Hindi Songs, Bollywood Music, Regional Music &amp; Radio Mirchi - on your mobile phone.<br><br>With our plethora of collection from New Songs to Old Classics, Bollywood songs, Indian Regional songs, you can enjoy millions of Hindi, English*, Tamil, Telugu, Marathi, Kannada, Punjabi, Malayalam, Odia, Rajasthani, Bengali, Assamese &amp; Bhojpuri Songs for free. Download songs of your favourite artists or from popular albums. Browse through our top charts such as Top 50 Bollywood Songs, International Top 50, Punjabi Top 50 &amp; much more. <br><br>Also explore new and old songs depending on your mood or liking through our discover section and listen to curated playlists; 90âs Romantic Hits, Sad Songs, Bhangra, Devotional, Rock, Rhymes, Bhajans &amp; Ghazals. You can also play Gaana Online Radio for an endless stream of your favorite genre. <br><br>Listen to songs of famous artists like Arijit Singh, Atif Aslam, AR Rahman, Badshah, Guru Randhawa, Lata Mangeshkar, Neha Kakkar, Kishore Kumar, R D Burman, Shreya Ghoshal, Sunidhi Chauhan and others only on Gaana music app. You can also browse English tracks of popular artists like Avicii, Ed Sheeran, David Guetta, Charlie Puth, Sia, Drake, Pitbull, Eminem, Enrique Iglesias, Bryan Adams, Justin Bieber.<br>Gaana music app offers the latest songs from Hindi movies such as Batti Gul Meter Chalu, Satyameva Jayate, Veere di Wedding, Raazi, Baaghi 2, Tiger Zinda Hai, Padmavat, Bareilly Ki Barfi and more.<br>If you are a fan of Telugu songs, you can listen to the songs such as Inkem Inkem Kaavale, Yenti Yenti, Aagi Aagi, Adbutham, O Cheli Thaara, Sada Nannu, Rangamma Mangamma, Bharat Ane Nenu and many more. We also have a notable collection of Tamil songs. Go on loop mode with Tamil songs like Kalyaana Vayasu, Orasaadha, Kaathalae Kaathalae, High On Love, Anthaathi and more<br><br><br>Gaana Music app offers:<br>+ Access to over 30 million Bollywood &amp; English MP3 songs <br>+ High quality music streaming<br>+ Thousands of playlists created by Experts and Users <br>+ Save your favorite songs, playlists, albums and artists<br>+ Listen to Non-stop Radio &amp; also 20 Radio Mirchi stations.<br>+ Music updated daily for Hindi, English, Punjabi, Tamil, Telugu, Bhojpuri, Kannada and other regional languages<br>+ Enjoy Lyrics of your favorite songs <br>+ Experience the app in 10 different languages<br>+ Ability to enjoy music in black and white theme<br><br>Gaana Plus offers:<br>+ Download unlimited mp3 songs for offline listening<br>+ Ad free Music experience<br>+ Music in high definition audio quality<br>+ Sync downloads on 5 devices<br><br>Explore interesting music and listen to bollywood songs, featured artists, latest trending songs, popular playlists and more on Gaana app. Download the app to play music on the go.<br><br>Subscribe to Gaana Plus for INR 99 per month (within India) or $3.99 per month (outside India) <br>Your Gaana Plus subscription will automatically renew each month through your Google Play account. You can cancel auto-renewal at any time from the subscription list in your Google Play account. Cancellation of the current subscription is not allowed during the active subscription period.<br><br>We need permission to read SMS to offer seamless phone number login by reading OTP sent via SMS. <br><br>Please go to http://gaana.com/privacy_policy.html and http://gaana.com/terms_and_conditions.html for more information<br><br>Like us on Facebook: facebook.com/gaana.com<br>Follow us on Twitter: twitter.com/gaana<br>Connect with us on Google+:https://plus.google.com/u/1/+GaanaBajao/posts<br>Send Feedback: feedback@gaana.com<br><br>All content available on this application is legitimate and duly licensed to the publisher* for use.<br><br>*Publisher - Times Internet (Times of India Group)<br><br>*English songs are currently available in India only<br><br>*Offline content is only playable from Gaana app, till you are an active Gaana+ subscribers', 'https://lh3.googleusercontent.com/WbMOtegwCi2bltxEiAKWCFLPMnEnN05FQ1NGdednkiCJZZj8e8KQDIEkQ_43f6MuX78=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"March 30, 2019\"},{\"type\":\"Size\",\"info\":\"16M\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"8.0.3\"},{\"type\":\"Requires Android\",\"info\":\"4.0.3 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact, Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a049.00 - \\u20b9\\u00a02,442.32 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Gamma Gaana Ltd\"},{\"type\":\"Developer\",\"info\":\"Visit websitefeedback@gaana.comPrivacy PolicyGaana Office,\\nFC - 4, 2nd Floor,\\nFilm City,\\nSector 16 A,\\nNoida 201301\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/tMC3zQ8xYF0\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/sGIpksuRqEabM-GuKBV4rLiK0ILrxq6vC1bPTTp6gsUJxXSEawgNPSoweqzokG2E6mg=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/Hz6_RN3NCuPnaeJJVlOyaBg7Y-IAVJD_eNxHnkWUMNS1p5UidarwxXGzK8LWN7zt0tAM=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[{\"url\":\"https:\\/\\/www.youtube.com\\/embed\\/tMC3zQ8xYF0?ps=play&vq=large&rel=0&autohide=1&showinfo=0\",\"image_url\":\"https:\\/\