(47, 54, 'Roposo is India\\\'s favorite video sharing app. Get the best from people from all over the country all the time.<br><br>With our free to download Indiaâs best app, you can share videos &amp; images using over 25+ Channels on the platform. You can use Indiaâs favorite Roposo app in English, Hindi, Tamil, Telugu, Kannada, Gujarati, Punjabi, Marathi &amp; Bengali.<br><br>Download Indiaâs favorite Roposo &amp; create amazing videos with the help of filters, stickers &amp; effects which help you to create videos in slow-mo, time-lapse, portraits with natural light, studio light, contour light, stage &amp; stage mono light. Add filters get creative with your posts! Edit videos, photos &amp; add trending stickers &amp; filters on Indiaâs favorite app to make your videos/photos trending! Use the perfect hashtags &amp; get to know how your likes &amp; views increase instantly! Donât just follow the best content, get the best content from this year!<br><br>Share interesting stand-up comedy videos &amp; photos with funny greetings &amp; wishes &amp; make them go viral among a huge audience in India. Download/Save &amp; share your favourite comedy trending from videos &amp; photos on various social media networks.<br><br>We have channels like:<br><br>Haha Tv:<br>Laugh at the hilarious world of HAHA Tv on Indiaâs favorite app &amp; discover the funny edge of your life. With so much humour, pranks &amp; Jokes in life, forget having a dull day ever! From Bakchod Billi, Santa-Banta, gf-bf, lawyer, Student-teacher, husband-wife, father-son, marriage jokes, funny sayings &amp; more awesome jokes- HaHa Tv has it all!<br><br>Bhakti: <br>Itâs a community of all religions across the world sharing &amp; discovering their rich diversity through photos, videos &amp; stories. You can get Aarti, Bhajan, Paath, Ardaas, Prayers, Namaaz, Mantras, Shlokas, religious programs information, Stotra, daily-darshan from users all over India! Get new devotional photos, videos, stories &amp; information of your favorite god every day. Get new devotional photos, videos related to Indian festivals, rituals &amp; practices from different parts of India. Get to interact with other devotees of India. Find wallpapers of any god &amp; share it with friends &amp; family! Download &amp; share your favourite photos &amp; videos from Indiaâs favorite app with family &amp; friends using social media apps.<br><br>Look Good-Feel Good:<br>Be it any of the languages we offer- Hindi, English, Punjabi, Gujarati, Marathi, Kannada, Tamil, Telugu or Bengali- You deserve to look good &amp; feel good in any language you want! This channel offers you the best tips of having a healthy lifestyle by offering the best health tips for you &amp; your family! Be it ayurvedic, homeopathic or simply home made solutions.  From stomach upset to skin &amp; hair care, get your dadi ma &amp; ke nuske right on your phone!  Download &amp; share Desi tips with friends from Indiaâs favorite app now! Get the easiest looking good feeling good tips on your phone. Desi solutions for your skin &amp; body problems taken care by home-made solutions!<br><br>Beats:<br>Get the best music &amp; dance videos &amp; images only on our Beats Channel! Set for a party mood? Just switch to beats channel &amp; get a huge variety of music videos on Indiaâs favorite app in Hindi, English, Punjabi, Marathi, Tamil, Telugu, Kannada, Gujarati &amp; Bengali! Your favorite film-star dancing on your favorite music in a collection of videos &amp; images saved just for you!<br><br>Along with these, we have many more channels like the Celebration Channel, Hungry Tv, Gabru, City Report, Punjabi Way, Digi TV, Nation Speaks, Wow Channel, Discover People, Filmistaan, Creative Space, Beats, Look Good Feel Good Channel. Feel free to go through all the videos &amp; photos &amp; simply chat with sellers to buy anything you may like on our Roposoâs very own Bazaar Channel.', 'https://lh3.googleusercontent.com/qk3