(52, 59, 'Using Swiggy, you can order food &amp; beverages online from restaurants near &amp; around you. We deliver food from your neighborhood local joints, your favorite cafes, luxurious &amp; elite restaurants in your area, and also from chains like <b>Dominos, KFC, Burger King, Pizza Hut, FreshMenu, Mc Donaldâs, Subway, Faasos, Cafe Coffee Day, Taco Bell,</b> and more. Exciting bit? We place no minimum order restrictions! Order in as little (or as much) as youâd like. Weâll Swiggy it to you! <br><br><b>Food per your mood:</b> In mood of a hot coffee? A nice biryani? Cheesy pizzas and sumptuous burgers? Or some salad &amp; juices? Youâll find all your favorite food &amp; beverages on Swiggy. We deliver 30+ cuisines at your doorstep including North Indian, Chinese, South Indian, and even foreign cuisines such as Thai, Vietnamese, and American. Healthy or junk, street food or luxury food, local or global, breakfast or late night cravings, youâll find every food option on Swiggy. <br><br><b>Long Distance Orders:</b> We take food (very) seriously! We deliver from restaurants not just that are near you but also from those far away, and those even further away from you. And hence, often times, to get to your favorite restaurants, we donât mind travelling those extra miles too. <br><br><b>Lightning Fast Delivery:</b> Weâre committed to delivering your food, piping hot and fresh. Our Delivery Executives are spread in every nook &amp; cranny of your city, and they take the phrase ASAP seriously. We even deliver food late nights, in the same lightning fast speed.<br><br><b>Live Order Tracking:</b> No more calling the restaurant to check if your order is prepared or picked. On Swiggy, youâll be able to live track your delivery right from the restaurant to your doorstep. <br><br><b>Freebies, Cashbacks, Offers, and Discounts:</b> To make your meals from Swiggy even more delightful &amp; affordable, youâll always find tens of amazing deals sponsored by us, and our host of restaurant, bank, and online wallet partners. <br><br><b>Pay instantly, on delivery, or later:</b> Pay instantly using VISA/MasterCard Credit or Debit Cards, Net Banking, PayTM, FreeCharge, and Mobikwik wallets, or Sodexo Meal Cards. Payment can also be done at the time of delivery using cash. Or laters, using LazyPay. <br><br>Hungry? Want tasty, affordable, and exciting meals, delivered right at your doorstep? Get Swiggy-ing! Install the Swiggy app now and order food online from Swiggy in <b>Agra, Ahmedabad, Allahabad, Amritsar, Aurangabad, Bangalore, Bhopal, Bhubaneswar, Chandigarh, Chennai, Coimbatore, Dehradun, Delhi, Faridabad, Goa, Gurgaon, Guwahati, Hyderabad, Indore, Jaipur, Jalandhar, Kanpur, Kochi, Kolkata, Kota, Kozhikode, Lucknow, Ludhiana, Madurai, Mangaluru, Manipal, Mumbai, Mysore, Nagpur, Nashik, Noida, Pondicherry, Pune, Ranchi, Surat, Thiruvananthapuram, Thrissur, Tirupati, Tirupur, Trichy, Udaipur, Vadodara, Varanasi, Vellore, Vijayawada, Vizag &amp; Warangal</b>.', 'https://lh3.googleusercontent.com/o82xp7dmL6PIDF_mHeRFHkhlj7h66xH0eOO-YGZOo0CGW-Pe1jldvAt_VcW50zU6JcA=s180', 4.2, '[{\"type\":\"Updated\",\"info\":\"March 29, 2019\"},{\"type\":\"Size\",\"info\":\"13M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.3.21\"},{\"type\":\"Requires Android\",\"info\":\"4.4 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Swiggy\"},{\"type\":\"Developer\",\"info\":\"Visit websiteandroid@swiggy.inPrivacy Policy\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/BFCvSJ3PNQA\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/9O7-Xx1B2Og7oY0lO8bFvmbqVmg4Rv9piOMefZMb4n3xcXDK7B0wj_k2kX0JdKJr5Xw=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/sV7RbhLxqpvlYg-I3n9H1cBUTh6HrgF1oF0HhdPjZ-QpEYgUXggWgxhGWTE0U6SSaC4=w720-h310\",null,nu