(53, 60, 'A fast and data-efficient messaging app to reach the people in your life. <br><br>Messenger Lite:<br>- Installs quickly. It\\\'s less than 10MB to download!<br>- Saves data. It loads fast, runs efficiently and uses less mobile data.<br>- Works everywhere. Reach people when you\\\'re in an area with a slow or unstable internet connection.<br><br>With Messenger Lite, you can:<br>- Contact anyone on Messenger, Facebook or Facebook Lite.<br>- See when people are active and available to chat.<br>- Message people one-on-one or in groups to catch up or make plans.<br>- Send photos, links, or express yourself with stickers.<br>- Make one-on-one voice and video calls for free over Wi-Fi (otherwise standard data charges apply). Talk as long as you want, even with people in other countries!', 'https://lh3.googleusercontent.com/TU0sEekxINa-D4wYgz9lkqQvZgwChcygYgZajNrQOmc5H__5VsnGG8FHCXGaksmuH8M=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"April 4, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"55.0.1.11.185\"},{\"type\":\"Requires Android\",\"info\":\"4.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Facebook\"},{\"type\":\"Developer\",\"info\":\"android-support@fb.comPrivacy Policy1 Hacker Way\\nMenlo Park, CA 94025\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/BNJoJKk8r3VEq5ECxm1MuiVzJCbl2uu3ZESUj6kyVUff9d88VgMGfoJJHG7pdubP250=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/0LsGYN3PUcfRyHG9NFU1p2ajlYMjqWDfDgVwktr14wivvQ8ZyLoiiMWr-IRh_twlby8=w720-h310\",null,null,null,null,null]', '[]', '2019-04-06 18:34:29', '2019-04-06 18:34:29', NULL),
