(65, 72, 'Fly cars with amazing new car flying physics on a single push button. Car driving games and simulators has been in trend but 55 Best Games have now launched all new FLYING CAR DRIVER game where you can not only drive your car but flying it like an airplane. We have integrated real plane like physics on all the attractive sports cars. Its a feature that no sports car have but its a futuristic car idea when luxury cars would have a feature to fly as well.<br><br>Just image being in a car driving around the city and exploring the car features you hit an unknown button and your car wings open up and when you press gas your car starts flying in the air and become flying car. Even top car games don\\\'t have a feature like this i.e driving and flying your car. <br><br>Now you can become car driver and pilot as well on a single push of a button. Explore more hidden features of your car simulator as it might do flips and big jump from the air when you turn off the flying feature in air. Just drive or take a flight on your very own car which is now not less than an airplane. Thinking about flying cars have always been exciting and fun in mind. Well that idea is now just become a flying car game and your car game is now also one of flying games as well.<br><br>Features: <br>- Best driving controls to drift and perform multiple stunts <br>- Exciting flying feature of cars<br>- Realistic car flying just like real aircraft<br>- Explore many hidden features<br>- Driving and flying both at the same time<br>- Easy and responsive controls<br>- Game fully optimized, No Lag.<br>- A futuristic car idea <br>- Totally free to to play (No in app purchases)', 'https://lh3.googleusercontent.com/Uq0wwOzRsSGJlBPD3AqmutFwTsKoA5xOK1st9XYfgzIsbwYBwameXJ8TaV5_TRcGhI4z=s180', 4, '[{\"type\":\"Updated\",\"info\":\"February 7, 2019\"},{\"type\":\"Size\",\"info\":\"57M\"},{\"type\":\"Installs\",\"info\":\"500,000+\"},{\"type\":\"Current Version\",\"info\":\"1.0\"},{\"type\":\"Requires Andro