ip and controversies, from across the array of Network18 news channels, now streaming LIVE on Voot.<br>News travels fast, it streams faster: The latest updates from CNN-News 18, News18 Assam North East, News18 Bangla, News18 Bihar Jharkhand, News18 Gujrati, News18 India, News18 Kannada, News18 Kerala, News18 Lokmat, News18 MP Chhattisgarh, News18 Odia, News18 Punjab Haryana Himachal, News18 Urdu, News18 Rajasthan, News18 Uttarakhand, News18 Tamil Nadu<br>12 languages: English, Hindi, Bangla, Gujarati, Tamil, Kannada, Urdu, Bihari, Odia, Marathi, Malayalam, Punjabi.<br>Top Featured Shows : 9 Months, Social Media Star, Virtuosity, Reporters Project, The Week That Wasnât, Tech and Auto show, Poster, Bhaiyaji Kahin, Hum To Poochenge, The right stand, Off Centre, FOMO, Tech2 Talks, Viewpoint, E-Buzz, Now Showing, Face Off, Aar Paar, Speed News, Aamne Samne, Khas Mulakat, Election Battle of 2019<br>Regional News: Catch all the news live, in your preferred language.<br><br>Music:<br>Music lovers rejoice: Watch MTV Unplugged, Coke Studio, Rising Star and more!<br><br>Regional TV Shows:<br>Fans can enjoy regional favourites like Bigg Boss Kannada Season 6, Colors Banglaâs Ke Hobe Banglar Kotipoti with Prosenjeet Chatterjee, Colors Tamilâs Enga Vettu Mapillai, Naagini, Sivagami, Maja Talkies S02; Colors Marathiâs Bigg Boss Marathi, Saraswati; Colors Gujaratiâs Rasoi Show, Savaaj; Colors Banglaâs Resham Jhanpi and Ki Kore Toke Bolbo <br>Extras and Exclusive content:<br>Besides full episodes, Voot has short-format entertainment which include mini clips, promos, mashups &amp; playlists, music videos, etc. A special version of this is Unseen Undekha â a collection of behind-the-scenes clips from reality shows like Roadies, Bigg Boss and other reality shows released exclusively.<br><br>Bollywood Movies:<br>The biggest Bollywood movies, anytime on Voot! Superhit movies like Bajirao Mastani, Queen, Gangs of Wasseypur, Bhool Bhulaiyaa, Cocktail, Jab We Met and more!<br>