(70, 77, 'Callbreak Multiplayer brings classic and popular card game with online multiplayer feature to the Google Play Store.<br><br><br>Game Rules<br>Callbreak is a trick-taking card game played with a standard 52-card deck between four players. There are 5 rounds in a game. Players\\\' sitting direction and the first dealer are selected before the first round begins. To randomize player\\\'s sitting direction and the first dealer, each player draws a card from the deck, and based on the order of the cards, their directions and first dealer are fixed. Dealers are changed successively in anti-clockwise direction in the following rounds.<br><br><br>Deal<br>In each round, a dealer starting from their right, deals all the cards in anti-clockwise direction to all the players without revealing any card, making 13 cards per each player.<br><br><br>Bidding<br>All four players, starting from the player to dealer\\\'s right bid a number of tricks that they must win in that round in order to get a positive score, otherwise they will get a negative score.<br><br><br>Play<br>In Callbreak, Spades are the trump cards.<br>In each trick, player must follow the same suit; if unable, player must play a trump card if eligible to win; if unable, player can play any card of their choice.<br>Player must always try to win the trick, in other words (s)he must play higher cards possible.<br><br>The first trick in a round is led by player to dealer\\\'s right with any card of any suit. Each player, in turn plays in anti-clockwise direction. A trick containing a spade is won by the highest spade played; if no spade is played, the trick is won by the highest card of the same suit. The winner of each trick leads to the next trick.<br><br><br>Scoring<br>Player that takes at least as many tricks as her bid receives a score equal to her bid. Additional tricks (Over Tricks) are worth an extra 0.1 times one point each. If unable to get the stated bid, score will be deducted equal to the stated bid.  After 4 rounds are completed, scores are summed to help players set a goal for their final round. After the final round, winner and runner-ups of the game are declared.<br><br><br>Features:<br>- Intuitive drag interface to play a card<br>- Bots with improved AI in single player mode<br>- Multiplayer with random online players<br>- Multiplayer with online facebook friends<br><br><br>Coming soon:<br>- Local/wifi/hotspot multiplayer<br>- Score history, statistics<br>- Leaderboard and achievements<br>- Sounds and notifications<br><br><br>Also try the web version<br>http://callbreak.com/<br><br><br>Localized name of the game:<br>- Callbreak (in Nepal)<br>- Lakdi, Lakadi (in India)', 'https://lh3.ggpht.com/pchqOaCIB5ureK_IkrBrXCW0k6uLG38r0QqBFrxo9U4iW2It24qmugsBDvmhNTedYRr3=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"December 13, 2018\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Teslatech\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport@callbreak.comPrivacy PolicyKupondole, Lalitpur\\nNepal\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/5wB7kl04PTQ\\/hqdefault.jpg\",\"https:\\/\\/lh3.ggpht.com\\/cO7yhVWI8u9EXhLXn16hfY3Zdo5Cjf1OSV0tbBUZTXJxFbHmIdVV3FUFH5So1J0xCeM=w720-h310\",\"https:\\/\\/lh3.ggpht.com\\/1Dudmq9g6kkoF9gb3RWiK8-5QPRFb-xYBp8df1EFERP47XTkMTTdf9y9sWseYRp3v4w=w720-h310\",null,null,null,null,null,null,null]', '[{\"url\":\"https:\\/\\/www.youtube.com\\/embed\\/5wB7kl04PTQ?ps=play&vq=large&rel=0&autohide=1&showinfo=0\",\"image_url\":\"https:\\/\\/i.ytimg.com\\/vi\\/5wB7kl04PTQ\\/hqdefault.jpg\"}]', '2019-04-07 19:12:14', '2019-04-07 19:12:14', NULL),
(71, 78, 'Official IRCTC partner train app for booking train tickets, and check where is my train with NTES live train running status, PNR status, train running status (works without internet) &amp; all other train information in one light-weight rail app. Check PNR status, prediction, train ticket, seat availability, station status, train enquiry etc. Make all your <b>train, flight, bus, hotel bookings</b> from one app.<br><br>Pay Rs.0 Service Charge On Your First IRCTC Train Booking &amp; Rs.0 PG Fees on All UPI Payments. One app to book all your Train, Bus &amp; Flight Tickets At Lowest Prices! Also, SIGN UP &amp; EARN Rs.50 ixigo money, use it to get instant off on your next train booking. <br><br><b>Loved by 10 crore Indian Railways travellers</b>, ixigo trains app is one of the highest rated railway app. <br><br>Exclusive offer for ixigoers. Book your first train ticket on ixigo today &amp; pay â¹0 service charge.<br><br>Awarded #1 âMade in Indiaâ app by Google among other apps like IRCTC rail connect, rail yatri, pnr status live train status &amp; indian rail info, where is my train etc.<br><br><b>PNR STATUS &amp; PREDICTION</b><br>- Do a PNR status check any time to know whether your Indian Railways seat is confirmed or not. <br>- Get PNR predictions to know the chances of ticket confirmation, before and after your booking. <br>- Automated PNR status updates.<br><br><b>TRAIN SEAT AVAILABILITY</b><br>- Check IRCTC train ticket and seat availability<br>- Do an Indian Railway enquiry to get train time table<br><br><b>TRAIN RUNNING STATUS &amp; ALARMS</b><br>- Check live train running status for over 5000+ Indian Rail trains running under the Indian Railways<br>- Know where your train has reached offline without internet<br><br><b>LOCAL TRAINS &amp; METRO LINES</b><br>- Get information about Delhi Metro, Mumbai Local Trains, Kolkata Metro, Hyderabad Local Trains, Chennai Local Trains<br><br><b>KNOW REAL TIME ANSWERS FOR</b><br>- Where is my train ?<br>- When will my train reach the station ? <br>- Will my PNR confirm or not ? <br>- Which platform will my train come on ?<br><br><br><b>TRAVEL BOOKINGS</b><br>Flight: Save flat Rs.800 on your first flight booking, use NEW800 only on this app. Get all Indigo, SpiceJet, Jet Airways, GoAir, Air India flights<br>Bus: Save flat Rs.100 on your bus bookings, use BUS100<br>Hotel: Get free cancellation, pay @ hotel &amp; free breakfast on over 1,000,000 hotels <br><br><b>INDIAN RAILWAYS INFORMATION</b><br>- See train timetable for all Indian rail passenger and express trains.<br>- Calculate exactly how much refund you are eligible for on ticket cancellation with the help of the Refund Calculator feature.<br>- Explore seat/berth maps to find convenient seats.<br>- Major Indian rail trains covered: Shatabdi Express, Rajdhani, Duronto Express, Garib Rath, Jan Shatabdi, Inter-city, Superfast Trains, etc.<br><br><b>SWITCH TO YOUR OWN LANGUAGE</b> <br>- Now browse the ixigo trains app in Hindi, Marathi, Gujarati, Bengali, Telugu, Tamil or Kannada<br>- Get to know live train status, PNR status update, railway enquiry, seat availability, all in in your own language. <br><br>OTHER APP FEATURES<br>- Save IRCTC train routes for offline use.<br>- Rated top railway app in: Mumbai, Delhi, Gurgaon, Noida, Bangalore, Pune, Chennai, Jaipur, Hyderabad, Ranchi, Patna, Hyderabad, Chandigarh, Ahmedabad, Kolkata, Aurangabad, Madurai, Rajkot, Udaipur, Mysore, Mangalore, Patiala, Jodhpur, Gwalior, Guwahati, Ajmer, Raipur, Gandhinagar, Bhopal, Nagpur, Lucknow, Kanpur<br><br>Disclaimer: This app is an official IRCTC partner, and also relies on public information available on 3rd party websites that you choose to access, at will, through the app. By using it, you are responsible for any legal implications that may arise from such usage.  Indian Railways, IRCTC and NTES apps are other apps you can use. <br><br>PERMISSIONS<br>1) Location permission: We seek this permission to show a more accurate train running status to you.<br>2) SMS read permission: We seek this permission to help you complete your transaction smoothly.<br><br>Feedback form: https://bit.ly/2JchRPv', 'https://lh3.googleusercontent.com/RWcN2gs6tgQ6JEgOljlq-M2zFeapPSiiCMNhBM6DKwys-ola0ne4YXC4ZszxYdLyAA=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"March 25, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"4.3.6.1\"},{\"type\":\"Requires Android\",\"info\":\"4.4 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"ixigo - India\'s #1 travel app\"},{\"type\":\"Developer\",\"info\":\"Visit websitetrains@ixigo.comPrivacy PolicyLe Travenues Technology Pvt Ltd\\n2nd floor, Veritas Building,\\nBehind Ibis Hotel, Sector 53,\\nGolf Course Road\\nGurgaon 122011\\nHaryana\\nIndia\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/jiy0osXUVDk5VQynI5TU5ZyxFxLuldgi2s3ijUU7iFxZB5CNot8W4v9-jMBWk8yZLD0=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/dX-YWLiNPf_HPtSuNbyswKQr0mBw4Q1BF8nWqLWI-zWP_0XcQ4w3Llv92CaA9YCUTzU=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\