(72, 79, 'WhatsApp Business enables you to have a business presence on WhatsApp, communicate more efficiently with your customers, and help you grow your business. <br><br>If you have separate business and personal phone numbers, you can have both WhatsApp Business and WhatsApp Messenger installed on the same phone, and register them with different numbers.<br><br>In addition to the features available in WhatsApp Messenger, WhatsApp Business includes:<br><br>â¢ BUSINESS PROFILE: Create a profile for your business to help your customers find valuable information â like your website, location, or contact information.<br><br>â¢ BUSINESS MESSAGING TOOLS: Be more responsive to your customers by using Away messages to indicate that you\\\'re away.<br><br>â¢ LANDLINE/FIXED NUMBER SUPPORT: You can use WhatsApp Business with a landline (or fixed) phone number and your customers can message you on that number. During verification, select the âCall meâ option to receive the code over a phone call.<br><br>â¢ RUN BOTH WHATSAPP MESSENGER AND WHATSAPP BUSINESS: You can use both WhatsApp Business and WhatsApp Messenger on the same phone, but each app must have its own unique phone number. <br><br>â¢ WHATSAPP WEB: You can more efficiently respond to your customers right from your computer\\\'s browser.<br><br>WhatsApp Business is built on top of WhatsApp Messenger and includes all the features that you rely on, such as the ability to send multimedia, free calls*, free international messaging*, group chat, offline messages, and much more.<br><br>*Data charges may apply. Contact your provider for details.<br><br>Note: once you restore your chat backup from WhatsApp Messenger to WhatsApp Business, you will no longer be able to restore it back to WhatsApp Messenger. If you would like to go back, we recommend that you copy the WhatsApp Messenger backup on your phone to your computer before you start using WhatsApp Business.<br><br>----------------------------------------------