(86, 93, 'Sick of endless racing games with third person perspective? Racing in Car is the best mobile racing game you have been looking for. You drive your car in cockpit view through the endless traffic and realistic environment. Tilt your device to drag your car wherever you want, overtake traffic, earn coins and buy new cars.<br><br>Features<br>- Easy to learn and drive<br>- 3D realistic cockpit view<br>- Endless game mode<br>- Different locations and cars to choose<br>- Simulator-like controls<br><br>Try Racing in Car now to see how far the mobile racing experience come nowadays.', 'https://lh3.googleusercontent.com/zvKQ4IArTMB5a2hOQ8HF9vEGckb5zy3i2WVaXbGVC5prUDFDYdpU8mh8tjM8xNt8eLk=s180', 4.2, '[{\"type\":\"Updated\",\"info\":\"November 22, 2016\"},{\"type\":\"Size\",\"info\":\"38M\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.0\"},{\"type\":\"Requires Android\",\"info\":\"2.3.3 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a0120.00 - \\u20b9\\u00a0410.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Fast Free Games\"},{\"type\":\"Developer\",\"info\":\"dzkdes@gmail.comPrivacy PolicyEtlik Ankara\\/Turkey\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/NUG2DSHektGXSrXVTXYNlPhUjcuXcV4xEvgAGOhQ8kAHNI3o_iNWil5DW-jZ0yuy1K7Y=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/Tek7Q4Y44e0YZY9KecKXKNHivOE5E-9XWKxTwxJE8J2uObLgg0jOqml5VPPEFeXg9Zo=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"