(87, 94, 'KineMaster is a full-featured video editor for Android. KineMaster has powerful tools that are easy to use, like multiple video layers, blending modes, voiceovers, chroma key, speed control, transitions, subtitles, special effects, and so much more! Find out why creators love KineMaster for YouTube, TikTok, and Instagram and why journalists, educators, marketers, and vloggers use it professionally! Download KineMaster to create, edit, and share your own amazing videos! <br><br><br><b><u>Features</u></b><br><br>â¢ Multiple layers of video, images, stickers, special effects, text, and handwriting <br>â¢ Blending modes to create startling, beautiful effects <br>â¢ Add voiceovers, background music, and sound effects <br>â¢ Editing tools to trim, splice, and crop your video <br>â¢ The Asset Store provides music, clip graphics, fonts, stickers, transitions, and more to enhance your video, updated weekly <br>â¢ Speed control for time lapse and slow motion effects <br>â¢ Auto volume, ducking, and volume envelope tools for immersive audio <br>â¢ Keyframe animation tool to add motion to layers <br>â¢ Multiple aspect ratios supported <br>â¢ Export 4K 2160p video at 30FPS <br><br>â¢ Share on YouTube, Facebook, Dropbox and more<br>â¢ Many, many more features, options, and settings! <br><br>For more details, questions and enhancement requests, please contact us: Tap on the question mark button on the KineMaster main screen, then tap E-mail support!<br><br><br><b><u>Permissions</u></b><br><br>KineMaster requires access to your phoneâs camera and microphone if you want to record videos or sound directly in the app. KineMaster also requires access to your phoneâs storage in order to save projects you are working on (projects are saved externally in a folder called âKineMasterâ so that you donât lose anything if you reinstall or clear the app data).<br><br><br><b><u>Subscription</u></b><br><br>KineMaster is free to use, but a watermark is added to videos and Premium assets and some tools are not available. With the purchase of a monthly or annual subscription to KineMaster Premium, the watermark is removed, all the editing tools are unlocked, and all items in the KineMaster Asset Store may be downloaded. You can subscribe to KineMaster Premium from within the app. Subscriptions to KineMaster Premium automatically renew unless you cancel in Google Play.<br><br><br><b><u>Supported OS and Devices</u></b><br>â¢ KineMaster can be used on most devices running Android 4.1.2 (Jelly Bean MR2) and above, but you will have the best editing experience using a device with powerful video decoding capabilities. See here for more details: https://goo.gl/0jNXBy', 'https://lh3.googleusercontent.com/6TKqdBcu3XvTWGRlfclOn35VWSX1zuwgpDxYfh29W53pIbCuD1gZ6_Uxe_mLk0n6QQg=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"April 4, 2019\"},{\"type\":\"Size\",\"info\":\"52M\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"4.8.13.12545.GP\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"In-App Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a056.11 - \\u20b9\\u00a02,321.66 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"NexStreaming Corp.\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport@kinemaster.comPrivacy Policy3rd Floor, Kunyoung Building\\n56 Baumoe-ro 37-gil, Yangjae-dong, Seocho-gu\\nSeoul,  06744\\nRepublic of Korea\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/EzTQUhOJxWg\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/I3Lenv2Ewe9z5WnI0iEMcCnhbLoutSIAHlBuSUNs6fIxt4TXSV8DefXoPOQptm9Z6LU=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/sx0BgTkmJjUlr3qDiSM91VoL0Czt0AreW4d1LtLrJ_TIfB9vll-rWcBnBsxbaNz3KKzy=w720-h310\",\"data:imag