(88, 95, 'Experience intense multiplayer combat with up to 6 players online or 12 using local wi-fi. Train with the Sarge and sharpen your skills in offline Training, Co-op and Survival modes.  Shoot a multitude of weapon types including the sniper, shotgun and flamethrower.<br><br>Features explosive online and local multiplayer warfare!  Intuitive dual stick shooting controls.  Open world maps utilizing rocket boots for extended vertical flight.  Zoom control, melee attacks and dual wield ability with modern and futuristic heavy duty weapons and grenades.  Play team based battles in this fun cartoon themed cross between Soldat and Halo.<br><br>Mini Militia - Doodle Army 2 aka DA2, based on the original stickman shooter Doodle Army, was created based on player feedback and suggestions. We love to hear your ideas so thank you and keep them coming!  Give a call out to Sarge from the in-game email link!<br><br>Purchase the Pro Player Pack to get full access to dual wield ability, extra avatar customization items and online weapons such as the rocket launcher, sniper rifle, laser, saw gun and more!', 'https://lh3.ggpht.com/PngI3eCj8wt9sz7zmbd3H8TC7AV4OxoZWeI9tvbn1IJlfh3nlmMnp55WTM51PodR9QZt=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"January 11, 2019\"},{\"type\":\"Size\",\"info\":\"50M\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"4.2.8\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 12+Moderate ViolenceLearn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact, Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a034.00 - \\u20b9\\u00a0159.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Miniclip.com\"},{\"type\":\"Developer\",\"info\":\"Visit websiteminimilitiasupport@appsomniacs.comPrivacy PolicyMiniclip SA\\n