(92, 99, 'Offroad transport truck driver 2019 is not an ordinary game like other truck driver games or offroad jeep driving games. In this 6x6 offroad jeep driving adventure game you have to drive various models of trucks and 4x4 jeeps on the impossible tracks of the offroad environment. Fear of death is spread everywhere due to blind turns of highly curvy roads. So drive carefully for completing all the challenging missions. <br><br>Enjoy the real mud tracks by driving an offroad jeep and get amused by the crazy offroad adventure on impossible tracks. Accelerate your 8x8 offroad jeep as a real car driver and transport cargo loaded on the jeep from one hill station to other uphill station. Get yourself ready for extreme offroad driving on giants jeeps fully loaded with a variety of cargo items.<br><br>It\\\'s time to show the skills of professional driving of heavy-duty trucks fully loaded with a variety of items like wooden logs, heaps of hay and other cargo drums. Keep driving your trucks and jeeps on high mountains, hills and on deep steep paths around the jungle. You have to grasp the steering very careful while driving on the blind turns and on the twisty roads for delivering the cargo safely on specific points.<br><br>It\\\'s time to take the long drive on the giant transporter trucks to transport cargo towards the areas where small vehicles are not reachable. Rural areaâs people are looking for the cargo trucks to be delivered on time for their survival in severe weather condition. Your main challenge is to deliver your cargo jeeps and trucks to the needy people in extreme weather and on highly deadly tracks.<br><br>There are multiple American trucks are available in the game store for you. You have to purchase them with the in-game currency, the more you would complete the challenging missions the more you will get the reward for purchasing big trucks. This game will let you help the people stuck in the dangerous and unreachable hilly areas. Play maximum for saving the people. <br><br>*** Features of Offroad Transport Truck Driving - Jeep Driver 2019 ***<br>* multiple challenging missions<br>* variety of big trucks and jeeps<br>* different weather conditions<br>* realistic 3d hilly environment<br>* amusing sounds<br>* compatible with the variety of devices<br>* smooth controls<br>* best among all free truck driver games<br><br>Just hit the install the button without wasting any time and enjoy extreme offroad truck driving on your devices.', 'https://lh3.googleusercontent.com/X12A2yhk1iHohCHM7lz-qz1EN0-qQXXLSztf5g5aNsJ9odxC998G0vrJAC8ZARmtmQ=s180', 3.9, '[{\"type\":\"Updated\",\"info\":\"April 5, 2019\"},{\"type\":\"Size\",\"info\":\"52M\"},{\"type\":\"Installs\",\"info\":\"5,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.0.2\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a0270.00 - \\u20b9\\u00a0520.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Futuristic Game Studio\"},{\"type\":\"Developer\",\"info\":\"futuristicgamestudio@gmail.comPrivacy PolicyLahore,Pakistan\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/a69IJDqhbDU\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/7SryY37FJRiEMtKDFBANI3u1_a7Y7Zgip9aOX2siOUq8H-vzeR7OCywpo4D45guVzC2z=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/4Dkgm4BGMyLoMWD6CsLotjxQenxLMCzVX3xHkQdwXXW4qkLJrSiWsY3UQjROuscadQ=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTA