(98, 105, 'Pure instant messaging â simple, fast, secure, and synced across all your devices. Over 200 million active users in four years.<br><br>FAST: Telegram is the fastest messaging app on the market, connecting people via a unique, distributed network of data centers around the globe.<br><br>SYNCED: You can access your messages from all your devices at once. Start typing on your phone and finish the message from your tablet or laptop. Never lose your data again.<br><br>UNLIMITED: You can send media and files, without any limits on their type and size. Your entire chat history will require no disk space on your device, and will be securely stored in the Telegram cloud for as long as you need it.<br><br>SECURE: We made it our mission to provide the best security combined with ease of use. Everything on Telegram, including chats, groups, media, etc. is encrypted using a combination of 256-bit symmetric AES encryption, 2048-bit RSA encryption, and DiffieâHellman secure key exchange.<br><br>POWERFUL: You can create group chats for up to 200,000 members, share large videos, documents of any type (.DOC, .MP3, .ZIP, etc.), and even set up bots for specific tasks. It\\\'s the perfect tool for hosting online communities and coordinating teamwork.<br><br>RELIABLE: Built to deliver your messages in the minimum bytes possible, Telegram is the most reliable messaging system ever made. It works even on the weakest mobile connections. <br><br>FUN: Telegram has powerful photo and video editing tools and an open sticker/GIF platform to cater to all your expressive needs.<br><br>SIMPLE: While providing an unprecedented array of features, we are taking great care to keep the interface clean. With its minimalist design, Telegram is lean and easy to use.<br><br>100% FREE &amp; NO ADS: Telegram is free and will always be free. We are not going to sell ads or introduce subscription fees. <br><br>PRIVATE: We take your privacy seriously and will never give third parties access to your data.<br><br>For those interested in maximum privacy, Telegram offers Secret Chats. Secret Chat messages can be programmed to self-destruct automatically from both participating devices. This way you can send all types of disappearing content â messages, photos, videos, and even files. Secret Chats use end-to-end encryption to ensure that a message can only be read by its intended recipient.<br><br>We keep expanding the boundaries of what you can do with a messaging app. Donât wait years for older messengers to catch up with Telegram â join the revolution today.', 'https://lh3.googleusercontent.com/jVXglyWWL5J2y1vRN-7Jy3_ozvvZc4w5486IAkbAIrWcNN_vn7YuIvhc1JDtGq43BqGl=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"March 26, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 12+Parental Guidance RecommendedLearn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Telegram FZ-LLC\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport@telegram.orgPrivacy PolicyBusiness Central Towers, Tower A, Office 1003\\/1004, P.O. Box 501919, Dubai, United Arab Emirates\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/4DD8TT_D5EWoHd7G03MX99MZSpAJVsdX2d14QJiwb2gGT1DrwgGlKJao0a8dWpAUlCc=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/OS7iPb4kgHjPLNCP7MSWu1D0OOVJJT05030B5cPxbHHEgo1Ter-U3pbVzqfkS5ETaxZk=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\