(100, 107, 'Only for Tata Sky Subscribers. <br><br>Now carry your Personal TV wherever you go. Watch Live TV with 400+ channels and catch your favourite shows and movies on demand from over 5000+ titles!<br>Check balance and due date, do a quick recharge, browse the channel schedule or if need be chat with us, email or even call us. <br>Manage everything related to your Tata Sky account from here - add, drop and modify your subscription pack, order showcase, raise and track service requests through MyTataSky within this app. <br>Thatâs not all, you can also use this app to set reminders and record your TV programs on your set-top box. <br><br>Highlights:<br>Features that can be used by all Tata Sky subscribers:<br><br>- Watch Cricket 2018 live streaming â Australia v India 2018 &amp; New Zealand v India<br>- Now enjoy real time live streaming of flagship sporting events â WWE, Premiere League, UEFA league, Pro Badminton League.<br>- Live TV: Stream live TV channels across genres like sports, news, entertainment and many more. (Language)<br>- Latest TV Shows: Watch your favorite TV shows like Taarak Mehta ka Ooltah Chasma, The Kapil Sharma Show, Khatron Ke Khiladi, Bhabhiji Ghar Par Hai, Super Dancer Chapter 3, Kundali Bhagya, Naagin 3, Mazya Navryachi Bayko, Tula Pahate Re.<br>- On Demand: Stream and download thousands of videos from our vast library of Bollywood and Hollywood movies, TV shows, short web videos. Also stream the last five days\\\' episodes of your favourite TV shows<br>- Download &amp; Go: Download your favorite videos on your device and watch them later offline.<br>- Schedule: Browse through 3-day program listings with synopsis.<br>- Recharge: Now recharge your Tata Sky account in simple steps from the app.<br>- My Tata Sky: View your Tata Sky account summary and current pack details <br><br>Tata Sky is a live streaming app that lets you watch your favourite shows, movies, sports &amp; live news on-the-go on your Android/iOS device for free. Tata Sky gives you the ability to pause and play along with live TV. Now do your Tata Sky recharge online through app in a hassle-free way. You can manage your Tata Sky account and get help at any point of time without the need to access the website. Tata Sky gives you the best of entertainment on the go with your favourite channels and so much more! It is the easiest and quickest way to have access to Live Indian TV channels, Hindi Movies, South Indian and International Movies, Live Sports, Breaking News, gossip, devotion and more.<br>Watch the best of Tata Sky Live TV channels with Sony, Star Plus, Colors, Zee TV, SAB, &amp;TV; Live News with Aaj Tak, ABP News, NDTV India, India TV, News 24, Republic TV; Regional Content with ABP Majha, ETV Telugu, Gemini TV, ETV Telugu, Colors Kannada, Gemini Movies; Movies with Zee Cinema, Sony Max, Movies OK, B4U Movies; and devotional with God TV, MH One Shraddha, Pragya &amp; Aastha TV.<br>This can be simply activated with your existing Tata Sky account. Video streaming supported on all mobile network operators. Note that content streaming will not be available outside India. <br>Tata Sky brings you trending &amp; most popular English movies, Hindi Movies, Marathi Movies, Bengali Movies, Odia Movies, Tamil Movies, Telugu movies, Kannada movies and Gujarati Movies. <br>On Tata Sky App, you can watch live cricket matches, Hockey, Badminton, Vivo Pro Kabaddi live stream, Premier league live, and football live stream with a single click<br><br>Note: <br>To optimally enjoy the app, you will require 3G/4G/ Wi-Fi broadband connection<br>For more information on the app visit: https://www.tatasky.com/wps/portal/TataSky/tsky-app-download', 'https://lh3.googleusercontent.com/jbYoBUdE1HeXBw3V68srEePdCWWSZDeZpVtaT-Lnp6Id95ziYKicdr27LVh5isdoIUDI=s180', 3.9, '[{\"type\":\"Updated\",\"info\":\"February 5, 2019\"},{\"type\":\"Size\",\"info\":\"24M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"9.3\