(101, 108, 'Wynk Music is the one-stop music app for the latest to the greatest songs that you love.<br> <br>From latest Bollywood hits to trending International artists - with over 3 million free songs weâve got it all covered. Pop, Rock, Bhangra, Devotional, Romantic, Dance, Party, Old Classics - whatever your choice of genre, you will find it here. Along with Hindi &amp; English, enjoy music across languages such as Punjabi, Telugu, Tamil, Bhojpuri, Bengali, Assamese, Malayalam, Gujarati, Rajasthani, Marathi, Oriya &amp; Kannada.<br> <br>More reasons to start Wynk-ing:<br>â¢ High quality music streaming<br>â¢ Personalised recommendations<br>â¢ Thousands of curated playlists<br>â¢ My Station: non-stop music personalised for you<br>â¢ Manage all your music in one place<br>â¢ Follow artists and playlists<br>â¢ Create your playlists and share with friends &amp; family<br>â¢ Search from more than 3 million songs<br>â¢ Free music streaming at low internet speeds<br>â¢ Internet Radio for hours of uninterrupted music<br>â¢ Song &amp; album purchase<br>â¢ Support for Chromecast<br>â¢ and much more...<br> <br>With Wynk Music, you donât need another music player to play your MP3 songs. It works as an MP3 Player too!<br><br>The song library gives you trending songs from the worldâs most popular artists such as Ed Sheeran, Taylor Swift, Justin Bieber, The Chainsmokers, Rihanna, Shakira, Avicii among others.<br><br>If itâs Bollywood music that you want, then take your pick from the best of Arijit Singh, AR Rahman, Badshah, Yo Yo Honey Singh, Atif Aslam, Lata Mangeshkar, Mohammed Rafi, Kishore Kumar, Rahat Fateh Ali Khan and many more. You can download old &amp; new songs starring Bollywood actors like Deepika, Ranbir, Katrina Kaif, Salman Khan, Alia, Ranveer Singh, Hrithik, Anushka Sharma &amp; others.<br><br>The app offers the latest songs from hit Hindi movies such as Veere di Wedding, Raazi, Padman, Baaghi 2, Hate Story 4, Raid, Tiger Zinda Hai, Padmavat, Bareilly Ki Barfi, to name a few. Hindi Songs such as Bom Diggy, Dil Diyan Gallan, Swag Se Swagat, Mere Rashke Qamar, O Saathi, Ban Ja Rani, Dil Chori, Phir Bhi Tumko Chaahunga &amp; many more are also available on the app.<br><br>You can also groove to the latest Punjabi songs by the best artists in the industry. Songs such as High Rated Gabru &amp; Lahore by Guru Randhawa, Backbone &amp; Naah by Hardy Sandhu, 3 Peg by Sharry Mann, Na Ja by Pav Dhariya, Jaani Tera Naa by Sunanda Sharma &amp; many more.<br><br>If you are a fan of Telugu songs, you can listen to the songs such as Rangamma Mangamma from Rangasthalam, Bharat Ane Nenu from Bharat Ane Nenu and Lover Also Fighter Also from Naa Peru Surya. We also have a notable collection of Tamil songs. Go on loop mode with Tamil songs like High On Love from Pyaar Prema Kaadhal, Semma Weightu from Kaala and Kalyana Vayusu from Coco.<br><br>Subscribe to stream unlimited music without ads, online &amp; offline. If youâre an Airtel user, you get unlimited online streams &amp; song downloads for free!<br> <br>Wynk subscription features:<br>â¢ Unlimited Music without Ads<br>â¢ Unlimited in-app song downloads to play them offline<br> <br>To enhance your experience, weâll need your mobile permission to access media (to support song download &amp; MP3 play) and phone calls (for a seamless registration on your mobile number). <br><br>If you have reached till here, we are sure that you have liked at least something about us. To find more, we would really appreciate if you experience the actual app. So, click on the install button above to get started. We are sure youâll like it even more. :)<br> <br>Follow us on Twitter: http://www.twitter.com/wynkmusic<br>Like us on Facebook: http://www.facebook.com/wynkmusic<br>Listen on Desktop: http://wynk.in/music <br>Mail us for Feedback: contact@wynk.in<br>Rate us on Play Store if you like the app.', 'https://lh3.googleusercontent.com/pekXClYKVaYHIT8dM4WOsA7l7sNVfatNWP0zFzBaGrLvJk6FupFsr9NfvOBRmjKO_J8=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"April 4, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a010.00 - \\u20b9\\u00a01,000.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Airtel\"},{\"type\":\"Developer\",\"info\":\"Visit websitecontact@wynk.inPrivacy PolicyPlot 16, Udyog Vihar Phase 4, Gurgaon  - 122016\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/Hzdnz-bgfBi08U4yheIhBvrnVmIXghrAxXXqIzQ0GxkaIb8PKd611FJ_b6LIGGUgE_4=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/1FHrbdIcgOmoGUXSIEBhZuRdgliWAJzXd0MFgyBb9_jzqM7umYsh42JsoT9Get0FTfvc=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[]', '2019-04-07 19:12:14', '2019-04-07 19:12:14', NULL),
(102, 109, 'Racing Moto is a fast paced racing game. You never dare drive so fast in the real world! Control your moto with incredible fast speed during traffic rush time! Also enjoy beautiful view during the journey - desert, city, bridge, sea and forest! <br><br>Intuitive game rules:<br># Tilt phone to control moto direction<br># Tap screen to accelerate<br><br>Tips to win high score:<br># Keep accelerating moto so that the score will be boosted. The boost factor is shown on the right top of the screen.<br># Watch out indicator light. Vehicles may turn left or right. <br><br>Enjoy feeling super speedy moto racing!  Please give us your feedback, rate or comment if you like this game!', 'https://lh3.ggpht.com/8njkQkujJ16qvSUhGUpYB75Rb4bFMbJCTC9n8Ekx_wUnOAeLtzx2GQbjzvwiJ-zYMRNn=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"July 3, 2018\"},{\"type\":\"Size\",\"info\":\"7.4M\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.2.13\"},{\"type\":\"Requires Android\",\"info\":\"3.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Droidhen Casual\"},{\"type\":\"Developer\",\"info\":\"Visit websitemobilehzcn@gmail.comPrivacy Policy\"}]', '[\"https:\\/\\/lh3.ggpht.com\\/0cS48TVJjbWyqCKLRoApiV_QdOqAx6LQlVKNSYF4xSuow9ODyKbRuaah2QFg82ph73o=w720-h310\",\"https:\\/\\/lh3.ggpht.com\\/FwVsb3q0VRgYB7EhRa2pp4altINSkJpl-cjx6OCO3STDv_PqrVTfEgJTan55Upl9w-S0=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",