(105, 112, 'The worldâs No. 1 mobile document scanning and sharing app!<br>* Installed on over 350 million devices in over 200 countries around the world<br>* Over 100,000 new registrations per day<br>* CamScanner, 50 Best Apps, 2013 Edition â TIME<br>* Top Developer â Google Play Store<br>* âThe application employs its own image cropping and enhancing algorithm that leads to clearer images.â â Makeuseof.com<br>* âCamScanner may just be the best deal for scanning documents on your phone.â â CNET.com<br><br>CamScanner helps you scan, store, sync and collaborate on various contents across smartphones, iPads, tablets and computers.<br><br>Features:<br><br>*Quickly Digitize Document<br>Just use your phone camera to scan and digitize all kinds of paper documents: receipts, notes, invoices, whiteboard discussions, business cards, certificates, etc. <br><br>*Optimize Scan Quality<br>Smart cropping and auto enhancing ensures the texts and graphics in scanned documents are clear and sharp with premium colors and resolutions. <br><br>*Extract Texts from Image<br>OCR (optical character recognition) feature recognizes texts in document images and extract them from images for later searching, editing or sharing. (Premium only)<br><br>*Share PDF/JPEG Files<br>Easily share documents in PDF or JPEG format with friends via various ways: post on social media, send attachment or document download link through email. <br><br>*AirPrint &amp; Fax Documents<br>Instantly print out any documents in CamScanner with nearby printer via AirPrint; directly select document and fax to over 30 countries from the app.<br><br>*Advanced Document Editing<br>Make annotations on documents with a full set of editing tools. Also adding customized watermarks are made available to mark your own documents.<br><br>*Quick Search <br>When you have plenty of documents, you can use Tags to categorize and easily find them. In addition, OCR for Search helps you find texts inside image and notes. Just enter one keyword, you can quickly find the document you want. (Registrants only)<br><br>*Secure Important Documents<br>If you want to protect confidential contents, you can set passcode for viewing important documents; also, while sending document download link, you can set password to protect others from seeing it.<br><br>*Sync across Platforms<br>Sign up to sync documents on the go. Just sign in to any smartphone, tablet or computer (visit www.camscanner.com ) and you can view, edit and share any document. (Registrants only)<br>Premium Subscription Service:<br>1. Edit OCR results and export as txt file<br>2. Batch download PDF files in web app<br>3. Share secured document downlink with others<br>4. Add extra 40 to the maximum number of collaborators<br>5. Add 10G cloud space<br>6. Everything benefit registrants enjoys<br>7. Everything paid app offers<br><br>Payment models for Premium subscription:<br>-$ 4.99/month<br>-$ 49.99/year<br>Please note the subscription is automatically renewed at the end of the period unless you choose to cancel the subscription.<br><br>CamScanner users scan and manage <br>* Bill, Invoice, Contract, Tax Roll, Business Cardâ¦<br>* Whiteboard, Memo, Script, Letterâ¦<br>* Blackboard, Note, PPT, Book, Articleâ¦<br>* Credential, Certificate, Identity Documentsâ¦<br><br>3rd Party Cloud Storage Services Supported:<br>-Box.com, Google Drive, Evernote, Dropbox, <br><br>The free version is an ad-supported version and scanned documents are generated are with watermark, plus a limit of 30 pages of adding annotations; Uploading to Evernote/OneDrive is only available for 7 days; Invite 10 collaborators per document at most.<br><br>Permission Overview:<br>1. Storage: CamScanner needs permission to store docs in your phone.<br>2. Camera: CamScanner needs permission to use camera to scan docs.<br>3. Phone: In order to bind Premium membership to your device or to ensure normal use without login, CamScanner needs to get your device ID.<br><br><br>Check out other INTSIGâs products:<br>CamCard - Business Card Reader<br><br>Weâd love to hear your feedback: asupport@intsig.com<br>Follow us on Twitter: @CamScanner<br>Like us on Facebook: CamScanner<br>Follow us on Google+: CamScanner', 'https://lh3.googleusercontent.com/eWYNxjXiub6-HqtwoS2d4bl-NkqcKgOHansSnXXqje8-K9XLRwflOgEYwSzPMicdAA=s180', 4.6, '[{\"type\":\"Updated\",\"info\":\"April 3, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a065.00 - \\u20b9\\u00a025,500.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"INTSIG Information Co.,Ltd\"},{\"type\":\"Developer\",\"info\":\"Visit websiteandroid_support@intsig.comPrivacy PolicyMilpitas,CA\\n95035\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/F27UuV-T5jQ\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/Z0ML97wKVqJ6deJOavg7AorWN1KIPFzJpEG-z3bgn9V13JrsppOpk5VXDCUDqntmnEM=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/CXNiBVSAaomLjf8hQ9p5Ay8H-zED_ey-Q35LvcJrB4bUb763Xd_jDsC3BnDmZgqH-fM=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;b