(106, 113, 'The OLX app is a fun, cool and easy way to buy and sell things around you. Is there something you do not need anymore? Or is there something that you have always wanted? Indiaâs largest classified marketplace, now brings you cool deals near you. Read through some of our salient features below.<br><br>Near you <br>We realize that buying and selling is easy when it happens nearby. Our App shows you cool items that are up for sale at great prices around you. Hop across to pick them up from your neighborhood. <br><br>All users 100% registered <br>We ensure that nobody is anonymous on OLX. You find only registered users. Get to know them by browsing their profile &amp; common friends. <br><br>Chat First <br>We are now a Chat First app. So no SPAM calls. People can only contact you via chat and you decide whether you want to share your number with them. Use shortcuts to make your chatting experience effortless.<br><br>Everything Sells<br>Everything sells on OLX - anything from cars, two-wheelers, mobiles, furniture, baby products, books, fashion, sports, electronics, musical instruments, pets, toys, â¦phewâ¦the list can go on.', 'https://lh3.googleusercontent.com/tYdcwxICaq7q-Qe_jmQ-2YIMfZ011Tap8PtWLOOpLx23LJLvqr_YziUqek9nBEdVJE8=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"April 5, 2019\"},{\"type\":\"Size\",\"info\":\"9.6M\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"13.11.03\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 12+Parental Guidance RecommendedLearn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact, Digital Purchases\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"OLX Global B.V.\"},{\"type\":\"Developer\",\"info\":\"Visit websiteandroidapp@olx.comPrivacy PolicyTaurusavenue 105\\n2132LS, Hoofddorp\\nThe Netherlands\"