(108, 115, 'AIM and SHOOT!  Download now for free one of the best FPS shooting games. Clash with the criminals on different scenarios full of action.<br><br>Sniper 3D AssassinÂ® in 7 words: great gameplay, awesome visuals and entertaining missions. And best of all? It\\\'s a free fps game to pass the time! Defend the victims from kidnappings to bomb attacks to a Vegas hitman: hostage survival is critical!<br><br>Features:<br>- Ultra realistic 3D graphics and cool animations<br>- Hundreds of thrilling missions<br>- Play in multiple battlegrounds, from huge cities to beautiful beaches<br>- Tons of letal guns and mortal weapons<br>- Addicting FPS gameplay<br>- Easy and intuitive controls<br>- Free game: play it both on your phone and tablet<br><br>Forget those dumb, repetitive shooting games. Here, your duty will include racing against time, exploding helicopters, killing zombies and quite a few shots in slow motion. Survival is necessary! But can you solve the puzzle, save the victims and kill only the right target hidden in the crowd? Can you stop the unknown virus from spreading? Will you take out the assassins in time? You received the call for duty of saving the people. Don\\\'t let their creed on you be in vain!<br><br>The best first person shooter (fps) action game! Be the best sniper in every environment! The combat is real, and you can be the hero.<br><br>â Hundreds of missions:<br>\\\"Alpha, Bravo, Charlie, do you copy?\\\" Find the target, aim, shoot. <br>Save the state secrets from the rogue agents and spies, and stop them from spreading a terrible virus. Do you have the skills? Help your country in the massive nuclear competition.<br><br>â The hostages are within the enemy fort. Will you storm in through the open, or sneak up at nite? <br><br>â El Diablo, the criminal king pin, is creating havoc in the city - will you end this rebellion?<br><br>â The enemy is racing to their target: don\\\'t let them reach it in time! <br><br>â Don\\\'t leave any zombies alive!! Are you prepared for all the action and adventure in this awesome fps shooting game? Can you guarantee the survival of the human race?<br><br>â Unlock awesome weapons and upgrade them with evolutions in the arsenal:<br>Buy the best Sniper rifles, assault rifles, shotguns or pistols that exist with the gems you earned in the game! Upgrade the ammo, the grip, and the calibre to get bullets that inflict more damage, have better range, scope, stability, or zoom. Will you choose the hunting rifle, the awesome assault mp5, a Glock or a Colt in the armory?<br><br>â Play it anywhere<br>Sniper 3D does not require you to be always online in order to have fun. You can enjoy it offline in the subway, while flying on a (real) plane, in the car on the road. From time to time, it may be necessary to download additional (free) content online.<br><br>â PvP mode<br>Try out the pvp mode: prepare your gun and hunt your enemy. The pvp mode will test your speed in killing and hunting. Take long and you will be dead. Follow the rules of your training and act! You can now join up with other players from around the world. Become the immortal sniper you were meant to be!<br><br>â Limited data usage<br>Our game will not consume tons of data from your mobile plan that you\\\'d want to use instead to surf the web, watch online videos and listen to free music. Have fun with limited data usage.<br><br>â Disclaimer<br>Sniper 3D AssassinÂ® is a free game but it contains mature content and optional in-app purchases for real money. You may want to keep away it from your kids and younger boys<br><br>Sniper 3D AssassinÂ® is brought to you by Fun Games For Free.', 'https://lh3.googleusercontent.com/YF7JzgviEWRZGqCFT3CiMooVirmXB-uBctKngM7CulATy9mLr7H1hA0xaZeDjMZD3w=s180', 4.6, '[{\"type\":\"Updated\",\"info\":\"March 13, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 18+Extreme ViolenceLearn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a064.53 - \\u20b9\\u00a07,700.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Fun Games For Free\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport+sniper3d@fungames-forfree.comPrivacy PolicyUnit A, 2\\/F, St. John\\u2019s Building, 33 Garden Road, Central | Hong Kong\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/qCUbfyWmFwk\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/FlYA-xKZLKpyMy882lnn-ZiiiAgZDX-j-WMSf4vEkSWA12MFVzjEuQL11EEJ2BCo4IGC=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/upDzasGb2nBSSWklbMrSEGIbwuc5MNufE25vRggoAsyLk0bNbUpwqhebK7FFMNuFGqx3=w720-h310\",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]', '[{\"url\":\"https:\\/\\/www.youtube.com\\/embed\\/qCUbfyWmFwk?ps=play&vq=large&rel=0&autohide=1&showinfo=0\",\"image_url\":\"https:\\/\\/i.ytimg.com\\/vi\\/qCUbfyWmFwk\\/hqdefault.jpg\"}]', '2019-04-07 19:12:14', '2019-04-07 19:12:14', NULL),
