(112, 119, 'Carrom Kingâ¢ is a fun to play board game for all ages. Put the coins in the pockets.<br><br>Carrom or Karrom, an Indian version of pool or billiards, was once played by the Indian Maharajas. In it you must use the striker to pocket the coins. So can you play like the Maharajas? Can you beat your opponent and bag the queen?<br><br>Now Coins system added. Play and win coins.<br><br>Play Carrom Kingâ¢ 3D in freestyle mode and pot either the black or white coins, each coin will grant you points, the one with the most points wins.<br><br>Or play with more precision in the Black or White Mode where you have to pot either only the white or only the black coins. The first one to pot all of their coins wins. <br><br>The queen is the most important coin in the game; it is worth 3 points alone. However, in order to bag the queen, you must give her a cover as well. This means that you must pocket one coin immediately after pocketing the queen. Can you bag the queen before your opponent?<br><br>Do you have what it takes to play carom king? Play the 3D game against the Computer or against your family and friends in Local Mode. Check the leaderboards to see who the best Carrom player amongst you is. Who will the winner be? Play now and see.', 'https://lh3.googleusercontent.com/aWBquR65Ou6G_ErPUx5wKjzKa2_xb6sU7LS2Lq0cj2eB2-K3B7X5PsMsvfyPkDS-rbk=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"November 30, 2018\"},{\"type\":\"Size\",\"info\":\"20M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.4\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a070.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Gametion Technologies Pvt Ltd\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport@ga