(131, 138, 'Food Delivery For Your Budget<br><br>Hungry? Order restaurant food easily with the Uber Eats app. Track your food order in real-time. Get your food delivered in minutes to your door. <br><br><b>FIND YOUR FAVORITE RESTAURANTS</b><br>Browse nearby restaurants and search for food by cuisine, restaurant name, dish, meal, and diet. Choose from a variety of food to order: Pizza. Burritos. Burgers. Sushi. Chinese food. Skip the line and reservations. Order food with Uber Eats.<br><br><b>SIMPLE ORDERING</b><br>Pick your food order from any menu and add it to your cart with a few taps. Thatâs it.<br>Order food to be delivered as soon as possible<br>Or, schedule your food order in advance for a later delivery time. Your choice!<br><br><b>EASY PAYMENT</b><br>Pay easily with a credit card or Uber Cash. Add a different card easily. <br>Enter a Uber Eats promo code to redeem a discount on your food order.<br>Tip the Eats courier in the app. No cash needed for tipping.<br><br><b>REAL-TIME ORDER TRACKING</b><br>Track your food order on a map as it heads your way.<br>See the estimated delivery time to your address.<br><br><b>DELIVERY IN MINUTES</b><br>Track the delivery time of your food order by-the-minute. Get notified when your order arrives.<br><br><b>RESTAURANTS INCLUDE:</b><br>McDonald\\\'s, Subway, Popeyes Louisiana Kitchen, Starbuck\\\'s, Five Guys, Panda Express, Denny\\\'s, Jersey Mike\\\'s Subs, T.G.I. Friday\\\'s, Hooters, Sonic, Red Lobster. Firehouse Subs, Moe\\\'s Southwest Grill, BurgerFi, Tropical Smoothie Cafe, Boston Market, Qdoba, Steak \\\'n Shake, The Halal Guys, Anthony\\\'s Coal Fired Pizza, Tijuana Flats, Church\\\'s Chicken, White Castle, McAlister\\\'s Deli, Jack in the Box, On The Border, Fatburger, Romano\\\'s Macaroni Grill, Famous Dave\\\'s Barbeque, and more.<br><br><b>AVAILABLE INTERNATIONALLY</b><br>Uber Eats is currently available in cities and metro areas including Abu Dhabi, Adelaide, Amsterdam, Atlanta, Auckland, Austin, Baltimore, Bangkok, Bogota, Brisbane, Brussels, Cape Town, Chicago, Dallas, Denver, Dubai, Hong Kong, Johannesburg, Glasgow, Liverpool, London, Los Angeles, Madrid, Melbourne, Mexico City, Miami, Milan, Moscow, Mumbai, Nashville, New Delhi, New Orleans, New York, Ottawa, Paris, Philadelphia, Rio de Janeiro, San Diego, San Francisco, Sao Paulo, Seattle, Singapore, Stockholm, Sydney, Taipei, Tokyo, Toronto, Vienna, Warsaw, and Washington DC.  Uber Eats helps you find food delivery around the world. Order delivery in Australia, Belgium, Brazil, Canada, China, Colombia, France, Japan, India, Singapore, South Korea, Mexico, New Zealand, Poland, Russia, South Africa, Spain, Taiwan, Thailand, United Arab Emirates, United Kingdom, United States, and more.<br><br><br>Visit <a href=\\\"http://www.google.com/url?q=http%3A%2F%2Fubereats.com&amp;sa=D&amp;sntz=1&amp;usg=AFQjCNHWAYP0qp2EFN1ddnhUlmf2jBeRYA\\\">ubereats.com</a> for more details!', 'https://lh3.googleusercontent.com/jiojOn-g8QB5xr6jFcbkNkKG9Av1g-UpTz0Dj2RV5q4De2ZmUyXx7T610DU47VGO7BQ=s180', 4.2, '[{\"type\":\"Updated\",\"info\":\"April 2, 2019\"},{\"type\":\"Size\",\"info\":\"38M\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.194.10002\"},{\"type\":\"Requires Android\",\"info\":\"5.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Shares Info\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Uber Technologies, Inc.\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport@uber.comPrivacy Policy\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/HJGS0Rlu2YhDxfCwac0EMw0ZPGU31YXveuQBl3t0GY4TttU1Ua9DzX9bGaNqVsR_4g8=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/K6eH9r0hYT21JPmQwZUzvrakfhpbyJwRu656SoYok7ldJPlG1Na7ZJkuThgREnCvUiw=w720-h310\",null,null,null]', '[]', '2019-04-07 19:15:22', '2019-04-07 19:15:22',