(133, 140, 'Coreader- QR Code &amp; Barcode Scanner, a powerful QR reader &amp; Barcode Scanner that supports all kinds of major barcode formats. Try it and you will find scanning has never been more convenient like that.<br><br><br><br>Coreader is extremely easy to use: simply point to QR or barcode you want to scan and app will automatically detect and scan it. No need to press any buttons, scan in just 1 second. <br><br><br><br><b>ãMain Features of Coreaderã</b>- <br><br>All in one: Scan QR codes and barcodes (all 1D &amp; 2D code types) to get Links, Text, Contact info. etc. all the formats code can be scanned by one-touch.<br><br><br><br>-Smart &amp; Fast: Multiple options for your QR scan result. Reading, opening, sharing and so on, just in your touch. <br><br>(all result types supported: URLs, Text, ISBN, Email, Contact, Calendar, Geo, Phone number, SMS, WIFI connection)<br><br>- Flashlight supported: Turn on the flashlight while scanning to avoid the invalid scan in the dark.<br><br>- View history: The scan history will be well saved, you can easily view your scan history at any time.<br><br>- Document Scanner supported. You can scan documents to PDF files in portable way.<br><br><br><br><b>ãHow to use Coreaderã</b><br><br>1.To scan QR code or barcode, you can simply open the app, point the camera at the code and the scanner will automatically recognize it<br><br><br><br>2.For different types of scanned result, there are varies options for you to choose. e.g. reading the text, sharing the link, dialing the phone number, sending e-mail, getting contact info. on your list and connecting WIFI etc.<br><br>3.If you are in the low-light circumstance when scanning the code, click the flashlight button to turn on the flashlight.<br><br>4. Try to view scan history, it could help you to review your scan record better.<br><br>5. This APP Includes but not limited to the following features:Tag reader, business card scanner, book scanner, store locator, food scann