(136, 143, '<b>Battle of Chepauk is a fun to play cricket game offering you hours of entertainment.<br><br>You own CSK, one of the best T20 teams! Your best players includes;  Suresh Raina, Ravindra Jadeja, Dwayne Bravo, and other greats, led by none other than the most successful captain India has ever had... the one and only Captain Cool, MS Dhoni!</b><br><br>Select your playing 11 (it\\\'s not going to be easy to decide who to leave out!), and get ready to conquer Chepauk, the stadium that has seen too many historic battles and victories on its hallowed grounds. <br>Here\\\'s your chance to create history.<br><br><b>Five exciting modes to play:</b><br>â¢	Super Over<br>â¢	Super Matches<br>â¢	Super Multiplayer<br>â¢	Super Chase<br>â¢	Super Slog<br><br><b>Super Over: </b>You have just one over to complete a nerve wrecking batting challenge! Every win takes you one step closer to final!! Now get sloggers and your power-hitters geared up!<br><br><b>Super Matches: </b>In Super Matches you get to chase a score which is based on the actual score from the real matches played by CSK during IPL.  Each match has got 3 objectives and played over for 20 overs length. <br>The primary objective is based on the match score set or chased by CSK in the event of IPL, the secondary and the tertiary objectives are loosely based on the match stats. The primary objective must be completed for the gamer to progress further, whereas the secondary and tertiary objectives are not mandatory to be completed in order to progress. <br><br><b>Super Multiplayer: </b>Play against 2 to 5 online players at the same time.<br><br>- Public Mode: Public mode allows you to compete against random players online. The match starts once the required players are on board.<br><br>- Private Mode: This mode lets you create a private room with the Room ID. Using the ID you can invite  people you know to compete against you. This addictive sports game allows you to choose to play either 2 or 5 overs match with your friends.<br><br><b>Super Chase:</b>In this mode you have six levels with 5 challenges per level with increasing targets to chase after. Every successful chase will unlock the next level where you will chase a higher target. So get cracking and get on top of the leaderboard with maximum points!<br><br>Levels:<br>â¢	CUB CLASS<br>â¢	YOUNG LION<br>â¢	POWER PLAYER<br>â¢	SUPER PRO<br>â¢	CHAMPION<br>â¢	PRIDE OF CHEPAUK<br><br><b>Super Slog:</b> Score as many points as you possibly can in 20 overs!! Fours and Sixes are sure to give you high points while dot balls, 1s and 2s will not be of much help. <br><br>Battle of Chepauk is brought to you by Chennai Super Kings, the most successful team in the IPL, and Nextwave Multimedia, developers of the most advanced mobile cricket game World Cricket Championship 2 (WCC2).<br><br>WCC2: https://play.google.com/store/apps/details?id=com.nextwave.wcc2&amp;hl=en_IN<br><br>Like Us: https://www.facebook.com/battleofchepauk<br><br>What are you waiting for? Top the Leaderboard by amassing the maximum number of points!! <br><br><b>Permissions Required: </b><br>- Contacts: To manage your account in the game and to access other game modes.<br>- Phone State: To get notifications on various updates and offers.<br>- External Storage: To serve you rewarded video ads to earn tickets within the game.<br>- Coarse Location: To serve you location specific ads &amp; offers.<br>- Record Audio:  To analyze media consumption and other device data and utilizing the same to target relevant content and ads to the device.', 'https://lh3.googleusercontent.com/NddHhpC9m6HrAnJpObqCQ1j3R8nRwrBxwPu2QG97SnewEzOHfGoWkSgSLKlJYehNzw=s180', 4.6, '[{\"type\":\"Updated\",\"info\":\"April 3, 2019\"},{\"type\":\"Size\",\"info\":\"57M\"},{\"type\":\"Installs\",\"info\":\"5,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.1.1\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\