(139, 146, 'NEW FREE MONSTER TRUCK RACING GAME IS FINALLY AVAILABLE ON GOOGLE PLAY!<br><br>Dominate your rivals in extreme head-to-head fire-breathing MONSTER TRUCK races! Yeah, the totally new monster truck racing simulator game is finally here! Jump behind the wheel of extremely powerful MONSTER TRUCKS, let the fire blaze merrily, race the fastest 4x4 offroad monster vehicles and feast your eyes with the fast jump filled racing on the beautiful, hills &amp; valleys packed American countryside!<br><br><b> FEATURES: </b><br>- Choose from the 30 extremely high-performance MONSTER TRUCKS!<br>- Enjoy extreme 3D visuals and have fun!<br>- Jump, jump, and jump! Perform the biggest and spectacular monster truck jump and stunts through hills!<br>- Prove your skills in hardcore challenges!<br>- Upgrade your vehicles with new tires, nitrous, exhaust, engine, gears, booster and body!<br>- Take part in the clash of energy monster truck drivers!<br>- Drive 4x4 cars and smash your rivals in head to head racing!<br>- Test your truck driving skills on muddy racing track!<br>- Conquer the top of the online leaderboards and dominate the world of monster trucks!<br>- The race for the glory, get the best racing results and become elite racer!<br>- Discover plenty of truck tunning options!<br><br>ENDLESS FUN &amp; VARIOUS RACE MODES<br>Have you ever wanted to drive a monster truck in real life? Great! It\\\'s about time to test your driving skills and decide on the truck category you would choose! Choose your favorite truck and test it in the Boss Battle Races, Ranking Races, Limited Races, Extreme Races, Single Contest and Daily Race mode! Climb to the top of the online leaderboards and smash other monster truck drivers!<br><br>WORLD OF MONSTER TRUCKS<br>Who has the best ride? You do! Race as fast as you can to become the top new monster truck driver in the world! US countryside is a heart of the extreme clash of fire-breathing, ultimately powerful Monster Trucks! Enjoy perfectly designed world with scenic valleys, hills, lakes, and railroads. Admire the amazing view, and keep your eyes on the road, rivals and the closest ramp! Speed up, compete in drag racing, dash, conquer the hill and uphill - the race is starting right now!<br><br>RACE, SPEED UP AND JUMP<br>If you are a fan of Monster truck games, Truck games or RC rally games, this game will be on your favorite games list. Once you want to get the best monster truck performance and speed but on the other hand, you always care about the best, possible truck design? Well, forget about casual arcade car racing! Perhaps you know a monster truck is a pickup truck modified with a larger suspension and larger tires, usually for recreational uses. Find a perfect solution with many options to customize and upgrade your fire-breathing vehicle and polish your gear.<br><br>DOMINATE AND CRUSH YOUR RIVALS<br>Racing Xtreme 2 gives you reasons you gotta go to a Monster Truck Show!  Being nice in this fast racing simulation has never been an option! Jump behind the wheel, speed up to reach the maximum, climb through the leaderboards and show your rivals, what are you made of! Mark your name in offroad monster truck competition by speed and strength. Get it now - jump in the middle of the offroad action! Get famous on the drag racing or die to try! <br><br>It\\\'s about time to get on your monster truck, customize, upgrade your gear, show how fast you are in the drag racing and your driving skills on the finish line! Your willing to fight will surely be tested, so get ready for the most intense racing game! Join the club of extreme racing drivers right now and climb to the top!<br><br>Download and play for extreme speed, amazing stunts, and adrenaline!<br><br>Other games: http://t-bull.com/#games<br>Facebook: https://facebook.com/tbullgames<br>Twitter: https://twitter.com/tbullgames', 'https://lh3.googleusercontent.com/P9TK8-80l-7FXgtP31_5UQTNm7HBZmo3ePyisjiA1vsp2GxyEz-FKudRi6MHzut51zL9=s180', 4.8, '[{\"type