(150, 157, '<b>Opera Mini is a lightweight and safe browser that lets you surf the Internet faster, even with poor Wi-Fi connection, without wasting your data plan. It blocks annoying ads and lets you easily download videos from social media, all while providing you personalized news. </b><br> <br><b>Top features</b><br><br>â¢ <b>Save data</b> - Save 90% of your data and browse faster even on slow networks with our famous compression modes without breaking your browsing experience.<br> <br>â¢ <b>Block ads</b> - Opera Mini has a built-in ad blocker so you can surf the web without annoying ads.<br><br>â¢ <b>Personalised news</b> - Catch up on trending news specially tailored for your interests with our rebooted news feed within the Opera Mini browser. <br><br>â¢ <b>Video download</b> - No time to watch videos? No problem. Tap the new download button and watch them when you\\\'re ready. <br><br>â¢ <b>Smarter downloads</b> - Download files in the background and hold off downloading large files until youâre back on Wi-Fi. Opera Mini will let you know when your downloads are complete. Just click the notification to open your download â no more digging around in folders.<br><br>â¢ <b>Browse privately</b> - Use private tabs to browse incognito and keep your secrets from others without leaving a trace on your device. <br><br>â¢ <b>Tab gallery</b> - Keep several pages open at once with tabs and easily navigate between different tabs.<br><br><b>Other great stuff</b><br><br>â¢ Night mode: Dim the screen to save your eyes when reading in darkness.<br><br>â¢ Save your favorite sites: Tap the <b>+</b> button on the search bar to save a page to your Speed Dial, add it to your mobile bookmarks, or store for offline reading.<br> <br>â¢ Sync your devices: Give yourself access to all the bookmarks, Speed Dial shortcuts, and open tabs from your other devices.<br> <br>â¢ Switch up your search: Assign your favorite default search engine.<br><br>Download Opera Mini and try one of the fastest ways to browse the web on your mobile device.<br> <br>To learn more about the specific permissions Opera Mini uses, please visit the follow page: http://www.opera.com/help/mini/android/permissions<br><br>Do more with Opera: https://www.opera.com/mobile/android<br><br>Opera may show ads from Facebook. To learn more, see https://m.facebook.com/ads/ad_choices<br><br>Keep in touch:<br>Twitter â http://twitter.com/opera/<br>Facebook â http://www.facebook.com/opera/<br>Instagram â http://www.instagram.com/opera<br><br><b>Terms &amp; Conditions:</b><br>By downloading this application, you are agreeing to the End User Licence Agreement at https://www.opera.com/eula/mobile. Also, you can learn how Opera handles and protects your data in our Privacy Statement at https://www.opera.com/privacy.', 'https://lh3.googleusercontent.com/CrsX4NgCfgY1B8ry-cP0qdEgR7cB7717qmVajenGgWuh5t7jCg6cRQxLi1c73hj3iQ=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"March 5, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases, Unrestricted Internet\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Opera\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport-mini-android@opera.comPrivacy PolicyGjerdrums vei 19\\nNO-0484 OSLO\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/Y7QBei_BwMMjWHIpkT1NzQ26aD9kFJpK5QYV2g1PkyBykht_xBwO-tHeyOjX7Rb1lpc=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/Uia0q-cZEbRzaorbYkcv_XkMOZLPskGk8BOIzbK5Vy6KM5P602suVHEIZNp_SrCG0w=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw=