(151, 158, 'Hi Players,<br><br>As you know Chess is one of the oldest strategy games in the world.<br>Chess is an excellent board logic game that develops such skills as tactics, strategy, visual memory.<br>I tried to create an application that allows a player of any level to enjoy the game.<br><br>Chess pieces:<br><br>- The pawn moves to one field forward or two fields at the first move of this figure, beats diagonally to one field forward.<br>- The king moves to one field in the vertical, horizontal or diagonal.<br>- The queen moves to any distance vertically, horizontally or diagonally.<br>- The rook moves to any distance vertically or horizontally.<br>- The knight moves to the field, which is in two fields along the vertical and one horizontally or one field vertically and two horizontally.<br>- The bishop moves to any distance diagonally.<br><br>The goal of the game is to checkmate the other king.<br><br>- Check - the situation in chess, when a king is under immediate attack by opponent\\\'s pieces<br>- Checkmate - the situation in chess, when the player whose turn it is to move is in check and has no legal move to escape check.<br>- Stalemate - the situation in chess, when the player whose turn it is to move has no legal move and is not in check. (draw)<br><br>Two special moves in Chess:<br><br>- Castling is double move, which is performed by the king and the rook, that never moved.<br>- En passant is a move in which a pawn can take an opponent\\\'s pawn if it jumps over a field under the pawn\\\'s blow.<br><br>Features:<br><br>- Ten difficulty levels<br>- Game Assistant (Helper)<br>- Undo-free stars for levels<br>- Six different themes<br>- Two board view (Top - 2D and Front - 3D)<br>- Alternately mode<br>- Two player mode<br>- Realistic graphics<br>- Save function<br>- Sound effects<br>- Small size<br><br>If you want to play good Chess, you can help me make app better.<br>Please write your feedback and suggestions here, I will read them and improve the quality of the application!<br><br>Thank you.', 'https://lh3.googleusercontent.com/Ec3ROPU7Xd__hAVe6QkUMR2t4uVUGPoVOmQ52dSeJnpy5Dx4VpGsuMRAVLi6wbDRFNw=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"March 24, 2019\"},{\"type\":\"Size\",\"info\":\"2.3M\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.5.4\"},{\"type\":\"Requires Android\",\"info\":\"4.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a070.00 - \\u20b9\\u00a0240.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Chess Prince\"},{\"type\":\"Developer\",\"info\":\"help.chess@mail.ruEsenina 8\\nMinsk 220025\\nBelarus\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/3sGnqVrVwTw\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/jGclFbg8xNeXRzd_FGEBvk1RKgrPJ4UTaSeM8pxvz1DMq7NKGy4QvaTs53mayMx7tH0=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/-b6U-9tUKP6-tInokhw5IMVQyqSbFujPp5tQjOrHwRnK69OUqwpkjdki-qBFsjnyfKYQ=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAA