(154, 161, 'Cut the best part of your audio song and save it as your Ringtone/Alarm/Music File/Notification Tone. The cut results are stored in \\\"/mnt/sdcard/media/audio\\\".<br><br>Make your own MP3 ringtones fast and easy with this app. You can even record a live audio and this MP3 editor can edit and trim the best parts from it for free. Supports MP3, WAV, AAC, AMR and most other music formats. This app is also a music editor/alarm tone maker/ ringtone cutter and notification tone creator.<br><br>How to use Mp3 Cutter and Ringtone Maker:<br>1.Select mp3/music from your mobile or from Recordings.<br>2.Select area to be chopped from your audio.<br>3.Save as Ringtone/Music/Alarm/Notification.<br><br>App Features:<br>âª Record button at top left of app to record an audio/music for editing.<br>âª An Inverted Red Triangle to Select and Edit Mp3/Music from your Mobile/SD.<br>âª Option to delete (with confirmation alert) the created Tone.<br>âª View a scrollable waveform representation of the audio file at 4 zoom levels.<br>âª Set start &amp; end for the audio clip, using an optional touch interface.<br>âª Tap anywhere on the wave &amp; the builtâªin Music player starts playing at that position.<br>âª Manually set the Start &amp; End time(in seconds) by typing the values in text boxes at bottom of app.<br>âª Option to Name the new cut clip while saving it.<br>âª Set the new clip as default ringtone or assign to contacts, using this editor.<br><br>Use this audio cutter free of cost and make the best ringtone ever from your old songs.', 'https://lh3.ggpht.com/XsnHe7qwLO5Oz5togkJDFcDrdPu4a4vDzU1zs6ZTNTHIeEecJ2LyIV8daAwYT623xkQ=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"January 23, 2019\"},{\"type\":\"Size\",\"info\":\"2.3M\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.1\"},{\"type\":\"Requires Android\",\"info\":\"4.0.3 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Per