(156, 163, 'Subway Rider - Train Rush is the latest endless bike riding adventure. Tap to change the lanes of the train to dodge them. Keep collecting cash to reach the highest score and to be the best bikes ride. The motive of the game is very simple, keep dodging the tracks and survive without any crashes. <br><br>Upgrade with various bikes and use the unique boost to blast away other train from the tracks. You can also drive on to the ramps and jump on to the top of the oncoming train to be the stunt ride in Subway Rider - Train Rush. Explore various roads that go through city, railway tracks and pass between cars. Be careful not to crash into any one of them or your game is over. Are you ready for the ultimate 3D endless dodging racing ride game?<br><br>Subway Rider - Train Rush is equipped with smooth controls and is compatible with most of the devices. So what are you waiting for? Download to enjoy this simple one tap  game now! Rider Rush - Subway Trains takes the endless racing genre to a whole new level by adding a full career mode, first person view perspective, better graphics and real life recorded bike sounds', 'https://lh3.googleusercontent.com/IgshWtUa4HSWUol19_qEEf5dR3aupgMATixkHya0ynQ3EkJEbN7vTaMLHAmdAVuAZos=s180', 4.1, '[{\"type\":\"Updated\",\"info\":\"February 13, 2019\"},{\"type\":\"Size\",\"info\":\"41M\"},{\"type\":\"Installs\",\"info\":\"1,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.7\"},{\"type\":\"Requires Android\",\"info\":\"4.0.3 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a0140.00 - \\u20b9\\u00a09,500.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Timuz Games\"},{\"type\":\"Developer\",\"info\":\"Visit websiteinfo@timuz.comPrivacy PolicyHitech City,\\nHyderabad, T