(173, 180, 'FEEL the thrill of this exciting Euro Train Simulator - Train Games 2019 game! Once you are in the train, all control is yours. Release the brakes and drive at full speed! You will be entirely dependent on the signals and track changing switches. Be alert and fast to choose the right path for your train. Sound the horn and avoid all train accidents or your game will be over. <br><br>CHANGE the camera view as per your comfort in this exciting Euro Train Simulator - Train Games 2019 game. The railroad environment is self-sufficient and realistic. Enjoy theÂ crowded stations and realistic railway tracks. <br><br>STOP the train before you enter the danger zone and safely park in the railway station. Euro Train Simulator - Train Games 2019 will get you addicted to quick track changing, unique trains, multiple camera views and tremendous train speed to explore.<br><br>COMPLETE missions to earn game coins. You can spend those coins to buy new and faster trains. Euro Train Simulator - Train Games 2019 has a garage with many impressive trains to choose from. Each train is faster and more power packed than the other!<br><br>FEATURES of Euro Train Simulator - Train Games 2019:<br><b> Realistic simulator experience </b><br><b> Use cameras and simple controls to improve your driving </b><br><b> Stunning rail sound effects </b><br><b> Perfect 3D graphics and intense environment </b><br><b> Challenging railway tracks </b><br><b> Challenge &amp; Share with your friends! </b><br><b> Child user friendly </b><br><b> Unique trains to unlock </b><br><b> Easy to control and change tracks </b><br><b> Multiple camera views </b><br><b> HD Graphics </b><br><b> Addictive gameplay </b><br><br>Euro Train Simulator - Train Games 2019 is PERFECT for train enthusiasts, train lovers &amp; kids who love to play train games. Drive and operate the train, control the path of the train, pick-up and drop the passengers and earn money.', 'https://lh3.googleusercontent.com/F1WS7YG_X6Ju72UuFPVeS