(177, 184, '<b><font color=\\\"#1fc7c7\\\"> *** Exclusively for Jio SIM and Jio Network users *** </font></b><br><br>Jio4GVoice (earlier JioJoin) from Reliance Jio Infocomm Ltd now comes in a brand new avatar. Did you know that your regular smartphone is capable of giving you a crystal clear voice and video calling experience? Jio4GVoice enhances your non-VoLTE 4G phone with VoLTE capabilities. You can now use your non-VoLTE smart phone to make HD voice and video calls to any landline or mobile number anywhere in the world. You can also use these VoLTE features on your existing 2G/3G smartphones via JioFi.<br>Not just that, Jio4GVoice also marks the entry of Rich Communication Services (RCS) in India. RCS has exciting features such as Rich Call, Chat, Group Chat, file share, location share, doodles, stickers and many more are available.  <br><br><b>What Jio4GVoice does?</b><br>â¢	Jio4GVoice brings TRUE 4G/ VoLTE high-definition voice and video calling on your existing 2G, 3G, 4G smartphone. You can use Jio4GVoice with a Jio SIM either in the phone or in a JioFi connected to your phone. To turn your device from âsmartâ to âsuperâ all you need is a Jio SIM... Jio4GVoice will do the rest!<br>â¢	Enjoy Rich Communication features with any Jio4GVoice user on any smartphone, including VoLTE phones.<br><br><b>Features:</b><br>HD Voice &amp; Video Calling<br>Stay connected with friends, family and work across the globe. Make and receive calls from any other mobile/landline number, over 4G mobile data. You can also enjoy group conversations with multiple participants. Enjoy HD voice and video calling with fellow Jio4GVoice users.<br><br>Rich Call<br>Give your calls more life with customized messaging, images &amp; location on the receiverâs screen. Intimate the urgency of your call on the receiverâs screen by using the âUrgent Callâ feature. It is hard to ignore a call that says it all! <br><br>Unified Messaging for SMS &amp; Chat<br>With Jio4GVoice you can send and receive text messages from your Jio number to any mobile number. You can do group chats &amp; share images, videos, location and all types of files like .zip, .pdf to your Jio4GVoice contacts. Set Jio4GVoice as your default messaging app to manage all your SMS and chat threads in one Inbox.<br><br>Enhanced Calling from your phone dialer<br>Want to make a call? Forget fishing for the app. Simply go to your phone dialer, punch in the number or search for the contact name like you always do, and Jio4GVoice will smartly place the call through the app.<br><br>You can also use the cool Rich Call feature through the phone dialer! <br>Psstâ¦ want to make a plain call and not Rich Call, just hold the phone to your ear and the call will go through!<br><br>In Call Share <br>Calling made more fun! Express your thoughts with a quick doodle, share location of the party or sketch the direction to a meeting point in real time, all this while you are on a call. Share images &amp; chat messages instantly without disconnecting your call!<br><br>So just grab a Jio SIM, download the Jio4GVoice app and experience the new edge in communication!<br><br>This service is provided by Reliance Jio Infocomm Ltd.', 'https://lh3.googleusercontent.com/cwl1gQjaatDPaYHUolbcZ-ClJXCpBcYBsRFsLUHZIXWl-5oyPn5FK4_Fx3zA1Yfz4wk=s180', 4.1, '[{\"type\":\"Updated\",\"info\":\"March 4, 2019\"},{\"type\":\"Size\",\"info\":\"41M\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"5.2.2\"},{\"type\":\"Requires Android\",\"info\":\"4.4 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact, Shares Location\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Reliance Industries Ltd.\"},{\"type\":\"Developer\",\"info\":\"Visit websitecare@jio.comPrivacy PolicyReliance Corporate Park, Ghanso