(180, 187, 'Do you have multiple apps for making payments? Manage all your bank accounts &amp; bill payments with the all new BHIM App.<br>What is BHIM?<br>Bharat Interface for Money (BHIM) is an initiative to enable fast, secure, reliable cashless payments through your mobile phone. BHIM is interoperable with other Unified Payments Interface (UPI) applications and bank accounts for quick money transfers online. BHIM is developed by the National Payment Corporation of India (NPCI) as a part of the Digital India initiative, BHIM is the only online payments app that you ought to have. With BHIM, your smartphone becomes your bank. <br>What can I do with BHIM?<br>BHIM works on Unified Payments Interface (UPI), which is a revolutionary payments platform. The features of BHIM are as follows:-<br>Access all bank accounts in one app<br>Pay to friends &amp; relatives using their mobile number. (Provided they are on BHIM/UPI) <br>Pay to any user using any UPI application. <br>Shop online and checkout using âPay by UPI/BHIMâ for a quick and seamless experience. <br>Request money from any UPI user. <br>Scan a QR and pay on the fly. <br>Check account balance <br>Create one time mandate as a payment instruction in the future. <br>Set Payment Reminders.<br>Split bill among friends and family.<br>**Payment Rewards on BHIM**<br>New Users: Get Rs 150 cashback on completion of 10 unique transaction with minimum transaction value of Rs 50<br>What is new about the BHIM App?<br>UPI Mandates:You can now pre-authorize a transaction(mandate)via UPI , for the future payment . Your account will block the mandate amount immediately post mandate creation and the account will get debited when the mandate is executed. You will authorize the mandate creation by inputting the UPI PIN etc.<br>Gift on BHIM: Send Gift to BHIM/other app with greeting message to friends/family.<br>Overdraft Facility: - Introducing Overdraft facility on BHIM UPI. Link your Overdraft account on UPI and make Merchant payments on the go.<br>Signed Intent &amp; QR: Enhanced security feature which informs users about the authenticity of the receiver(merchant)while scanning a QR or initiating a merchant payment.<br>Support for Foreign Inward Remittance â Now receive funds from abroad using your BHIM UPI ID.<br>Invoice in the inbox*: Now you can view the invoice before making the payment.<br>Available only for verified merchants/please check authenticity of the invoice before making payment.<br>How does it work?â¨<br>To get started with the BHIM app, register your bank account with BHIM, &amp; set a UPI PIN for the bank account. Your mobile number is your Payment Address, &amp; you can simply start transacting. <br>â¨How to Transfer Money?Â â¨<br>Make Cashless Payments or receive money from friends, family and customers through a mobile number or payment address. Instant Money Transfer can also be made to an unregistered user using  UPI ID, Mobile number or Account number+IFSC. You can also collect money by sending a request and receive payments instantly if required.<br>Requirements:<br>â¨Before you register on the app, please ensure the following:<br>â¢ You have a valid Debit Card for your account<br>â¢ You have linked your Mobile Number with your Account<br>â¢ Your registered mobile no. is present in the same device as the BHIM app<br>â¢ You have registered your account for Internet/Mobile Banking<br>Supported Banks:<br>â¨â¨Visit our website https://www.npci.org.in/bhim-live-members to find out if your bank is live on BHIM.<br>More about BHIM:- <br>13 languages supported on BHIM (Assamese, Bengali, English, Gujarati, Hindi, Kannada, Malayalam, Marathi, Punjabi, Tamil, Telugu, Odia and Urdu.)<br>Transaction limit is Rs 20,000 per transaction and Rs. 40,000 per day (for 1 bank account) <br>BHIM app is compatible with Android 5.0 &amp; iOS 8.1 and above. (Works best on Android 6.1 &amp; above) <br>Terms &amp; Conditions:- https://www.bhimupi.org.in/terms-conditions<br>All State bank accounts (SBH, SBBJ, SBP, and SBT) are merged with SBI. If you have an account with any of them, please select SBI as your bank <br>For more information, visit https://www.bhimupi.org.in/', 'https://lh3.googleusercontent.com/B5cNBA15IxjCT-8UTXEWgiPcGkJ1C07iHKwm2Hbs8xR3PnJvZ0swTag3abdC_Fj5OfnP=s180', 4.1, '[{\"type\":\"Updated\",\"info\":\"March 9, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.6.3\"},{\"type\":\"Requires Android\",\"info\":\"4.2 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"National Payments Corporation of India (NPCI)\"},{\"type\":\"Developer\",\"info\":\"Visit websitecontact.bhim@npci.org.inPrivacy Policy\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/HSthWET5zaA\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/qoqIH2xD7kITgMp2unoWuJsXvpRmmWUVJw4wB7M3JcBNCkS0RJ6GhVYBQ908T5_ToBY=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/zOwG1jmNE3cTn_s9p4He0my-jlTnA1ByLo89Z6qXbGWjmdQST6Rc2Ru2oBL3mEcZSWU1=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[{\"url\":\"https:\\/\\/www.youtube.com\\/embed\\/HSthWET5zaA?ps=play&vq=large&rel=0&autohide=1&showinfo=0\",\"image_url\":\"https:\\/\\/i.ytimg.com\\/vi\\/HSthWET5zaA\\/hqdefault.jpg\"}]', '2019-04-07 19:40:04', '2019-04-07 19:40:04', NULL)