(181, 188, 'Play Ludo online with friends and be a star - play LUDO CLUB!<br><br>This is the online multiplayer version of the epic hit board game Ludo! Join an exclusive club of star players in this premium dice game - be the best player, climb the ladders of winning and become the KING OF LUDO!<br><br>Learn how to move your red, yellow, green or blue pieces with strategy and luck on best looking games board. Be the king of of Ludo and become a star! Compete against other players and reach the top of the leaderboard! Download and install for hours of fun and enjoyment.<br><br>Category :<br>Dice Game<br>Board Game<br>Fun Game<br>Quick Game<br><br>Exciting Features:<br>â¦ Play this dice game with friends and family<br>â¦ Connect to facebook and play the ludo game on different devices!<br>â¦ Use very little data - works smoothly on 2G, 3G, 4G!<br>â¦ Play Ludo the dice game in offline mode vs Computer and with your friends<br>â¦ Send gifts to co-players and friends<br>â¦ Chat with other players on your games board<br>â¦ Win FREE coins using our Daily Bonus and Lucky Dice features to keep playing!<br><br>Looking for hours of non-stop enjoyment on your phone? Install Ludo Club and play Indiaâs favourite board game from developers of Indiaâs favourite games Teen Patti Gold and Baahubali. The board game is available in loud, striking colours and beautiful design of board and dice for your mobile phone. <br><br>In India, itâs versions are Chopat, Chaupur, Pachisi or Parcheesi. It is also misspelt as lado, lodo, iodo and lido. Ludo the board game should not be confused for games like lotto and judo. Ludo Club is the best free board game searched on Bing on Google. What are you waiting for? Letâs roll the dice!', 'https://lh3.googleusercontent.com/CBh5Ts0J5KJJjy7xEYnMMWxMAxMAwxSzI9BT_vNsR3J1DDVnN3DVOIa1MR9nKgrWsg=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"April 7, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.1.32\"},{\"type\":\"Requires Android\",\"info\":\"4.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact, Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a010.00 - \\u20b9\\u00a025,000.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Moonfrog\"},{\"type\":\"Developer\",\"info\":\"Visit websiteludoclubsupport@moonfroglabs.comPrivacy Policy16\\/3, Level 3, Adarsh Yellavarthy Centre\\nCambridge Road, Ulsoor\\nBangalore - 560008\\nKarnataka, India\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/rV4LPNtF1tMk1j_yi9HvlbpxFv_VJceiprt9N8zE2Ezdq8AkhEs0U7JTf7f-BZip2SQ=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/lLOWfatV2W6MizRr-pE-H2pnYXrT_LRHpNloS7h6S_w-n4GpEkYwuinD2FDCsX5YuF8K=w720-h310\",null,null,null,null,null]', '[]', '2019-04-07 19:40:04', '2019-04-07 19:40:04', NULL);
