(182, 189, 'Google Duo is the highest quality video calling app*. Itâs simple, reliable, and works on smartphones and tablets.<br><br><br><br>    Features:<br><br><br><br>    <b>Simple interface</b><br><br>    Pick a loved one and jump right in, with a simple interface that makes video calling as easy as one tap.<br><br><br><br>    <b>The highest quality video calling app*</b><br> Experience more reliable video calls with excellent video quality whether youâre on Wi-Fi or on-the-go.<br><br><br><br>    <b>For Android and iOS devices</b><br> Duo works on Android and iOS smartphones and tablets, so you can call all your close friends and family using just one app.<br><br><br><br>    <b>Knock Knock</b><br> See whoâs calling before you pick up with a live video preview.<br><br><br><br>    <b>Video Messages</b><br> Friend canât answer your call? No problem. Leave them a video message for them to call you right back. With a video message, you can still capture everything about that moment you wanted to share.<br><br><br><br>    <b>Voice Calls</b><br> Make voice-only calls to your friends when you canât chat over video.<br><br><br><br>    *Based on Signals Research Group technical study comparing video degradation time over 3G, LTE, and WiFi.<br><br><br>    **Data charges may apply. Check your carrier for details.', 'https://lh3.googleusercontent.com/ceYbl4U0NCqIReEvd5GEApfzHEUgs17pEnoEaLFnjMjIWFIMAfg3PV6RI2A8cxLXzn8=s180', 4.6, '[{\"type\":\"Updated\",\"info\":\"April 2, 2019\"},{\"type\":\"Size\",\"info\":\"20M\"},{\"type\":\"Installs\",\"info\":\"1,000,000,000+\"},{\"type\":\"Current Version\",\"info\":\"50.1.240885383.DR50_RC06\"},{\"type\":\"Requires Android\",\"info\":\"4.4 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Goo