(183, 190, 'QR &amp; Barcode Scanner is the fastest QR / barcode scanner out there. QR &amp; Barcode Scanner is an essential app for every Android device. <br><br>QR &amp; Barcode Scanner / QR code reader is extremely easy to use; simply point to QR or barcode you want to scan and app will automatically detect and scan it. No need to press any buttons, take photos or adjust zoom. <br><br>QR &amp; Barcode Scanner can scan and read all QR / barcode types including text, url, ISBN, product, contact, calendar, email, location, Wi-Fi and many other formats. After scan and automatic decoding user is provided with only the relevant options for individual QR or Barcode type and can take appropriate action. You can even use QR &amp; Barcode Scanner to scan coupons / coupon codes to receive discounts and save some money.<br><br>Scan product barcodes with QR &amp; Barcode Scanner in shops and compare prices with online prices to save money. QR &amp; Barcode Scanner app is the only QR code reader / barcode scanner you will ever need.<br><br>âº Like us on Facebook: https://www.facebook.com/gammaplay/ <br>âº Follow us on Twitter: https://twitter.com/GammaPlay', 'https://lh3.ggpht.com/-LHkE5TWqK0bWUdreGY2m28wJa9YsMvkkXiL-1u7ZRcBs2gXP8bsTTpo9IWWdY1hhaw=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"December 14, 2018\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Gamma Play\"},{\"type\":\"Developer\",\"info\":\"gammaplay.com@gmail.comPrivacy PolicyGAMMA PLAY LIMITED\\n31\\/F CHINACHEM CENTURY TOWER,\\n178 GLOUCESTER ROAD, WANCHAI,\\nHONG KONG\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/