(195, 202, 'Welcome to the Next Generation in Mobile Cricket Gaming! Every cricket lover can now have the most advanced 3D mobile cricket game at the palm of their hands! You can play the maximum number of cricket shots including the famous Dil-scoop, the Helicopter shot and the Uper-Cut! This is a game built for you the cricket fan! You have loads to look forward to! You can customize your players and cheer your team with customized banners! You can also look forward to scintillating animations, more cricketing venues, new controls, and new camera angles! âWorld Cricket Championship 2â has features that make it the most the most dynamic and versatile game in the world of mobile cricket. Be prepared for insane fun!!<br><br>Features include:<br><br>Â· 140 different batting animations and 14 different bowling actions<br>. Rain Interruption, D/L Method<br>. Hot-Spot &amp; Ultra Edge for LBW and Edge<br>Â· Enjoy the Blitz Tournament for free!<br>Â· Electrifying fielding with stunning diving catches &amp; quick throws to surprise the opponent.<br>Â· Challenging AI opponent<br>Â· Realistic ball physics which response to the pitch (Dead, Dusty, Green)<br>Â· Player attributes â Players gain extra skills for consistent performance<br>Â· 18 different international teams, 10 domestic teams, 24 different stadiums. TEST Cricket, Hot Events and more than 11 tournaments including World Cup, World T20 Cup, Blitz Tournament and ODI Series.<br>Â· The Gangs of Cricket mode where the user can form gangs and compete in challenges.<br>Â· Challenge A Friend mode enables the user to challenge your friends.<br>Â· Batsman may get injured for poor shot selection.<br>Â· The emotions of the fielders vary according to the circumstances of the match.<br>Â· Cinematic cameras and real-time lighting enhance the visual appeal.<br>Â· Real-time Infographics representations:<br>- 3D Wagon wheel with dynamic game data<br>- Hawk-eye view for bowling summary &amp; for LBW appeals<br>- 3D Bar chart fo