(197, 204, 'Uber is a ridesharing app for fast, reliable rides in minutesâday or night. Thereâs no need to park or wait for a taxi or bus. With Uber, you just tap to request a ride, and itâs easy to pay with credit or cash in select cities.<br><br>Whether youâre going to the airport or across town, thereâs an Uber for every occasion. Uber is available in more than 630+ cities worldwideâdownload the app and take your first trip today.<br><br>Requesting your Uber is easyâhereâs how it works:<br>- Just open the app and tell us where youâre going.<br>- The app uses your location so your driver knows where to pick you up.<br>- Youâll see your driverâs picture, vehicle details, and can track their arrival on the map.<br>- Payment can be made by credit card, cash in select cities, Android Pay, PayPal, and more.<br>- After the ride, you can rate your driver and provide feedback to help us improve the Uber experience. Youâll also get a receipt by email.<br><br>Need a simple way to get from A to B quickly? Take uberX, our most affordable individual option.<br><br>Want to save money on your ride? Take uberPOOLâyouâll travel with other riders headed your way and enjoy a lower fare.<br><br>Want to elevate your experience? Take a high-end vehicle with UberBLACK. And thereâs still more optionsâwhether youâre traveling with a big group, or need a vehicle with accessibility features.<br><br>See if Uber is available in your city at https://www.uber.com/cities<br>Follow us on Twitter at https://twitter.com/uber<br>Like us on Facebook at https://www.facebook.com/uber<br><br>Have a question? Visit uber.com/help', 'https://lh3.googleusercontent.com/nTcQY6kRL6TgNQu4NSG0eBLQGDTTVj2-YOVyA71LFOuePtx057oSmt_xiObOrKdXMlg=s180', 4.2, '[{\"type\":\"Updated\",\"info\":\"April 5, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Re