(206, 213, 'Newly multiplayer feature added in this amazing train simulator. Enjoy Racing with your friends. Invite your friends, race with them and get top on the leader board. Park your train at the right spot, before your friends does. Be very attentive while parking your train at the station.<br><br>Enjoy the latest fusion of train simulator games and train driving games that will allow you to become the best train driver in this amazing railway station games. Itâs time to test your driving theory in passenger train games! So letâs start with the basic precision driving skills of a train driver in this modern train driving games. Itâs time to show your professional abilities of driving through realistic scenes and open railway tracks in railway station games. Letâs have fun while playing TRAIN SIMULATOR GAMES, the best train simulator games and passenger train games in the market!<br><br>Be very careful of Truck, cars and bus in this Train vehicle game. Vehicles might come suddenly on the tracks. <br><br>Itâs a perfect combination to have fun for both adults &amp; kids who are fond of trains &amp; other adventurous vehicle trips. Pick up the passengers from stations, drive and control your train perfectly with modern and new 3D graphics. The role of a train driver has never been so smooth, keep going and enjoy the gameplay with easy controls. If you are driving your train in the city area, check for trucks, cars,bus and other small and big vehicles. Change the camera view as per your comfort, pick up all the passengers and drop them at their respective destinations. You need to clear all the levels successfully before you call yourself a real train driver. You may face many challenges to get through and complete the tasks, but this game will definitely take you to a whole new level of satisfaction &amp; fun.<br><br>If you like truck games or car games,or bus games or any other heavy vehicle games. You will definitely like this train game.<br><br>One of the best train simulator games will enliven your soul and you will forget about other similar train driving games and railway station games. This is the only driving simulator that fully embraces incredibly smooth 3d engine physics and effects. Download TRAIN SIMULATOR GAMES, the newest passenger train games on play store!<br><br>Book your tickets for this local train game, get ready for the ultimate train journey through this mobile train game and travel across the country.', 'https://lh3.googleusercontent.com/tFKUivVCa2t2_h1nLMQrzl3_R003seNFSkfRpwCV9cbrAugP6eivrF08tQ4TIsGJRw=s180', 4.2, '[{\"type\":\"Updated\",\"info\":\"March 29, 2019\"},{\"type\":\"Size\",\"info\":\"29M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"6.8\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a050.00 - \\u20b9\\u00a0150.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"ALP GAMES\"},{\"type\":\"Developer\",\"info\":\"info.2bitventures@gmail.comPrivacy Policy\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/TK416p6xGlYHrBiKPojlA3UDNRBswNlRaYxsGHb308yRlKD07WCAhJz1wNgQhPyvViZw=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/qKmFTjmgoKPQgFK2-6UsygCumTsbS_B4UvmvtnfA8RZOEqbB3jf3-IUulS9Rh7_jrQ=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw