(207, 214, 'Pura india kar raha hai dosti Ludo pe. Suresh and Pooja met on Hello Ludo aur baatein kuch aisi hui:<br><br>Suresh - Hello Hello! Aap kahan se ho? Kya karte ho?<br><br>Pooja - Main Surat se hoon.Yahan main ek dance class chalati hoon. <br><br>Suresh - Kya baat hai Gajab! Main Patna se hoon aur state cricket team mein kehlta hoon. <br><br>Pooja -  Main toh saare cricket matches dekhti hoon. Kaun jyaada pasand hai Dhoni ya kohli?<br><br>Suresh - Bihar se hoon to pakka Dhoni. <br><br>Pooja - oh! Yeh game to main haar gayi but aapse baat karke bada mazza aaya.<br><br>Suresh -  Mujhe bhi. Chalo bye! Deekhte hain next game pe kaun milta hai. <br><br>Picture abhi baki hai, dost. Hello Ludo is the newest and most interesting Ludo game on the Play Store.<br><br><b>[Fun exciting chats]</b><br><br>Launch the online ludo game and meet new exciting people from all over India. Do a live chat with strangers on your ludo board.<br><br><br><b>[Best ludo game]</b><br><br><br><br>Hello Ludo is the latest and best online ludo game on play store. Itâs one of the trending free osum and nyc lodo games. You can play multiple modes - real ludo live online multiplayer with strangers and Facebook friends, local multiplayer or computer. Unlike other games like king and master, itâs fair and there is no cheating at all. At the same time, it has little ads. Hello Ludo is having one of the best graphics and most vibrant game experience even on low-end devices like Micromax, redMI and Samsung and connections like 2G, 3G &amp; 4G. Be the king and master of ludo on the best ludo game - Hello Ludo. People are loving and calling us with various names and we totally love this - Hello Ludo, Hello Ludo Game,Hello Ludo Board Game, hello ludo, hello Ludo, hello alludo, hello lodo, hello ludo game, hallo ludo, halo ludo, helo ludo, hello ludu, ludo game, ludo chat, Helloludo, Helo lodo Chat game, hello, helo lidu.<br><br><br><br><b>[Make new friends]</b><br><br><br>The real fun in playing ludo online is to do a live audio-video chat and talking to strangers and turning them into your friends. Share exciting thoughts - Joy, worries, the big news with your new friends. Who knows you may end up finding your best friends!<br><br><b>[Upcoming features]</b><br><br>Video chat with beauty mode is also on the way. Just not this but you can add friends and have next game with him or her. We are coming up with leaderboards to track your progress and XP. You will be able to play ludo in your favourite languages - Bengali, Marathi, Telugu and many more! Not just this we will get your favourite snakes and ladder also here soon.<br><br>Hello LUDO needs AUDIO SETTING permissions. This allows Hello LUDO to enable the talk feature.<br><br>To help us improve and add the features you love the most, please send your feedback to ludosupport@mechmocha.com. We would love to hear from you.<br><br>Join the exciting community of Hello Ludo players here to enjoy a whole new way of playing your favourite board games - https://www.facebook.com/helloludo/', 'https://lh3.googleusercontent.com/FZbMPPxJ_fD4ywmNaIdqQkZCG3ao-qtIKHjx8k8RX_zctNhLqeXtRjaoYKcY7yRwRx0=s180', 4.1, '[{\"type\":\"Updated\",\"info\":\"January 18, 2019\"},{\"type\":\"Size\",\"info\":\"32M\"},{\"type\":\"Installs\",\"info\":\"5,000,000+\"},{\"type\":\"Current Version\",\"info\":\"6.2\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Mech Mocha Entertainment\"},{\"type\":\"Developer\",\"info\":\"Visit websitepublish@mechmocha.comPrivacy PolicyBangalore, Karnataka\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/UW5-DBXGfXg\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/hlcS5gj3s67BhwymIw4cABZlvcZHsUr76DBjaTXxRQK9CR2cDek4kXEjDLQNe_7