(208, 215, '<b>Come, fall in Love with learning!</b><br><br>BYJUâS-The Learning App is the worldâs largest learning app for school students with 16 million registered students on its platform. The app offers comprehensive learning programs in Math and Science for students between classes 4th-12th. It also has test prep courses for competitive exams like CAT, NEET &amp; JEE, IAS, GRE &amp; GMAT etc.<br><br>The app has classes from Indiaâs best teachers including Founder CEO, Byju Raveendran, using state of the art technology for visualization. BYJUâS in-house R&amp;D team of 600+ members have completely developed the app in house and are constantly working on making it even more engaging and effective.  The latest version of the app personalises learning based on the individual pace and style of learning of each and every student.  <br><br>BYJUâS has developed an all-inclusive model, which breaks the clutter around rank holders making learning effective not just for the motivated students, but for everyone. The BYJUâS learning programs has been designed to make âeveryâ student fall in love with learning and not for the \\\'toppers\\\' only.<br><br><b><u>Features (School Learning):</u></b><br>â¢	<b>Learn -</b> From engaging video lessons and personalized learning journeys designed by BYJUâS Rockstar R&amp;D Team.<br>â¢	<b>Test -</b> Practice to perfection with chapter wise tests that are customized to the learning requirement of every student.<br>â¢	<b>Analyse -</b> The app runs an in-depth analysis based on customized tests and personalised learning paths adopted by the student. View detailed analysis of your progress and performance to plan better and improve your performance.<br>â¢	<b>Revise -</b> Each module offers revision and practice sessions for students to perfect their understanding of concepts and help them excel in their examinations.<br>â¢	<b>For exams and beyond -</b> The modules are planned in a way that it provides complete coverage of all state-level Boards, ICSE and CBSE syllabus for classes 6-10 and complete IIT JEE Preparation and AIPMT Preparation for classes 11-12.<br><br><b><u>Features (Competitive Exam prep)</u></b><br>For CAT Aspirants, get video lectures directly from Byju and PN Santosh (CAT 100 percentilers) themselves and complete test series (over 200 chapter-wise tests) and 20 Full Length Mocks.<br><br>For IAS aspirants, get tricks and tips from IAS toppers to crack the CSAT GS Prelims and Mains. Also be up to date with updated current affairs videos, weekly current affairs quizzes.  Watch simple and engaging video lectures on all topics from our expert IAS faculty. <br><br><b><u>Latest Features!</u></b><br><b>Knowledge Graphs -</b> Exhaustive Knowledge Graphs provide students customized recommendations to understand concepts better.<br><b>Practice -</b> Feature offers warm up, run and sprint mode for every concept. This unique feature allows students to test at their pace and based on their level of understanding.<br><br><b><u>Proven Results!</u></b><br>Today, over 16 million students are learning from BYJUâS. 93% Parents reported an increase in their childrenâs grades after using BYJUâS-The Learning App. Also, students are spending 57 minutes every day learning from BYJUâS. <br><b>Few of our notable accolades -</b><br>â¢	Business Standard Start Up of the Year Award (2017)<br>â¢	Express IT Awards â Individual award â Newsmaker of the Year (2017)<br>â¢	Winner of Amazon Mobility Awards for Established Education App of the Year ( 2017)<br>â¢	Winner of CNBC TV18 Young Turks of the Year Award (2017)<br>â¢	Winner of Deloitte Technology Fast 50 India and Fast 500 Asia Award (2012, 2013, 2014, 2015, 2016, 2017)<br>â¢	Winner of Reimagine Education Awards for the Best Educational App (2016)<br>â¢	Winner of VCCircle Awards for Education Company of the Year (2016)<br>â¢	Winner of Future of India Award for Education (2016) (Listed as Think and Learn)<br>â¢	Winner of 