(209, 216, 'Snapseed is a complete and professional photo editor developed by Google.<br><br><br><br>== KEY FEATURES==<br><br>â¢ 29 Tools and Filters, including: Healing, Brush, Structure, HDR, Perspective (see list below)<br><br>â¢ Opens JPG and RAW files<br><br>â¢ Save your personal looks and apply them to new photos later<br><br>â¢ Selective filter brush<br><br>â¢ All styles can be tweaked with fine, precise control<br><br><br><br>== TOOLS, FILTERS AND FACE ==<br><br>â¢ RAW Develop â open and tweak RAW DNG files; save non-destructively or export as JPG<br><br>â¢ Tune image â adjust exposure and color automatically or manually with fine, precise control<br><br>â¢ Details â magically brings out surface structures in images<br><br>â¢ Crop â crop to standard sizes or freely<br><br>â¢ Rotate â rotate by 90Â°, or straighten a skewed horizon<br><br>â¢ Perspective â fix skewed lines and perfect the geometry of horizons or buildings<br><br>â¢ White Balance â adjust the colors so that the image looks more natural<br><br>â¢ Brush â selectively retouch exposure, saturation, brightness or warmth<br><br>â¢ Selective â the renown âControl Pointâ technology: Position up to 8 points on the image and assign enhancements, the algorithm does the rest magically<br><br>â¢ Healing â remove the uninvited neighbor from a group picture<br><br>â¢ Vignette â add a soft darkness around the corners like a beautiful, wide-aperture would do<br><br>â¢ Text â add both stylized or plain text<br><br>â¢ Curves - have precise control over the brightness levels in your photos<br><br>â¢ Expand -  increase the size of your canvas and fill up the new space in smart ways with content of your image<br><br>â¢ Lens Blur â add a beautiful Bokeh to images (background softening), ideal for photographic portraits<br><br>â¢ Glamour Glow â add a fine glow to images, great for fashion or portraits<br><br>â¢ Tonal Contrast â boost details selectively in the shadows, midtones and highlights<br><br>â¢ HDR Scape â bring a stunning look to your images by creating the effect of multiple exposures<br><br>â¢ Drama â add a hint of doomsday to your images (6 styles)<br><br>â¢ Grunge â an edgy look with strong styles and texture overlays<br><br>â¢ Grainy Film â get modern film looks with realistic grain<br><br>â¢ Vintage â the style of color film photo from the 50âs, 60âs or 70âs<br><br>â¢ Retrolux â go retro with light leaks, scratches, film styles<br><br>â¢ Noir â Black and White film looks with realistic grain and the âwashâ effect<br><br>â¢ Black &amp; White â classic Black and White look straight out of the darkroom<br><br>â¢ Frames â add frames with adjustable size<br><br>â¢ Double Exposure - blend two photos, choosing from blend modes that are inspired by shooting on film and by digital image processing<br><br>â¢ Face Enhance â add focus to the eyes, add face-specific lighting, or smoothen skin<br><br>â¢ Face Pose - correct the pose of portraits based on three dimensional models', 'https://lh3.googleusercontent.com/Rilq4obCk7XIl2Pjb8XT-Ydh_aI3hBNeFwro9fFXrIAuC-zPxCZ4feE4rx5fZ3jHNLw=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"June 29, 2018\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.19.0.201907232\"},{\"type\":\"Requires Android\",\"info\":\"4.4 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Google LLC\"},{\"type\":\"Developer\",\"info\":\"Visit websiteapps-help@google.comPrivacy Policy1600 Amphitheatre Parkway, Mountain View 94043\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/CrRfRw8TPhbyqOJZ1qUscqOZf5pVYbO2I2oPnf0-8RBOUOV3PqthpLa1almaQ9ObN9GZ=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/AyIokk