(211, 218, 'Top Movies Running - Luka Chuppi, Captain Marvel, Badla, Kesari<br><br>Top Events - Indian Premier League, Sunburn<br><br>New Addition: BookMyShow Activities, Indian Premier League <br><br>With BookMyShow\\\'s app, you can now book tickets for movies, plays, concerts, sports and many other events happening in your city. You can book and buy movie tickets online where the app also lets you check movie show timings, list of theatres, read reviews &amp; news. Movie booking now made easy. BookMyShow\\\'s application is definitely a one-stop destination for all your ticketing and entertainment shows. Bollywood, Hollywood, Tamil or Telugu movie shows, plays or comedy shows, music concerts or IPL bookings - You want it, we\\\'ve got it!<br><br>Over the years, Bookmyshow has catered to millions and have strived in becoming India\\\'s number 1 online entertainment portal. We have a tie-up with most of the renowned cinemas in the country like PVR Cinemas, BIG Cinemas, INOX, AGS Cinemas, Apna Cinema, CineMAX, City Gold, DT City Centre, E-SQUARE, Cinepolis, Fame Cinemas, Fun Cinemas, Glitz Cinemas, Gold Cinema, Gopalan Cinemas, HDIL Broadway, Movietime, Prasads, Q Cinemas, Rajhans Cine World, Satyam Cineplexes, SRS Cinemas, Storm 5D. If you\\\'re a movie buff, then this is the right place for you to book your movie tickets without any hassle. <br><br>When it comes to events, we have made a significant growth in curating the best of events in the country and providing our customers with great service. NCPA, Prithvi Theatre, Rangashankara, Canvas Laugh Club and many more venues offer the best of plays. If you\\\'re the kind who really enjoys a great drama, we have got you covered with the best plays happening in your city. Be it IPL or ISL, we are here to meet your needs and leave you with great memories. We have just raised the bar by bringing in our own production team who have handled top events like Mughal e Azam, Disney Aladdin, Cirque du Soliel and much more. Want to be amongst the first few to get notified about your favorite event? You know exactly where to go.<br><br>We at Bookmyshow have great offers/discounts in store for you. Following is the list of brands through which you can avail great deals. <br><br> - Amazon<br> - Paypal<br> - Google pay<br> - Axis Bank<br> - SBI<br> - RBL Bank<br> - ICICI Bank<br> - Lazypay<br> - Kotak Bank<br> - Visa<br> - OYO<br> - Citi Bank<br> - Yes bank<br> - Mobikwik<br> - Payzapp<br><br>At BookMyShow, we take our users\\\' privacy very seriously. <br><br>â¢ Storage: We save some data locally to avoid making a lot of network calls.<br>â¢ Your Location: We use the location data to show you venues around you. No data is saved on our servers.<br>â¢ Your Social Information: We only need to read your contacts when you need to pick someone from the contacts to share booking details with. We don\\\'t save any of this data on our servers. Ever.<br>â¢ Your applications information [Retrieve running apps] &amp; Logs: We use this to gather information that helps us fix any issues that you may experience with our app. We do not save any of this information.<br>â¢ Your Accounts: We require this to be able to send push notifications. Donât worry, we never spam.<br>â¢ Won\\\'t affect your battery: We require this to be able to send you push notifications. Don\\\'t worry, we never spam.<br>â¢ Your Contacts : We need access to your contacts, so that you can invite your friends to chat or join you after you\\\'ve booked your tickets. We\\\'re asking for the contact permission for a bunch of features like chat, sharing tickets with friends. Your information will kept confidential.<br>â¢ Read and Receive SMS: We need this permission to enable our app to read your One <br>â¢ Time - Password SMS and automatically enter the code while completing the payment. Your privacy will be respected and no information will be saved.<br><br>Download our app for FREE and book tickets on the go. The box office at your fingertips.<br><br>Like us on Facebook:- http://www.facebook.com/BookMyShowIN<br>Follow us on Twitter:- https://twitter.com/BookMyShow<br>Follow us on Instagram:- https://www.instagram.com/bookmyshowin/', 'https://lh3.googleusercontent.com/KSXq3Idt1WbHnaHcsC4p5KxaRE0KuuB-GNRJP3XRS2omj6DY8ohkbMlIbK53Sp6TlxYm=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"March 28, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"5.5.6\"},{\"type\":\"Requires Android\",\"info\":\"5.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Bigtree Entertainment Pvt. Ltd.\"},{\"type\":\"Developer\",\"info\":\"Visit websitetechdesk@bookmyshow.comPrivacy Policy\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/HZ9C7gwwp4U\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/9tZTJgcmxS1AFD39qSbWMeV6lgtWSkPVth2vqU3YPUO9znsfrjQXNIlNCU4SQM3l6WgT=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/x1wdUVrftuBm3L7yfSZ3qj_MoxB8n3Zru2u8hQatPqA4PaUPMdMscYeugFmL4FOkrxc=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[{\"url\":\"https:\\/\\/www.youtube.com\\/embed\\/HZ9C7gwwp4U?ps=play&vq=large&rel=0&autohide=1&showinfo=0\",\"image_url\":\"https:\\/\\/i.ytimg.com\\/vi\\/HZ9C7gwwp4U\\/hqdefault.jpg\"}]', '2019-04-07 19:43:47', '2019-04-07 19:43:47', NULL),
