nserv Wallet powered by Mobikwik is a pre-paid instrument issued by Mobikwik under co-branding arrangement with Bajaj Finance Limited, in accordance with the applicable RBI guidelines.', 'https://lh3.googleusercontent.com/nP_DCkllgWwLCkIZzHh1-rPca3esOX_A1wjMtyNB6dwXII8N9k2nFm9DoPScZ8VNCDI=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"March 8, 2019\"},{\"type\":\"Size\",\"info\":\"21M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"7.7\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Bajaj Finance Limited\"},{\"type\":\"Developer\",\"info\":\"Visit websitebajajfinservandroid@gmail.comPrivacy Policy\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/P6SBCDZ_77k\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/uuAsJrh6Q3XSH53YX3bcTGVDZnBW53TzOJUopXF9y9DaQebSW8lLYr7wkyk6OIhVSg=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/Ow6xtJJ_liQGALFkTbZAtSKrjdy_Yw4d6VDCSreLU8pWShWqtz8YTaSCGjy-xPlv9ZaQ=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[{\"url\":\"https:\\/\\/www.youtube.com\\/embed\\/P6SBCDZ_77k?ps=play&vq=large&rel=0&autohide=1&showinfo=0\",\"image_url\":\"https:\\/\\/i.ytimg.com\\/vi\\/P6SBCDZ_77k\\/hqdefault.jpg\"}]', '2019-04-07 19:43:47', '2019-04-07 19:43:47', NULL),
