(219, 226, 'âThe Catapult 2â is the continuation of the popular game about the brave stickman, who with the help of a catapult on the top of the tower, trying to protect his castle from destruction by the army of the stickman enemy.<br><br>Now our stickman warrior has new weapons and a large number of means of defense. In addition to the catapult, you can crush the attackers from the ballista and destroy them with accurate cannon shots. Throw stones, cannonballs, bombs, arrows and magic shells at opponents. Skills are added to the new version of the game âThe Catapultâ. Now you can hit opponents not only with a volley of cannon balls, but also with a lightning strike.<br><br>The game saved a simple intuitive control. Tap on the screen and pull to charge the catapult and choose the tension force. Release to launch the projectile into the enemy and smash them!<br><br>It becomes more difficult to defend, because there are more opponents. In addition to the classic infinite mode, a campaign of 90 levels has been added to the game, in which our hero will now be confronted with not only stickmen on catapults, but also artillery, siege towers, siege rams and huge walking combat mechanisms capable of blowing up the castle from one volley of their powerful guns.<br><br>In order to fight off enemy warriors and withstand a siege, constantly update and grow your castle. You can upgrade the towers by adding slots with archers or cannons that will hit more damage to the enemy. You can also upgrade the defense by placing a barricades in front of the castle or mines to stop the enemy. New equipment and armor are added to make your stickman hero stronger.<br><br>The game has a two players mode. You can play duels with friends without the Internet on one screen.<br><br>Download the second part of the popular free game âThe Catapultâ.<br><br>We are actively working on updates, so we are waiting for your wishes and comments on the game.<br><br>Have a nice game!!', 'https://