(232, 239, '[Control]<br>-- Direction pad: move the player<br>-- A button: Dig a hold at the right side<br>-- B button: Dig a hold at the left side<br>-- Start button: Start/Pause the game (you can review the whole level when pause)<br>-- Select button: press \\\'select\\\', then \\\'start\\\' to re-try a level when you get stuck<br>-- Reset button: Restart the game<br><br>[Introduction]<br>The player must collect all the gold in a level while avoiding guards who try to catch the player. After collecting all the gold, the player must touch the top of the screen to reach the next level.<br><br>    Levels feature a multi-story, brick platform motif, with ladders and suspended hand-to-hand bars that offer multiple ways to travel throughout. The player can dig holes into floors to temporarily trap guards and may safely walk atop trapped guards. Should a guard be carrying a bar of gold when he falls into a hole it will be left behind, and can be retrieved by the player. Over time, floors dug into will regenerate, filling in these holes. A trapped guard who cannot escape a hole before it fills is consumed, immediately respawning in a random location at the top of the level. Unlike guards, the player\\\'s character may not climb up out of a hole, and will be killed if it fills before he can escape by other means. Floors may also contain trapdoors, through which the player and guards will fall, and bedrock, through which the player cannot dig.<br><br>    The player can only dig a hole to the sides, and not directly underneath himself. This introduces an important strategy for when digging a hole x blocks deep, the player must first dig a gap at least x wide to be able to dig through it, as the number of spaces will shrink with each layer, and the player needs at least one free adjacent space to be able to dig. However, exceptions to this rule arise when the player digs from the position of standing on a ladder, or hanging from a hand-to-hand bar, which allows the player to repeatedly dig and descend one row. This kind of digging is involved in solving many of the levels.<br><br>    The player starts with five lives; each level completion awards an extra life. Should a guard catch the player, one life is subtracted, and the current level restarts. The player\\\'s character can fall from arbitrary heights without any injury but cannot jump, and players can trap themselves in pits from which the only escape is to abort the level, costing a life, and begin again.<br><br>    The player may come into contact with a guard directly from above, with the stick figure\\\'s feet touching the guard\\\'s head. This is what enables the player to walk over guards who are temporarily stuck in a hole that has been dug. It is also possible to make this contact while both the guard and the player are in free fall, since the player not only runs faster than the guards, but also falls faster; moreover, it is possible to survive the feet-to-head contact while a guard is standing on a platform and begins to move. Both forms of contact are necessary to solve some levels. Sometimes it is necessary to liberate a trapped guard by digging while standing on his head, but then moving rapidly in the opposite direction when the guard begins marching to freedom. In a few levels, it is necessary to use a falling guard as a bridge to reach an otherwise unreachable area. One subtlety is that if a down movement is initiated while standing on a guard\\\'s head, or briefly touching the guard\\\'s head during free fall, the consequences are fatal.<br><br>    In some levels, guards can be deliberately trapped in various ways. They can be lured into entering a part of the level from which there is no escape. In some situations, the player can liberate trapped guards by digging them out. In some levels, to collect some gold pieces, the player must exploit the guards into collecting gold pieces.', 'https://lh3.googleusercontent.com/9Dp40HzbqAAZ1H0Okr1RuZ-4w8GO2ePSUcZPXlH6tqmSgOscS_ozR6AB8yR5PlDhNQM=s180', 3.8, '[{\"type\":\"Updated\",\"info\":\"April 6, 2019\"},{\"type\":\"Size\",\"info\":\"5.2M\"},{\"type\":\"Installs\",\"info\":\"100,000+\"},{\"type\":\"Current Version\",\"info\":\"1.3\"},{\"type\":\"Requires Android\",\"info\":\"4.2 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Brainsoft Corp.\"},{\"type\":\"Developer\",\"info\":\"games.brainsoft@gmail.comPrivacy Policy\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/AinvQl4aSxy4ayIiPZpJXY9Qzt9tvdq1V1ipsVamazqzUhcQWq6cvDZhsT6-i7zaTzk=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/CuEoBHhvEWLqvIYYdV5LMwUW05IST6zTfHYa4TBG2K9wIODB4eoIk5Kj6qY0VyqcRkag=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[]', '2019-04-07 19:43:47', '2019-04-07 19:43:47', NULL),
(233, 240, 'Bike Racing 2018 the latest in the world of bike race simulation. Get ready for the fantastic and extremely adventurous bike games. Race, jump and crash your way and other mad rivals through the amazing frontier tracks. You never dare drive so fast in the real world! Control your motorbike with incredible fast speed!<br><br>Ride in the most spectacular environment built just for performing the craziest tricks. The Physics are realistic and you get to choose your bikes / motorbike too, just avoid the obstacles and finish the ride\\\'s in time. Bike Racing 2018 has fast pace control over the speed and advanced power brakes. <br><br>The game has one the best 3D graphics with the motorbikes competition. You can enjoy the feeling of real based dirt games, stunt like original and accident will also happen so be drive careful. Enjoy very attractive and beautifully designed bike racing tracks.<br><br>Ride your Bike through curvy paths on amazing desert roads, mountain off road , and city roads but be careful on dangerous turns.  Prove that you are the best bike racer. Experience the excitement and thrill of driving a dirt motorbike through a massive stadium, filled with bumps and jumps. Can you be the best and complete the daredevils course on your motorcycle? Then take a ride with this Bike Race now!<br><br>Challenging Racing game play with features :<br><br>- Free to Play!<br>- Tons of Amazing Racing Bikes<br>- Amazing 3D Environment<br>- Stadium with fast racing tracks<br>- Challenge your facebook friends<br>- Simple and intuitive bike driving controls<br>- Fun Unlimited<br>- Realtime Multiplayer mode coming soon. <br><br>Install \\\"Bike Racing 2018\\\" Now, you are waiting for an incredible racing adventure.', 'https://lh3.googleusercontent.com/MJGdLDGjToSdYvuMtZm6WLEFGCAyz50pN5YRBEvFtAmNmHdTThla5omYE-3LY2WgW7A=s180', 4.2, '[{\"type\":\"Updated\",\"info\":\"April 2, 2019\"},{\"type\":\"Size\",\"info\":\"47M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"