(234, 241, '<b>SBI Anywhere Personal is now \\\'Yono LITE SBI</b><br><br>Mobile Banking application for Smart Phone customers of SBI supporting English and Hindi languages.  Use your Retail Internet Banking credentials to login or register afresh through the <i>Register &gt; New User</i> option.<br><br>A safe, convenient and easy to use application with a host of features to help users manage your finances on the move. Download from Google Play store Only. Do not use any other websites for downloading this application.<br><br><b>Voice Assisted Transactions</b><br>    â¢ Balance Enquiry<br>    â¢ Mini Statement (Last 10 transactions)<br>    â¢ Mobile Recharge <br>    â¢ DTH Recharge<br>    â¢ Quick Transfer<br>    â¢ View and Pay Bills<br>    â¢ Logout<br><br><b>My Accounts</b><br>    â¢ Detailed account information (Transaction / Deposit / Loan / PPF / SSA accounts)<br>    â¢ Mini Statement (Last 10 transactions)<br>    â¢ mPassbook (upto 150 transactions)<br><br><b>Banking</b> <br>    â¢ Funds Transfer within Self Accounts<br>    â¢ Third Party Transfer within SBI<br>    â¢ Inter-Bank Transfer (RTGS / NEFT /IMPS)<br>    â¢ Quick Transfer to Unregistered Beneficiaries using QR Code<br>    â¢ IMPS Transfer (using IFSC &amp; Account Number or Mobile Number &amp; MMID)<br>    â¢ Transfer to mobile number or email id using mCash<br>    â¢ Instant Opening / Closing of Fixed and Recurring Deposits<br>    â¢ Schedule Transactions<br><br><b>UPI</b><br>    â¢ Pay to VPA<br>    â¢ Pay to Aadhaaar<br>    â¢ Pay to Account No &amp; IFSC<br>    â¢ UPI Payment History &amp; Raise Dispute<br>    â¢ Dispute Status<br>    â¢ Set UPI Transaction Limit<br><br><b>Bill / Merchant Payments</b><br>    â¢ View and Pay Bills<br>    â¢ Adhoc Payment to unregistered Billers<br>    â¢ Credit Card (VISA) Transfer<br>    â¢ SBI Life Premium Payment<br>    â¢ Bill Payment History<br>    â¢ Add / Manage Billers with Auto Pay facility<br>    â¢ Postpaid Bill Payments<br>    â¢ Schedule Bill Payments<br><br><b>Top-up and Recharge</b><br>    â¢ Mobile Top-up<br>    â¢ DTH Recharge<br>    â¢ Top-up of State Bank Wallets<br>    â¢ Top-up of Pre Paid Cards<br>    â¢ Manage NCMC card<br>    â¢ Load Money in NCMC card<br><br><b>Services</b><br>    â¢ Manage Debit Cards Access Channels<br>    â¢ Manage Channel Wise Limits for Debit Card Transactions<br>    â¢ Debit Card Hotlisting<br>    â¢ Create and Manage Standing Instruction<br>    â¢ Change Maturity Instructions for eDeposits<br>    â¢ Online Nomination<br>    â¢ TDS Enquiry<br>    â¢ Cheque Book Request<br>    â¢ Submit 15G /15H online<br>    â¢ Virtual Card facility for secure eCommerce payments<br>    â¢ Aadhaar Linking<br>    â¢ LPG Seeding to A/c Number for DBT<br><br><b>Smart Watch Banking</b> - Enquiry, Funds Transfer and Mobile Top-up<br><br><b>Other Pre-login features</b><br>    â¢ Registration for New Users<br>    â¢ BharatQR Merchant Payments<br>    â¢ State Bank Collect<br>    â¢ Bharat Billpay (BBPS)<br>    â¢ mPassbook facility (view passbook without internet connectivity)<br>    â¢ Debit Card Blocking<br>    â¢ Claim mCash<br>    â¢ Online Locker Enquiry<br>    â¢ Contact Us<br><br><b>All you need :</b><br>   â¢ A smart phone with Android Operating System (Android ver 4.2 or above).<br>   â¢ Internet connectivity through Mobile Data/ Wi-Fi.<br><br><b>For feedback &amp; suggestions</b>, kindly email us at <b>mb.support@sbi.co.in</b><br><br>Visit https://mobility.onlinesbi.com for more details.', 'https://lh3.googleusercontent.com/4zgUUYqoz-tItNnViVXOqd_hqle_k4GWJELuW470ociNQtgKO31ZfyXSoJN_2rjBfA=s180', 4.2, '[{\"type\":\"Updated\",\"info\":\"March 20, 2019\"},{\"type\":\"Size\",\"info\":\"32M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"5.3.22\"},{\"type\":\"Requires Android\",\"info\":\"4.2 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\"