(235, 242, 'Mission Counter Attack FPS is the fast paced first person shooter where you play as a dangerous agent on a task to complete all the missions. In this game you will have to take down multiple targets with , assassinate all the targets from the top of a helicopter and much more. These tasks just keep getting harder and harder and the enemies are increasing in every level. Can you maintain your cool and come out as the top shot? Use high tech long range weapons to sniff out the enemy and hit them. Upgrade to higher guns to create huge damage with a single bullet. Bored of the sniper mode? Do not worry, we <br>also have a huge arsenal of assault rifles to keep the heat high. <br><br>Auto reload, crouch, jump and smooth scope controls wih minimal recoil make Mission Counter Attack FPS the best shooter gaming experience on mobile. Use the mini map to watch out for the enemy that approaching towards you and stay alert to survive till the end. With tactical AI using high level offense moves like throwing a grenade to hold you engaged for hours. This is not going to be easy at all. So get ready for the ultimate rain of bullets while using the medi kit to refill the health regularly or you will die soon! Reload, stack up the bullets and fire to eliminate the last of the enemies. Follow the sniper\\\'s bullet as it travels towards your kill. <br><br>Mission Counter Attack FPS Game Controls <br><br>- Use Joystick to move around<br>- Touch and slide the screen to aim and kill the enemy<br>- Use sniper mirrors to zoom in and out and aim at and kill enemies<br>- Click the Shoot button. Launch bullets', 'https://lh3.googleusercontent.com/KNQTtHCor1T4MQoLDFci9hY2mFLMaIR6Kq0DRZThQMRDLUJ4PoePN6XDDLTfY9orRaDa=s180', 4.2, '[{\"type\":\"Updated\",\"info\":\"February 14, 2019\"},{\"type\":\"Size\",\"info\":\"46M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.3\"},{\"type\":\"Requires Android\",\"info\":\"4.0.3 and up\"},{\"type\"