(239, 246, 'Fly airplanes in the most realistic simple airplane simulator game. You have many plane options to chose and fly from one airport to the other completing multiple missions. Whenever you complete a task you will be rewarded with the gold and you can buy new airplanes for your flight. <br><br>Pass through the several waypoints, reach the destination airport, touch the runway gently and land your flight perfectly to get full points. Control your aircraft with very detailed controls on your screen. <br><br>Not all flight simulators have a realistic touch of flying but Airplane Pilot - Flight Simulator is all about flying the airplane just like the real one. after you start the mission you\\\'ll be the captian of the airbus to transport passengers from one place to the other. Fly between the airports by following the waypoints and end the flight operation by perfect landing. <br><br>This game will make you forget all other plane games and once you master the flying art your will be given the title of best pilot with extra reward with which you can buy from all the new collection of cool planes with different shapes and color. Not all the aircrafts are locked, few are unlocked in the start to teach you how to fly a plane in airplane simulator game. <br><br>Features:<br>- Realistic plane physics<br>- Eye catching graphics with realistic terrains<br>- Many cool animations close to reality<br>- Easy controls for your airplane<br>- Close to reality flying simulation<br>- Totally free plane simulator', 'https://lh3.googleusercontent.com/aphFLTGsrIZAydd0sIywx02E6R4beGJKHiWyIRaVMtPTh2j65xMHKe_sbtMQ9mt5mrE6=s180', 3.8, '[{\"type\":\"Updated\",\"info\":\"February 7, 2019\"},{\"type\":\"Size\",\"info\":\"33M\"},{\"type\":\"Installs\",\"info\":\"100,000+\"},{\"type\":\"Current Version\",\"info\":\"1.0\"},{\"type\":\"Requires Android\",\"info\":\"4.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View detai