(255, 262, 'Township is a unique blend of city-building and farming! <br><br>Build your dream town! Harvest crops at the farms, process them at your facilities, and sell goods to develop your town. Trade with exotic countries. Open restaurants, cinemas, and other community buildings to give life in your town special flavor. Explore the mine to get resources and find ancient artifacts. Run your own zoo and collect animals from around the world.<br>Are you ready to become a farmer and city-manager to build your dream? Letâs get started!<br><br>Township features:<br>â Different buildings and decorations you can use to create your dream town<br>â Various crops to grow and later process at your factories<br>â Fun, charismatic townspeople with orders you need to fill<br>â Your town\\\'s mine packed with ancient artifacts to discover and collect<br>â Lovely animals to take care of<br>â Farms to manage and expand<br>â Exotic goods brought from islands<br>â A zoo to build where you can even breed animals<br>â Country flags and famous landmarks you can use to decorate your town, like the Statue of Liberty, Big Ben, and many more!<br>â Play with your Facebook and Google+ friends, make new friends in the game community create your own clans! <br><br>Township is free to play, though some in-game items can also be purchased for real money.<br><br>*Internet connection is required to play the game and enable social interactions, competitions and other features* <br><br>Enjoying Township? Learn more about the game! <br>Facebook: www.facebook.com/TownshipMobile <br>Twitter: twitter.com/township_mobile <br><br>Questions? Contact our Tech Support at support@playrix.com.', 'https://lh3.googleusercontent.com/3RxD6W0cXTWNwi1EvyiLwMMAyOvpuJYA5hP89ALUocTFhx4d7fkIi9-M6ZHDAm-x=s180', 4.6, '[{\"type\":\"Updated\",\"info\":\"March 25, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\