(269, 276, 'Truck Driving Uphill - Loader and Dump is a free 3D game where you drive to various locations to transport the given objects. Choose from any given objects to increase your drive rewards. A free open world with highly detailed 3D graphics to give you the best driver feel. Get behind the wheel of heavy construction vehicles and move your dump truck around the open terrain and the city streets performing stunts. Explore the most beautiful mountainous green tracks with speed breaker on road.<br><br>Explore a open world simulation, ascend tall skyscrapers by driving up ramps, smashing your trucks or wrecking other vehicles! Show your trucking and parking skills by safely transporting the objects to the destination without dropping any on the way. Carry heavy cargo across the site safely and park your trucks to complete the game. Play the best driving games of 2018.<br><br>Become a jeep driver, hold the steering of a cargo jeep and enjoy most realistic simulation game.Transfer lots of cargo items from one place to the destination. To move safely on curvy and dangerous hilly tracks, we recommend you to take it slow. Lots of cargo items like drums, wooden pallets &amp; gas cylinders etc. <br><br>This game lets you enjoy the fun of controlling a heavy truck and be a real driver.  Complete timed obstacle courses or free roam different environments.<br>Control your truck by tilting your device, or use touch control for steering. <br><br>Truck Driving Uphill - Loader and Dump is a realistic simulation and racing game where you have to climb hills by overcoming the obstacles by an off road vehicle. You should try to reach the hill as soon as possible and collect all the coins on your way in the stage, and complete successfully. You have to do your best to avoid falling from a hill cliff and facing an obstacle, while trying to reach the hill climb. <br><br>Play the best truck driving game now.', 'https://lh3.googleusercontent.com/e6q_3bLq1gRKqwFyD4kGwdiMWSC3SssR9npTR