(272, 279, 'Hello bus drivers get ready to accept a new challenge to drive high in the sky. Welcome to new Furious Bus Stunts: Driving Adventure game where you can drive amazing, luxury buses on sky level heights like a legend. Driving big bus on impossible tracks that are sky high is dangerous task for this you are in the need of Furious Bus Stunts: Driving Adventure game skills. If you love driving big lorry or heavy vehicles then this sky top driving on impossible difficult road and stunt parking game is for you.<br>Make your dreams possible by driving in sky tracks with modern luxury buses and involve in exciting game play of Furious Bus Stunts: Driving Adventure . One of the best Furious Bus Stunts: Driving Adventure game with thrilling environment and spectacular 3d graphics of this Furious Bus Stunts: Driving Adventure 2019. Grip the steering, fasten seat belt and move towards destination in space road maps with your sensible driving and take care of the obstacles, hurdles, signals and materials. Control the speed and acceleration of the bus on sharp turns and steep paths. Different bus vehicle models and customization option makes you prominent player of this Furious Bus Stunts: Driving Adventure 3d game.<br><br>Features of Furious Bus Stunts: Driving Adventure <br>Realistic physics for real driving experience on impossible tracks.<br>Solve difficult mission and buy best luxury bus.<br>Most difficult tracks to drive on.<br>Unique driving camera angles with stunning 3D graphics. <br> Interesting tracks paths and animations.<br>Thrilling interface and smooth game play control.', 'https://lh3.googleusercontent.com/9A5bPYRuLRCm--ruz9jeLaEonpeUtEQ_v06qalNnLthY4PpwgfXIKG_TDtFx8KBZPk4-=s180', 4, '[{\"type\":\"Updated\",\"info\":\"March 21, 2019\"},{\"type\":\"Size\",\"info\":\"18M\"},{\"type\":\"Installs\",\"info\":\"1,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.3\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"i