(273, 280, 'VLC media player is a free and open source cross-platform multimedia player that plays most multimedia files as well as discs, devices, and network streaming protocols.<br><br>This is the port of VLC media player to the Androidâ¢ platform. VLC for Android can play any video and audio files, as well as network streams, network shares and drives, and DVD ISOs, like the desktop version of VLC.<br><br>VLC for Android is a full audio player, with a complete database, an equalizer and filters, playing all weird audio formats.<br><br>VLC is intended for everyone, is totally free, has no ads, no in-app-purchases, no spying and is developed by passionate volunteers. All the source code is available for free.<br><br><br>Features<br>ââââââââ<br>VLC for Androidâ¢ plays most local video and audio files, as well as network streams (including adaptive streaming), DVD ISOs, like the desktop version of VLC. It also support disk shares.<br><br>All formats are supported, including MKV, MP4, AVI, MOV, Ogg, FLAC, TS, M2TS, Wv and AAC. All codecs are included with no separate downloads. It supports subtitles, Teletext and Closed Captions.<br><br>VLC for Android has a media library for audio and video files, and allows to browse folders directly.<br><br>VLC has support for multi-track audio and subtitles. It supports auto-rotation, aspect-ratio adjustments and gestures to control volume, brightness and seeking.<br><br>It also includes a widget for audio control, supports audio headsets control, cover art and a complete audio media library.<br><br><br>Permissions<br>ââââââââââââ<br>VLC for Android needs access to those categories:<br>â¢ \\\"Photos/Media/Files\\\" to read your all media files :)<br>â¢ \\\"Storage\\\" to read your all media files on SD cards :)<br>â¢ \\\"Other\\\" to check network connections, change the volume, set the ringtone, run on Android TV and display the popup view, see below for details.<br><br>Permission Details :<br>â¢ It needs \\\"read the contents of your USB storage\\\", in to order to read your media files on it.<br>â¢ It needs \\\"modify or delete the contents of your USB storage\\\", in order to allow deletion of files and store subtitles.<br><br>â¢ It needs \\\"full network access\\\", to open network and internet streams.<br>â¢ It needs \\\"prevent phone from sleeping\\\" in order to prevent... your phone from sleeping when watching a video.<br>â¢ It needs \\\"change your audio settings\\\", in order to change audio volume.<br>â¢ It needs \\\"modify system settings\\\", in order to allow you to change your audio ringtone.<br>â¢ It needs \\\"view network connections\\\" in order to monitor whether device is connected or not, to hide the streaming parts.<br>â¢ It needs \\\"draw over other apps\\\" to start the popup menu.<br>â¢ It needs \\\"control vibration\\\" to give feedback on the controls.<br>â¢ It needs \\\"run at startup\\\" to set recommendations on Android TV launcher screen, only used with Android TV version.<br>â¢ It needs \\\"record audio\\\" to provide voice search on Android TV devices, only used with Android TV version.', 'https://lh3.ggpht.com/8BDSUv0P-kr9Kik7weOSet4Au_BlBpM0SmM8dUDdYQOceErGCLroJlhVoSL7cPP14YE=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"April 1, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"2.3 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Videolabs\"},{\"type\":\"Developer\",\"info\":\"Visit websitevideolan.android@gmail.comPrivacy Policy18 rue Charcot\\n75013 Paris\\nFrance\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/fd-Vx2JsvAkhtzanvExidgNz0dJZ3Y9UJsxl-niXZK1kPe876N44