(274, 281, 'October Update ! <br>Motu and Patlu have to protect Furfuri Nagar and its residents after John the Don steals the Gold from the Furfuri Nagar Bank. Rush after John the Don as Motu Patlu or the rest of the team as Chingam, Ghasitaram or Dr Jhatka and get your Gold coins back!<br><br>Chase through the streets of Furfuri Nagar, use different bikes and grab power ups on the go and make the chase shorter. Dodge Trucks, Bus and cars before John gets away. Running and chasing John helps as you collect enough gold coins to unlock other characters of the Motu Patlu Run adventure. <br><br>Endless Runner â Run to catch John the Don <br>- RUN as fast as you can to catch John the Don<br>- EVADE oncoming Trucks and Cars to collect more gold <br>- JUMP &amp; DUCK to avoid Obstacles like Traffic Barrier and Cones<br>- Use a selection of BIKES to RACE and to get additional lives <br>- Ride on Rockets <br>- Collect Coins <br>- Get Multipliers <br>- Get Mystery Box Rewards by collecting Letters <br>- Boost your Score with multipliers by completing challenges <br>- Participate in Events<br>- Challenge your Friends<br><br>Motu Patlu &amp; Friends - Play as Your Favorite Motu Patlu Character <br>- Run and Jump as Motu, Patlu, Inspector Chingam, Dr Jhatka or Ghasitram <br>Explore New Worlds â Run Through New Lands<br>- Challenge Friends to make it to the Motu Patlu leaderboards<br>- Enjoy with your friends with Mystery Boxes and Special Gifts in this family friendly action adventure game<br><br>Will Motu Patlu get back their gold coins and save the Furfuri Nagar Bank or will John the Don Escape. <br>Join us on our Epic adventure through the streets and suburbs of Furfuri Nagar with Motu Patlu and the rest of the team to collect Gold Coins and explore the Motu Patlu world in Motu Patlu Run for Gold ! <br><br>***********************************************************************************<br>Motu Patlu Run respects your privacy, does not store any personal information and does not allow you share this information. <br><br>We do require a few additional Permissions to function: <br><br>1. READ_EXTERNAL_STORAGE &amp; WRITE_EXTERNAL_STORAGE<br>These permissions are needed to cache and read ad content during the game play<br><br>2. ACCESS_COARSE_LOCATION/READ_PHONE_STATE/ACCESS_FINE_LOCATION<br>These permissions are needed to show suitable ad content for targeted user for better ad experience<br><br>3. GET_ACCOUNTS<br>This permission would use your google account name and picture to show it on the leaderboard once you sign in', 'https://lh3.googleusercontent.com/giI8QQeM4aoskuXO3EDDpetJAjbAjiInslJan8pEaL_B6gqcoUs98uZvjnY8RyJhvnI=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"January 18, 2019\"},{\"type\":\"Size\",\"info\":\"36M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.10\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a010.00 - \\u20b9\\u00a06,200.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Nazara Games\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport@nazara.comPrivacy Policy5th Floor, Makers Chambers 3, Nariman Point, Mumbai - 400021, India\\n\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/-YVPFjqLIhRr3iV06iyJpSq1Afo4HwQJqCzZRjV7VMXsZHuY86MvVKbRxAR3Cc-DjNg=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/JtRCwT8Ixx0iqZ3OpZQHZMj4UtSHR6tHee57J22U02mskkH7d6USLAYjBCUZrf_3tkVP=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEK