(280, 287, 'HDFC Bank MobileBanking The official app of HDFC Bank for Android HDFC Bank MobileBanking gives you access to your account on your Android Mobile. Now, you can perform your banking tasks from the palm of your hand, from anywhere and at anytime! What can you do? - Pay utility bills, credit card bills, etc. - View Account summaries and Fixed Deposit summaries - Transfer funds, including transfers to other bank customers - Request statements, cheque book And much, much more. Important Disclosures: By downloading the HDFC Bank MobileBanking App: *you consent to the installation of this app and its future updates and upgrades. You can withdraw your consent at any time by deleting the app from your device, *you are agreeing and providing consent to have read and understood the privacy notice of HDFC Bank. To know more about the privacy notice, please click here. http://www.hdfcbank.com/aboutus/terms_conditions/privacy.htm', 'https://lh3.googleusercontent.com/mylccQPi4SRxK3zKq44XAzmmJNgDNZYLKqxLlDIqftp0ng_Q9Sz8eeCQ5VQixIzstQ=s180', 3.3, '[{\"type\":\"Updated\",\"info\":\"March 8, 2019\"},{\"type\":\"Size\",\"info\":\"20M\"},{\"type\":\"Installs\",\"info\":\"1,000,000+\"},{\"type\":\"Current Version\",\"info\":\"8.4\"},{\"type\":\"Requires Android\",\"info\":\"4.4 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"HDFC Bank\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport@hdfcbank.comPrivacy Policy\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/2nhG87IfC42W6uz6beew-AxuptNivKCpNd8D3HLxpiunEPzP61opUg-edjxAWITyS20=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/aw_w-4iVnaDMJn990QYgXwQLfaT2HAI5akDsaIdpBb7zXV31HRPe13IVEeWg9VjzSJI=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQAB