(281, 288, 'Traffic Racer is a milestone in the genre of endless arcade racing. Drive your car through highway traffic, earn cash, upgrade your car and buy new ones. Try to be one of the fastest drivers in the global leaderboards. Endless racing is now redefined!<br> <br>KEY FEATURES<br>- Stunning 3D graphics<br>- Smooth and realistic car handling<br>- 35+ different cars to choose from<br>- 5 detailed environments: suburb, desert, snowy, rainy and city night<br>- 5 game modes: Endless, Two-Way, Time Trial, Police Chase and Free Ride<br>- Rich types of NPC traffic including trucks, buses and SUVs.<br>- Basic customization through paint and wheels<br>- Online Leaderboards and Achievements<br> <br>GAMEPLAY<br>- Tilt or Touch to steer<br>- Touch gas button to accelerate<br>- Touch brake button to slow down<br> <br>TIPS<br>- The faster you drive the more scores you get<br>- When driving over 100 kmh, overtake cars closely to get bonus scores and cash<br>- Driving in opposite direction in two-way mode gives extra score and cash<br> <br>Traffic Racer will be updated constantly. Please rate and give your feedback for further improvement of the game.<br> <br>FOLLOW US<br>* http://facebook.com/trafficracergame<br>* http://twitter.com/TrafficRacer<br>* https://plus.google.com/115863800042796476976/', 'https://lh3.googleusercontent.com/2uTOewaztiOuJsDPyMXSlBkeQq2sM5netXJUpi2Nk_e06XU9cqIfaK6l02vRYkumsQI=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"February 27, 2018\"},{\"type\":\"Size\",\"info\":\"53M\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.5\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a0120.00 - \\u20b9\\u00a03,600.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as in