(303, 310, 'Cricbuzz, the No. 1 Cricket App on Google Play, now brings Cricket in Hindi, Tamil, Kannada, Telugu, Marathi and Bengali. The app provides ball-by-ball coverage of all international cricket matches (Test, ODI and T20), Indian Premier League (IPL), ICC Cricket World Cup, Champions League T20, Big Bash and other major domestic tournaments from across the globe in regional languages.<br><br><br>Top Features:<br><br>  -  Live cricket scores and ball by ball updates that helps you stay close to the action.<br>  -  Squads, Playing XI, Umpires, Venues - all the information you need about ongoing matches.<br>  -  Upcoming matches - what\\\'s up for tomorrow, next week, next month?<br>  -  Results of recent matches - in case you want to look at the scorecard of a game that you recently missed.<br>  -  Player profiles - Cricket is all about the players - runs, wickets and everything else.<br>    <br><br>Important Note: <br><br>     <br>   -  Some handsets do not support certain regional languages. So, if you are not able to find any of the above mentioned languages in the list, it is a device specific issue. <br>   -  For the Complete Cricket App in English (which includes ball by ball commentary, news, photos, rankings, archives and much more) download this version of the Cricbuzz App here: https://play.google.com/store/apps/details?id=com.cricbuzz.android', 'https://lh3.ggpht.com/LGAwt1hJ_6eK0Y4Vr9MgtGt6ne4tHhXHqUNf4x6OpuWVmF8xs1DxGJTh3PviEYB0wA=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"February 27, 2019\"},{\"type\":\"Size\",\"info\":\"5.3M\"},{\"type\":\"Installs\",\"info\":\"5,000,000+\"},{\"type\":\"Current Version\",\"info\":\"3.1\"},{\"type\":\"Requires Android\",\"info\":\"4.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Cricbuzz.com\"},{\"type\":\"Developer\",\"info\":\"Visit