(307, 314, '<b>Do you like word search?</b> This letter puzzle game will surprise you. Edujoyâs word search game is <b>easy to play</b>, ideal for hours of fun entertainment while training your brain. It is suitable for both <b>adults and children</b>, resulting in an educational and enriching experience as you play. It has <b>different levels</b> of difficulty, making it perfect for anyone who is on the lookout for words on a board.<br><br><u>Easy</u>: Perfect for little kids. The board is 6x6 so it\\\'s easy to find the words and solve the puzzle. In addition, the clue system helps you find a new word when the child is stuck.<br><u>Medium</u>: The board is built 9x9. As you move up in the game the level becomes much more difficult and challenging than the last.<br><u>Hard</u>: The board is 12x12 and each game is harder. This level is made for players who are looking to test and train their brain with a classic puzzle game.<br><u>Extreme</u>: Only the bravest may face this level! A difficult feat for those up for the challenge. Do you think you\\\'ll be able to beat it?<br><br>Our app is a classic mental game for all ages. Find the hidden words! 5 levels of difficulty for all ages - easy for children all the way up to extreme for adults.<br>It is also available in several languages, which ââmakes it ideal for learning new vocabulary in other languages. If you are learning: <i>Spanish, English, German, Portuguese, French, Italian, Polish, Turkishâ¦</i> this is the game for you!<br>You will never want to play another word search game and end up referring it to your friends! Every time you play it\\\'s a new experience due to our generating system that creates a brand new, random puzzle game. By doing this, it makes it challenging for you every time and allows us to keep you wanting to solve the puzzle. So, you will never get bored!<br>The word search boards are created with many fundamental topics: food, animals, cities, countries, transport, home, colors, sportsâ¦ Are you ready to solve hundreds of fun-filled puzzles?<br>In addition, the game is integrated with game services making it a <b>social experience with your friends and family</b>. This system allows you to compare your skills and results with others and millions of people around the world. Rankings and achievements included.<br>The classification is based on the time needed to complete a level. So the faster you are, the higher you rank.<br>Through your achievements, you can track your progress and know how you are doing as time passes by. Unlock all the achievements and eventually you\\\'ll become the master of puzzles.<br><br>Thanks to you, Itâs very important for us that you share your opinions so we can improve based off the feedback we receive. If you have any questions or suggestions please contact us on our site or through our profiles on social media:<br><br>Twitter: twitter.com/edujoygames<br>Facebook: facebook.com/edujoysl', 'https://lh3.googleusercontent.com/j0csnAweogwk4mLfDSX4PxjUYSeOfkBxIuIMOzRv9Kz-5ScSLRwd_7vXHAH2PmQgir8=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"February 19, 2019\"},{\"type\":\"Size\",\"info\":\"15M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"8.3\"},{\"type\":\"Requires Android\",\"info\":\"4.0.3 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a0100.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"AppQuiz\"},{\"type\":\"Developer\",\"info\":\"Visit websiteedujoy@edujoy.esPrivacy PolicyPlaza Euskadi, 9\\nBilbao CP 48009\\nBizkaia\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/AMI829aObxuX50JDKuYWNiu7yGsH3_kSvSBx9npF4-ujKZS0obNNYCAOHFx71bhWEKw=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/2T9Vf5oqZqNLb-VBa0imMtulsQ1TL-EK2mEyl9ig0MUVL1ogpdAw6YQTulPFsDy2cA=w720-h310\",\"data:i