(308, 315, 'This virtual coloring and drawing book, full of fairytale pictures, is designed for all family ages, girls and boys alike (although, girls especially like it). It is suitable for both phones and tablets.<br><br>You can fill the colors in prepared image outlines and can also create your own original drawings. It is so simple and easy even the youngest kids can play it. The game includes a lot of beautiful images of famous and beloved fairytale characters.<br><br>The Princess Coloring game includes the following features:<br>â 60 colorable pictures of princesses, princes, queens, mermaids, ponies, unicorns, etc.<br>â 20 bright and beautiful colors to use for drawing and filling.<br>â Filling an entire region with color, drawing with a pencil or a brush, and using an eraser.<br><br>You can paint, draw, or doodle their favorite fairytales, or basically whatever they want. Doodling, painting, and drawing have never been easier and more fun, so let\\\'s start now with your favorite fairy tales.<br><br>Our goal at Forqan Smart Tech is to provide the best value for your family, allowing them to develop visual and cognitive abilities, to learn to communicate with their peers and the environment around them, and to acquire important life skills. Each game is designed by a professional for the specific age group.<br><br>It is the time to have fun with our wonderful Princess Coloring game!', 'https://lh3.googleusercontent.com/P4OWLptfJiv4kdx8tsGeDQ11mwxEg8E-ueVYXF4Ppw0pA6K5natJoKTZla7hPaBHwKo=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"March 6, 2019\"},{\"type\":\"Size\",\"info\":\"37M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.3.4\"},{\"type\":\"Requires Android\",\"info\":\"4.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a0130.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info