(309, 316, 'Snow excavator machine - construction crane 2019 is developed for rescuing the people stuck in the snow mountains. In this extreme driving simulator, you have to drive snow excavator crane on the deadliest tracks of the world. You have to play as a construction crane operator for clearing the demolished areas. Be the savior for people who are stuck due to heavy land sliding, clear the roads with the snow plow and with the help of there other big machines.<br><br>You have to show pro driving skills by operating snow excavator machine in worst situations. Your goal should be to save the people by clearing the paths on any cost, the more your drive heavy cranes, the more expert construction truck driver you would be. So drive giant machines maximum to improve your expertise in digging games. This snow truck game is totally different from other construction games for free in terms of its stone cutter operations, driving snow plow and other heavy machines.<br><br>Your goal must be to become the best snow excavator operator to help humanity in extreme conditions. Perform all the construction operations like lift, load and dig for making the path clear and smooth. Benign the expert construction crane driver you have to drive dumper truck and snow excavator machine on the narrow paths and steep slopes. Be careful while driving in the village streets because there are huge piles of snow scattered all around that makes the entire village very slippery and very risky to drive. So be careful your one mistake can lead to a game end and you would have to perform all construction operations again for further proceedings.<br><br>Unlike other excavator sim 2019 games, this game is totally different due to dangerous missions. In each mission, you have to complete the unique challenging task for completing this stone cutter game. In one mission you have to play as snowplow driver by clearing all the snow from the roads. Remove the snow from the offroad roads for smooth driving. In other mission you have to perform construction missions like there may be land sliding in any village, you have to pick the snow piles or stones with the help of snow excavator and load all the stuff into the dumper truck. Then drive the dumper truck to the remote areas for disposal of stones and snow.<br><br>Be the winter hero and rescue the people by operating snow machines in the offroad areas. Show that you are the best snow excavator crane driver by completing all the challenging missions within the given time. Make no mistake and dedicately complete all the construction missions.<br><br>*** Features of Snow excavator machine - construction crane game ***<br>* very challenging road construction missions<br>* variety of heavy machines <br>* impossible tracks for driving machines<br>* extreme weather conditions <br>* real physics-based controls of all machines<br>* ultra high-quality graphics <br>* compatible with the variety of devices<br><br>Just download this excavator construction game for operating heaviest machines of the world.', 'https://lh3.googleusercontent.com/-1Oivc-RcmepOnoPcgusYK7R38pSYA7Gdo17b3Y5qXSpe4qWo4LPCWd8ay-LLZnpHifP=s180', 4, '[{\"type\":\"Updated\",\"info\":\"January 29, 2019\"},{\"type\":\"Size\",\"info\":\"52M\"},{\"type\":\"Installs\",\"info\":\"1,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.0.2\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a0240.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Futuristic Game Studio\"},{\"type\":\"Developer\",\"info\":\"futuristicgamestudio@gmail.comPrivacy PolicyLahore,Pakistan\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/Wc0WAeTSCF0\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/EcPsPpW0J46rruvyrzULWFLHeUKKB4xSrEb_3mqTT1tAc78NMpjDac5