(310, 317, 'Reverse Movie FX is an app that lets you create a reverse video that looks like a magic trick! First record a video of someone (or you): walking, drinking orange juice, talking or any other idea that comes to your head! After that select a desired movie fragment and press start! The app will reverse your video: you will see people walking backwards, your friend spitting the juice out, people talking backwards!<br><br>A few ideas of video reverse:<br>- item kinetic attraction (you have to throw an item)<br>- tear a sheet of paper<br>- throwing a sheet of papier to the toilet<br>- drinking a juice (and spitting it out as a result)<br>- spilling a juice<br>- money attracting<br>- etc.<br><br>Reverse video options:<br>- Add music<br>- reversed + original (loop)<br>- original + reversed (loop)<br><br>Give it a try, you\\\'ll be amazed! See how to play video in reverse! You can share the result with your friends of course anywhere you want: e-mail etc.', 'https://lh3.googleusercontent.com/6cIM-bTd0uxV0FGy2skU_zQja70nZvJYQi9Be91_d-SeqIMHtUR6desB6SQ74Yh4SQ=s180', 4.6, '[{\"type\":\"Updated\",\"info\":\"April 5, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact, Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a075.00 - \\u20b9\\u00a0150.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Bizo Mobile\"},{\"type\":\"Developer\",\"info\":\"Visit websitecontact@bizomobile.comPrivacy Policyul. Borkowska 25B\\/30\\n30-438 Krak\\u00f3w, Polska\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/JAjzea8mVOA\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleu