(311, 318, 'Drive and enjoy Offroad Jeep Driving Fun: Real Jeep Adventure 2019 with an offroad hummer on impossible tracks. Start offroad Jeep driving as car driver with wonderful and amazing impossible track in new 4x4 car riding. Offroad Jeep adventure is changing the rally car riding and offroad Prado racing into the real 4x4 extreme offroad adventure among the offroad Jeep driving games. Get ready as offroad hummer legend in car driving simulation 3d game on tricky tracks.<br><br>Offroad Jeep Driving Fun: Real Jeep Adventure 2019, feel the Prado driving challenge on four wheeler. Awesome four wheel offroad drive will give you unique experience of Prado riding and 4x4 legend drive. Build your career as the pro land cruiser driver in offroad car driving game of best simulation games. You have to be skilled offroad jeep driver to drive on hilly or mountain tracks. Modern Prado drive will add fun with its four wheeler. Get ready for 4x4 extreme offroad adventure 3d.<br><br>To become the professional jeep rider of impossible land cruiser driving game you have to drive on tricky tracks while going through checkpoints and collecting coins among offroad simulation games 2017. You can choose your favorite 4x4 wheeler car for offroad drive 3d among new offroad games. If you like the offroad jeep driving games or offroad four wheeler games and offroad jeep games then you will surely love to play impossible Prado game.<br><br>Offroad Jeep Driving Fun Features:&lt; /b&gt;<br><br>â¢	Easy, simple, smooth and relaxed control.<br>â¢	Outstanding Hummer game for legend players.<br>â¢	Multiple challenges with 4x4 Land Cruiser simulation.<br>â¢	Huge variety of smart jeep for unlock.<br>â¢	Great Fun, realistic driving physics.<br>â¢	Off road riding fun with impossible adventure tracks<br><br>If you like Offroad jeep Driving Fun: Real Prado Adventure 2019 then donât forget to rate and review.', 'https://lh3.googleusercontent.com/lykC2aYvqNeo8VnHbrYWmJzrrqkKN_rCNqTnQiOcU2COTZu-QIBuJYUSSXxdtQjMxh0=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"November 26, 2018\"},{\"type\":\"Size\",\"info\":\"44M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.0\"},{\"type\":\"Requires Android\",\"info\":\"5.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a0260.00 - \\u20b9\\u00a04,200.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Jima Apps\"},{\"type\":\"Developer\",\"info\":\"crownapps94@gmail.comPrivacy PolicyKhlong Toei, Bangkok, Thailand\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/gSQx1XuYQbrXPlKBtPzrhXZXU7YV58FXHo03LvEiVrKsUSoBT-t4g1oOorDKNMRR9FSf=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/6F1T71DSoD9dtQuQTRNtdgErLA_f88xfF9R3KxDchxzr0egt_zuZFgheGDlGqUQck_0=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[]', '2019-04-07 19:46:01', '2019-04-07 19:46:01', NULL);
