(312, 319, 'Ball by ball cricket updates with live scorecard and detailed scorecard available for all past cricket leagues is what basically the Cricket Live Line app tries to feed its users with. One of the leading app for live cricket updates Cricket Live Line is being updated to Cricket Live Line by adding a whole lot of exciting and enthralling features in order to serve its users with the best services.<br>The new Cricket Live Line app is a home to various magnificent features that include:<br>Live Ball-by-Ball Updates<br>â¢ Attractive Score Widget<br>â¢ Ball by Ball score updates<br>â¢ Live cricket match scores at the fastest<br>Schedules for upcoming Cricket Leagues<br>â¢ Schedules for all Upcoming matches <br>â¢ Upcoming T20, ODI and Test Face-offs<br>Detailed Scorecard for Past Leagues<br>â¢ A detailed overview for all past T20, ODI and test matches<br>â¢ Achieved Scorecard for all past domestic and International cricket leagues<br>Voice Commentary<br>â¢ Ball by ball updates with voice commentary for visualizing the experience<br>â¢ Voice Commentary to enhance the entertainment experience<br>â¢ Enthralling cricket moments spiced up with voice commentary<br>Player Stats, Rankings and Records<br>â¢ Player and Team Rankings based on the ICC ranking list<br>â¢ Latest Records achieved by Players and Teams<br>â¢ Player Performance Stats <br>â¢ Rankings and Records amendments in all international and domestic cricket leagues<br>Latest Cricket News<br>â¢ Cricket news regarding all domestic and international leagues from around the world<br>â¢ Match reviews and previews for all ongoing, past and upcoming matches<br>â¢ Special article coverage regarding different players and matches<br>â¢ Special article coverage for major Cricket tournaments<br>Popularity Polls for Upcoming Matches<br>â¢ Popularity polls for different matches<br>â¢ Chance to users for expressing their views by various ongoing polls<br>Market and Session Updates<br>â¢ On-going price updates in markets <br>â¢ On-going price on sessions<br>Cricket Live Line focuses on making your cricketing experience a whole lot better by keeping you updated with the recent things making the cricket world abuzz. Apart from live scores and match schedules, we offer a plenty of features that makes the cricket fever more exciting than ever.<br><br>Now Catch Your Live Score Fastest Ever <br>What\\\'s New in App<br>1.  Cricket Live Line Give You Fastest Live Score<br>2.  Cricket Live Line Give You Playing XI info of current Match<br>3.  Cricket Live Line Give You Live Commentary (add soon)<br>4.  Cricket Live Line Give You Rate and Session Details<br>5.  Cricket Live Line Give You Upcoming Fixtures<br>6.  Cricket Live Line Give You Recent Results with full scorecard<br>7. Accurate Rate<br>8. Fastest Session Report<br>9. Full Scorecard<br><br>Cricket Live Line will show almost all international and domestic cricket leagues scores, rates, session and many other important info.', 'https://lh3.googleusercontent.com/bQS6LefogjzJIdggYSyfxf-vhShXLp9MjHBKTQT_-hEHyx6TwqOEoDeUjMMgkSWMVIxY=s180', 4.7, '[{\"type\":\"Updated\",\"info\":\"August 28, 2017\"},{\"type\":\"Size\",\"info\":\"7.0M\"},{\"type\":\"Installs\",\"info\":\"5,000,000+\"},{\"type\":\"Current Version\",\"info\":\"3.8\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Cricket Line\"},{\"type\":\"Developer\",\"info\":\"abcdekho@gmail.comPrivacy Policy\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/7gSPnbatjJe6GSKLqSVOofMSMEMcZL0yO1dFNyYxI9LgIi9ROxl4sM5toWf4Qtn7Tw=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/7dIxZqQXKxeUgeegi9pR5A2wiko_vZrOqNB0Q0g98AatA2OCnJH4rxcvXkZtAuep6zs=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[]', '2019-04-07 19:46:01', '2019-04-07 19:46:01', NULL),
(313, 320, 'A brand new addition in google play games free army games US army commando of war shooting games will play survival game in wolrd war battleground of unknown island where he has been called for US army commando survival war in intense free to fire shooting games where World war US army commando will accompany the US army firing squad in war shooting battle to be the last unknown army player standing in world war survival battleground war shooting games.<br><br><br>The battle for unknown survival for WW US army commando in shooting battleground starts when US army commando lands onto the island for survival shooting missions against rival army players. World war Battle of US Army Commando Survival Battleground is best survival games and shooting game which lets player parachute onto an island, loot and scavenge weapons, supplies, health box and other survival war equipment for ultimate survival in world war US army shooting battleground of world war.<br><br><br>In this army games for free US army commando survival the player has to be perfect in fire shooting games, war shooting games and take perfect aim as unknown shooting battle has many US army rivals having heavy war equipment to win this Last Survival Game. Defeat your enemies in shooting battle as US Army Commando Survival Battleground and get ready to explore the battleground land, loot, survive, shoot and do whatever it takes to survive in US Army Commando Survival Battleground. Search and scavenge for world war equipment, secret documents, bomb planting and secret mission of incineration on unknown island. The battle of unknown army squad in this fps shooting games and survival games gets intense with increasing levels. Fight for your ultimate survival shooting battle as best US army commando in world war survival shooting battleground war shooting games.<br><br><br>Enjoy both TPS and FPS mode in one gameplay US Army Commando Survival Battleground with most realistic action shooting experience. The survival battleground is big, look in maps to search for rivals in battleground arena. Be the real survival hero and make world war survival war prisoner escape from world war battleground. Fight for honor and valor as unknown survival hero of US army war shooting games with perfect ambush in offline game. Explore the open world in US Army Commando Survival Battleground and follow the rules to survive against lethal weapons and realistic ballistic. Fight till your last breath in this army game. In this war shooting games, search for health aid and explore survival battleground war shooting games.<br><br>Enjoy world war survival battleground shooting mission in survival game of US army commando with thrilling gameplay. Fight with rivals in intense shooting battle in survival battleground and defeat the unknown shooting players in fps shooting games. Scavenge and loot weapons and guns for your war survival in US Army Commando Survival Battleground.<br><br><b> *GAMEPLAY FEATURES* </b><br><br>â¢	High Quality Graphics &amp; engaging sound effects!<br>â¢	Challenging gameplay to Scavenge for weapons!<br>â¢	Gather supplies, guns and war equipment for survival!<br>â¢	Battle against unknown army squad in world war shooting game!<br>â¢	Explore the vast battleground as US army commando survival shooter!<br>â¢	Challenge yourself to be the last standing player in finest google play games!', 'https://lh3.googleusercontent.com/CwtwIDmrrhf59E2oHMKaLve7xsD1pn2iJopoJgQJO5yEKFffT3PC35b-HfTi4wVOPlk=s180', 3.9, '[{\"type\":\"Updated\",\"info\":\"April 2, 2019\"},{\"type\":\"Size\",\"info\":\"64M\"},{\"type\":\"Installs\",\"info\":\"5,000,000+\"},{\"type\":\"Current Version\",\"info\":\"3.1\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 16+Strong ViolenceLearn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a065.00 - \\u20b9\\u00a03,800.00