(315, 322, 'Are you ready for war? Download this explosive multiplayer tank shooting game, it\\\'s FREE!<br>Choose your tank and gun, and clash with your opponents in fast-paced battles featuring realtime action and packed with exciting action in combat.<br><br>Challenge your friends and fire up in this game. Prove yourself in battle as the greatest tanks commander of all time!<br><br><b>FAST PACED SHOOTING GAME</b><br>3 minutes! That\\\'s the time you have to take down as many tanks as you can in a perfectly balanced tank game designed from the ground up for mobile. <br><br><b>DEFEND YOUR COUNTRY</b><br>Defend the honor of your country against your enemies. Battle against players from China, USA, Russia, Japan and more. The world is full of tanks!<br><br><b>TWO EXPLOSIVE MODES</b><br>Fight in team-based battles or in the free-for-all conflicts.<br><br><b>ICONIC TANKS FROM ALL AROUND THE WORLD</b><br>Choose your tank from a wide range of powerful beasts depending on your strategy. Choose a light tank to fast scout the enemy\\\'s territory and provide your team battle changing intel. Or take the heaviest and strongest of all, the Panzer, and give your enemy what it deserves.<br><br><b>DEEP TANK UPGRADE SYSTEM</b><br>Unlock new tanks and make strategic decisions over what part you want to upgrade. Show your enemy who you are with tank customization with decals and patterns. Are you ready to beat the best?<br><br><b>VARIOUS BATTLEFIELDS TO EXPLORE AND MASTER</b><br>Fight and shoot your enemies in various World War II battlefields: European cities, industrial zones with robots, no man\\\'s lands... Know the battlefield and get the edge on your assault over the enemy.<br><br>Download now, it\\\'s free!<br><br>From Fun Games for Free, the same developer behind games like Sniper 3D, War Heroes and Castle Crush!', 'https://lh3.googleusercontent.com/yy2zhciIL0Y7g6ZohdHDF9I39RMNOdeNJwAEZuavV6zkyVJfh_YKaJG6Xq0h5iYFkw=s180', 4.6, '[{\"type\":\"Updated\",\"info\":\"April 1, 2019