(319, 326, 'Participate in GOQii India Steps Challenge 2019 #AbChalegaIndia<br><br>GOQii: Smart Preventive Healthcare for you and your family<br>Family Care with Personalized One-on-One Coaching, Doctor Consultation and Expert advice + Activity Tracking + Rewards<br><br>GOQii (pronounced âgo-keyâ) goes beyond basic activity tracking by giving your and your family access to professional GOQii Care Team<br><br>GOQii Family Care<br>Family Care encourages you as well as your entire family to make a sustainable shift towards a healthy lifestyle. GOQii family care connects, tracks and takes care of entire familyâs health with Consults from GOQii Care Team.<br>GOQii Family Care would be managed by GOQii Care Team consisting of GOQii Coach, GOQii Doctors and GOQii Experts. <br><br>GOQii Personal Coaching<br>Whether your goal is to feel better, get healthier, lose weight, sleep better, or break a bad habit, your GOQii coach will help put you on your best path to success. You will get consistent support, motivation and expertise through unlimited text chats and scheduled calls through the app.<br><br>GOQii Doctor<br>GOQii Doctor is a qualified physician who will be available on the GOQii platform to provide consultations. This is your lifestyle Doctor who can give you a basic health consult and 2nd opinions.<br><br>GOQii Expert<br>GOQii Expert is a subject matter expert who resolve your health concerns. You can ask you and your familyâs health concerns and get answers from health experts.<br><br>GOQii Tracker<br>GOQii app is designed to work with GOQii Fitness Trackers.<br>Sync your GOQii HR, GOQii Vital, GOQii Run-GPS, GOQii Stride Tracker with your Android device wirelessly.<br>Track your Steps, Distance, Heart Rate Monitoring, Exercise Mode, Call/SMS Notification and more.<br><br>Centralised GOQii Health Locker <br>You can now keep track of your and your family memberâs  health records in one place that\\\'s organized and available to them online through the app. You can now get the lab results, prescription history etc. directly into Health Locker and use or share it as needed.<br><br>GOQii Health Risk Assessment (HRA)<br>GOQii provides you with a Health Risk Assessment (HRA) questionnaire to help you better evaluate health risks and quality of life. The screening assigns you with a health risk score and generate a comprehensive report for the GOQii Care Team to evaluate. <br><br>GOQii Karma<br>GOQii Karma is a philanthropic platform designed by GOQii to enable you to help others as you achieve your goals. You are rewarded with Karma points that you can use as virtual currency to make donations towards any of the worthy causes listed on the GOQii Platform. In lieu of this virtual donation, GOQiiâs Karma partners will make a real monetary donation.<br><br>GOQii Arena<br>GOQii Arena allows you to get influenced and be motivated by friends in making a lifestyle change for the better and get healthy. You can connect with new people and spread the word of health and fitness and magnify oneâs own fitness and health quotient.<br><br>GOQii Health Store - Marketplace for Health Products and Services<br>GOQiiâs Health Services Marketplace offers a whole suit of health products and services in partnerships with various health service providers. (Currently available only in India)<br> <br>GOQii Rewards<br>With GOQii Rewards, you will get GOQii Cash points which can be redeemed for multiple health products/ services. (Currently available only in India)<br> <br>GOQii Diagnostics<br>You can book lab tests from the comfort of your home through the GOQii app and get discounts on family health checkups and other lab tests. (Currently available only in India)<br><br>GOQii App<br>All the GOQii Services and features are made available to you on GOQii App. <br>Key features include:<br>Communicate with coach via chat and calls<br>Consult with GOQii Doctor and Expert<br>Manage family health<br>Goal and habit tracking<br>Track sleep, steps, 