(322, 329, 'Race the Traffic is one of the best racing games. Have fun dodging cars and trucks while you speed up to the limit. Race against the AI in an outstanding Racing Face-Off and try to earn the respect of your fellow drivers. <br>Take your car and race against everyone in 3 different game modesâ¦ day or night!<br>Race the Traffic has lots of cars to purchase. You can also upgrade your ride with your hard earned money. Get the best car money can buy and beat everyone in this amazing racing game.  <br>What are you waiting for? Download Race the Traffic now!<br><br>Features:<br><br>- 3 games modes.<br>- Lots of cars.<br>- Great 3D graphics.<br>- Awesome music.<br>- Endless fun!', 'https://lh3.googleusercontent.com/a9wJ_SFf9r1M7OTG5upBx7X-a5-P9z85ZsBas8n7e_gxdP-beHO0JhtFIqC__fzXN9U=s180', 4, '[{\"type\":\"Updated\",\"info\":\"August 21, 2018\"},{\"type\":\"Size\",\"info\":\"26M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.2.1\"},{\"type\":\"Requires Android\",\"info\":\"4.0.3 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 12+Simulated GamblingLearn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Shares Location, Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a010.00 - \\u20b9\\u00a0100.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Play365\"},{\"type\":\"Developer\",\"info\":\"TameikaHastin@gmail.comPrivacy Policy9709 Kenneth Oren drive\\nCharlotte, NC 28213\\nUnited States\\n\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/cPUu8jiOeofvP3VRHb3JAyUVo2c7uDBtDsx5BIBx-B03C2npYEVSY6AmrF2nI4VY7rc=w720-h310\",\"https:\\/\\/lh3.ggpht.com\\/vCNNRNq0Oxy-UyyuKdoV-4zBeWmYIBidQe5X-pnTNRdWN4wjKfG5lXGedKN49-HJWzRe=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIA