(323, 330, 'FPS Hunter is the latest thrilling shooting game where you have to play the role of a stealth huntsman. Be wary of your surroundings and adapt accordingly. Watch out for the beasts of the forest that are out to hunt you. Kill any wild animal on sight! Do not give it an opportunity to attack you as it might be the last thing you do. It is time to load out your weapons and get your 5 star shooting fix! Be careful, wild animals are dangerous and can attack people. For best shooting results - use the scope. Do not approach your prey too close - you will frighten the animal away.<br><br>Hold the barrel of your gun and get ready to pull the trigger as you roam in this realistic environment full of unknown dangers in Hunting Challenge. With access to powerful guns you will rely on your marksman skills to kill and trap animals including Zebras, Bears, Cheetahs, Elephants, Lions and even dinosaurs escaped from parks. Hunt animals so real they nearly jump off the screen! Track down and bag the worldâs most exotic and elusive game.<br><br>FPS Hunter Game Features:<br><br>- Jaw dropping 3D graphics<br>- Immersive hunter missions to complete<br>- Awesome sound effects<br>- Dozens of real world weapons and upgrades', 'https://lh3.googleusercontent.com/qkCDkaIXPWUBF7-QlXMlgYAfHLD1DmzxEsBR01rSWzhF1t4M3W_yKMyHePkLwPpcbjGA=s180', 4.2, '[{\"type\":\"Updated\",\"info\":\"February 28, 2019\"},{\"type\":\"Size\",\"info\":\"89M\"},{\"type\":\"Installs\",\"info\":\"1,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.4\"},{\"type\":\"Requires Android\",\"info\":\"4.0.3 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 16+Strong ViolenceLearn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a0150.00 - \\u20b9\\u00a09,500.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Timuz 