(324, 331, 'Welcome to the most authentic, complete and surreal Cricket experience on Android - Real Cricketâ¢ 18 now with 3D Gameplay<br><br>For all you cricket fans out there, Intensity of a Real Cricketâ¢ game is now on your mobile with a host of new World Cricket Championships and Premier Leagues making this game one of the best in World Cricket!<br><br>MOST INNOVATIVE GAMEPLAY EVER!<br>For the first time, feel the difference between various batsmen and their styles of play with Batting Types â Defensive, Balanced, Radical and Brute, each with their unique cricket shots and aggression levels making it one of the best games in World Cricket<br><br>CHOOSE YOUR PREFERRED TIME OF DAY!<br>Choose between our Morning, Afternoon, Evening, Dusk and Night timings and experience different day times as the match progresses giving you the option to play Day Matches, Day Night Matches and Night Matches<br><br>BOWL REAL DELIVERIES<br>Now have an arsenal of bowling deliveries to choose from such as Off Spinner, Arm Ball, Top Spinner, Doosra, Leg Cutters, In-Swingers, Slower Balls and many more.<br><br>ULTRAEDGE â SNICOMETER AND HOTSPOT<br>Review the umpires call for edges and LBW with the most enhanced technology of the ultraedge review system which includes both Hotspot as well as Snicometer. <br><br>RAIN AND DUCKWORTH-LEWIS METHOD<br>Weather is unpredictable and it may rain anytime. Same is the case in the most authentic cricket game on the store. Now introducing Rain and Duckworth-Lewis method for a rain curtailed match adding unpredictability to the outcome of the entire match<br><br>AUTHENTIC STADIUMS<br>Experience the most authentic live stadiums including Mumbai, Pune, Cape Town, Melbourne, London and Dubai. Each stadium providing a unique feel and guaranteed to provide an experience different from the other.<br><br>ALL NEW PRO CAM <br>Play from the eyes of the batsman and feel the thrill of the ball hurtling towards you at 90 MPH. Bat yourself into form and show nerves in crucial moments!<br><br>TOURNAMENTS<br>Real Cricketâ¢ 18 has 16 Different World Cricket Championships  including the World Cup, Asia Cup, Champions Cup, Master Cup, Under 19 World Cup and Premier Leagues including the Indian Premier League, Pakistan Super League, Bangladesh Premier League, Big Bash Cricket and Caribbean Premier League<br><br>INDIAN PREMIER LEAGUE â PLAYERS AUCTION<br>The only Mobile Cricket Game in the world to allow users to participate in the IPL Auction building their own Dream XI and competing for the most coveted cup in Premier League history!<br><br>TEST MATCHES<br>The longest and the purest form of Cricket is now available to you in Real Cricket 18 with true to life Match Conditions and Gameplay along with New commentary and Field Setup options along with Pink Ball Test Cricket giving you the surreal experience of playing Test Cricket under lights with the Pink Ball<br><br>CRICKET SIMULATION AT ITS BEST<br>Get stuck in and grind out through the tough moments. Hitting sixes in no more a piece of cake.<br><br>ACTION, DRAMA &amp; SLEDGING<br>Be part of key battles between players. Engage the opposition players with some mind games.<br><br>UNIQUE PLAYER FACES, JERSEYS &amp; JERSEY NUMBERS<br>Get unique player faces, great looking team jerseys with numbers on the back!<br><br>DRS &amp; THIRD UMPIRE<br>The best in class and most authentic Decision Review System is now included. Also, Experience Third Umpire referrals for Run Outs and Stumpings.<br><br>This app offers in-app purchases.<br><br>*Permissions:<br>To deliver the best experience we would need some permissions from our users:<br><br>GET_ACCOUNTS: This permission is required to access Google Game Play Services including Login, Achievements and Leaderboard.<br><br>WRITE_EXTERNAL_STORAGE and READ_EXTERNAL_STORAGE: We need these permissions to cache and read game content during the gameplay.<br><br>READ_PHONE_STATE: We need this permission to serve you relevant notifications on various updates and offers.<br><br>ACCESS_FINE_LOCATION: We need this permission to detect your location so as to provide region-specific content as well as analyze your regions needs and feedback better.', 'https://lh3.googleusercontent.com/zReKWzbI16ZwOm8FO8l3nGlWrNeVbhU5i-JueLPvMHf3pFw3fuBMZ7gMvw3KQfjhwA=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"February 7, 2019\"},{\"type\":\"Size\",\"info\":\"34M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.1\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a040.00 - \\u20b9\\u00a05,000.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Nautilus Mobile\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport@nautilusmobile.comPrivacy PolicyNautilus Mobile Pvt. Ltd.\\nD.No 8.-2-684\\/III\\/9, Kanaka Durga Temple Lane.\\nBanjara Hills Road No.12, Hyderabad - 500034, A.P. India\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/uWNZO_k_ifk\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/gd50uXkQ8OShntYzwZ5VxCgntvXj1kN2ix0AJzneZvz1Wb7BmX41IjQfyyRxV2qYKNE=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/ica4QjOeBK0DfJnOgkdx5afkGMoqtKKW_6uhsrvDOJ4lopFZVPl73J6KXLWhmbtN4w=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAA