(325, 332, '<b>Over 1.3 Billion Downloads</b><br>Google Play Best of 2015<br><br>All templates can be downloaded for free in the latest version!<br><br>WPS Office is the smallest size (less than 37MB) and all-in-one complete free office suite on Android mobile and tablets, integrates all office word processor functions: Word, PDF, Presentation, Spreadsheet , Memo and Docs Scanner in one application, and fully compatible with Microsoft Word, Excel, PowerPoint, Google Doc and Adobe PDF format.<br><br>The aim of WPS Office is to provide you one-stop working solution since 1989. Various of office tools and unique and intuitiveÂ UI design ensures you enjoy the best mobile office experience. You could easy to do all office word processing on-the-go on phone, tablet and other portable devices. WPS Office allows you can create, view, edit and share office word documents and homework as handy as you need while out of office, in class,traveling, before bedtime or whenever and wherever you want. <br><br>ãWPS Office Highlights Featuresã<br><br><b>All-in-one Complete Free Office Suite App</b><br>â¢ Integrate with Memo, Document, Spreadsheet, Presentation and PDF<br>â¢ High compatibility with Microsoft Office( Word, PowerPoint, Excel ), Google Docs, Google Sheets, Google Slides, Adobe PDF and OpenOffice. <br><br><br><b>Free PDF Converter, PDF Reader and PDF Editor</b><br>â¢ Convert all office docs ( word, text, excel, PowerPoint,doc ) to PDFs<br>â¢ Scan paper docs to PDFs/images using mobile camera<br>â¢ Support PDFs viewing, Add bookmarks and Annotations Viewing<br>â¢ Support PDF Signature,PDF Extract/Split, PDF Merge, PDF to Word<br><br><b>Make Presentations on-the-go</b><br>â¢ Dozens of new Presentation layouts, animation and transition effects<br>â¢ Make presentations using WIFI, NFC, DLNA and Miracast<br>â¢ Touch controlled laser pointer, Ink feature lets you draw on slides while in presentation mode<br><br><b>Easy to Use and Powerful Spreadsheets</b><br>â¢ Complete predefined formulas makes you do basic data and digital operation more conveniently<br><br><b>Connect to Cloud Drive</b><br>â¢ Automatically save office documents to the clouds: Dropbox, Google Drive, Box, Evernote and OneDrive. Keep your all documents always up-to-date via cloud service.<br>â¢ Easily access and edit office documents directly from any devices<br><br><b>Easy to Share/Transfer Documents</b><br>â¢ Easy to share office documents via WIFI, NFC, DLNA, Email, Instant Messaging, Whatsapp, Telegram, Facebook and Twitter<br><br><b>Fully supports Multi-window mode</b><br>â¢ Allows you easy to deal with different tasks at the same time<br><br><b>Unique and IntuitiveÂ Mobile Office Experience</b><br>â¢ Special Night Mode and Mobile View mode for Documents viewing and PDFsÂ reading<br><br><b>Supports 51 languages and All Office File Formats</b><br>â¢ File Formats: doc, docx, wpt,dotm,docm, dot, dotx / xls, xlsx, xlt, xltx, csv, xml , et, ett / PDF / ppt, pot, dps, dpt, pptx, potx, ppsx / txt / log, lrc, c, cpp, h, asm, s, java, asp, bat, bas, prg, cmd, Zip<br><br><b>Various of Value-added in-app Products</b><br>â¢ Exclusive authorized Fonts Package and Presentation Templates;<br>â¢ Convert texts to fine images;Â <br>and more services for WPS Office members is coming soon. Join us now!<br><br>ãEditorsâ Reviewsã<br>CNET:Â âAn all-in-one office app with speedy performanceâ âone of the best mobile office suitesâ<br>USA Today: âBest Apps for Mobile Phones and Tabletsâ<br>Gizmodo:Â \\\"Essential app for your new Android phone or tabletâ âThere may well be better Office apps out there, but this is one of the best free ones.â<br>Economic Times:Â âone of the best free document viewer and editing apps availableâ<br><br>Some permissions may be required:<br>- Billing Authorization: We provide a variety of added-value services for our premium members.<br>- Position Permission: We are preparing additional services (such as weather information) and features. They will be available to designated users based on location.<br><br>ãSupport Pageãhttp://help.wps.com/Android-Office/', 'https://lh3.googleusercontent.com/7-CBOICJrtltP-Ndzq-c8Vugt1FTsy2vw-SZUZ5ov0BY7XgDrVeltTwtyhjVbxh943M=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"March 25, 2019\"},{\"type\":\"Size\",\"info\":\"38M\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"11.5.2\"},{\"type\":\"Requires Android\",\"info\":\"4.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a029.99 - \\u20b9\\u00a02,200.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Kingsoft Office Software Corporation Limited\"},{\"type\":\"Developer\",\"info\":\"Visit websitefeedback@wps.comPrivacy PolicyUnit 1309A, 13\\/F, Cable TV Tower, No. 9 Hoi Shing Road, Tsuen Wan, N.T., Hong Kong\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/mKxiujJ8ClQ\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/7JbCYhmhzKMARbqwJbxWaGsKfsW3aBW9k-FXmJLHaFqO7MPOhPjOLzPU1dY4SSZtWnw=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/xr1PXgAIGU-Hz8foi8gda84hB7ji8BcOFoutKkrUK24-lWWw9pXmmLu2nhIHCDWf_gg=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEK