(326, 333, 'My Name Ringtone Maker is the best app for making name ringtone as your favourite caller tune. <br><br>Not only your own name. You can create ringtone using any names. How famous the name can be, you can make it as your incoming call ringtone.<br><br>By using MP3 Cutter option you can able to cut mp3 songs and you can able to keep them as ringtones. This app can be used as MP3 Ringtone Maker.<br><br>No need to browse online websites to create best ringtones. You can use this app to create beautiful ringtones for your mobile.<br><br>Using this name ringtone maker app you can create name ringtone in 3 simple steps.<br><br>1) Enter your favourite name in the textbox.<br><br>2) Play it to listen.<br><br>3) Now you can save the ringtone.<br><br>This app also having Flash Light and Audio Record functionality. So by using audio record functionality you can record voice and you can use it as your ringtone.<br><br>Go to the MyRingtones section to check all of your ringtones created using the app.', 'https://lh3.googleusercontent.com/uIY5aiaGca-yJvZ8BaSPCC7jc5QC6q3v0uZ9ZN_x-mYba_lsVGw5EwD0pSy_BPTFhpMq=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"March 22, 2019\"},{\"type\":\"Size\",\"info\":\"3.7M\"},{\"type\":\"Installs\",\"info\":\"5,000,000+\"},{\"type\":\"Current Version\",\"info\":\"5.5.6\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"MOBIHOME\"},{\"type\":\"Developer\",\"info\":\"arun09125@gmail.comPrivacy Policy\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/aS0at3tDB3dG3GYyeqC-qCysJY0g-JT_4xFi7qCBylaecUBmkvKx9J-H_pyUN7EdAZrP=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/F6z25be9yrcjHHVFBgey2mY0Y4Dhu3dyuZuj24uwOall1ZH5HrZitkYDV8I0yfrhpogp=w720-h310\",\"data:imag