(327, 334, 'Adobe Photoshop Lightroom CC is a free, powerful, yet intuitive photo editor. Lightroom also provides a robust premium offering filled with advanced photo editing features to take your photography to the next level. Check out all the features below.<br><br>FREE FEATURES<br><br>â¢ PRESETS: Make dramatic changes to your photos with our single touch photo editor<br>â¢ PROFILES: Use these one-tap miracles to create visually striking changes to the look-and-feel of your photo edits<br>â¢ CURVES: Make advanced photo edits to change color, exposure, tone, and contrast<br>â¢ COLOR MIXER: Refine and tweak colors on your photo to make them pop<br>â¢ CLARITY &amp; DEHAZE: Breathe life into your photo edits with these industry-leading tools<br>â¢ BULK EDITS: Easily edit photos in large albums and get consistent looks by copying your favorite edits across photos<br>â¢ PRO-LEVEL CAMERA: Unlock your phoneâs potential with unique controls. Choose from exposure, aperture, wide or telephoto lens, instant presets and more<br>â¢ CUTTING-EDGE CAMERA MODES: Get more detailed shots with advanced capture modes such as raw, professional, and HDR*<br>â¢ ORGANIZE &amp; MANAGE: Use folders, albums, star ratings and flags to highlight your best photos<br>â¢ SHARE YOUR WORK: Post your photos to Instagram, Facebook, Twitter, Flickr, and more with the hashtag #lightroom<br><br>PREMIUM FEATURES<br>Take your photography to the next level with Lightroom Premium! Upgrade to unlock easy-to-use photo editor tools like the Healing Brush, selective adjustments, geometry, cloud storage, Adobe Sensei features, and much more.<br><br>â¢ HEALING BRUSH: Take complete control of your image by removing just about anything from your photo, no matter how big or small<br>â¢ SELECTIVE ADJUSTMENTS: Precisely edit any part of a photo with your finger or stylus to apply enhancements with exact detail<br>â¢ GEOMETRY: Make sure it all lines up. Create super clean shots with straight lines by adjusting the perspective of your image with powerful upright, guided upright, and geometry slider tools<br>â¢ RAW EDITING: Import raw photos from your DSLR or mirrorless camera to your phone allowing you to edit them anywhere<br>â¢ ADOBE SENSEI: Harness the power of artificial intelligence to automatically tag and organize your photos based on the objects or people that are in them. A quick search for âmountainsâ or âMariaâ will surface all the photos with those elements in them<br>â¢ ADOBE CREATIVE CLOUD STORAGE: Back up your original photos and edits to access them on other devices, as well as through Lightroom CC on web<br>â¢ ADVANCED SHARING: Lightroom CC web galleries enable you to easily showcase your photos online. Photo edits sync seamlessly, so any changes you make are always up-to-date<br><br>*Full raw HDR capture mode is currently supported on devices that contain advanced processing and memory capabilities including but not limited to devices such as - Samsung S7, S7 Edge, S8, S8+, Note 8, Google Pixel, Pixel XL, Pixel 2, Pixel 2 XL, Pixel 3, Pixel 3 XL, and OnePlus 5.', 'https://lh3.googleusercontent.com/1JJMfwHTCT-wDIxciN2XFCqQV7neyoJ1DhXQIuEkPJ5mxwiYDiAqdeZT8UxLEfW8AQ=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"April 3, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"4.2.2\"},{\"type\":\"Requires Android\",\"info\":\"5.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact, Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a0300.00 - \\u20b9\\u00a0690.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Adobe\"},{\"type\":\"Developer\",\"info\":\"Visit websiteLrAndroid-Feedback@adobe.comPrivacy PolicyAdobe Systems Incorporated