(328, 335, 'Message and video chat with your friends and family for free, no matter what device they are on!<br><br>With imo beta, users can preview and try new and experimental IM features. However, the beta app is less stable than the official imo instant messenger app. For the latest stable version, download our official app at https://play.google.com/store/apps/details?id=com.imo.android.imoim.<br><br>- Send unlimited messages and make free video and voice calls over your 2G, 3G, 4G or Wi-Fi connection*<br>- Make high-quality video and voice calls<br>- Group chat with friends, family, roommates and others<br>- Share photos and videos<br>- Express yourself with hundreds of free stickers!<br>- Encrypted chats and calls<br>- Optimized for Android tablets<br>- Avoid SMS and phone call charges<br><br>*Data charges may apply. Contact your provider for details.', 'https://lh3.ggpht.com/653qJf6Ro417FXETOBl3cAJ9hborY6PnCONzLBapvNDw6VgRximFc9YKWDGc82yKKNEV=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"April 2, 2019\"},{\"type\":\"Size\",\"info\":\"21M\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"9.8.000000011672\"},{\"type\":\"Requires Android\",\"info\":\"4.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a065.00 - \\u20b9\\u00a013,400.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"imo.im\"},{\"type\":\"Developer\",\"info\":\"Visit websiteandroidsupport@imo.imPrivacy Policy395 Pagemill Rd, Suite 100, Palo Alto, CA 94306\"}]', '[\"https:\\/\\/lh3.ggpht.com\\/EAOFobUNpLgty62vcTTunBz73FEJ4bkSM9Fpe73n94Xs7WR-gJzGUfpEUvVLD8dShpk=w720-h310\",\"https:\\/\\/lh3.ggpht.com\\/PZ6Ppt6XYbs6gx53Aj8vnVoR-PuWbmU_mOVFLpxnbhqfHnX6tDNKvFjyKATOdIRmRbo=w720-h310\",\"data:image\\/gif;base