(330, 337, 'Start your agricultural career in Farming Simulator 14 on mobile and tablet! Take control of your farm and its fields to fulfil your harvesting dreams.<br><br>As well as a refined look and feel, Farming Simulator 14 gives you double the number of farm machines to control, all authentically modelled on equipment from real agricultural manufacturers, including Case IH, Deutz-Fahr, Lamborghini, Kuhn, Amazone and Krone.<br><br>Features:<br><br>- New highly detailed 3D graphics and a slick user interface take your gameplay experience to the next level<br>- Play with a friend in a free roaming open world in the brand new local multiplayer mode for WiFi and Bluetooth<br>- Plant wheat, canola or corn and sell it in a dynamic market<br>- Mow grass, tedder and windrow it to create hay bales to feed to your cows, then sell their milk to the highest bidder<br>- Make money by selling grass or chaff at the Biogas Plant<br>- Hire computer-controlled assistants to help you with your work', 'https://lh3.ggpht.com/QA6VaufIyoaedx2JIusbaQzw8EadQ9QnwGQzjkbcaT5rs35g1bRlFBNm832AaYztSgA=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"July 17, 2017\"},{\"type\":\"Size\",\"info\":\"51M\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.4.4\"},{\"type\":\"Requires Android\",\"info\":\"2.3.3 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a020.00 - \\u20b9\\u00a060.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"GIANTS Software\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport@giants-software.comPrivacy PolicyWiesenstrasse 19\\n8952 Schlieren\\nSwitzerland\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/qMA2dDGuJ-Y\\/hqdefault.jpg\",\"https:\\/\\/lh3.ggpht.com\\/kRlsJPZSjzxuAZyshYd