(340, 347, 'The Alibaba.com app is a leading wholesale mobile marketplace for global trade. Buy products from suppliers around the world, all from the convenience of your mobile device.<br><br>Buy &amp; Pay with confidence<br>Alibaba Trade Assurance fully covers your purchases when suppliers do not meet the product quality and delivery schedule specified in the agreed contract. <br><br>Customized products<br>Suppliers have years of experience in customizing products, fulfilling the demands from sellers on Amazon, eBay, wish, etsy, mercari, lazada, etc.<br><br>Easy sourcing<br>Browse millions of products from industry-wide categories. Post Request for Quotations (RFQs) and receive price quotes quickly. <br><br>Fast shipping <br>Alibaba partners with major freight forwarders to provide sea, air &amp; land shipping solutions with on time delivery , tracking information and fair pricing.<br><br>Popular Categories<br>Alibaba.com covers a wide range of popular categories including hot and trending consumer products, also features industrial and raw materials categories <br><br>Product quality under control<br>Chose Alibaba.com\\\'s Inspection Service, making sure orders meet the quality standards specified in your contract.<br><br>Discount &amp; Promotions<br>Pick the best deals from factories offering discounts and promotions.<br><br>Stay in the loop<br>Buyers on the Alibaba.com app can follow their favorite suppliers to stay up to date on new products and promotions.<br><br>Languages &amp; currencies supported<br>Alibaba.com supports 16 popular languages and 140 more local currencies. <br>Now you can use Alibaba Real-time Translator to communicate with sellers in mother tongue.', 'https://lh3.googleusercontent.com/Dt0z5o9iWlUXaU0e0vby4WYFMpYYmD4X99Qouk3bd7JOz4B5ikI8qqy5w00yOoh2uPg=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"April 3, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version