(341, 348, '\\\"Gun Shot Fire War\\\" 3D FPS game. In the game you play the role of a superb shot technology elite killer. You will be faced with fully armed murderous terrorists, they are heinous. In order to complete the task and not be destroyed by them, you have to go all out. You can use a variety of weapons and shoot, including pistols, rifles, machine guns,and so on. Choosing different scenes and fight with them will make the game interesting. You will feel surprised by the Perfect game play. What are you waiting for, quickly picked up arms to fight with them. Last tips, take care and show no mercy, goodluck!<br><br>***Game Features:<br><br>***There are several game modes available to players. Time limited Mode which you have a limited time to destroy the enemy, whether those tasks fail. In the Hostage mode, you should rescue the hostages whom controlled by the terrorist. Anyway you have to pick up guns and  launched a desperate struggle with the enemy.<br><br>***The game offers a variety of combat maps, such as the Desert II, Ice and Snow, the Persian Town, Dilapidated City.You will experience the fantastic fighting experience on this maps and will be shocked by realistic brilliant battle scenes.<br><br>***Arsenal will provide attractive firearms for you. Which include guns such as AK47,M4A1,M249,Deagle,Grozo,Barrett,AWP,MP5 and so on. All guns are very realistic, I believe it will give you a sense straightforward shooting experience.<br><br>***The operation of the game is very cool, the game runs smooth, realistic sound effects, exquisite effects definitely gives you a straightforward shooting experience. Blood, Sound, Effects, GamePlay, all things are perfect. What you have to do is bore the bullet pierced into body of terrorist.<br><br>***Each destroy an enemy, you will get gold award. You can use coins to buy more sophisticated guns or  other useful items. You also can comparisons with other players to see who is more powerful and stronger. Your score will be uploaded to the rank.<br><br>***Important is that the game is free, all things are free. Quickly pick up your guns and experience.', 'https://lh3.googleusercontent.com/CC2Bfdm7p04EyzsoQC3cSNP4P1Lsv1bf7OCofFIBfRIXf8W31sfoJbGKSZ1XUlCTdbvZ=s180', 4.2, '[{\"type\":\"Updated\",\"info\":\"October 7, 2018\"},{\"type\":\"Size\",\"info\":\"22M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.2.4\"},{\"type\":\"Requires Android\",\"info\":\"4.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 16+Strong ViolenceLearn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"LuGame\"},{\"type\":\"Developer\",\"info\":\"luciano199599@gmail.comPrivacy Policyluciano199599@gmail.com\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/K9jXfNsEXMQj-o19ukTHXcyvsY3g7nSvymxElgtLWpkwSeKAJrinPi4Q-CD8ffSsX-Y=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/4Rb268FX5Bb-AzhhAsgzZ7YyQyaC1fDtFy0jkQx95o0ONy05C7YJIKHfDZbB3I1YqDC1=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEA