(342, 349, 'Jalebi â A Desi Adda is first ever Indian Game center, Now itâs packed with 8 favorite games.<br>Play Ludo, Snake and Ladder, Word Search, Quiz, Word Hunt (Jalebi) and 4-Letters (Barfi), Brick and Snake in this single pack.  And also play all these games in our own language.<br><br>8 Game in 1 pack âJalebi â A Desi Addaâ<br><br>#1 â Word Hunt<br>Do word hunt in this word games to find the hidden words. Solve words with friends and challenge them to guess the word. Tap your finger over the crossword grid and see the puzzle breakdown in our desi word hunt games challenge as a word master.<br><br>#2 â Word Search<br>Best desi word search game ever played before. Our desi word search is a classic word puzzle game where you need to find the hidden words from the secret letters on the board. All the word search puzzles are automatically generated by the app for endless fun and their difficulty varies with 4 different grid sizes - 7*7, 8*8, 9*9, and 10*10.<br><br>#3 â Ludo<br>Play this mazing Ludo game and become King. <br>Ludo â An Indian variant ludo game ever played before. Grab this real ludo board game and have ultimate desi ludo fun. This ludo game is a board game played between 2 â 4 members â friends, family and kids. Play this ultimate ludo game and recall your childhood!<br><br>#4 â Snakes and Ladders<br>Snakes and ladders is the simple and addictive family board game for all snake game players. The snake games â kids board game or fun board games comes alive with this amazing Snakes Ladders board game! Play this snakes games in two different modes i.e.., against computer and local (play with your friends). Have the fun of catching the ladder, attacked by snake and sliding down and leading against your opponent and lot more.<br><br>#5 â Quiz<br>Quiz is an ultimate desi trivia game, test your general Knowledge and learn more about India. Letâs play Quiz game! This Indian GK Quiz is forms of quiz game in which everybody can be strengthen their knowledge by answering the questions related to India in different Indian languages. All the quiz questions are automatically generated by the app for endless fun.<br><br>#6 â Four Letters<br>Desi four letter word games is waiting for you, get ready to create a four letters one word in different Indian languages. Creating word from given 4 letters is an easy game, but you must be quick! You gain extra time when you create 4 letter words. The ultimate word puzzles becomes more and more challenging as you keep on making words to solve the 4 letter word puzzle games. All the 4 letters one word puzzles are automatically generated by the app for endless fun.<br><br>#7 Brick<br><br>Play Brick game in Jalebi now. Brick retro game will take you down the memory lane. Itâs nearly 25 years since its arrival to this world and since then, it has been a great entertainer. This was and will be your favorite classic video game, which entertains like nothing. If you have played the 1 Bit Video game, then you will really like this game on your Phone.<br><br>#8 Snake<br><br>The old classic snake game and 1-Bit animation brought live on your Jalebi Pack now. This serpent is sure to take you by its hood. We have made all efforts to make this game really awesome classic snake game.<br><br>Its simpilicity is in its controls and animation. The very easy to navigate controls makes this an excellent entertainer. If you need to kill your time or banish your boredom, try Snake game and feel the difference. <br><br>Adding More Games very soon. Stay Tuned to Jalebi - A Desi Adda.', 'https://lh3.googleusercontent.com/XN4ObW8PNS4l9va1lJ8Am4dkUMmEFgP5TDFxlmf8jkspmFP26i0JZj6fOEsZUulYtUs=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"April 7, 2019\"},{\"type\":\"Size\",\"info\":\"21M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"5.0.9\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\"