(352, 359, 'BaaziNow Live Games App â Play Live Trivia Games, live quiz game, bingo game &amp; live poll game, win &amp; earn money in PayTM or Mobikwik wallets<br><br>BaaziNow is a Live Free Games App by Times Internet Limited where you can play trivia quiz game show, bingo game &amp; guess all answers with millions of other users to earn money online. BaaziNow, gaming app features BrainBaazi - live trivia quiz game, BingoBaazi âa live bingo games &amp; PollBaazi an interesting live quiz game where majority wins.<br>Get ready for BaaziNow - the gaming app and play live quiz game, fun quiz &amp; bingo game to earn money online!<br><br>Download BaaziNow app, play BrainBaazi - live quiz gaming app &amp; test your trivia quiz skills at 8:30 PM for Rs. 50,000 everyday &amp; afternoon show at 1.00 PM for Rs. 20,000 Monday to Friday, bingo game at 4.30 PM for Rs. 20,000 or PollBaazi at 3:00 PM for 5,000 &amp; Rs. 9:00 PM for Rs. 10,000 daily.<br><br>Refer BaaziNow online trivia quiz games app and money earning app to your family, friends &amp; colleagues for an extra life.<br><h2><b>BrainBaazi-Live Trivia &amp; Quiz Game Show to Earn Money Online</b></h2>\n<br>BrainBaazi is one of the most innovative online trivia quiz games app in India where you compete with millions of players in live quiz game show. The host asks questions, which you have to answer correctly to win the cash prize.<br><h2><b>How to Play Live Quiz Game? </b></h2>\n<br>* Download the BaaziNow online games app to earn money<br>* Sign up using your mobile number &amp; OTP<br>* The host will ask questions, each having 3 options. Only one of these options is correct<br>* Players get only 10 seconds to answer each question<br>* If your answer is incorrect or you run out of time, then use your extra Life to be in the game<br>* Answer the Q7 Kal-Nayak Sawaal/Agent Rana Sawaal correctly without using your life to get an extra life at the end of quiz game. Both eliminated &amp; non-eliminated users can answer this question<br>* Everyday 10 minutes before quiz game starts, host shares cheat code to increase your chances of winning<br><br><h2><b>How to play the PollBaazi?</b></h2>\n<br>Go to PollBaazi to play &amp; guess the quiz online. The anchor asks 8 questions with 3 options and 10 seconds to answer each. There will be no correct or incorrect answers, options with maximum submissions will be considered correct. Guess all questions correctly to win your share from prize money. You can play even after being eliminated, a late entry to the game or coming back after dropping because of the network glitch, also, use an extra life in the game to continue playing the game even after giving an incorrect answer.<br><h2><b> BingoBaazi â Live Bingo Game Show</b></h2>\n<br>Participate in BingoBaazi âlive bingo game daily at 4.30 PM. Play online bingo game with millions of users &amp; win cash. The anchor will call out numbers live, for which players will get 6 seconds to confirm. Enjoy bingo live game app to win loads of prizes! Download now to enjoy the bingo game!<br><br><h2><b> How to Play Bingo Live? </b></h2>\n<br>* Go to BingoBaazi to play live bingo game<br>* Join the game every day at 4.30 PM to get a ticket, each having 3 rows &amp; 15 numbers<br>* Players get 4 chances to win top, middle, bottom rows &amp; full house<br>* Anchor will announce a number, players will get only 6 seconds to confirm each number<br>* If all the numbers in a row match the announced numbers, you will win the row prize<br>* After the claim, our system will verify the eligibility &amp; prize money will be credited in your E-wallet<br>* If all the numbers of your ticket match the announced numbers before 36th call, you will win the grand prize for Full House<br>* Claimed prizes will be available at the top of the screen<br>* In case your claim is incorrect, we allow one bogus call per bingo game. <br><br>We need the following permissions:<br>Location: To optimise streaming experience basis your geo<br>SMS: For mobile number verification<br>Mobile Number: To link your Paytm/Mobikwik wallet to transfer the winning amount. We also use this to send periodic show reminders<br>Follow us on Twitter &amp; Facebook', 'https://lh3.googleusercontent.com/H_s-43HUvgcS_Fz3LNrMCjq7KCPbfrtB-KNhh4dJDwUYkNh2jRVQeTWsdpNitHo4Ymk=s180', 4.2, '[{\"type\":\"Updated\",\"info\":\"March 14, 2019\"},{\"type\":\"Size\",\"info\":\"12M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.0.69\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Times Internet Limited\"},{\"type\":\"Developer\",\"info\":\"Visit websitehelp@baazinow.comPrivacy PolicyTimes Internet Limited\\nEcstasy IT Park\\nPlot 391,Udyog Vihar, Phase 3\\n(opp. Trident Hotel)\\nGurgaon\\nHaryana-122016\\n\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/DoBQdc5RxAkotPF3z_iOlNDsPGztabJGYElhS-UCM6eTzk8hU81XEll2ftHxZKkrHOM=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/FVFDc4k6tMyZ176MaB83S1c840N-f5YRLl3hJ_kg8vSEPk05Svnu-DznktPA_7vhEt4=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[]', '2019-04-07 19:50:17', '2019-04-07 19:50:17', NULL),
