(355, 362, 'He is strong, intelligent and smart. He is the youngest Super Cop and the protector of the town. He\\\'s Little Singham. <br><br>The Shambala broke out of Jail with help from Kallu and Ballu and seeks to make his way out of the town. Join Little Singham on his quest to stop Shambala from escaping. Let the chase begin!<br><br>Play with different forces Avatars of Little Singham - Police, Army, Navy and Air Force. Run on the streets of Mirchi Nagar and collect as many coins you can. Slide through concrete pipes. Jump over incoming cars and barricades. <br><br>Tackle through Kallu and Ballu to stay out of their reach and get back on your quest to capture Shambala. Grab Magnets on the run to collect all the nearby coins. Seize the Bulletproof Jacket and run through obstacles. Power Boots boost up your speed and help Little Singham narrow down the distance between him and Shambala. Do not forget to nab the Rockets on your way. They help you collect easy coins. Coins can be used to upgrade your Power-ups to last longer.<br><br>Give your run a Head-start or a Mega Head-start with Bikes and Cars. Use Different Hover boards with Special Power-ups for free run and glide through Mirchi Nagar in style. Pick up Boss Fights with Shambala and show him who\\\'s the real boss with Little Singham\\\'s lethal Hand Attack. <br><br>Participate in daily challenges and earn extra rewards. Take up various missions and complete them to increase your XP multiplier. Collect Singham Tokens on the run and use them to revive when needed. Connect and play with your Facebook friends and challenge them to beat your high score. <br><br>Play Little Singham to discover the âHeropantiâ of Mirchi Nagarâs superstar.<br>â¢ EXPLORE the vibrant Mirchi Nagar<br>â¢ DODGE, JUMP, and SLIDE through obstacles<br>â¢ Collect COINS, gather REWARDS and complete MISSIONS<br>â¢ Use Bikes and Cars for HEADSTART and MEGA-HEADSTART <br>â¢ Get free runs with HOVERBOARDS with Special Powerups<br>â¢ Pick up BOSS FIGHTS with Shambala and use the special PANJA ATTACK <br>â¢ Get Free Spins and earn Lucky Rewards with the SPIN WHEEL<br>â¢ Accept the DAILY CHALLENGE to earn extra Rewards<br>â¢ SCORE THE HIGHEST and beat your friends using exciting power-ups<br><br>- The game is also optimized for tablet devices.<br><br>- This game is completely free to download and play. However, some game items can be purchased with real money within the game. You can restrict in-app purchases in your storeâs settings.<br><br>* *Permissions:<br>1. READ_EXTERNAL_STORAGE and WRITE_EXTERNAL_STORAGE<br>This permission is needed to cache and read ad content during the gameplay.<br><br>2. ACCESS_COARSE_LOCATION<br>To determine your location for region-based offers.<br><br>3. RECORD_AUDIO<br>This is required to analyze offline TV viewing data and serve media-targeted ads. Granting this permission is optional. If you\\\'d like to opt-out of this targeting, please visit the following link: http://www.zapr.in/privacy/', 'https://lh3.googleusercontent.com/hroPkRCrbwGdicnJffw_0h1SC0ruhcFPgG5q676knZwKNAPfFLo7MGgudWNq8ZERQL-a=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"March 29, 2019\"},{\"type\":\"Size\",\"info\":\"55M\"},{\"type\":\"Installs\",\"info\":\"5,000,000+\"},{\"type\":\"Current Version\",\"info\":\"3.10.117\"},{\"type\":\"Requires Android\",\"info\":\"4.2 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a010.00 - \\u20b9\\u00a0250.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Zapak Mobile Games Pvt. Ltd\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport@zapak.comPrivacy Policy801\\/ 802, Grandeur Lotus, Captain Sawant Marg, Andheri (W), Mumbai \\u2013 400 053\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/Lt5OeZ_l8SA\