(359, 366, 'It quickly and easily turns on the flashlight next to the rear camera.<br><br>Features:<br>1. Flashlight in Dark<br>2. Color Screen Flashlight<br>3. Morse Code Flashlight for SOS<br>4. Compass &amp; Map<br><br>With this app, you can do : <br>+ Find Your Keys in the Dark <br>+ Read a Real Book at Night <br>+ Light the Way When Camping and Hiking <br>+ Make Yourself Visible on Roadside at Night <br>+ Light Your Room During a Power Outage <br>+ Repair Your Car or Change a Puppets <br>+ Check on the Little Ones<br><br>It\\\'s hard to beat the super bright LED flashlight on Android when it comes to simplicity. The flashlight app\\\'s setup mimics an actual hardware flashlight, with an on and off switch you can toggle to turn on and off your digital torch light.<br><br>You can also adjust the light\\\'s strobe or blinking mode by swiping left or right on the digital flashlight\\\'s bezel. If it\\\'s a free and simple flashlight app you\\\'re after and you use a smartphone running Android, this should be one of the first downloads you check out.<br><br>You\\\'ll find the basic torch functionality with this torch light app, but it also offers some more \\\"fun\\\" features. Apart from that most basic torch functionality, you can even use the torch light to send Morse code.', 'https://lh3.googleusercontent.com/PLBCCl6gq8evyvgCSN4rT2uVfhjHoouHfnz_w6grWF7gOunpsPXfCsed_EKC-4Rbw1aj=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"December 28, 2018\"},{\"type\":\"Size\",\"info\":\"4.9M\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"8.10.1\"},{\"type\":\"Requires Android\",\"info\":\"4.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a0130.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Lighthouse, Inc.\"},{\"type\":\"Developer\",\"in