(360, 367, 'Music player app is a powerful player which helps you listen to all song formats and help you edit music information and optimize them by cutting tool. Music player app supports almost formats of audio files. Following music formats can be playback well: MP3, AAC, MP4, WAV, M4A, FLAC, 3GP, OGG, etc. This music player is also called with other name: mp3 player. Because mp3 format is most popular song format in android.<br>Music player was designed to bring better experience to user when they listen to music. Music player scans all music automatically and group them by title, artist, album. Easy to find the song you want. Supports audio equalizer to improves music sound, you can customize with own style. Please listen to songs on \\\"Music player\\\" everyday and enjoy the life. It is totally free. <br><br>Main functions of free music player - mp3 player:<br>* Scan all audio files automatically. Support almost formats: mp3, m4a, wav, flac, ogg, aac <br>* High quality. Other names: Offline music player, song player, audio player, mp3 player.<br>* Quick navigator with helpful label: album, artist, genre, song, playlist, artist, directory and album.<br>* Notification bar and mini music player. Show enough information such as: album artwork, titles and artists. Include basic buttons: play, pause, skip and stop.<br>* Play next, Previous, Rewind, Pause, Fast forward. Queue of songs is supported. Add music to the waiting list very easily.<br>* Share your favorite songs to someone<br>* Equalizerd. This MP3 player has built-in equalizer which brings great music listening experience.<br>* Background and wallpaper. Make mp3 music player more beautiful, there are a lot options to choose.<br>* Cutting editor. Crop or Trim music, cut audio. Optimize size of music, remove unwanted parts. Make smaller audio to set music as ringtone.<br>* Edit tag. Include: song title, album name, artist name.<br>* Headset or headphone. You can play, pause, next by pressing buttons on headphone. Bluetooth headphone also is supported.<br>* Music library and all hidden places. All of audio music, songs will be scan.<br>* Search. Fast and convenient. Search by title (song name), album , artist, playlist.<br>* Playlist. create new playlist, edit or delete an old playlist. Add album, artist, song, genre directory to playlist. Has recent playlists.<br>* Music player widget.<br>* Mp3 file. Mp3 is the most popular music format. Mp3 player or audio player also is the name of this app<br>* Photo of song, artist and cover of album.<br><br>Enjoy free music player - listen to your favorite songs. While using music player app if you want some new features please contact me. I will try to make music player better.', 'https://lh3.googleusercontent.com/PdndnWPEaztvwVnYJh7GbSwDJ9xDJOwLonmx6klDL3uy0NE-X_YQttQ_z0166Wi1zsY=s180', 4.7, '[{\"type\":\"Updated\",\"info\":\"January 3, 2019\"},{\"type\":\"Size\",\"info\":\"8.9M\"},{\"type\":\"Installs\",\"info\":\"5,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.0\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"creative & quality std\"},{\"type\":\"Developer\",\"info\":\"creative.mobileapps.std@gmail.comPrivacy PolicyHanoi\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/HPwzKv3syLeZ3rCedwt1W_0WhGJP_gRf4UXBAArnLowvRYPjbFthm1jmCsVqXKoS8g=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/TpjYbkGvsowl_pAyizaYYqjjV0OwKkQuSPpQZTK0ZPlxagFZUISa9734hFIwM79wUyk=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0