(361, 368, 'With Money View Loans, get a personal loan in just a few hours. The app gives you the freedom to do more with your life. Whether you want to furnish your home, cover wedding expenses, throw a party or take a break &amp; go on a family vacation, we\\\'ve got you covered with a quick and easy personal loan.<br><br>Money View Loans is the fastest &amp; easiest way to get a collateral free, personal loan.<br><br><b>Eligibility</b><br><br>Our proprietary credit models use financial SMS data (sent by banks and billers) to give you the best real time loan offer.  This process goes beyond the traditional credit scores and allows us to understand your profile better, and make you the best possible offer. In fact, having a credit history isn\\\'t necessary to avail a personal loan through Money View Loans.<br><br><b>Features of the loan:</b><br><br>â It\\\'s quick - Get the loan in a few hours<br>â Apply for a personal loan of up to â¹5 Lakh<br>â Personalise your loan amount and payback period through the app<br>â Completely paperless process - Apply for a personal loan through the app and pay back through the app<br>â No document pickup required for personal loan approval - completely app based<br>â Backed by excellent customer service<br><br>This app is brought to you by the makers of the Money View money manager app. The Money View money manager app has 10 million downloads on the Play Store. Money View is trusted by the best banks and financial institutions in the country. People from 500+ cities across the country have used Money View to avail a loan.<br><br><b>Personal Loan Process</b><br><br>The Money View Loans app is the fastest and easiest way to get a personal loan. It is completely app based - from loan application to loan repayment. Four steps, that\\\'s all you need to complete to get the loan amount in your account:<br><br>â Choose loan amount and loan tenure<br>â Upload your documents &amp; complete your loan application<br>â Check eligibility &amp; verify documents<br>â Review and submit the loan agreement<br><br>Get started by downloading the app right away!<br><br>Our loan amount range from â¹10,000 to â¹5,00,000<br>Loan duration range from 3- 36 months<br>Annual Interest rates vary from - 16-24%*<br>Processing fee vary from 2.5% - 4%*<br><br>For eg., for a loan of â¹50,000 with an APR of 18% and 24-month tenure total interest &amp; fees will be â¹11,679.<br><br><i>*These numbers are indicative and final interest rate or processing fee may vary from one user to another depending on their credit assessment</i><br><br><b>About Safety &amp; Security</b><br><br>Money View Loans does not read your personal SMSs, bank OTP\\\'s, passwords or account numbers. The app recognises accounts based on the last four digits mentioned in an SMS. Money View uses bank grade security &amp; encryption - so your data and money are safe. Money View is completely safe &amp; secure.<br><br>Over 10 million people have downloaded Money View apps. Leading banks and financial institutions trust Money Viewâs technology.<br><br>The app requires the following permissions to function properly :<br><br>SMS - READ_SMS, RECEIVE_SMS<br>Required to read your financial SMS sent by banks and biller. Your financial transactions are used to create your financial and risk profile, to provide the best loan offer based on the financial SMSs <br><br>Location - ACCESS_FINE_LOCATION<br>Required for verifying current address for the loan application<br><br>Contacts - GET_ACCOUNTS<br>Required to fetch the verified Google email for the loan application<br><br>Contacts - READ_CONTACTS, READ_CALL_LOG<br>Required for assessing your social profile as an input for providing the best loan offer<br><br>Camera &amp; Media Access - CAMERA, READ_EXTERNAL_STORAGE, WRITE_EXTERNAL_STORAGE<br>Required for enabling upload of loan application documents like PAN card, Selfie, etc.<br><br>Read Device Info - READ_PHONE_STATE<br>Required to link the unique phone ID (IMEI) to the loan application for security purposes', 'https://lh3.googleusercontent.com/LkyGu9PE8glwtghqUcaz57UJOez3UdErjXEFF0G0e28sJgGXxpaR_O_7cYbMmTOQ-A=s180', 3.9, '[{\"type\":\"Updated\",\"info\":\"April 6, 2019\"},{\"type\":\"Size\",\"info\":\"9.0M\"},{\"type\":\"Installs\",\"info\":\"5,000,000+\"},{\"type\":\"Current Version\",\"info\":\"KOI-7711.94\"},{\"type\":\"Requires Android\",\"info\":\"4.0.3 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"WhizDM\"},{\"type\":\"Developer\",\"info\":\"Visit websiteloans@moneyview.inPrivacy PolicyM\\/s Whizdm Innovations Private Limited\\nThe Address, No 17\\/1, Kadubeesanahalli, Outer Ring Road\\nBangalore - 560087\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/vyso5hJxeMVI17nmmYSqib7mD8tmHNQFOK6xIc5UCVyqESLsXXirD3mneczG03f2nIY=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/oxNrS0yo9rPwH1M3Z52MSBIbG0FSzIOoiuTHD8Uryybdd76vb60gKeA3pCh_2E2aL14A=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[]', '2019-04-07 19:50:17', '2019-04-07 19:50:17', NULL),
