(370, 377, '<b>Rapido, Indiaâs Largest Bike App</b>, is the fastest and the most affordable way for daily travel. Rapido Bike app is available in 40 cities in India.<br><br>With over 2 Million happy customers and 10+ Millionrides on this app, Rapido is changing the intra-city travel and is providing last-mile connectivity at affordable fares. Having over 1 Lakh Captains (drivers), this bike booking app provides fast transport on bikes, which are easy to wade through other vehicles in the traffic and far more economical than other cab booking apps.<br><br>Download the Rapido Bike App now and you will never have to wait for the buses in queues or pay the soaring fares of other cab booking apps. Offering a quicker, efficient, economical and trusted bike app.<br>Rapido Bike app is also instrumental in reducing traffic congestion on roads and provides a better travel option for solo commuters. Ahead of other cab booking apps, Rapido is by far the most efficient iteration of booking app for Indian roads. Bikes are obviously a much affordable and inexpensive option for daily travel compared to other online booking options available.<br><br><b>Key features of the Rapido Bike App - </b><br><br>* Vernacular App - Rapido is available in your own language for an easier and comfortable experience. Currently, the app is accessible in English, Hindi, Tamil, Telugu, and Kannada. <br>* One-Click Login - No waiting for the OTP to book a bike app. For seamless onboarding of users, Rapido uses one-click login via Truecaller, which lets them register in a moment<br>* Save frequently visited locations as Favourites for easier access <br>* Live tracking for real-time location of the ride<br><br><b>Insured and Safe Rides</b><br> <br>Safety of the customers being our priority, we ensure that every user is protected. Each and every Rapido ride is insured with Reliance Insurance for no extra cost. Also, we provide a helmet and a disposable cap, so you can enjoy the bike app ride safely without having to worry about hygiene.<br><br><b>Easy online booking app</b><br><br>Booking a ride on Rapido Bike App is more convenient than just any other online booking app. With user-friendly applications on Android and Apple platforms, you will always have Rapido as your go-to app!<br><br>* Open Rapido Bike App<br>* The App picks your pickup location via GPS, which you can change manually too<br>* Enter the destination location. You can also drop a pin on the map<br>* The estimated fare will be displayed on the screen<br>* Go ahead and Request Rapido to confirm the online booking<br><br><b>Trusted and Responsible Captains</b><br><br>With background verified, trained and responsible Captains to escort you to your destination, safety should be the last thing you should be worried about.<br><br><b>Easy Payment Methods</b><br> <br>Making the bike booking experience seamless, Rapido has easy payment methods with a choice to pay via Cash or can even choose to go digital with wallets such as PayTM, Freecharge, Mobikwik and Rapido Wallet. Rapido also has a payment option to pay later with LazyPay.<br><br><b>Connect</b><br><br>Stay up-to-date with whatâs new at Rapido and find more exciting offers on our Social Media pages.<br>Follow us on Twitter: https://twitter.com/rapidobikeapp<br>Like us on Facebook: https://www.facebook.com/rapido4bike<br>Follow us on Instagram: https://www.instagram.com/rapidoapp<br>Have a question or any concern? Get in touch with us at shoutout@rapido.bike', 'https://lh3.googleusercontent.com/snhaE064sxpyelp7tsQKRSyfKejmdOymDGnonOmFOkq6NJfLPVhhSheoBK8Arcqm7pQ=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"March 20, 2019\"},{\"type\":\"Size\",\"info\":\"10M\"},{\"type\":\"Installs\",\"info\":\"1,000,000+\"},{\"type\":\"Current Version\",\"info\":\"4.5.1\"},{\"type\":\"Requires Android\",\"info\":\"4.4 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Shares Info, Shares Locati