(372, 379, 'Internet Speed Meter Lite displays your internet speed in status bar and shows the amount of data used in notification pane. This helps you to monitor network connection anytime while using your device.<br>The app is completely Ad-Free.<br><br><br><b>Lite Features</b><br>- Real time speed update in status bar and notification.<br>- Daily traffic usage in notification.<br>- Separate stats for Mobile network and WiFi network.<br>- Monitors your traffic data for the last 30 days.<br>- Battery efficient<br><br><br><b>Pro Features</b><br><b>Notification Dialog</b><br>A notification dialog appears when you tap the notification having<br> - Graph to monitor last minute internet activity<br> - Time and usage of current session<br> - Today\\\'s app usage for mobile and wifi<br> - Realtime speed of running applications<br><b>Smarter notifications</b><br>Notification appears only when you are connected to internet. You can change priority of notification. You can also hide the notification when connection is idle for specified amount of time.<br><b>Themes support</b><br>You can manually select the color of user interface.<br><b>Blue status bar icon</b><br>Option to choose between blue or white status bar icon. (only for KitKat and below versions of Android)<br><b>Upload and Download Speed</b><br>Option to show upload and download speed in separate notifications.<br><br><br><br><br><br>Warning: Do not move this app to SD card. It will stop (Force close) when you remove the card.', 'https://lh3.ggpht.com/Tlwdc9yeq7ru5AI9YOF_RHIFZO-a0ww6NA04c6FxXxHWFAKS8j_WwAukHJLUi1CIYZE=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"September 5, 2016\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View