(374, 381, 'It\\\'s wedding time! These \\\"humans\\\" will be ready to encounter their godparent once you prepare them for this special event. You are not gonna guess who are they, so to break the mystery you will have two lovely kitties for that. Start the adventure with the bride\\\'s facial treatment. Take her to the spa and make those dark circles go away. Apply different masks to moisturize her skin, clean the pimples and arrange the eyebrows. Right after you will move to the makeup salon where you will ensure a natural and well-cared skin. You can choose her eye color, the eyeshadow, the lipstick and the blush for the cheeks. Continue with the kitty\\\'s bath and dress up phase. Bath each one of them and spoil them with a relaxing rubbing. After they are all washed out you might wanna continue their transformation. Use the wardrobe we have and assemble a lovely outfit that will highlight this special occasion. Add different pieces of clothing and try to be creative in preparing these two kitties for a wedding event. You will also have the opportunity to design the marriage certificate as you wish. Choose the color, have a particular font for writing and take care of the last details. All that is left is the final wedding picture. Arrange them in a suitable position and get them to be seen together as a lovely pair of animals and people. <br><br>Be pleased to find many amazing features that are brought to you by this bridal game:<br>- Free to play<br>- Easy gameplay and nice background sounds <br>- Having adorable cats in your care and their humans too<br>- Learn how a spa salon works<br>- Use different tools and add new techniques to your skills<br>- Dress up items and cool accessories<br>- Find a proper outfit and look for the wedding <br>- Pamper two kitties and a beautiful future bride<br>- Create a unique marriage certificate', 'https://lh3.googleusercontent.com/UZ7UnKrrz2MHArfd5FmyAHVgO1y9yPGlZmg7fUJRI3MKV4-sdxy_4i2GZVHi_6ZRXVA=s180', 3.9, '[{\"type\":\"