(377, 384, 'The latest Game from the Award Winning Team behind Hitwicket is here!<br><br>Ever wondered how well your team would do, if it was you calling the shots at the stands of the World Cup or the T20 Leagues? <br>If you had the power to decide which bowler would bowl the next over against the star batsman in the opponent\\\'s line-up?  <br>If you could model your own batting order from scratch?  <br>Or If you had the ability to train your troops to total perfection on the pitch?<br><br>We\\\'ve all had dreams of being Leaders - Dreams of listening to the crowd and your team chant your name in the stadium. Dreams of shooting to fame and eternal glory. Most of us have never really had the chance to make that our reality.<br><br>Well, now, Welcome to the World of HitwicketÂ® Superstars!<br><br>A unique, brand new and free-to-play, strategic simulator that puts you in the shoes of a Cricket manager with all the power of the sport. Brought to you by the developers of the smash-hit original HitwicketÂ® Game, awarded the \\\'Best App\\\' by HYSEA and recognised by HYPE Foundation, UK, as one of the \\\'Top Ten Global Start Ups in Sports Innovation\\\'.<br><br>Come create your own squad and lead the path for your ambitious cricket career!<br><br>ð <b> Maximum Control </b> - Feel the ultimate experience of running a virtual T20 cricket team. You get to control your team\\\'s destiny! Choose your strategic line ups to maximize your innings totals and fielding efficiency.<br><br>ð <b>Multiplayer </b> - Engage and defeat hundreds of rival managers and their teams from all around the world on a wide, communicative platform, as you clash on the pitch for domination! Expand and trade to rise to the top, by playing in tournaments and official World leagues!<br><br>ð <b>City </b> - Your region needs your team to win! Form alliances with fellow managers to push your city to the top of the leaderboards, and unlock special crates and boosts to level up!<br><br>ð <b>Characters </b> - Choose your Superstar players from a range of 16 different player profiles, each with varied personalities and skills that you can you can upgrade.<br><br>ð <b>League </b> - Play Home and Away matches against all global teams to claim the championship cup. The leader of the charts at the end of the season is crowned the champion, and promoted to a higher tier of teams.<br><br>ð <b>Scouting </b> - Keep an eye out for the best of youth talent during every season, to build and expand your future squad. Catch \\\'em young!<br><br>ð <b>Training </b> - Customize and choose training packs for your players to enhance their stats and fitness levels to evolve them into Superstars!<br><br>ð <b>Special Abilities </b> - No two players in the Hitwicket Universe are ever the same. Character abilities are special, and vary from smashing sixes and cleaning up the enemy\\\'s defense.<br><br>ð <b>AI powered Match Engine </b> - The next generation of our Award Winning Match Engine is finally here! This gives you the ability to make Real Time tactical decisions and strategic placements to give your team a tighter winning edge.<br><br>So come be a part of the community. Unleash your passion for Cricket!', 'https://lh3.googleusercontent.com/CWbz9Thpr_lutYBuJs2cg6yi2CxKSfGnl3IsxZ5Vm-RgaNbEmvuJ1CPdKU12wJ-X3g=s180', 3.4, '[{\"type\":\"Updated\",\"info\":\"April 6, 2019\"},{\"type\":\"Size\",\"info\":\"71M\"},{\"type\":\"Installs\",\"info\":\"100+\"},{\"type\":\"Current Version\",\"info\":\"1.0.3\"},{\"type\":\"Requires Android\",\"info\":\"5.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"In-Game Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a050.00 - \\u20b9\\u00a07,900.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Hitwicket Cricket Games\"},{\"type\":\