(383, 390, 'The Kindle app puts millions of books at your fingertips. Itâs the app for every reader, whether youâre a book reader, magazine reader, or newspaper readerâand you donât need to own a Kindle to use it. Choose from over four million Kindle books from the Kindle Store or enjoy popular magazines like The Economist and Readerâs Digest with high-resolution color images.*<br>Read Free BooksâChoose from thousands of free ebooks such as Pride &amp; Prejudice or The Adventures of Sherlock Holmes.<br>Shop for BooksâEasily shop for ebooks, including new releases and New York Times Best Sellers.<br>Explore Page Flip enabled books to reference charts, graphs and maps while we save your place<br>Use the Built-In Dictionary, Google, and WikipediaâThe Kindle app has a built-in dictionary that allows you to look up words instantly while youâre reading your ebooks. Simply tap and hold a word to view its definition or use the Google and Wikipedia links to get more information.<br>Sync Your eBooksâThe Kindle app lets you read the same book across devices and automatically syncs where you left off so you can start reading on one device and pick up where you left off on another device. The app syncs your furthest page read, bookmarks, notes, and highlights between Android, PC, Mac, iPad, iPhone, iPod touch, BlackBerry, Windows Phone 8, and any of our Kindle devices using our Whispersync technology.<br>Sample Books Before You BuyâRead the first chapter of a book for free before you decide to buy.<br>Customize Your ReadingâChoose your preferred font size, screen brightness, background color, and orientation (portrait or landscape) to read your books.<br>Borrow eBooks from the LibraryâCheck out ebooks from your local library and have them delivered wirelessly to your Kindle app.<br>Read print replica textbooks on Android tablets. Print Replica Kindle books maintain the rich formatting and layout of their related print editions and provide features to help students study smarter including ability to highlight passages, add margin notes, and search for keywords. Whispersync technology saves and synchronizes your bookmarks, notes, and highlights across your devices.<br>* Selection for U.S. users only; selection and price of ebooks and e-periodicals vary by country.<br><br><br>About app permissions<br>â¢ https://amazon.com/help/kindleforandroid/permissions<br><br>Support<br>â¢ http://amazon.com/help/kindle<br>â¢ http://amazon.com/fb/kindleforum', 'https://lh3.googleusercontent.com/48wwD4kfFSStoxwuwCIu6RdM2IeZmZKfb1ZeQkga0qEf1JKsiD-hK3Qf8qvxHL09lQ=s180', 4.2, '[{\"type\":\"Updated\",\"info\":\"March 30, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 12+Parental Guidance RecommendedLearn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Amazon Mobile LLC\"},{\"type\":\"Developer\",\"info\":\"Visit websitekindle-cs-support@amazon.comPrivacy PolicyAmazon Mobile LLC\\n500 9th Avenue N,\\nSeattle, WA 98109\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/2H6ThBLtNSPye3xs2ST8s44Tw4ROmO-2Ek-m8wxz6vcGOfbdBVD-pp1iVb0vNmcyMQ=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/Etz3lMot3cvXZqkMg9T_EsHSJ6qyByTahDH2KQiHcMxgbRv_08sfA8xVt9AKqcatyQs=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[]', '2019-04-07 19:53:07', '2019-04-07 19:53:07', NULL),
