(390, 397, '<b>Free, Safe, Simple, Manage your files efficiently and easily with ES File Explorer (File Manager)! <br>ES File Explorer (File Manager) is a full-featured file (Images,  Music,  Movies,  Documents,  app) manager for both local and networked use! With over 500 million users worldwide, ES File Explorer (File Manager) helps manage your android phone and files efficiently and effectively and share files without data cost.</b><br><br><b>File Manager and Folder Manager</b> â Powerful tools put desktop-grade features in your pocket<br>ââ¢ Sender: Transfer apps, images, music, movies, documents, without using mobile data and cables. Support same Wi-Fi mode &amp; auto-created hotspot.<br>ââ¢ File Manager: Manage your files with cut, copy, paste, rename, and compress operations<br>ââ¢ Built-in viewers and players for various file types: click to play music/videos, check image(s) and document(s)<br>ââ¢ Built-in ZIP and RAR support: allows you to compress and decompress ZIP files, unpack RAR files, and create encrypted (AES 256 bit) ZIP files<br><br><b>Remote File Access</b> â Get to your files from anywhere<br>ââ¢ Cloud Storage: Supports Dropbox, Box.net, Sugarsync, Google Drive, OneDrive(SkyDrive), Amazon S3, Yandex and more clouds platforms<br>ââ¢ Remote File Manager: When this feature is enabled, you can manage files on your phone from your computer<br>ââ¢ Functions as an FTP and WebDAV client: Manage files on FTP, FTPS, SFTP, and WebDAV servers just like you manage files on your SD card<br>ââ¢ Access your home PC: Through your smartphone via WiFi with SMB<br><br><b>File transfer and File Explorer</b><br>ââ¢ Root Explorer: The ultimate set of file management tools for root users. Provides access to the entire file system and all data directories, and allows the user to change permissions.<br>ââ¢ Bluetooth file browser: You can copy and paste files between Bluetooth-ready devices. ES File Explorer (File Manager) supports OBEX FTP for browsing devices and transferring files between Bluetooth devices<br>ââ¢ Wi-Fi File transfer: Use your PC to wirelessly edit your mobile files using FTP<br><br><b>Library and Other</b> â Find any and every file in seconds<br>ââ¢ App Manager: Categorize, uninstall, back up, and create shortcuts to your apps<br>ââ¢ Note editor: support syntax highlight for 30 languages (Java, XML, Javascript, PHP, Perl, Python, Ruby, etc).<br>ââ¢ SD Card Analyst: Analyze for App Associate Folder &amp; Large Files &amp; Recently Created Files &amp; Redundancy Files &amp; Duplicate Files to help save space; Detect Sensitive Permission &amp; App Cache &amp; Memory Usage to know your apps better<br>ââ¢ Kill tasks with a single click, increase memory and speed up your device: Includes a simple widget that stays on your home screen to let you know your current RAM situation and automatically kill tasks, with an ignore list to ignore the applications you want to keep running. The Task Manager module is required for this feature.<br>ââ¢ Cache Cleaner and Auto-start Manager: Delete junk files that take up valuable storage space. The Task Manager module is required for this feature.<br>â â¢ Real-time Observerï¼help load recently added files in library 80% faster<br><br>ES File Explorer (File Manager) helps you handle all your files whether they are stored in your device\\\'s memory, microSD card, local area network, and cloud storage accounts.By default, ES File Explorer (File Manager) allows you to copy, move, rename, delete or share files to and from any of your storages. It also lets you browse and access your files by category.', 'https://lh3.googleusercontent.com/GXJtgfcxiEaLabZDmJasdFYB74hSSz1M5fdpKA0wPAmobuI1uc6mcSH_tTdu5XpQaNES=s180', 4.6, '[{\"type\":\"Updated\",\"info\":\"April 6, 2019\"},{\"type\":\"Size\",\"info\":\"16M\"},{\"type\":\"Installs\",\"info\":\"100,000,000+\"},{\"type\":\"Current Version\",\"info\":\"4.1.9.9.31\"},{\"type\":\"Requires Android\",\"info\":\"4.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a015.00 - \\u20b9\\u00a04,950.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"ES Global\"},{\"type\":\"Developer\",\"info\":\"Visit websitecontact@estrongs.comPrivacy Policywww.estrongs.com\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/YqgLsuLRv7Y\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/vgMuIkliAQ7iC9fAyU8kgujzmceJAWMgh85hTj1IN_-JAY5nUqmjTZhFlaVmuscEww=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/ZI5rj1u4iaMpb0t4TX0ZrBI7q6PBjNApq0dPuV1fyN8rG74Pwqh4KWddnv6VW5BCGDw=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\