(391, 398, 'Once upon a time, there was wannabe baker whose dream came true! Enjoy this mouth-watering cake bakery story and help Lizzie fulfill her dream of someday opening up a sweet bakery of her own. Now that day has finally arrived! She\\\'s graduating from college, and she\\\'s more than ready to get baking some tasty cupcakes. But she needs your help! Have fun opening up lots of yummy bakeries, baking with Lizzie and becoming a true baking professional whoâs famous for beautiful, tasty delights!<br><br>Help Lizzie open up world-famous bakeries and take specific orders from her demanding customers! Learn how to bake delicious, mouth-watering desserts like cupcakes, smoothies, donuts and cakes! With your assistance, Lizzie will become the most talented pastry chef ever! Youâll just LOVE this tasty bakery story game! <br><br>But hereâs a little warning - this bakery story game WILL make you hungry!<br><br>Features:<br>&gt; Youâll love this fun cake bakery story game! Help Lizzie open up a cake bakeryâ¦ and then another cake bakeryâ¦ and another cake bakery! Thereâs no such thing as too many bake shops! And definitely no such thing as too many cupcakes!<br>&gt; Take specific orders from your customers, and serve them with a smile! Make sure they get exactly what they asked for, whether itâs cupcakes, donuts or cakes!<br>&gt; Learn how to bake tons of desserts from so many yummy recipes, with a professional cake maker!<br>&gt; Make your cakes extra fancy with colorful cake decorations!<br>&gt; Dress up Lizzie like the true baker she is! Give her a pretty chefâs hat and a pretty apron!<br>&gt; Show off your sweet bakery skills and win first prize in baking contests and cake fairs!<br>&gt; Get ready to bake the tastiest desserts ever, from apple yogurt smoothies to princess birthday cakes, to scrumptiously delicious cupcakes!<br>&gt; Build up your reputation and become the most famous baker in the world, in this fabulous sweet bakery story game!<br><br><br>ABOUT Coco Play<br>Coco Play Limited is China-based developer of creative and unique apps for kids. Founded in 2013, Coco Play provides rich 3D simulation-based games for the whole family. Coco Play is a subsidiary of TabTale, a leading, global creator of innovative games, interactive books and educational apps.<br>Visit us: https://www.tabtale.com/ <br>Like us: https://www.facebook.com/TabTale<br>Follow us:@TabTale<br>Watch us: https://www.youtube.com/Tabtale<br><br>CONTACT US <br>Let us know what you think! Questions? Suggestions? Technical Support? Contact us 24/7 at WeCare@TabTale.com.<br><br>FOR PARENTS <br>The app is free to play but certain in-game items may require payment. You may restrict in-app purchases by disabling them on this device. The app may include advertising for TabTale and certain third parties which will redirect users to our sites, apps or third-party sites.<br>Your privacy matters. The app may enable collection of limited user data by TabTale or its carefully selected providers (e.g. ad networks and analytics) for limited purposes described in our Privacy Policy (e.g. respond to support queries; enable, analyze and improve the appâs features and services; serve contextual ads and measure their performance). The app includes certain features only accessible behind an age-gate to protect children (e.g. restrict behavioral ads; social networks links to connect with others while playing; option to accept push notifications to inform of exciting news e.g. updates). For more information (notably on the providers), please read our Privacy Policy: https://tabtale.com/privacy-policy/. By downloading, updating or using the app you consent (in your personal capacity and for other users of your device) to this collection and use of limited device information for ad display and reporting purposes, and to our Terms of Use: https://tabtale.com/terms-of-use/.', 'https://lh3.googleusercontent.com/BqMntrgRJc0uWkHlUwY1hmOYU4Ld5eQE0mE9SbpStDmrP2lV9FoT