(406, 413, 'ALTBalaji is Indiaâs leading subscription-based Video-on-Demand platform that offers never seen before original web series written by acclaimed writers, starring popular celebrities &amp; directed by award-winning directors. <br><br>Our subscription service is pocket-friendly &amp; starts at just â¹100 for 3 months and â¹300 for a year. If you are not an ALTBalaji subscriber, sign up now and start enjoying immediately on the device of your choice with the first episode of all shows FREE.<br><br>Why Choose ALTBalaji?<br><br>â¢	Download original shows and movies over Wi-Fi or cellular to watch seamlessly anywhere, anytime.<br>â¢	ALTBalaji subscription gives you access to original web series and movies for less than â¹1* per day. <br>â¢	No limits! Watch all original shows as often as you want, anytime you want. <br>â¢	Stream seamlessly on up to 5 devices simultaneously.<br>â¢	Enjoy your favourite shows dubbed in Malayalam, Tamil, Telugu, Arabic, Bahasa Indonesia &amp; Bahasa Malaysia languages.<br>â¢	Get fresh &amp; customized content. <br><br>While we are known for our Indian Originals, you can also watch movies from our list of blockbuster films. Some of our best seller shows are:<br><br>The Great Indian Dysfunctional Family â The web series starring Kay Kay, Barun Sobti &amp; Swaroop Sampat shows what happens when an unusual reunion of family members brings heartbreaks, emotional setback &amp; betrayals among themselves. <br><br>Bose: Dead/Alive â Featuring Rajkummar Rao in a realistic portrayal, watch this thrilling story of Subhash Chandra Bose who went on to become India\\\'s Biggest Coverup.<br><br>The Test Case - Story of Indiaâs first ever woman combat officer starring Nimrat Kaur, Rahul Dev &amp; Atul Kulkarni.<br><br>Dev DD â Full of drama, heartbreak and unpredictable romantic twists, watch this modern-day take on Devdas. <br><br>Broken but Beautiful - Watch Vikrant Massey and Harleen Sethi in an amazing story of two broken hearts, when given a second chance, giving birth to a beautiful love story or NOT. <br><br>Karrle Tu Bhi Mohabbat - The romance web series starring popular on-screen couple Ram Kapoor &amp; Sakshi Tanwar.<br><br>Class of 2017- Watch this coming-of-age drama of youngsters as they try to overcome teenage problems while learning about life. <br><br>Baby Come Na â Featuring Shreyas Talpade, Chunkey Pandey, Kiku Sharda &amp; other famous actors, this show is a pure definition of comedy involving twisted hilarious situations.<br><br>Kehne Ko Humsafar Hain- Watch Ronit Roy and Mona Singh choose their course of life while being torn between choices, responsibilities and personal needs.<br> <br>Dil Hi Toh Hai - A drama about an industrialist family where siblings love and respect each other despite differences.<br><br>Hum â This original revolves around the bond between three sisters who, despite having different ideas about life, share a strong sisterly bond. <br><br>Gandii Baat - Stories that unravel complex relationships, closet issues, shocking truths &amp; bizzare myths from rural India.<br><br>Shows for Everyone<br><br>Our shows range from thriller, mystery &amp; crime to drama, comedy &amp; romance in multiple Indian languages. ALTBalaji has original web series for just about everyone- youth to working professionals to families. <br><br>Movies<br><br>Enjoy a curated set of Blockbuster Bollywood movies. Enjoy movies like Lootera (Ranveer Singh and Sonakshi Sinha), Shootout at Wadala (John Abraham), Kya Kool Hai Hum 3, Ragini MMS 2 (starring Sunny Leone), Main Tera Hero (Varun Dhawan, Nargis Fakhri and Ileana), Love Sex Aur Dhokha and many more.<br><br>Comedy- Shows and stand up<br><br>We have some of the most hilarious comedy shows and stand-up acts. ALTBalaji has created original and exclusive comedy shows like Baby Come Na, PM Selfiewali, Zabaan Sambhal Ke etc along with curated stand-up acts across languages to tickle your funny bone. <br><br>For any feedback or queries, please mail us: support@altbalaji.com<br><br>Facebook : https://www.facebook.com/ALTBalaji <br>Instagram: https://www.instagram.com/altbalaji<br>YouTube : https://www.youtube.com/altbalaji<br>Twitter : https://www.twitter.com/altbalaji', 'https://lh3.googleusercontent.com/LorUdiKkD2jgnPzJGaExsp8sBN_njftCz5GYKRSpQqj1csHYNQnBV7NWvQ-6l4FZZQ=s180', 4.2, '[{\"type\":\"Updated\",\"info\":\"March 22, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"Varies with device\"},{\"type\":\"Requires Android\",\"info\":\"Varies with device\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 12+Parental Guidance RecommendedLearn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a010.00 - \\u20b9\\u00a0850.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"ALT Digital Media Entertainment Ltd\"},{\"type\":\"Developer\",\"info\":\"Visit websitedeveloper@altdigital.inPrivacy PolicyC-13, Balaji House\\nDalia Industrial Estate\\nNew Link Road\\nAndheri (West)\\nMumbai,  400053\\nIndia\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/rbllhZZPWT8\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/qb3imcGlJ920IOTE9g7sbI2WOVQTJh-W7n0emk2_eXdsH94qmh_3xId50YjGxin5ahg=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/bRTDhvKNrPLE7Baud4zTQ2cTHDSwwsqxHPW8pMhElpskRtiaJkucqdr_KJhLZ64Fdf0Q=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\