(412, 419, 'mAadhaar is official mobile application developed by Unique Identification Authority of India (UIDAI) to provide an interface to Aadhaar Number Holders to carry their demographic information viz. Name, Date of Birth, Gender &amp; Address along with photograph as linked with their Aadhaar Number in smart phones.<br>Key Features:<br>1.	Aadhaar Number Holder profile download â A convenient way to carry Aadhaar number with demographic details anytime, anywhere.<br><br>2.	Biometric locking/unlocking â To secure biometric authentication by locking biometrics data. Once resident enables Biometric Locking system their biometric remains locked till the Aadhaar Holder chose to either Unlock it (which is temporary) or Disable the Locking system.<br><br>3.	TOTP generation â Time-based One-Time Password is an automatically generated temporary password which can be used instead of SMS based OTP.<br><br>4.	Update of profile â An updated view of Aadhaar profile data after successful completion of update request.<br><br>5.	Sharing of QR code and eKYC data by Aadhaar Number holder â Share QR code and password protected eKYC data to retrieve accurate demographic information from it instead of manual entry.<br><br>6.	Show Authentication Report - To view all the authentication report for particular time frame.<br><br>7.	Generate VID/Fetch VID - VID can be generated or if already created then can be fetched.<br>Note for Users:<br>Registered Mobile Number is essential to use mAadhaar app. In case your mobile number is not registered with Aadhaar visit the nearest Enrolment Centre/Mobile Update End Point.<br><br>Usage Guidelines:<br><br>1. Application will ask for password as soon as it is opened as the first step after confirming consent. User should enter a password containing only numbers and of length 4 e.g. 1234<br><br>2. Aadhaar profile can be downloaded only on mobile devices having registered mobile number (Registered mobile number is the mobile number linked with your Aadhaar)<br><br>3. Please do not navigate from application if it is waiting for SMS. mAadhaar will automatically read the OTP once it is received.<br><br>4. There is no provision to manually enter the OTP anywhere in mAadhaar. This is a security feature.<br><br>5. mAadhaar needs to connect and download data from UIDAI.So ensure that internet connectivity is available on your phone.<br><br>6. One Aadhaar profile can be active on only one device at a time. If you create profile on another device by inserting the sim in another device, the previous profile would become inactive and would be deleted from older device whenever any operation is attempted from that device.<br><br>7. If members of your family have the same mobile number registered as you in their Aadhaar, you can add their profile in your device.<br><br>8. A user can add maximum 3 profiles in his device, all having same mobile number registered in their Aadhaar.<br><br>9. In case of any issue or query, please write to feedback.maadhaar@uidai.net.in<br><br>#########################################################<br>Please Note:<br>If you are getting issues while connecting to server, or any misbehave in the application, immediately after you have updated the app, please uninstall and install again or clear data from settings. Its an known issue and will be resolved in the next update.', 'https://lh3.googleusercontent.com/ACx52uxAZTEDBZ2vC5WCNTHfKcDsgPwGEc304IjCOia_hm3dF6N30P9QhNCUxhAl7A=s180', 3.3, '[{\"type\":\"Updated\",\"info\":\"February 4, 2019\"},{\"type\":\"Size\",\"info\":\"12M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.1.4\"},{\"type\":\"Requires Android\",\"info\":\"5.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Unique Identification Authority of India\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport.maadhaar@uidai.net.inPrivacy PolicyUnique Identification Authority Of India\\nGovernment of India\\nBangla Sahib Road, Behind Kali Mandir,\\nGole Market,\\nNew Delhi - 110001\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/RNvDLUIjTkt1EgV21ZlHx6TQBAtH8Qvpeh5J1ADzykfCCUtuE1k8tLkRBthXKu09p7g=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/s-uWe7Loxn57GY5Cyc_RCr7tG8Chik1Xp6AwC9bktlYmalkww1y8VWIXxQDH5u80VAqu=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[]', '2019-04-07 19:53:07', '2019-04-07 19:53:07', NULL),
