(414, 421, 'Mazes &amp; More is a classic maze/labyrinth puzzle game with fun tweaks and surprises. Just swipe your finger and guide the dot through the walls to find a way out and escape the labyrinth. Minimal 2D graphics make it feel like a classic and retro maze game, while new game modes keep the adventure fresh (and sometimes scary!). No marker needed. We donÂ´t experiment with mouses or cheese.<br><br>MAZES &amp; MORE KEY FEATURES<br>- Easy play, forget about awkward tilt controls or unresponsive accelerometer. Better than using a marker!<br>- All mazes are made by hand, no randomized levels<br>- 6 categories: Classic, Enemies, Ice Floor, Darkness, Traps, and Time Trial. More will come!<br>- Puzzles range from easy mazes to much harder and advanced labyrinths<br>- Minimal and retro 2D graphics, forget about complicated 3D mazes.<br>- We donÂ´t use poor mouses in the labyrinths nor tasty cheese is wasted.<br><br>Guide the dot through different routes in this free maze adventure. Run, explore and find a way out through the intricate walls. Is there a Minotaur?  Complete all 450 labyrinths and become the king of the maze. Have fun :-) No mouses were hurt during the creating of this game.', 'https://lh3.googleusercontent.com/JchaxYkVuO_jGLOaS2-Ur2HcAFAOOPPYsRm6sraO7E55OqoVK_WlZ5k32iIvF_HyeD8=s180', 4.6, '[{\"type\":\"Updated\",\"info\":\"February 16, 2019\"},{\"type\":\"Size\",\"info\":\"17M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.97\"},{\"type\":\"Requires Android\",\"info\":\"4.0.3 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a070.00 - \\u20b9\\u00a03,400.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Leo De Sol Games\"},{\"type\":\"Developer\",\"i