(417, 424, 'You must be an engineer! So, your Dad is then, right? Or maybe your Grandpa? No? But you want to build an airplane anyway. Well, what can we say? Maybe youâd better start with a paper one.<br><br>No, weâre not talking about the ones you made out of your school math test. OK, maybe those too. But weâre also talking about tens of incredible paper airplane models: flying ones for you pilots-at-heart, and stationary ones for the true builders among you. And you can download them all for free.<br><br>If youâve ever dreamed about building a bomber or a modern fighter jet, that doesnât mean you love war; you just think planes are cool. We understand you completely. All right, are you ready? Go get a piece of paper.<br><br>The âHow to Make Paper Airplanesâ app is simple and easy to use. Follow the step-by-step instructions and watch the 3D animation carefully. And donât worry, youâd have to try really hard to get confused.<br><br>By the way, making paper airplanes, like origami, develops logical reasoning, attention span, spatial thinking and fine motor skills. Consider that when youâre trying to keep your fidgety kids busy.<br>So, stock up on paper (and a little patience) and take off to the sky!<br><br>Do you dream of building an airplane? Maybe youâd better start with a paper one. Our app will help you with it!', 'https://lh3.ggpht.com/-FcfQhx5SuDuk-JjCVY1zBLt03aYZOjRX22KoSkUz80TYHFAoP3NBm8bGfjAhnBaiTc=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"March 18, 2019\"},{\"type\":\"Size\",\"info\":\"3.8M\"},{\"type\":\"Installs\",\"info\":\"1,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.0.31\"},{\"type\":\"Requires Android\",\"info\":\"4.2 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Mobilicos\"},{\"type\":\"Developer\",\"info\":\"Visit websiteglobalrunet@gm