(418, 425, 'The Word app from Microsoft lets you create, edit, view, and share your files with others quickly and easily. Edit documents attached to emails, collaborate with your team and bring the Microsoft Office features with you wherever you go.<br><br>Your office moves with you when you use Microsoft Word. The word processor app is as handy as you want it to be, whether youâre a blogger, writer, journalist, columnist, student, or a project manager working on documentation.<br><br>Word introduces a mobile PDF reader for your phone. Edit documents and read PDFs or e-books while traveling, before bedtime, or wherever you want.<br><br>Create documents, scripts, blogs, write-ups, or resumes. Edit documents, letters, resumes, or notes your way with robust tools that enable you to accomplish your best writing with the best format options.<br><br>Create Word documents, edit docs and collaborate with your team wherever you are with Microsoft Word.<br><br><b>Microsoft Word Features:</b><br><br><b>Create Documents With Confidence</b><br>â¢ Create docs, assignments, letters, blogs, scripts, notes, resumes and more with beautifully designed modern templates.<br>â¢ Edit documents with rich formatting and layout options to note down your ideas and express them in writing. <br>â¢ Document editor keeps formats and layouts pristine and looking great, no matter what device you use.<br><br><b>Read, Write, and Edit </b><br>â¢ Read docs, PDFs, letters, scripts, and more on your device with Reading View. <br>â¢ Edit documents from PDFs by converting to and from Word documents to easily make changes.<br>â¢ Convert docs into PDF after editing and share your PDF file with a few taps.<br><br><b>Collaborate With Anyone, Anywhere</b><br>â¢ Collaborate by commenting in your doc right next to the text you\\\'re discussing.<br>â¢ Edit documents as a team and stay on top of changes to the text, layout, and formatting.<br>â¢ The document editor lets you revert to view earlier drafts 