(430, 437, 'bigbasket is Indiaâs leading online supermarket shopping app, trusted by 5 million+ happy customers and counting! Shop anytime, anywhere from a vast range of 20,000+ products including farm-fresh fruits and vegetables, groceries, home &amp; household essentials, pet care needs, organic products, beauty and hygiene, imported and gourmet &amp; more at the best prices. Enjoy hassle-free online grocery shopping and home delivery at just a click of a button. New to bigbasket? Hereâs a flat Rs. 200 cashback on your first order above Rs. 1000. Use voucher code MYFIRST200. <br><br><br>FEATURES AND SERVICES<br><br>What to expect from us?<br><br>* Wide range of products, including fresh fruits and vegetables: Choose from a vast collection of 20,000+ products across 1000+ national and international brands including Aashirvaad, Amul, Bisleri, Cadbury, Complan, Fresho, Haldiram, Himalaya, Horlicks, Kelloggâs, Lays, Lizol, Nandini, Nescafe, Nivea, Nutella, Patanjali, Saffola, Sunpure, Surf Excel, Vim, Zespri to name a few. And yes, we have a full range of fresh fruits and vegetables, procured directly from farmers!<br><br>* Enjoy low prices and great offers: Buy at low prices with great offers including discounts, bundle pack offerings, promotions.<br><br>* Fast and Secure Checkout: Pay by cash-on-delivery, net-banking, credit and debit cards options and e-wallets. Most days we have great offers on multiple payment options including Paytm, HDFC Bank, Citi, ICICI Bank and many others.<br><br>* Assured quality:  We source most of our fruits, vegetables and private label staples (bb Royal, bb Popular) directly from farmers. Our confidence in quality is the reason we have a âno-questions-askedâ return policy.<br><br>* On-time, every-time: We take pride in timely delivery and if you get any of the products after the stipulated time, you are entitled to a 10% refund.<br><br>* Search in 7 languages: Our  app supports searching for items in seven regional languages.