(433, 440, '<b>10 million businesses trust Paytm for their payments</b><br><br><b>Accept Payments Everywhere</b><br><br>Paytm for Business is the fastest and easiest way to collect payments from your customers. If you are a small business, a startup, a freelancer, if you run a shop or a delivery service - you can accept payments from millions of Paytm customers in India. If you have a need to collect payments, we have a solution for you.<br><br><b>All Payment Methods Accepted</b><br><br>Your customers can pay you using UPI, Debit/Credit Card, Net-banking and Paytm Wallet. We take care of payments so you focus on running your business!<br><br><b>Quick Registration</b><br><br>Sign up with your Paytm account or create a new one with just your mobile number. Power payments for your business with Paytm within minutes! Start collecting up to Rs. 50,000 a month and upgrade this limit when you need to. <br><br><b>Accept Payments with QR Code</b><br><br>Get your Paytm QR Code and start accepting payments in your store. Send your QR code over chat or email to customers, print the QR code and display it next to your cash counter or just show the code in your phone to collect payments. Mobile payments do not get easier than this!<br><br><b>Request Money</b><br><br>Collect payments over chat or email with Payment Links. Just add the amount and a description and your link is ready to be shared. It\\\'s incredibly simple yet powerful.<br><br><b>Track Payments Real-time</b><br><br>Get notified via SMS and push notification every time you receive a payment. Check all payments received, initiate refunds, see bank transfers and watch your business grow all within one app!<br><br><b>Instant Bank Settlements</b><br><br>Yes you read that right! Get money in your bank account whenever you want! We are gradually launching instant settlement to our partners. Till then, enjoy next day automatic transfers in your bank account.<br><br><br><b>Introducing Paytm Wholesale: Buy in bulk and Save Big!</b><br><br>Best Prices: Now buy directly from manufacturers and wholesalers to get the best prices and bulk discounts on a wide range of products.<br><br>Access to Credit: Use Paytm Postpaid to buy products now and pay next month<br><br>Deals &amp; Promotions: Pick offers and deals in addition to low prices<br><br>Popular Categories: Get access to quality products across categories such as Mobiles and accessories, Electronics, Fashion, Home &amp; kitchen, Gold and many more!<br><br>GST: Get GST invoice and claim input tax credit for all purchases<br><br>Secure Payments: We are one Indiaâs most trusted Payment Platform<br><br>Door to Door Shipping: Need not worry about shipping anymore. We have tie-ups with major freight providers and assure on time delivery across the country<br><br><b>We are here to help</b><br><br>For any concerns with your business account, feel free to reach us -<br><br><b>Call at</b> - 0120-33663377<br><b>Website</b> - https://business.paytm.com<br><b>Facebook</b> - https://www.facebook.com/paytmbusiness<br><b>Twitter</b> - https://twitter.com/Paytmcare', 'https://lh3.googleusercontent.com/UUyaLb9Jd-AC8dNG0_pJd0uWp-7N5Xf67FGyZ9P1yU4VmdQ_lFY9D-k9Ogh96K4tGqg=s180', 4.2, '[{\"type\":\"Updated\",\"info\":\"March 28, 2019\"},{\"type\":\"Size\",\"info\":\"17M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.4.1\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Paytm - One97 Communications Ltd.\"},{\"type\":\"Developer\",\"info\":\"Visit websitebusinessapp.feedback@paytm.comPrivacy PolicyB-121, Sector 5, Noida, UP, 201301\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/fGFDZlCD7XigBoUbE0vtiEDxJGIiQ2TtYbRkDQ0K4TH2vnGRPVdXQU_jI3fGhCXpmr-_=w720-h310\",\"https:\\/\\/lh3.googleuserconten