(453, 460, 'Create awesome lip-sync music videos with live video effects and your choice of music! <br><br>It\\\'s super easy to use, you don\\\'t have to be a pro. Just pick a soundtrack from your music collection and start shooting your lip-sync performance or action. Apply the video effects live while previewing or shooting. Pause and resume your work at any time! <br><br>Have you ever wondered how people create those funny animated videos ? Now you can shoot them too with our Stop Motion feature (available as an in-app). To use it pick a soundtrack, enable Stop Motion mode (under the timer button) and adjust duration of shots and delay between them to get desired time-lapse effect or re-position scene objects. <br><br>Create your masterpiece in a snap, share it and become a video star !<br><br><br><b><u>Highlights</u></b><br><blockquote>\n<br>âINSERT INTO `app_detail` (`id`, `app_id`, `about`, `images`, `rating`, `additional_info`, `screenshot`, `video`, `created_at`, `updated_at`, `deleted_at`) VALUES
(459, 466, 'UTS on mobile app is an Indian Railways official android mobile ticketing app to book unreserved train tickets. <br> <br>Who can use utsonmobile application? <br>The service is not available to a person under the age of Seventeen or previously suspended or removed from the services by Indian Railway.  <br> <br>By accepting the Terms &amp; Conditions or by otherwise using the Service or the website, it would be deemed that the concerned person is at least Seventeen years of age and have not been previously suspended or removed from the Services by Indian Railway. The Person represents and warrants that he has the right, authority, and capacity to enter into this Agreement and to abide by all of the terms and conditions of this Agreement. The person shall not impersonate any other person or entity, or falsely state or otherwise misrepresent identity, age or affiliation with any other person or entity. <br> <br>Pre-requisites to avail the utsonmobile app service: ï¼<br>Presently, utsonmobile app is available in Android, Windows &amp; iOS versions.  ï¼ <br>The Smartphone should have good GPRS connectivity.  ï¼ <br>In order to avail paperless mode of tickets, the Smartphone should be GPS enabled. <br>  <br>Registration Process: <br>User Registration for availing the above services can be done through the utsonmobile app or the website (https://www.utsonmobile.indianrail.gov.in). <br>The passenger needs to provide information like Mobile Number, Name, Password, Gender, Date of Birth for the one time registration process. <br>The mobile application would send an OTP to the mobile number specified against the USER ID field to ensure the validity of the mobile number. After successful registration, an SMS will be sent informing the user about the successful registration. A zero-balance R-Wallet account would be activated. <br> <br>Login Process: <br>After the registration, the passenger needs to enter the credentials in the login page for entering into the utsonmobile app.<br><br>Services offered by utsonmobile app: <br>1. Book Ticket: <br>    Normal Booking(Journey and Return tickets)ï¼ <br>    Quick Booking (Journey and Return tickets)ï¼ ï¼ <br>    Platform Ticket ï¼ <br>    Season Ticket ï¼ <br>    QR Booking (Platform Tickets, Journey and Return Tickets)<br><br>2. Cancellation of Ticket :-<br>Paper Ticket with booking amount greater then cancellation charges can be cancelled using utsonmobile app before printing of ticket. Cancellation of Paperless Ticket is not allowed.<br><br>3. Booking History<br><br>4. R-Wallet:<br>ï¼R-Wallet Balance ï¼ <br>    Recharge R-Walletï¼ <br>    History ï¼ <br>    Surrender R-Wallet<br><br>5. Profile:<br>ï¼Change city ï¼ <br>    Change Frequent travel Route ï¼ <br>    Change Journey Details ï¼ <br>    Change Password ï¼ <br>    Change Handset Request ï¼ <br>    Change Personal Details ï¼ <br>    Sync Ticket<br><br>6. Show Booked Ticket:<br>Using \\\'show ticket\\\' feature the ticket can be showed to the TTE(Travelling Ticket Examiner) or TC. Off-line mode is also available to show the paperless ticket if Internet connection not available in the mobile.<br><br>Note:- <br>Paperless ticket booking(Book and Travel) is not allowed inside train or within station premises to avoid ticket booking just by seeing TTE(Travelling Ticket Examiner) or TC.<br>For booking of paperless ticket user should be away from Station premises/Railway track.<br><br>For Paper Ticket(Book and Print) mode of booking, It is mandatory to take printout of the ticket from ATVM/CoTVM kiosks or General Booking counters at station before boarding the Train.', 'https://lh3.ggpht.com/O0Vntql3nOaA1wnh1WcuezOYlbUjxcJu4yOtNN3ueGQGYM6XzPRieDHUwKvftU15Ewk=s180', 4.2, '[{\"type\":\"Updated\",\"info\":\"April 6, 2019\"},{\"type\":\"Size\",\"info\":\"5.9M\"},{\"type\":\"Installs\",\"info\":\"5,000,000+\"},{\"type\":\"Current Version\",\"info\":\"14.0.13\"},{\"type\":\"Requires Android\",\"info\":\"4.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Centre for Railway Information Systems\"},{\"type\":\"Developer\",\"info\":\"Visit websiteutsonmobile@cris.org.inPrivacy Policy\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/F6tQP_fCmPt97tQa2g3KEErAis1E7RL0tg5c0S7uZRYC3piJcil6l08ZGl2N9Lc_ZIw=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/aoUANAfLuItPn2a1WWFjAMXsKDuM0htn7HGPc_aR4e_n14Rpmu3MjdOHdrTumhn_xUA=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[]', '2019-04-07 19:56:40', '2019-04-07 19:56:40', NULL),
