(489, 496, 'Retrica is a beautiful camera app with powerful tools for taking selfies, personalizing your photos, and sharing images with friends. Express yourself with mesmerizing filters and discover new interesting people.<br><br>â¢ Beautiful camera filters for any occasion<br>We have 100+ filters to choose from. And you can see them in real time, before you take your selfie â which means you can focus on capturing your good side instead of editing.<br><br>â¢ Multiple different looks<br>Need to make your colors pop? Want that washed out beach look? How about some vintage camera light leaks? Whether you want retro or remarkable, Retrica has you covered. Double tap to adjust each look to juuuuuust the right amount.<br><br>â¢ Stand out with videos, and GIFs<br>A tap will take the perfect snapshot, and a long press will capture live video. Switch into GIF mode and turn a collage or video into your very own GIF-able moment.<br><br>â¢ Easy Instant Collage<br>One picture not enough? Take multiple selfies and turn them into a beautiful collage instantly. You can turn your phone into a retro photo booth with the touch of a button.<br><br>â¢ Fun stickers, stamps, doodles, and more!<br>Over 100 stickers to decorate and edit your shots. Make your videos pop, embed a personal message on your selfie, or add the date and time with Retrica\\\'s creative stamps. We\\\'ve got tons of ways to decorate your selfies.<br><br>â¢ Chronological Follow Feed<br>When you follow someone on Retrica, we show you all of their posts in reverse chronological order. Always. We never hide photos or videos from the people you follow.<br><br>â¢ Send private messages<br>Retrica isn\\\'t just a camera, it\\\'s also a community. Meet and make new friends in Retrica, and send private messages with our new direct messaging feature.<br><br>â¢ Share<br>Upload your beautiful selfies to social media platforms like Facebook, Twitter, Instagram, and more. In Retrica, your followers can see every shot y