(500, 507, 'PNB ONE is an amalgamation of various banking processes being delivered through single platform.  PNB ONE mobile banking app  is an all in one application which allows you to transfer funds, view account statement, invest in term deposits,  manage debit card &amp; credit card and many other exclusive services at your fingertips.<br>Note:-  PNB ONE is official mobile banking application of Punjab National Bank. This application provides access to PNB banking services across all operators.<br>Services Available / Features of PNB ONE Mobile Banking App.<br>Interactive Interface:-<br>â¢	Redesigned dashboard with more features available on the dashboard.<br>â¢	Access all the accounts on the dashboard itself.<br><br>Accounts:-<br>â¢	All accounts will be displayed in illustrative manner. ( Savings, Deposits, Loan, Overdraft, Current).<br>â¢	Detailed view of account statement.<br>â¢	Check Balances.<br> <br>Transfer Funds:-<br>Regular Transfers<br>â¢	âSelfâ (for own accounts), âWithinâ (for PNB accounts) &amp; âOtherâ (for non-pnb accounts) will be there.<br>â¢	NEFT/IMPS/UPI for Interbank fund transfers.<br>Instant Transfers (without adding beneficiary).<br>â¢	IMPS using MMID.<br>â¢	Quick Transfer without adding beneficiary.<br>Indo- Nepal Remittance.<br> <br>Invest funds:-<br>â¢	Open a term deposit account.<br>â¢	Mutual Funds.<br>â¢	Insurance.<br> <br>Transactions:-<br>â¢	My transactions will display all the recent transactions.<br>â¢	My Favorite Payee will show list of recent payees.<br>â¢	Schedule a transaction.<br>â¢	Recurring transactions.<br><br>Safe and secure:-<br>â¢	Sign in much faster and simpler with your fingerprint.<br>â¢	2 factor authentication.<br>â¢	Encryption.<br><br>Manage Debit Card:-<br>â¢	Apply for a new card.<br>â¢	Update limits of ATM withdrawal, POS/ E-Comm transaction.<br>â¢	Hotlist debit card.<br><br>Manage Credit Card:-<br>â¢	Link/De link Credit Card.<br>â¢	Auto Payment Registration.<br>â¢	Auto Payment De-Registration.<br>â¢	Change card limit.<br>â¢	Statement on e-mail.<br>â¢	Damaged card replacement.<br><br>Unified Payment Interface (UPI):-<br>â¢	Send/ Collect money through UPI.<br>â¢	Transaction History.<br>â¢	Complaint Management.<br>â¢	User Deregistration.<br><br>Scan &amp; Pay (BHARAT QR):-<br>â¢	Make Payment by scanning QR directly.<br>â¢	Link your cards once and make the payment directly from the account.<br><br>Pay Bills/Recharge:-<br>â¢	Register your biller pertaining to Mutual find, Insurance, Telecom, Electricity, DTH, credit card etc.<br>â¢	Pay bills directly to your registered biller.<br><br>Languages:-<br>â¢	Available in English and Hindi.<br><br>Cheques:-<br>â¢	Inquire Cheque Status.<br>â¢	Stop Cheque.<br>â¢	Request for Cheque book.<br>â¢	View Cheque.<br><br>M-Passbook:-<br>â¢	View account statement of account.<br>â¢	Download account statement in PDF for offline purposes.<br><br>Favourites:-<br>â¢	Customer can add/delete most frequently used functionalities as favourite.<br><br>Value Added Services:-<br>â¢	PAN/ Aadhar Registration.<br>â¢	E-mail ID Updation.<br>â¢	E statement registration.<br>â¢	E-statement de registration.<br>â¢	MMID( used for IMPS).<br>â¢	Last 10 SMS.<br><br>Complaint Service Management:-<br>â¢	Raise a complaint/ Service Request.<br>â¢	Track your request.<br>â¢	Request history.', 'https://lh3.googleusercontent.com/9ZMu5TroJ2NtKYCSW5hvSM6UD-cDRn-46b37bDkbC8b4sNq70i-4iNsO5xen5Ak_aA=s180', 4.2, '[{\"type\":\"Updated\",\"info\":\"March 15, 2019\"},{\"type\":\"Size\",\"info\":\"24M\"},{\"type\":\"Installs\",\"info\":\"500,000+\"},{\"type\":\"Current Version\",\"info\":\"1.11\"},{\"type\":\"Requires Android\",\"info\":\"5.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"PNB\"},{\"type\":\"Developer\",\"info\":\"Visit websitemobhelp@pnb