(510, 517, 'ð¯ Let\\\'s play darts! Compete against real opponents in the stunning new multiplayer darts game from the creators of \\\'Table Tennis Touch\\\'. \\\'Darts of Fury\\\' is an action-packed, modern darts game designed for darts newcomers and fans alike.<br><br>MULTIPLAYER LEAGUES<br>Pick up your darts, join Sparrows League and face your first challenger. Take aim, swipe to throw and compete against real opponents from all over the world. Earn XP to climb up the Leagues and aim for League promotion to unlock better darts, faster flights, tougher challenges, and bigger rewards. Can you reach the legendary Eagles league?<br><br>MODERN ARENA<br>Set in a stunning and crowd-packed arena, Darts of Fury is unlike any darts game you\\\'ve ever seen before. Perfect for both darts newcomers and darts fans. Interactive dartboards will highlight your targets, freeing you to concentrate on achieving the perfect throw.  Meet \\\'ShotBot\\\' - your very own checkout guide drone. She\\\'ll guide you around the board, calculating the safest path to that winning checkout. Big screen action, explosive celebrations, interactive dartboards, and digital oches all come together to launch darts into the 21st century.<br><br>COLLECT AND UPGRADE DARTS<br>Customize your darts with endless combinations of barrels, shafts and flights. With 80 darts, hundreds of flight designs and shaft stickers, you can show off your unique personality to League challengers. Earn coins in League matches to upgrade to slimmer, faster darts and increase your chances of getting that elusive perfect \\\'180\\\'.<br><br>GAME MODES<br>In League, play \\\'Tower X01\\\' - an explosive take on the classic \\\'01 game. Race to score the most points and be the first to checkout without going Bust! In Training, test your accuracy under pressure in the fast paced \\\'Round The Clock\\\'. And stay tuned for more of your favorite darts games coming soon.<br><br>AND MORE<br>â¢ Facebook and Google sign in so you can save progress across devices and play with your real name and photo<br>â¢ Loads of achievements to collect<br>â¢ Player stats <br>â¢ Flag selection<br>â¢ Language support<br><br>SUPPORT<br>If you have any problems with Darts of Fury or you just want to tell us about a feature you want to see, then you can reach us at https://support.yaku.to<br><br>Note: Darts of Fury is free to download. However, some items are available to purchase with real money. If you don\\\'t want to use this feature, please disable in-app purchases in your device settings.', 'https://lh3.googleusercontent.com/WieasyZblaS-rxQCXevthoEXoudA2lIdYZ8n7GuibAwzdgCaG4akkAzwk89iVC6cAZU=s180', 4.7, '[{\"type\":\"Updated\",\"info\":\"April 3, 2019\"},{\"type\":\"Size\",\"info\":\"95M\"},{\"type\":\"Installs\",\"info\":\"1,000,000+\"},{\"type\":\"Current Version\",\"info\":\"2.1.0401.1106\"},{\"type\":\"Requires Android\",\"info\":\"4.4 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a035.00 - \\u20b9\\u00a04,150.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Yakuto\"},{\"type\":\"Developer\",\"info\":\"Visit websitesupport@yaku.toPrivacy Policy44 Paul Street\\nLondon\\nEC2A 4LB\"}]', '[\"https:\\/\\/i.ytimg.com\\/vi\\/p_3YepBIH2g\\/hqdefault.jpg\",\"https:\\/\\/lh3.googleusercontent.com\\/-6p4aiEySNhukjaQCWRRFnSENyBnyotvRs37HVhWEifMU1sGI-HZAD_VYbco-mnnuQQ=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/MyK2hrSQxCksDK0IKryb0MPbeW5L2j9pjOEvLsrK-CwB6mlnoDZnsmGbCpF6A17d_2w=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/