(513, 520, '<b>Key Benefits:</b><br><br><b>PhonePe supports payments via all (70+) BHIM UPI apps: </b><br>PhonePe for Business supports more than 70 BHIM UPI apps to accept payments. Users of any  BHIM UPI app can make merchant payments using their preferred app. <br><br><b>Supports All Payment Methods (BHIM UPI, Credit Card, Debit Card, Wallets):</b><br>The PhonePe for Business app supports all payment methods like BHIM UPI, Credit Card, Debit Card and Wallets., You can start accepting payments from millions of BHIM UPI app customers instantly, irrespective of the size or scale of your business.<br><br><b>Direct Settlement into Your Bank Account: </b><br> Money is transferred directly into your bank account either instantly or within 1 day. There is no intermediate wallet. <br><br><b>No Daily Limit of Money Transfer:</b><br>PhonePe for Business understands what a growing business needs. There is no limit on the amount of money which can be transferred in your bank account.<br><br><b>Real-time Transactions and Payments Tracking:</b><br> Businesses can track their transactions and payments on a real-time basis using their PhonePe for Business dashboard. <br><br><b>Reports and Analytics:</b><br>Using the reports and analytics section, you can get useful insights to grow your business.', 'https://lh3.googleusercontent.com/z6wYJPA1QqpwiufMxVqpZ9Ion3Sdpvx-vy3i5VJJL1foJ-crT4-D7EOffh5w82DYi5I=s180', 4.3, '[{\"type\":\"Updated\",\"info\":\"March 26, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"1,000,000+\"},{\"type\":\"Current Version\",\"info\":\"0.0.7\"},{\"type\":\"Requires Android\",\"info\":\"4.4 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"PhonePe\"},{\"type\":\"Developer\",\"info\":\"Visit websitemerchant-desk@phonepe.comPrivacy Policy\"}]', '[\