p; Body: Get bath and body products for daily use from your favourite brands such as The Body Shop, Palmolive, Nivea, Pondâs, Dove, Vaseline and more.<br><br>Accessories: Handbags, jewellery, sunglasses, watches, belts, scarves, storage kits and more.<br><br>Appliances: Hair straighteners, curling irons, blow dryers, menâs beard trimmers, hand more!<br><br>Fragrance: Exquisite perfumes and colognes for men and women from top brands including Jimmy Choo, Davidoff, Calvin Klein, Bvlgari, etc.<br><br>Menâs Store: Shaving creams, beard trimmers, hair care, grooming kits, wellness and gift ideas for men.<br>Satisfy any womanâs shopping needs with our easy to use makeup shopping app.<br><br>Follow Whatâs Trending - Shop the latest makeup products, natural hair products, with our beauty trends. You can also buy from our collection of sunglasses, handbags and jewellery. <br><br>âRefer A Friendâ program: Invite friends to join the Nykaa community and you both get rewarded. Once you refer a friend, you earn Rs. 200 for every friend who registers and completes their first order at Nykaa.com. Your friends win too â they get Rs.200 for their first purchase of online shopping with us! ð<br><br>Womenâs shopping is more rewarding with our exclusive shopping deals, offers with discounts from top brands including Maybelline, Lakme, LâOreal Paris, Nykaa Cosmetics, The Face Shop, M.A.C, Nivea, The Body Shop, Neutrogena, Clinique &amp; other beauty products. <br><br>Visit Nykaa beauty store for the virtual makeover tool, beauty advice and assistance on the phone, free expert advice and articles on beauty trends and tutorials and celebrity looks. <br><br>You have the option of paying via COD, Mobile Wallet, UPI, Debit Card, Credit Card and Net Banking processed through secure and trusted gateways. <br>You can also purchase gift cards for your loved ones. ð<br><br>Download Indiaâs most loved make up app and enhance your online shopping experience with makeup tu