(522, 529, '<b>The most powerful and complete Audio Editor! It has all the features you would ever want in an Audio Editor!!</b> Trim Audio â MP3 Cutter for Ringtones, Merge two or more audio files, Mix Audio Clips, Change Metadata fields like Art Cover, Music  Album name etc, Convert from one format to another - MP3, AAC, WAV â¦ and the list of app features goes on!!<br><br><b>App is completely FREE!! No limits!</b><br><br><b>&gt;&gt;&gt;&gt; Features &lt;&lt;&lt;&lt;</b><br><br>â <b>MP3 Cutter</b>: Select the best part from the Song then trim and cut the desired part of the song for using in Ringtone, Notification tones, Alarm tones. Inbuilt player for easy selection of ringtone cutter start location, end cut location and waveform support. Mp3 cutter supports cutting of MP3, AAC, WAV, M4A, AMR etc.<br>â Easily choose the Songs, other audio files from the list. You can search the list of songs. Also Music, Ringtones, Notifications, Alarms are marked separately so that one can choose easily. Also songs are listed alphabetically, so that one can choose by just browsing as well.<br>â <b>Ringtone Setting</b>: Set Trimmed audio as Ringtone, Notification Tone, Alarm Tone. Apart from default ringtone maker, you can also use ringtone cutter for a particular contact.<br>â <b>Audio Mixing Tool</b>: Mix Audio of two songs to create remixes. Same or any format songs can be remixed. You can also choose the Volume, for instance you can keep one song at low volume and another at high volume in your mashups.<br>â <b>Merge Audio</b>: Merge two or more Audio Clips. You can merge any number of Audio clips and make a unique tone with ringtone cutter. Merging of different formats is possible for eg. One MP3 file and another WAV music. . It also supports Fade In/ Fade Out support thus giving a professional output.<br>â <b>Metadata Editor</b>: You can change a number of metadata tags of a Song like â Song Title tag, Cover Art, Music Album name, Singer Name/ Artist, Genre, Composer, Year, Track number and more. This gives you enhanced control and professional audio editor features with mp3 cutter. You can choose a photo from your gallery for using in art cover in the tag editor.<br>â <b>MP3 Converter</b>: Easily convert from one format to another. Supports a large number of formats like - MP3, AAC, WAV, M4A encoder etc. You can also choose the sample rate like 32 Kb, 64, 128, 192 etc in mp3 converter.<br>â Supports large number of formats in all the features - MP3 Cutter, Merge, Metadata Song Editor etc.<br>â Easily access your music creations. Music output list is well organized, stored in different tabs like Trimmed Audio has the cut mp3 files, Merged files, Metadata change files &amp; Format Converter files. You can browse your music and search. You can play a particular file, set as default ringtone. You can also use ringtone cutter for a particular contact.<br>â Share your creations with the world!  Share on Faceboook, Whatsapp, email and more.<br>â <b>Mp3 Player</b>: Inbuilt Mp3 player in the app.<br>â Recorder for recording your voice and music. Use these recordings in ringtone maker, remixes etc. .<br>â Super Fast processing &amp; rendering!<br>â Intuitive &amp; Modern UI<br><br>Get the most powerful Audio Editor with mp3 cutter app and see what you have been missing! Create best song tracks, ringtone cutter, remixes, shorten music, mashups, tag editor and much more with this tool!<br><br>App uses FFmpeg under permission of LGPL.', 'https://lh3.googleusercontent.com/KKZWf2oyI5GxNbWO5Bw-k_1-izHMuhgsALXs1Ys1bOTDmeuka45_sLu2ycMVlf7q6Lcl=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"April 4, 2019\"},{\"type\":\"Size\",\"info\":\"11M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.80\"},{\"type\":\"Requires Android\",\"info\":\"4.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchas