(540, 547, 'The free document scanning app from Adobe, with integrated OCR technology to instantly recognize text. <br><br>With Adobe Scan you can transform anything into digital - scanning documents, photos, notes, tax receipts or even save multiple business cards to contacts. Using the automatic text recognition technology you can easily edit, copy and save your scans to an Adobe PDF - ready to share with your contacts.<br><br>HOW ADOBE SCAN WORKS:<br><br>With the Adobe Scan document scanner app, you can make anything scannable. Use the PDF scanner to quickly create a photo or PDF scan. Scan and go right back to other important things.<br><br>â¢ CAPTURE DOCS, BOOKS, TAX RECEIPTS AND MORE. <br>Scan anything with precision with this mobile PDF scanner app. Advanced image technology automatically detects your documents for borders, sharpens scanned content, and recognizes text (OCR). <br><br>â¢ ENHANCE SCANS. <br>Touch up scans, photos, and documents from your camera roll. Whether itâs a PDF or photo scan, you can preview, reorder, crop, rotate, and adjust color.<br><br>â¢ REUSE WITH THE OCR SCANNER. <br>Turn your photo scan into a high-quality Adobe PDF document that unlocks content through automated text recognition (OCR). You can reuse content after scanning PDF documents thanks to OCR. Using it as a book scanner can digitize bulk pages, fast!<br><br>WHAT CAN ADOBE SCAN DO FOR YOU?<br><br>You need a business card scanner? The Adobe Scan photo scanner is so easy and powerful to use, youâll say, âThis is the free PDF scanner for me.â<br><br>â¢ SCAN ANYTHING, ANYWHERE, ANYTIME. <br>Capture forms, tax receipts, notes, and business cards with this mobile scanner. The Adobe Scan scanning app can be used as book scanner or receipt scanner and even lets you scan multi-page documents and save with a single tap.<br><br>â¢ RECYCLE CONTENT. <br>The Adobe Scan to PDF scanner makes any content scannable and reusable. Free, built-in optical character recognition (OCR) lets you reuse scanned content by creating a high-quality PDF that you can work with in Adobe Acrobat Reader. Even turn Adobe Scan into a tax receipt scanner so you can highlight expenses with ease.<br><br>â¢ QUICKLY FIND DOCUMENTS IN PHOTOS. <br>This powerful scanning app automatically finds documents and receipts in your photos and turns them into PDF scans, so you don\\\'t have to. Automatic OCR turns text into content you can edit and reuse. Do you have lots of business expenses? The receipt scanner will help collate all of your expenses together.<br><br>â¢ SAVE BUSINESS CARDS TO CONTACTS. <br>Scanning business cards turns Adobe Scan into a fast business card scanner and reader. Contact information will be automatically extracted while using the business card scanner, so you can quickly add to your device contacts â no typing needed.<br><br>â¢ GET MORE DONE ON THE GO. <br>Save each PDF scan to Adobe Document Cloud for instant access and sharing. Even lengthy legal documents become manageable and scannable with the Adobe Scan scanning app, which lets you search, select, and copy text. You can also open a PDF scan in Acrobat Reader to highlight key sections and add comments to your documents. <br><br>â¢ GET CONNECTED. <br>The Adobe Scan document scanner connects you to the worldâs best document services that let you do even more with your PDFs. Edit PDF and photo scans, convert to Microsoft Office, fill and sign, and send for tracked signatures. <br><br>Terms &amp; Conditions: Your use of this application is governed by the Adobe General Terms of Use (http://www.adobe.com/legal/terms.html and the Adobe Privacy Policy (http://www.adobe.com/privacy/policy.html)', 'https://lh3.googleusercontent.com/tELLvbTfEuNoCUMOM_vpk05N5fZZ_vwsSb-oDY3s4NXcg8wGl4-UbxtZkx5rdM-5bA=s180', 4.6, '[{\"type\":\"Updated\",\"info\":\"March 29, 2019\"},{\"type\":\"Size\",\"info\":\"Varies with device\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\"