(542, 549, '<b>Circle</b> app brings to you the interesting and important stories happening around you. Download the app to get <b>videos, short stories of local breaking news in Hindi &amp; Malayalam</b> with speed, accuracy and quality. The app is live in multiple districts of <b>Uttar Pradesh, Rajasthan &amp; Kerala</b>. Join the Circle now!<br><br>Get every step update on <b>Lok Sabha elections &amp; IPL</b> with Circle.<br>#LokSabhaElections2019 #Elections #IPL2019<br><br>Circle - your one stop for <b>Uttar Pradesh News, Rajasthan News &amp; Kerala News</b>.<br><br><b>Whatâs inside?</b><br><br>News Feed: Get news &amp; videos of things happening around you and of local events<br><br>Short &amp; Crispy: Our summarized stories focus on facts to help you stay updated with the latest news<br><br>Breaking: Get the news as and when it happens, news updated 24x7<br><br>Verified: All the content on the app is verified and posted by people from your own city, whom you can trust<br><br><b>Features:</b><br><br>Download the short news and videos on your phone and watch them later<br><br>Share news and videos easily with your friends and family on WhatsApp and Facebook<br><br>Access the news in your preferred language (<b>Hindi &amp; Malayalam</b>)<br><br><b>What you\\\'ll get?</b><br><br>Latest local news updates on upcoming Lok Sabha elections 2019, local breaking news, <b>live video news, Hindi news, Malayalam news</b>, latest news, news alerts, live updates, video news, viral videos, local videos, election news, news headlines &amp; live news, political news, sports news, cricket news, <b>IPL news</b>, business, horoscope, astrology, health, entertainment, local jobs, food &amp; movie reviews, local events. Special reports on local level politics, Lok Sabha elections and IPL 2019, local festivals and events.<br><br>Circle currently provides local news, videos and stories from the following districts: <br><br><b>Uttar Pradesh (UP) - Agra, Aligarh, Ambedkar Nagar, Ameth