(545, 552, 'Racing Fever is an addictive game for the fans of arcade racing and driving simulations.<br><br>THE ULTIMATE MULTIPLAYER RACE<br>Pick your favorite car and join the ultimate challenge!<br>Join 6 different rooms with massive prizes from Amateur to King<br>Race head-to-head against your friends or challenge random players across the globe<br><br>HIGH SPEED DRIVING<br>Race at high speeds, drive against traffic and overtake cars!<br>Nothing is forbidden in Racing Fever, More Danger = More Coins!<br><br>HIGH QUALITY GRAPHICS<br>Enjoy the cutting edge 3D graphics with realistically created environments and amazingly detailed cars.<br><br>THE CAR OF YOUR DREAMS<br>Upgrade your car to the limits, customize with paints, vinyls and rims.<br>Make it better, faster, stronger and prettier.<br><br>SLOW MOTION MODE<br>Don\\\'t push your luck in sticky situations, slow time for easier manoeuvres. <br>It does not last forever but quickly refills.<br><br>EXPLORE DIFFERENT THEMES<br>Take a ride in Village, Desert, City, or have a snowy one in Winter. <br>Each 4 environment are realisticly created and highly detailed.<br><br>GAME MODES FOR EVERY MOOD<br>Feel the Fever in One Way and Two Way, rush a quick game in Time Attack or drive calmly in Free Ride.<br><br>DRIVE IT YOUR WAY<br>Control your car as you like.<br>Choose Steering Wheel, Buttons, Gyro or even Joystick.<br><br>MULTIPLE CAMERA ANGLES<br>Race through traffic with Top or Back camera, or just dive into the action with Hood camera.<br>Each camera angle offers a unique driving experience.<br><br>LANGUAGE SUPPORT<br>Available in 36 different languages and more soon!<br><br>BONUSES<br>Enter time limited quests to win big prizes!<br>Get your daily bonus every day, multiply your bonuses with every consecutive visit. <br>Don\\\'t forget to visit mini game too!<br><br>SHARE &amp; COMPETE<br>Exchange keys with friends and win a brand new car!<br>Compare scores on leaderboards with friends and drivers all around the world.<br><br><br><br>KEY FEATURES<br>- Stunning 3D graphics<br>- Smooth and realistic driving<br>- 4 detailed environments: Village, Desert, City, Winter<br>- 4 game modes: One Way, Two Way, Time Attack, Free Ride<br>- 10 different cars (new cars on the way!)<br>- Upgradeable Speed, Acceleration, Handling, Braking options<br>- Customizable Paints, Rims, Vinyls<br>- Rich traffic: Trucks, Buses, Vans, Pickups, SUVs &amp; etc.<br>- High, Medium and Low Graphic options<br>- Time limited Quests &amp; Bonus Game<br>- Online Leaderboards and Achievements<br><br><br>Please rate us and give your feedback for further improvement of the game.<br><br>Visit our official site at http://www.gameguru.mobi/<br>Follow us on Facebook at https://www.facebook.com/racingfevergame', 'https://lh3.googleusercontent.com/pephiKFfIaQu8hpzEqvSB6YiQZrucQjm3AtTi0P3F-ei6KFh3pPqaJntR9tYgOA_5kc=s180', 4.5, '[{\"type\":\"Updated\",\"info\":\"April 4, 2019\"},{\"type\":\"Size\",\"info\":\"75M\"},{\"type\":\"Installs\",\"info\":\"50,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.6.6\"},{\"type\":\"Requires Android\",\"info\":\"4.1 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a0110.00 - \\u20b9\\u00a011,800.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Gameguru\"},{\"type\":\"Developer\",\"info\":\"Visit websiteadmin@gameguru.mobiPrivacy PolicyP.O.Box 16111 RAK FTZ Ras Al Khaimah UAE\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/pOnyHGClcx5WPsLDwzKTg2oAnnqfr3j535CkRUA5sW3RGiNJblhvvpDyl2vkYjjpaAA=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/Fa74IB0kOYHUMHjFt6blg1QieY1Qj0c5PabkdcjGGSJlF7sqCvP3e7350PDKxa8fsWU=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:i