(557, 564, 'RTO registration details at your fingertips. <br><br>The app gives following RTO vehicle registration information details by using vehicle number :<br><br>- Owner Name<br>- Age<br>- Engine Number<br>- Chassis Number<br>- Vehicle Registration Date<br>- Vehicle Registration City<br>- Type<br>- Model<br>- City <br>- State<br><br>The app gives following Information for Licence Search <br><br>- Holder\\\'s Name<br>- Age<br>- Valid Upto Date<br>- Registered Office<br>- Issuance Date<br>- Status (ACTIVE/INACTIVE)<br><br>Find vehicle RTO registration number details and use it to-<br><br>- Get RTO vehicle details of the unclaimed vehicle parked just outside your gate for days <br>- Check RTO registration details of an already registered car or vehicle before buying it using the number plate of the vehicle<br>- Know which car your friend (or maybe rival) owns just by his name :) RTO SEARCH<br>- Check your Driving Licence Status - DL Search (NEW)<br>- Daily Fuel prices for All cities in India (Petrol and Diesel)<br>- Find out about the newest supercars information and details<br>- Read some interesting facts about cars and watch amazing car videos?<br>- Know which car your favourite celebrity owns?<br>- You can use CarInfo app to search for a vehicle owner just by entering the vehicle registration number<br>- You no more need to go to the Regional Transport Office (RTO) to get these details for a car, bike, truck, taxi, scooter or any other Indian Vehicle!<br>- Use recent searches tab to quickly view past results. <br>- Share vehicle information with friends on email, WhatsApp, Facebook with a single link.<br>- This works for all RTO vehicle types - cars, motorbikes, trucks, autos, just about everything!<br>- You can also add all your vehicles to your garage!<br>- You can reverse search a vehicle using the name of the person and get to know about all the vehicles owned by that person.<br>- Read interesting articles and watch amazing videos related to cars and share with your friends. <br>- Check out the cars owned by different celebrities.<br>- Search vehicle by name RTO <br><br>The app can find the RTO registration number verification details for the below states of India.<br>RTOs in Andhra Pradesh<br>RTOs in Arunachal Pradesh <br>RTOs in Assam<br>RTOs in Bihar<br>RTOs in Chhattisgarh<br>RTOs in Delhi<br>RTOs in Goa<br>RTOs in Gujarat<br>RTOs in Haryana<br>RTOs in Himachal Pradesh<br>RTOs in Jammu and Kashmir<br>RTOs in Jharkhand<br>RTOs in Karnataka<br>RTOs in Kerala<br>RTOs in Madhya Pradesh<br>RTOs in Maharashtra<br>RTOs in Manipur<br>RTOs in Meghalaya<br>RTOs in Mizoram<br>RTOs in Nagaland<br>RTOs in Odisha<br>RTOs in Punjab<br>RTOs in Rajasthan<br>RTOs in Sikkim<br>RTOs in Tamil Nadu<br>RTOs in Telangana<br>RTOs in Tripura<br>RTOs in Uttar Pradesh<br>RTOs in Uttarakhand<br>RTOs in West Bengal<br><br>Disclaimer :<br>We are not related to VAHAN, PARIVAHAN or any RTO authority of India. This is not an official RTO App.<br>All details shown in the app about vehicle owner is publically available on the official Parivahan RTO website and can be looked up by anyone visiting the website absolutely free. We are showing the information available on the website as it is, without making any changes to it. Car Info is only acting as a platform to make this information available to users easily via this app.', 'https://lh3.googleusercontent.com/NOyyusXmKpxEAjZyoDdRFvESE1JEPdxGL14j32UV5sRjZ-hyEuxmzb9RyB4XMbkQmA=s180', 4.6, '[{\"type\":\"Updated\",\"info\":\"April 4, 2019\"},{\"type\":\"Size\",\"info\":\"6.1M\"},{\"type\":\"Installs\",\"info\":\"5,000,000+\"},{\"type\":\"Current Version\",\"info\":\"4.2.1\"},{\"type\":\"Requires Android\",\"info\":\"4.4 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Users Interact\"},{\"type\":\"In-app Products\",\"info\":\"\\u20b9\\u00a010.00 - \\u20b9\\u00a050.00 per item\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Car Info\"},{\"type\":\"Developer\",\"info\":\"Visit websitecuvora@gmail.comPrivacy PolicyNew Delhi, India\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/w4_gTsiPiLN4Mlsci7arV3Wk2mKxhir5_Kqu3tscIWBRrgxbxnPpef9zS5VZUKJiP6M=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/euOnhJT0JknucDKwG9gmJvw06nVT9bdFfNLaQiasAzokAA6bMCRo1k9Zz6CsdkwYMw=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[]', '2019-04-07 20:04:58', '2019-04-07 20:04:58', NULL),
(558, 565, 'The first ever Nepali variant of Ludo game available for mobile. It has both classic and new modern design + Nepali / Indian local rules along with international rules. Lots of options/rules for customization according to your need is possible. Hope you enjoy playing it ;).<br><br>Features:<br>1. Added rules/options which are played and popular in Nepal:<br>    i)  Option to show safe block(square) which is represented by star icon<br>    ii) Option to get another turn on both dice number 1 (Pot) and 6 (Chhakka)<br>    iii) 3 consecutive rolls of 1 kills one own playing coin<br>    iv) 3 consecutive rolls of 6 brings a coin out if all coins are in the yard<br>    v)  All the rules are optional so you can play both international version or Nepali version or your own customized version according to your desire<br>2. Classic sketch marks design with wooden or white board<br>3. New modern design with wooden or white board<br>4. Option to choose the dice number (1-6) which will start the token(coin)<br>4. Option to choose the number of coins to be played (from 2 to 4)<br>5. Dice changing color according to color of actual player on turn<br>6. Variety of rules to meet your own taste of gaming experience<br>7. Multiplayer in the same device (up to 4 player)<br>8. Play against CPU<br>9. Real Dice: you can play with real dice, throw the real dice, input the result back to the app manually by tapping the dice buttons<br>10. User can leave the game if he doesn\\\'t want to play during the game play.<br>11. Game play progress is saved automatically, you can resume the game later even after app is closed<br>12. Low mb of package size, Light weight and fast.<br>13. Updated Ludo rules in 2018<br><br>About user data and permissions uses:<br>-Ludo Neo-Classic accesses information pertaining to your device name, operating system version, carrier, geo-location, IP address for analytics purpose so that we can provide a better game experience.<br>-Ludo Neo-Classic uses Location permission to show the location specific ads, which will help to show the relevant ads.\\\"', 'https://lh3.googleusercontent.com/Cc2ge79WSLrBCNLwmB91YwnPqoBBqa535Bb_37FwYOUsBkt1qBeF0PWQDNp9XNtd7g=s180', 4.4, '[{\"type\":\"Updated\",\"info\":\"December 17, 2018\"},{\"type\":\"Size\",\"info\":\"5.7M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"1.19\"},{\"type\":\"Requires Android\",\"info\":\"4.0 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Neoclassic Tech Pvt. Ltd.\"},{\"type\":\"Developer\",\"info\":\"meehjeevan@gmail.comPrivacy PolicySamakhushi-26\\nKathmandu\\nNepal\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/qQB7AxWdPKOMapXhwBn2TZYUDZ5nMjPXs2NoG59_8gNqE_PRVzUD--9p9e63W08TJtRG=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/vWDieiyiz-jXAuSjIyj_tTWp3UdQCKM_vOXhlUYBp8rXpZYcxx75qHrrT_xdDAflOGGS=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[]', '2019-04-07 20:04:58', '2019-04-07 20:04:58', NULL),
(559, 566, 'Axis Mobile is a user friendly, safe and secure mobile banking application from Axis Bank, with 100+ cutting edge features and services satisfying more than just banking needs. Axis mobile has following features-<br>â¢New dashboard with easy one view access to all your Axis bank accounts<br>â¢Personalize your side menu by adding a picture<br>â¢One stop shop for all retail and business loans <br>â¢Pre-approved credit cards for you<br>â¢Rate the application to give us feedback on Axis Mobile<br>â¢All new my privileges with exciting offers for you<br>â¢ASAP- Instantly open online savings account in just 3 simple steps<br>â¢Bhim Unified Payment Interface (UPI) is enabled on Axis Mobile - Add Payee, Send &amp; Receive Money, Link Multiple Bank Accounts and start transacting<br>â¢Scan &amp; Pay instantly using UPI<br>â¢Instant UPI Transactions History to Help You Track Your Transactions. <br>â¢Make Your Own UPI QR Code<br>â¢Grab Exciting Deals, Just for You<br>â¢Get instant notifications on offers around you<br>â¢View account summary, mini-statement and transaction details for all your savings, current and credit card accounts<br>â¢View latest, unbilled and past statements of your credit cards. Pay your Credit Card bill instantly or schedule payment for a later date.<br>â¢Instantly open FD or RD on a click<br>â¢Access your Deposit, Loan, Forex, Demat and Mutual Fund details easily.<br>â¢Easy access and control over your Credit and Debit Cards. <br>â¢Convert Credit Card Transactions into EMI<br>â¢Analyse your credit card spends using the spend analyser feature<br>â¢Check eligibility for Credit Limit Increase<br>â¢Block and Replace your cards<br>â¢Temporarily switch your debit card on and off<br>â¢Modify your debit card purchase limits as per your needs<br>â¢Make immediate payments to other bank customers using IMPS or scheduled fund transfers to Axis Bank and Other Bank customers through NEFT. <br>â¢Safely add payees directly from the app. No need to log in to internet banking to add a payee.<br>â¢Recharge your Prepaid Mobile, Data Card and DTH connection instantly.<br>â¢Schedule/ Pay/ Auto-Pay your utility bills for more than 200 billers. View scheduled bills on your phone calendar.<br>â¢Save 10 frequent transactions as Favourites and repeat them in just a click in future<br>â¢Request for statement of your account, new cheque book, issued cheque status and stop cheque payment.<br>â¢Locate Axis Bank Branches, ATMs and Dining Delights near you. <br>â¢View your eDGE Loyalty Reward points balance and redeem from over 500 exciting reward options.<br>â¢Complete control over the value of transactions made from the app. Modify your transaction limits in just a click.<br>To allow us to give you a superior experience, we need your permission to access the following:<br>â¢Location: To display the ATMs/Branches and Offers near you<br>â¢Photos and Camera: Personalise the accounts and payees added to the app<br>â¢Phone: To allow calling Axis Bank Customer service from the app<br>â¢Device ID and Status, Mobile Number (SIM) and send SMS facility: To perform the required SIM locking to your device for your account security by reading phone status and identity<br>â¢Calendar: Sync your scheduled payments<br>â¢SMS: To send an activation SMS from your device<br>Simple steps to install and start using Axis Mobile on your device:<br>â¢Download Axis Mobile from the Google Play Store<br>â¢Register using your Internet Banking OR Debit Card credentials. Standalone credit card users can register using the Credit Card credentials. Standalone Loan Customers can register using their customer id and password (self-generated) for registration.<br>â¢Enter the 8 digit Activation Code that you receive in your registered mobile number.<br>â¢Set a six digit mPIN that you would use every time to login to Axis Mobile. Remember this mPIN and do not share it with anyone.<br>You are now ready to bank with Axis Bank right from your device! For any other details please visit www.axisbank.com/axismobile<br>For any feedback, queries or issues pertaining to Axis Mobile application please write to customer.service@axisbank.com or call us @ 1860-419-5555', 'https://lh3.ggpht.com/nNyS8pk_qjq2BNwGO6ESd8B52HRiMWDvDabNKyUu28uwmVUgxcBWOGkEraUNEQmZHPA=s180', 4.6, '[{\"type\":\"Updated\",\"info\":\"March 12, 2019\"},{\"type\":\"Size\",\"info\":\"28M\"},{\"type\":\"Installs\",\"info\":\"10,000,000+\"},{\"type\":\"Current Version\",\"info\":\"5.7\"},{\"type\":\"Requires Android\",\"info\":\"4.4 and up\"},{\"type\":\"Content Rating\",\"info\":\"Rated for 3+Learn More\"},{\"type\":\"Interactive Elements\",\"info\":\"Digital Purchases\"},{\"type\":\"Permissions\",\"info\":\"View details\"},{\"type\":\"Report\",\"info\":\"Flag as inappropriate\"},{\"type\":\"Offered By\",\"info\":\"Axis Bank Ltd.\"},{\"type\":\"Developer\",\"info\":\"Visit websiteinternet.banking@axisbank.comPrivacy Policy\"}]', '[\"https:\\/\\/lh3.googleusercontent.com\\/UYzJMtzV1I3Z8yzHvnMvFkau2IYrGi1NseW0dv_V01WA_-0IM33pXZpj6iEgTAQ08UBt=w720-h310\",\"https:\\/\\/lh3.googleusercontent.com\\/eo5FswFGclRYOE36cN7Nr7SQC3W7_caQi6byRujmZZF21H5DiGu6mSP2y2yH9EJB2uk=w720-h310\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\",\"data:image\\/gif;base64,R0lGODlhAQABAIAAAP\\/\\/\\/\\/\\/\\/\\/yH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==\"]', '[]', '2019-04-07 20:04:58', '2019-04-07 20:04:58', NULL);
